--
-- Name: admin_set_entitlement(uuid, text, text, integer, text); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.admin_set_entitlement(p_user uuid, p_product text, p_status text, p_days integer DEFAULT NULL::integer, p_note text DEFAULT NULL::text) RETURNS void
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
DECLARE 
    v_until timestamptz := CASE WHEN p_days IS NULL THEN NULL ELSE now() + (p_days || ' days')::interval END;
BEGIN
    IF NOT is_admin() THEN RAISE EXCEPTION 'forbidden'; END IF;

    INSERT INTO user_entitlements(user_id, product, status, started_at, trial_ends_at, expires_at, paused, source, note)
    VALUES (p_user, p_product::product_kind, p_status, now(),
            CASE WHEN p_status='trialing' THEN v_until ELSE NULL END,
            CASE WHEN p_status='active'   THEN v_until ELSE NULL END,
            false, 'manual', p_note)
    ON CONFLICT(user_id, product) DO UPDATE
        SET status=EXCLUDED.status,
            trial_ends_at=EXCLUDED.trial_ends_at,
            expires_at=EXCLUDED.expires_at,
            paused=false,
            note=COALESCE(EXCLUDED.note, user_entitlements.note),
            updated_at=now();
END $$;


--
-- Name: admin_set_override(uuid, text, timestamp with time zone); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.admin_set_override(p_user uuid, p_product text, p_until timestamp with time zone) RETURNS void
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
begin
  IF NOT is_admin() THEN RAISE EXCEPTION 'forbidden'; END IF;
  
  insert into user_entitlements (user_id, product, status, started_at, expires_at, paused, source, note)
  values (p_user, p_product, 'active', now(), p_until, false, 'override', 'admin override')
  on conflict (user_id, product) do update
    set status     = 'active',
        expires_at = excluded.expires_at,
        paused     = false,
        source     = excluded.source,
        note       = excluded.note,
        updated_at = now();
end;
$$;


--
-- Name: admin_set_override(uuid, public.product_kind, timestamp with time zone); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.admin_set_override(p_user uuid, p_product public.product_kind, p_expires_at timestamp with time zone) RETURNS void
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
BEGIN
  IF NOT is_admin() THEN RAISE EXCEPTION 'forbidden'; END IF;

  INSERT INTO access_overrides(user_id, product, expires_at)
  VALUES (p_user, p_product, p_expires_at)
  ON CONFLICT (user_id) DO UPDATE
    SET product = COALESCE(EXCLUDED.product, access_overrides.product),
        expires_at = EXCLUDED.expires_at;
END $$;


--
-- Name: analyze_exercise_progression(uuid, integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.analyze_exercise_progression(p_client_item_id uuid, p_weeks_back integer DEFAULT 1) RETURNS jsonb
    LANGUAGE plpgsql STABLE SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
DECLARE
  v_avg_rpe NUMERIC;
  v_session_count INTEGER;
  v_current_weight NUMERIC;
  v_current_reps TEXT;
  v_suggestion JSONB;
  v_rpe_target_min NUMERIC := 6;
  v_rpe_target_max NUMERIC := 8;
  v_weight_increment NUMERIC := 5;
BEGIN
  -- Get average RPE for the exercise over the specified weeks
  SELECT 
    AVG(en.rpe),
    COUNT(DISTINCT ws.id)
  INTO v_avg_rpe, v_session_count
  FROM exercise_notes en
  JOIN workout_sessions ws ON ws.id = en.session_id
  WHERE en.client_item_id = p_client_item_id
    AND en.rpe IS NOT NULL
    AND ws.started_at >= NOW() - (p_weeks_back || ' weeks')::INTERVAL;

  -- Get current exercise parameters
  SELECT weight_kg, reps 
  INTO v_current_weight, v_current_reps
  FROM client_items 
  WHERE id = p_client_item_id;

  -- If not enough data, return no change
  IF v_avg_rpe IS NULL OR v_session_count < 2 THEN
    RETURN jsonb_build_object(
      'action', 'maintain',
      'reason', 'insufficient_data',
      'current_weight', v_current_weight,
      'current_reps', v_current_reps,
      'avg_rpe', v_avg_rpe,
      'session_count', v_session_count
    );
  END IF;

  -- Analyze and suggest progression
  IF v_avg_rpe < v_rpe_target_min THEN
    -- Too easy, increase intensity
    v_suggestion := jsonb_build_object(
      'action', 'increase_weight',
      'reason', 'rpe_too_low',
      'current_weight', v_current_weight,
      'suggested_weight', CASE 
        WHEN v_current_weight IS NOT NULL THEN ROUND(v_current_weight * (1 + v_weight_increment/100), 1)
        ELSE NULL
      END,
      'current_reps', v_current_reps,
      'avg_rpe', ROUND(v_avg_rpe, 1),
      'session_count', v_session_count
    );
  ELSIF v_avg_rpe > v_rpe_target_max THEN
    -- Too hard, decrease intensity or maintain
    v_suggestion := jsonb_build_object(
      'action', 'decrease_weight',
      'reason', 'rpe_too_high', 
      'current_weight', v_current_weight,
      'suggested_weight', CASE 
        WHEN v_current_weight IS NOT NULL THEN ROUND(v_current_weight * (1 - v_weight_increment/100), 1)
        ELSE NULL
      END,
      'current_reps', v_current_reps,
      'avg_rpe', ROUND(v_avg_rpe, 1),
      'session_count', v_session_count
    );
  ELSE
    -- Perfect range, maintain current intensity
    v_suggestion := jsonb_build_object(
      'action', 'maintain',
      'reason', 'rpe_optimal',
      'current_weight', v_current_weight,
      'current_reps', v_current_reps,
      'avg_rpe', ROUND(v_avg_rpe, 1),
      'session_count', v_session_count
    );
  END IF;

  RETURN v_suggestion;
END;
$$;


--
-- Name: analyze_exercise_progression_enhanced(uuid, integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.analyze_exercise_progression_enhanced(p_client_item_id uuid, p_weeks_back integer DEFAULT 2) RETURNS jsonb
    LANGUAGE plpgsql STABLE SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
DECLARE
  v_exercise_data RECORD;
  v_progression_data jsonb;
  v_current_weight NUMERIC;
  v_current_reps TEXT;
  v_avg_rpe NUMERIC;
  v_rpe_trend NUMERIC;
  v_consistency_score NUMERIC;
  v_volume_trend NUMERIC;
  v_session_count INTEGER;
  v_recommendation TEXT;
  v_suggested_weight NUMERIC;
  v_confidence_score NUMERIC;
  v_rpe_variance NUMERIC;
  v_total_volume NUMERIC;
BEGIN
  -- Get exercise details and current parameters
  SELECT ci.*
  INTO v_exercise_data
  FROM client_items ci
  WHERE ci.id = p_client_item_id;
  
  IF NOT FOUND THEN
    RETURN jsonb_build_object(
      'error', 'Exercise not found',
      'exercise_id', p_client_item_id
    );
  END IF;
  
  v_current_weight := v_exercise_data.weight_kg;
  v_current_reps := v_exercise_data.reps;

  -- Analyze recent performance with proper aggregation
  WITH recent_performance AS (
    SELECT 
      ws.started_at::date as session_date,
      en.rpe,
      AVG(sl.weight_kg_done * sl.reps_done) as session_volume,
      COUNT(sl.id) as sets_completed
    FROM workout_sessions ws
    LEFT JOIN exercise_notes en ON en.session_id = ws.id AND en.client_item_id = p_client_item_id
    LEFT JOIN set_logs sl ON sl.session_id = ws.id AND sl.client_item_id = p_client_item_id
    WHERE ws.started_at >= NOW() - (p_weeks_back || ' weeks')::INTERVAL
      AND ws.ended_at IS NOT NULL
      AND en.rpe IS NOT NULL
    GROUP BY ws.started_at::date, en.rpe
    ORDER BY session_date DESC
  ),
  performance_stats AS (
    SELECT 
      COUNT(*) as session_count,
      AVG(rpe) as avg_rpe,
      STDDEV(rpe) as rpe_variance,
      AVG(session_volume) as avg_volume,
      -- Simple trend calculation: compare first half vs second half
      AVG(CASE WHEN ROW_NUMBER() OVER (ORDER BY session_date) <= COUNT(*) OVER () / 2 THEN rpe END) as early_rpe,
      AVG(CASE WHEN ROW_NUMBER() OVER (ORDER BY session_date) > COUNT(*) OVER () / 2 THEN rpe END) as late_rpe,
      SUM(session_volume) as total_volume
    FROM recent_performance
  )
  SELECT 
    COALESCE(ps.session_count, 0),
    COALESCE(ps.avg_rpe, 7),
    COALESCE(ps.rpe_variance, 0),
    COALESCE(ps.avg_volume, 0),
    COALESCE(ps.total_volume, 0),
    -- RPE trend: positive = getting harder, negative = getting easier
    CASE 
      WHEN ps.late_rpe IS NOT NULL AND ps.early_rpe IS NOT NULL 
      THEN ps.late_rpe - ps.early_rpe
      ELSE 0
    END
  INTO v_session_count, v_avg_rpe, v_rpe_variance, v_total_volume, v_total_volume, v_rpe_trend
  FROM performance_stats ps;
  
  -- Calculate consistency score
  v_consistency_score := CASE 
    WHEN v_rpe_variance IS NULL OR v_rpe_variance = 0 THEN 1.0
    ELSE GREATEST(0, 1 - (v_rpe_variance / 3))
  END;
  
  -- Professional progression logic
  IF v_session_count < 2 THEN
    v_recommendation := 'maintain';
    v_suggested_weight := v_current_weight;
    v_confidence_score := 0.3;
  ELSIF v_avg_rpe < 6.5 AND v_consistency_score > 0.7 AND v_rpe_trend <= 0 THEN
    -- Too easy + consistent + not getting harder = increase intensity
    v_recommendation := 'increase_weight';
    v_suggested_weight := CASE 
      WHEN v_current_weight IS NOT NULL THEN 
        ROUND(v_current_weight * 1.05, 1) -- 5% increase
      ELSE NULL
    END;
    v_confidence_score := 0.8;
  ELSIF v_avg_rpe > 8.5 OR (v_avg_rpe > 8 AND v_rpe_trend > 0.5) THEN
    -- Too hard or getting progressively harder = decrease intensity
    v_recommendation := 'decrease_weight';
    v_suggested_weight := CASE 
      WHEN v_current_weight IS NOT NULL THEN 
        ROUND(v_current_weight * 0.95, 1) -- 5% decrease
      ELSE NULL
    END;
    v_confidence_score := 0.9;
  ELSIF v_avg_rpe BETWEEN 6.5 AND 8.5 AND v_consistency_score > 0.6 THEN
    -- In target zone + consistent = maintain or small progression
    IF v_rpe_trend < -0.3 THEN
      -- Getting easier over time = small increase
      v_recommendation := 'increase_weight';
      v_suggested_weight := CASE 
        WHEN v_current_weight IS NOT NULL THEN 
          ROUND(v_current_weight * 1.025, 1) -- 2.5% increase
        ELSE NULL
      END;
      v_confidence_score := 0.7;
    ELSE
      v_recommendation := 'maintain';
      v_suggested_weight := v_current_weight;
      v_confidence_score := 0.8;
    END IF;
  ELSE
    -- Inconsistent performance or insufficient data = maintain
    v_recommendation := 'maintain';
    v_suggested_weight := v_current_weight;
    v_confidence_score := 0.4;
  END IF;
  
  -- Build comprehensive progression data
  v_progression_data := jsonb_build_object(
    'action', v_recommendation,
    'reason', CASE v_recommendation
      WHEN 'increase_weight' THEN 
        CASE 
          WHEN v_avg_rpe < 6.5 THEN 'RPE too low - exercise is too easy'
          WHEN v_rpe_trend < -0.3 THEN 'Getting progressively easier - ready for advancement'
          ELSE 'Consistent good performance - time to progress'
        END
      WHEN 'decrease_weight' THEN
        CASE 
          WHEN v_avg_rpe > 8.5 THEN 'RPE too high - exercise is too challenging'
          WHEN v_rpe_trend > 0.5 THEN 'Getting progressively harder - need recovery'
          ELSE 'Preventing overreaching'
        END
      ELSE 'Maintain current intensity for consistency'
    END,
    'current_weight', v_current_weight,
    'suggested_weight', v_suggested_weight,
    'current_reps', v_current_reps,
    'avg_rpe', ROUND(v_avg_rpe, 1),
    'rpe_trend', ROUND(v_rpe_trend, 2),
    'consistency_score', ROUND(v_consistency_score, 2),
    'confidence_score', ROUND(v_confidence_score, 2),
    'session_count', v_session_count,
    'analysis_period_weeks', p_weeks_back,
    'exercise_name', v_exercise_data.exercise_name,
    'professional_notes', CASE 
      WHEN v_consistency_score < 0.5 THEN 'Focus on consistent RPE reporting for better recommendations'
      WHEN v_session_count < 3 THEN 'More data needed for confident progression decisions'
      WHEN v_confidence_score > 0.8 THEN 'High confidence recommendation based on solid data'
      ELSE 'Moderate confidence - monitor next few sessions'
    END
  );
  
  RETURN v_progression_data;
END;
$$;


--
-- Name: analyze_exercise_progression_optimized(uuid, integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.analyze_exercise_progression_optimized(p_client_item_id uuid, p_weeks_back integer DEFAULT 3) RETURNS jsonb
    LANGUAGE plpgsql STABLE SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
DECLARE
  v_exercise_data RECORD;
  v_current_weight NUMERIC;
  v_current_reps TEXT;
  v_exercise_type TEXT := 'isolation'; -- default
  v_session_count INTEGER;
  v_avg_rpe NUMERIC;
  v_avg_rir NUMERIC;
  v_rpe_trend NUMERIC;
  v_volume_trend NUMERIC;
  v_consistency_score NUMERIC;
  v_confidence_score NUMERIC;
  v_recommendation TEXT;
  v_suggested_weight NUMERIC;
  v_suggested_reps TEXT;
  v_deload_needed BOOLEAN := false;
  v_base_increment NUMERIC := 0.05; -- 5% base increment
  v_compound_exercises TEXT[] := ARRAY[
    'squat', 'deadlift', 'bench press', 'overhead press', 'row', 'pull up', 'chin up',
    'dip', 'lunge', 'bulgarian split squat', 'hip thrust', 'romanian deadlift'
  ];
BEGIN
  -- Get exercise details
  SELECT ci.*
  INTO v_exercise_data
  FROM client_items ci
  WHERE ci.id = p_client_item_id;
  
  IF NOT FOUND THEN
    RETURN jsonb_build_object(
      'error', 'Exercise not found',
      'exercise_id', p_client_item_id
    );
  END IF;
  
  v_current_weight := v_exercise_data.weight_kg;
  v_current_reps := v_exercise_data.reps;
  
  -- Determine exercise type based on name
  IF EXISTS (
    SELECT 1 FROM unnest(v_compound_exercises) AS compound_ex
    WHERE LOWER(v_exercise_data.exercise_name) LIKE '%' || compound_ex || '%'
  ) THEN
    v_exercise_type := 'compound';
    v_base_increment := 0.025; -- 2.5% for compound exercises
  END IF;

  -- Analyze recent performance with RPE and RIR data
  WITH recent_sessions AS (
    SELECT 
      ws.started_at::date as session_date,
      en.rpe,
      en.rir_done,
      AVG(sl.weight_kg_done * sl.reps_done) as session_volume,
      COUNT(sl.id) as sets_completed,
      ROW_NUMBER() OVER (ORDER BY ws.started_at DESC) as session_rank
    FROM workout_sessions ws
    LEFT JOIN exercise_notes en ON en.session_id = ws.id AND en.client_item_id = p_client_item_id
    LEFT JOIN set_logs sl ON sl.session_id = ws.id AND sl.client_item_id = p_client_item_id
    WHERE ws.started_at >= NOW() - (p_weeks_back || ' weeks')::INTERVAL
      AND ws.ended_at IS NOT NULL
      AND (en.rpe IS NOT NULL OR en.rir_done IS NOT NULL)
      AND sl.id IS NOT NULL
    GROUP BY ws.started_at::date, en.rpe, en.rir_done
    ORDER BY ws.started_at DESC
  ),
  performance_stats AS (
    SELECT 
      COUNT(*) as session_count,
      AVG(rpe) as avg_rpe,
      AVG(rir_done) as avg_rir,
      STDDEV(rpe) as rpe_variance,
      AVG(session_volume) as avg_volume,
      -- Trend analysis: compare recent vs earlier sessions
      AVG(CASE WHEN session_rank <= 3 THEN rpe END) as recent_rpe,
      AVG(CASE WHEN session_rank > 3 THEN rpe END) as earlier_rpe,
      AVG(CASE WHEN session_rank <= 3 THEN session_volume END) as recent_volume,
      AVG(CASE WHEN session_rank > 3 THEN session_volume END) as earlier_volume
    FROM recent_sessions
  )
  SELECT 
    COALESCE(ps.session_count, 0),
    COALESCE(ps.avg_rpe, 7),
    COALESCE(ps.avg_rir, 2),
    COALESCE(ps.rpe_variance, 0),
    CASE 
      WHEN ps.recent_rpe IS NOT NULL AND ps.earlier_rpe IS NOT NULL 
      THEN ps.recent_rpe - ps.earlier_rpe
      ELSE 0
    END,
    CASE 
      WHEN ps.recent_volume IS NOT NULL AND ps.earlier_volume IS NOT NULL AND ps.earlier_volume > 0
      THEN (ps.recent_volume - ps.earlier_volume) / ps.earlier_volume
      ELSE 0
    END
  INTO v_session_count, v_avg_rpe, v_avg_rir, v_consistency_score, v_rpe_trend, v_volume_trend
  FROM performance_stats ps;
  
  -- Calculate consistency score (inverse of RPE variance)
  v_consistency_score := CASE 
    WHEN v_consistency_score IS NULL OR v_consistency_score = 0 THEN 1.0
    ELSE GREATEST(0, 1 - (v_consistency_score / 2))
  END;
  
  -- Check for deload need (high RPE trend across multiple exercises)
  WITH program_rpe AS (
    SELECT AVG(en.rpe) as program_avg_rpe
    FROM exercise_notes en
    JOIN workout_sessions ws ON ws.id = en.session_id
    JOIN client_items ci ON ci.id = en.client_item_id
    JOIN client_days cd ON cd.id = ci.client_day_id
    WHERE cd.client_program_id = (
      SELECT cd2.client_program_id 
      FROM client_items ci2 
      JOIN client_days cd2 ON cd2.id = ci2.client_day_id 
      WHERE ci2.id = p_client_item_id
    )
    AND ws.started_at >= NOW() - '1 week'::INTERVAL
    AND en.rpe IS NOT NULL
  )
  SELECT (program_avg_rpe > 8.5) INTO v_deload_needed FROM program_rpe;
  
  -- Calculate confidence score based on data quality
  v_confidence_score := CASE
    WHEN v_session_count >= 6 THEN 0.9
    WHEN v_session_count >= 4 THEN 0.8
    WHEN v_session_count >= 2 THEN 0.6
    ELSE 0.3
  END * v_consistency_score;
  
  -- Progression decision logic
  IF v_session_count < 2 OR v_confidence_score < 0.5 THEN
    v_recommendation := 'maintain';
    v_suggested_weight := v_current_weight;
    v_suggested_reps := v_current_reps;
  ELSIF v_deload_needed THEN
    v_recommendation := 'deload';
    v_suggested_weight := CASE 
      WHEN v_current_weight IS NOT NULL THEN ROUND(v_current_weight * 0.9, 1)
      ELSE NULL
    END;
    v_suggested_reps := v_current_reps;
  ELSIF (v_avg_rpe < 6.5 OR (v_avg_rir > 3 AND v_avg_rpe < 7.5)) AND v_rpe_trend <= 0 THEN
    -- Too easy: low RPE or high RIR and not getting harder
    v_recommendation := 'increase_weight';
    v_suggested_weight := CASE 
      WHEN v_current_weight IS NOT NULL THEN 
        ROUND(v_current_weight * (1 + v_base_increment), 1)
      ELSE NULL
    END;
    v_suggested_reps := v_current_reps;
  ELSIF v_avg_rpe > 8.5 OR (v_avg_rir < 1 AND v_avg_rpe > 8) OR v_rpe_trend > 0.5 THEN
    -- Too hard: high RPE, low RIR, or getting progressively harder
    v_recommendation := 'decrease_weight';
    v_suggested_weight := CASE 
      WHEN v_current_weight IS NOT NULL THEN 
        ROUND(v_current_weight * (1 - v_base_increment), 1)
      ELSE NULL
    END;
    v_suggested_reps := v_current_reps;
  ELSIF v_avg_rpe BETWEEN 6.5 AND 8.5 AND v_avg_rir BETWEEN 1 AND 3 THEN
    -- Optimal zone: consider micro-progression or maintain
    IF v_rpe_trend < -0.2 AND v_volume_trend > 0.1 THEN
      -- Getting easier and volume increasing = micro-progression
      v_recommendation := 'micro_increase';
      v_suggested_weight := CASE 
        WHEN v_current_weight IS NOT NULL THEN 
          ROUND(v_current_weight * (1 + v_base_increment/2), 1)
        ELSE NULL
      END;
      v_suggested_reps := v_current_reps;
    ELSE
      v_recommendation := 'maintain';
      v_suggested_weight := v_current_weight;
      v_suggested_reps := v_current_reps;
    END IF;
  ELSE
    v_recommendation := 'maintain';
    v_suggested_weight := v_current_weight;
    v_suggested_reps := v_current_reps;
  END IF;
  
  RETURN jsonb_build_object(
    'action', v_recommendation,
    'exercise_type', v_exercise_type,
    'current_weight', v_current_weight,
    'suggested_weight', v_suggested_weight,
    'current_reps', v_current_reps,
    'suggested_reps', v_suggested_reps,
    'avg_rpe', ROUND(v_avg_rpe, 1),
    'avg_rir', ROUND(v_avg_rir, 1),
    'rpe_trend', ROUND(v_rpe_trend, 2),
    'volume_trend', ROUND(v_volume_trend, 2),
    'session_count', v_session_count,
    'confidence_score', ROUND(v_confidence_score, 2),
    'consistency_score', ROUND(v_consistency_score, 2),
    'deload_needed', v_deload_needed,
    'weeks_analyzed', p_weeks_back,
    'reasoning', CASE v_recommendation
      WHEN 'maintain' THEN 'RPE and RIR in optimal range, maintain current load'
      WHEN 'increase_weight' THEN 'RPE too low or RIR too high, increase intensity'
      WHEN 'decrease_weight' THEN 'RPE too high or RIR too low, reduce intensity'
      WHEN 'micro_increase' THEN 'Optimal zone with positive adaptations, small increase'
      WHEN 'deload' THEN 'Program-wide high RPE detected, deload recommended'
      ELSE 'Insufficient data or low confidence'
    END
  );
END;
$$;


--
-- Name: archive_old_conversations(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.archive_old_conversations() RETURNS trigger
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
BEGIN
  -- Archive previous active conversations for this user
  UPDATE public.support_conversations
  SET status = 'archived',
      updated_at = now()
  WHERE user_id = NEW.user_id
    AND status = 'active'
    AND id != NEW.id;
  
  RETURN NEW;
END;
$$;


--
-- Name: assign_template_to_user(uuid, text, date); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.assign_template_to_user(template_id uuid, target_email text, start_date date) RETURNS uuid
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
declare
  v_target  uuid;
  v_program uuid;
begin
  if not public.is_admin() then
    raise exception 'admin only';
  end if;

  -- leia kasutaja UUID e-maili järgi
  select u.id
  into v_target
  from auth.users u
  where u.email = target_email
  limit 1;

  if v_target is null then
    raise exception 'user not found for %', target_email;
  end if;

  -- kontrolli, et template eksisteerib
  if not exists (
    select 1 from public.workout_templates wt
    where wt.id = assign_template_to_user.template_id
  ) then
    raise exception 'template % not found', assign_template_to_user.template_id;
  end if;

  -- loo programm kliendile
  insert into public.client_programs (id, template_id, assigned_to, assigned_by, start_date)
  values (
    gen_random_uuid(),
    assign_template_to_user.template_id,   -- ← PARAMEETER on kvalifitseeritud funktsiooni nimega
    v_target,
    auth.uid(),
    assign_template_to_user.start_date
  )
  returning id into v_program;

  -- kopeeri päevad
  insert into public.client_days (id, client_program_id, day_order, title, note)
  select gen_random_uuid(), v_program, td.day_order, td.title, td.note
  from public.template_days td
  where td.template_id = assign_template_to_user.template_id;

  -- kopeeri harjutused
  insert into public.client_items (id, client_day_id, exercise_name, sets, reps, rest_seconds, coach_notes, order_in_day, video_url)
  select
    gen_random_uuid(),
    cd.id,
    ti.exercise_name,
    ti.sets,
    ti.reps,
    ti.rest_seconds,
    ti.coach_notes,
    ti.order_in_day,
    ti.video_url
  from public.template_items ti
  join public.template_days td
    on td.id = ti.template_day_id
  join public.client_days cd
    on cd.client_program_id = v_program
   and cd.day_order = td.day_order
  where td.template_id = assign_template_to_user.template_id;

  return v_program;
end;
$$;


--
-- Name: assign_template_to_user_v2(uuid, text, date, uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.assign_template_to_user_v2(p_template_id uuid, p_target_email text, p_start_date date, p_assigned_by uuid DEFAULT auth.uid()) RETURNS uuid
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
declare
  v_user_id     uuid;
  v_program_id  uuid;
begin
  -- 1) Find user by email in profiles
  select id
  into   v_user_id
  from   public.profiles
  where  lower(email) = lower(p_target_email)
  limit  1;

  if v_user_id is null then
    raise exception 'User with email % not found', p_target_email
      using errcode = 'P0002';
  end if;

  -- 2) Insert the program
  insert into public.client_programs
    (template_id, assigned_to, assigned_by, start_date, is_active)
  values
    (p_template_id, v_user_id, coalesce(p_assigned_by, auth.uid()), p_start_date, true)
  returning id into v_program_id;

  -- 3) Copy template_days -> client_days
  insert into public.client_days (client_program_id, day_order, title, note)
  select v_program_id, d.day_order, d.title, d.note
  from   public.template_days d
  where  d.template_id = p_template_id
  order  by d.day_order;

  -- 4) Copy template_items -> client_items
  --    We join client_days back by (program_id, day_order)
  insert into public.client_items
    (client_day_id, order_in_day, exercise_name, sets, reps, seconds,
     weight_kg, rest_seconds, coach_notes, video_url)
  select cd.id, ti.order_in_day, ti.exercise_name, ti.sets, ti.reps, ti.seconds,
         ti.weight_kg, ti.rest_seconds, ti.coach_notes, ti.video_url
  from   public.template_days   td
  join   public.template_items  ti on ti.template_day_id = td.id
  join   public.client_days     cd
         on cd.client_program_id = v_program_id
        and cd.day_order         = td.day_order
  where  td.template_id = p_template_id;

  -- 5) Return the new program id (required by RETURNS uuid)
  return v_program_id;
end;
$$;


--
-- Name: audit_subscriber_access(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.audit_subscriber_access() RETURNS trigger
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
BEGIN
  -- Log access to sensitive subscriber data for security monitoring
  -- This is disabled by default but can be enabled by creating the audit table
  
  IF EXISTS (SELECT 1 FROM information_schema.tables WHERE table_name = 'security_audit_log') THEN
    INSERT INTO security_audit_log (
      user_id, 
      action, 
      table_name, 
      accessed_user_id, 
      timestamp,
      ip_address
    ) VALUES (
      auth.uid(),
      TG_OP,
      'subscribers',
      CASE WHEN TG_OP IN ('INSERT', 'UPDATE') THEN NEW.user_id ELSE OLD.user_id END,
      now(),
      current_setting('request.header.x-forwarded-for', true)
    );
  END IF;
  
  RETURN CASE WHEN TG_OP = 'DELETE' THEN OLD ELSE NEW END;
END;
$$;


--
-- Name: auto_progress_program(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.auto_progress_program(p_program_id uuid) RETURNS jsonb
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
DECLARE
  v_program_record RECORD;
  v_item_record RECORD;
  v_progression JSONB;
  v_updates_made INTEGER := 0;
  v_results JSONB := '[]'::jsonb;
BEGIN
  -- Check if program exists and has auto-progression enabled
  SELECT * INTO v_program_record
  FROM client_programs 
  WHERE id = p_program_id 
    AND auto_progression_enabled = true 
    AND status = 'active';
    
  IF NOT FOUND THEN
    RETURN jsonb_build_object(
      'success', false,
      'reason', 'program_not_found_or_disabled',
      'updates_made', 0
    );
  END IF;

  -- Loop through all exercises in the program
  FOR v_item_record IN 
    SELECT ci.*, cd.client_program_id
    FROM client_items ci
    JOIN client_days cd ON cd.id = ci.client_day_id
    WHERE cd.client_program_id = p_program_id
  LOOP
    -- Analyze progression for this exercise
    v_progression := analyze_exercise_progression(v_item_record.id, 1);
    
    -- Apply progression if suggested
    IF (v_progression->>'action') = 'increase_weight' AND (v_progression->>'suggested_weight') IS NOT NULL THEN
      UPDATE client_items 
      SET weight_kg = (v_progression->>'suggested_weight')::NUMERIC
      WHERE id = v_item_record.id;
      v_updates_made := v_updates_made + 1;
    ELSIF (v_progression->>'action') = 'decrease_weight' AND (v_progression->>'suggested_weight') IS NOT NULL THEN
      UPDATE client_items 
      SET weight_kg = (v_progression->>'suggested_weight')::NUMERIC
      WHERE id = v_item_record.id;
      v_updates_made := v_updates_made + 1;
    END IF;
    
    -- Add to results
    v_results := v_results || jsonb_build_object(
      'exercise_name', v_item_record.exercise_name,
      'item_id', v_item_record.id,
      'progression', v_progression
    );
  END LOOP;

  RETURN jsonb_build_object(
    'success', true,
    'program_id', p_program_id,
    'updates_made', v_updates_made,
    'progressions', v_results
  );
END;
$$;


--
-- Name: auto_progress_program_enhanced(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.auto_progress_program_enhanced(p_program_id uuid) RETURNS jsonb
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
DECLARE
  v_program_record RECORD;
  v_item_record RECORD;
  v_progression JSONB;
  v_updates_made INTEGER := 0;
  v_results JSONB := '[]'::jsonb;
  v_deload_recommended BOOLEAN := false;
  v_program_rpe_avg NUMERIC;
BEGIN
  -- Get program with progression parameters
  SELECT 
    cp.*,
    COUNT(ws.id) as total_sessions,
    AVG(en.rpe) as program_avg_rpe
  INTO v_program_record
  FROM client_programs cp
  LEFT JOIN workout_sessions ws ON ws.client_program_id = cp.id
  LEFT JOIN exercise_notes en ON en.session_id = ws.id
  WHERE cp.id = p_program_id 
    AND cp.auto_progression_enabled = true 
    AND cp.status = 'active'
  GROUP BY cp.id;
    
  IF NOT FOUND THEN
    RETURN jsonb_build_object(
      'success', false,
      'reason', 'program_not_found_or_disabled',
      'updates_made', 0
    );
  END IF;

  v_program_rpe_avg := COALESCE(v_program_record.program_avg_rpe, 7);
  
  -- Check if deload is recommended (program-wide RPE too high)
  IF v_program_rpe_avg > 8.5 AND v_program_record.total_sessions > 6 THEN
    v_deload_recommended := true;
  END IF;

  -- Loop through all exercises in the program
  FOR v_item_record IN 
    SELECT ci.*, cd.client_program_id
    FROM client_items ci
    JOIN client_days cd ON cd.id = ci.client_day_id
    WHERE cd.client_program_id = p_program_id
    ORDER BY cd.day_order, ci.order_in_day
  LOOP
    -- Use enhanced progression analysis
    v_progression := analyze_exercise_progression_enhanced(v_item_record.id, 2);
    
    -- Apply deload if recommended program-wide
    IF v_deload_recommended THEN
      UPDATE client_items 
      SET weight_kg = CASE 
        WHEN weight_kg IS NOT NULL THEN ROUND(weight_kg * 0.85, 1) -- 15% deload
        ELSE weight_kg
      END
      WHERE id = v_item_record.id;
      v_updates_made := v_updates_made + 1;
      
      -- Override progression result for deload
      v_progression := v_progression || jsonb_build_object(
        'action', 'deload',
        'reason', 'Program-wide deload recommended due to high RPE',
        'suggested_weight', CASE 
          WHEN v_item_record.weight_kg IS NOT NULL THEN ROUND(v_item_record.weight_kg * 0.85, 1)
          ELSE v_item_record.weight_kg
        END
      );
    ELSE
      -- Apply individual exercise progression
      IF (v_progression->>'action') = 'increase_weight' AND (v_progression->>'suggested_weight') IS NOT NULL THEN
        UPDATE client_items 
        SET weight_kg = (v_progression->>'suggested_weight')::NUMERIC
        WHERE id = v_item_record.id;
        v_updates_made := v_updates_made + 1;
      ELSIF (v_progression->>'action') = 'decrease_weight' AND (v_progression->>'suggested_weight') IS NOT NULL THEN
        UPDATE client_items 
        SET weight_kg = (v_progression->>'suggested_weight')::NUMERIC
        WHERE id = v_item_record.id;
        v_updates_made := v_updates_made + 1;
      END IF;
    END IF;
    
    -- Add to results
    v_results := v_results || jsonb_build_object(
      'exercise_name', v_item_record.exercise_name,
      'item_id', v_item_record.id,
      'progression', v_progression
    );
  END LOOP;

  RETURN jsonb_build_object(
    'success', true,
    'program_id', p_program_id,
    'updates_made', v_updates_made,
    'deload_applied', v_deload_recommended,
    'program_avg_rpe', ROUND(v_program_rpe_avg, 1),
    'total_sessions_analyzed', v_program_record.total_sessions,
    'progressions', v_results,
    'professional_summary', CASE 
      WHEN v_deload_recommended THEN 'Deload week applied - program intensity was too high'
      WHEN v_updates_made > 0 THEN 'Progressive overload applied based on performance data'
      ELSE 'Program maintained - current intensity is appropriate'
    END
  );
END;
$$;


--
-- Name: auto_progress_program_optimized(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.auto_progress_program_optimized(p_program_id uuid) RETURNS jsonb
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
DECLARE
  v_program_record RECORD;
  v_item_record RECORD;
  v_progression JSONB;
  v_updates_made INTEGER := 0;
  v_results JSONB := '[]'::jsonb;
  v_deload_count INTEGER := 0;
BEGIN
  -- Check if program exists and has auto-progression enabled
  SELECT * INTO v_program_record
  FROM client_programs 
  WHERE id = p_program_id 
    AND auto_progression_enabled = true 
    AND status = 'active';
    
  IF NOT FOUND THEN
    RETURN jsonb_build_object(
      'success', false,
      'reason', 'program_not_found_or_disabled',
      'updates_made', 0
    );
  END IF;

  -- Loop through all exercises in the program
  FOR v_item_record IN 
    SELECT ci.*, cd.client_program_id
    FROM client_items ci
    JOIN client_days cd ON cd.id = ci.client_day_id
    WHERE cd.client_program_id = p_program_id
    ORDER BY cd.day_order, ci.order_in_day
  LOOP
    -- Use optimized progression analysis
    v_progression := analyze_exercise_progression_optimized(v_item_record.id, 3);
    
    -- Apply progression based on recommendation
    IF (v_progression->>'confidence_score')::NUMERIC >= 0.6 THEN
      CASE (v_progression->>'action')
        WHEN 'increase_weight', 'micro_increase' THEN
          IF (v_progression->>'suggested_weight') IS NOT NULL THEN
            UPDATE client_items 
            SET weight_kg = (v_progression->>'suggested_weight')::NUMERIC
            WHERE id = v_item_record.id;
            v_updates_made := v_updates_made + 1;
          END IF;
        WHEN 'decrease_weight', 'deload' THEN
          IF (v_progression->>'suggested_weight') IS NOT NULL THEN
            UPDATE client_items 
            SET weight_kg = (v_progression->>'suggested_weight')::NUMERIC
            WHERE id = v_item_record.id;
            v_updates_made := v_updates_made + 1;
            IF (v_progression->>'action') = 'deload' THEN
              v_deload_count := v_deload_count + 1;
            END IF;
          END IF;
        -- 'maintain' requires no action
        ELSE NULL;
      END CASE;
    END IF;
    
    -- Add to results
    v_results := v_results || jsonb_build_object(
      'exercise_name', v_item_record.exercise_name,
      'item_id', v_item_record.id,
      'progression', v_progression
    );
  END LOOP;

  RETURN jsonb_build_object(
    'success', true,
    'program_id', p_program_id,
    'updates_made', v_updates_made,
    'deload_exercises', v_deload_count,
    'algorithm_version', 'optimized_v1',
    'progressions', v_results
  );
END;
$$;


--
-- Name: calculate_user_streaks(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.calculate_user_streaks() RETURNS void
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
DECLARE
  user_rec RECORD;
  current_streak INTEGER;
  best_streak INTEGER;
  last_activity DATE;
BEGIN
  -- Calculate streaks for each user based on userprogress (Kontorikeha) and workout_sessions (PT)
  FOR user_rec IN 
    SELECT DISTINCT user_id FROM (
      SELECT user_id FROM userprogress 
      UNION 
      SELECT user_id FROM workout_sessions WHERE ended_at IS NOT NULL
    ) u
  LOOP
    -- Calculate streak from userprogress (static program) and workout sessions (PT)
    WITH user_days AS (
      SELECT DISTINCT completed_at::date as day
      FROM userprogress 
      WHERE user_id = user_rec.user_id AND completed_at IS NOT NULL
      UNION
      SELECT DISTINCT ended_at::date as day  
      FROM workout_sessions 
      WHERE user_id = user_rec.user_id AND ended_at IS NOT NULL
      ORDER BY day DESC
    ),
    ordered_days AS (
      SELECT day, 
             LAG(day) OVER (ORDER BY day) as prev_day,
             ROW_NUMBER() OVER (ORDER BY day DESC) as rn
      FROM user_days
    ),
    streak_groups AS (
      SELECT day,
             SUM(CASE WHEN prev_day IS NULL OR day - prev_day > 1 THEN 1 ELSE 0 END) 
             OVER (ORDER BY day DESC ROWS UNBOUNDED PRECEDING) as grp
      FROM ordered_days
    ),
    streaks AS (
      SELECT grp, 
             COUNT(*) as streak_length,
             MAX(day) as latest_day,
             MIN(day) as earliest_day
      FROM streak_groups
      GROUP BY grp
      ORDER BY latest_day DESC
    )
    SELECT 
      COALESCE(
        (SELECT streak_length 
         FROM streaks 
         WHERE latest_day >= CURRENT_DATE - interval '1 day' 
         ORDER BY latest_day DESC 
         LIMIT 1), 
        0
      ),
      COALESCE(MAX(streak_length), 0),
      COALESCE(
        (SELECT latest_day 
         FROM streaks 
         WHERE latest_day >= CURRENT_DATE - interval '7 days' 
         ORDER BY latest_day DESC 
         LIMIT 1),
        NULL
      )
    INTO current_streak, best_streak, last_activity
    FROM streaks;
    
    -- Insert or update calculated streak for this specific user only
    INSERT INTO user_streaks (user_id, current_streak, best_streak, last_workout_date, updated_at)
    VALUES (user_rec.user_id, current_streak, best_streak, last_activity, NOW())
    ON CONFLICT (user_id) DO UPDATE SET
      current_streak = EXCLUDED.current_streak,
      best_streak = EXCLUDED.best_streak,
      last_workout_date = EXCLUDED.last_workout_date,
      updated_at = NOW();
  END LOOP;
END;
$$;


--
-- Name: can_access_pt(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.can_access_pt(u uuid) RETURNS boolean
    LANGUAGE sql STABLE
    SET search_path TO 'public'
    AS $$
  SELECT CASE 
    WHEN u != auth.uid() AND NOT is_admin() THEN false
    ELSE COALESCE((
      SELECT can_pt
      FROM v_access_matrix WHERE user_id = u
    ), false)
  END;
$$;


