--
-- Name: combine_policies(text, text, name, character, text); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.combine_policies(_schema text, _table text, _role name, _cmd character, _newname text) RETURNS void
    LANGUAGE plpgsql
    SET search_path TO 'public'
    AS $$
declare
  _rel regclass := format('%I.%I', _schema, _table)::regclass;
  _using_conds   text := null;
  _check_conds   text := null;
  _rec record;
  _sql text;
  _exists boolean;
begin
  -- Gather USING / WITH CHECK from all matching policies except the target name
  for _rec in
    select polname,
           pg_get_expr(polqual,      polrelid) as using_expr,
           pg_get_expr(polwithcheck, polrelid) as check_expr
    from pg_policy
    where polrelid = _rel
      and _role::regrole = any(polroles)
      and polcmd = _cmd
      and polname <> _newname
  loop
    if _rec.using_expr is not null then
      _using_conds := coalesce(_using_conds || ' OR ', '') || '(' || _rec.using_expr || ')';
    end if;
    if _rec.check_expr is not null then
      _check_conds := coalesce(_check_conds || ' OR ', '') || '(' || _rec.check_expr || ')';
    end if;
  end loop;

  -- Nothing to combine? bail.
  if _using_conds is null and _check_conds is null then
    return;
  end if;

  -- INSERT cares about WITH CHECK; if we only have USING, reuse it as CHECK
  if _cmd = 'a' and _check_conds is null and _using_conds is not null then
    _check_conds := _using_conds;
  end if;

  -- If the target policy name already exists, drop it so we can recreate
  select exists(
    select 1 from pg_policy where polrelid = _rel and polname = _newname
  ) into _exists;

  if _exists then
    execute format('drop policy %I on %s', _newname, _rel);
  end if;

  -- Build CREATE POLICY
  _sql := format(
    'create policy %I on %s for %s to %I',
    _newname, _rel,
    case _cmd when 'r' then 'select'
              when 'a' then 'insert'
              when 'w' then 'update'
              when 'd' then 'delete' end,
    _role
  );

  -- USING is irrelevant for INSERT, keep it for r/w/d only
  if _using_conds is not null and _cmd <> 'a' then
    _sql := _sql || format(' using (%s)', _using_conds);
  end if;
  if _check_conds is not null then
    _sql := _sql || format(' with check (%s)', _check_conds);
  end if;

  execute _sql;

  -- Drop the originals we just merged
  for _rec in
    select polname
    from pg_policy
    where polrelid = _rel
      and _role::regrole = any(polroles)
      and polcmd = _cmd
      and polname <> _newname
  loop
    execute format('drop policy %I on %s', _rec.polname, _rel);
  end loop;
end
$$;


--
-- Name: complete_due_programs(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.complete_due_programs() RETURNS jsonb
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
DECLARE
  v_completed_count INTEGER := 0;
  v_program_record RECORD;
BEGIN
  -- Find and complete programs that are due
  FOR v_program_record IN
    SELECT id, assigned_to, duration_weeks, start_date
    FROM client_programs
    WHERE status = 'active'
      AND start_date IS NOT NULL
      AND EXTRACT(EPOCH FROM (NOW() - start_date)) / (7 * 24 * 3600) >= duration_weeks
  LOOP
    -- Mark program as completed
    UPDATE client_programs 
    SET 
      status = 'completed',
      completed_at = NOW()
    WHERE id = v_program_record.id;
    
    v_completed_count := v_completed_count + 1;
  END LOOP;

  RETURN jsonb_build_object(
    'completed_programs', v_completed_count,
    'timestamp', NOW()
  );
END;
$$;


--
-- Name: complete_static_program_day(uuid, uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.complete_static_program_day(p_user_id uuid, p_programday_id uuid) RETURNS jsonb
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
DECLARE
  v_existing_today RECORD;
  v_today_tallinn date;
  v_programday_data RECORD;
  v_total_sets INTEGER := 0;
  v_total_reps INTEGER := 0;
  v_total_seconds INTEGER := 0;
BEGIN
  -- Security check - users can only complete their own program days
  IF p_user_id != auth.uid() AND NOT is_admin() THEN
    RAISE EXCEPTION 'Access denied: can only complete own program days';
  END IF;
  
  -- Get current date in Tallinn timezone
  v_today_tallinn := (NOW() AT TIME ZONE 'Europe/Tallinn')::date;
  
  -- Get program day data to calculate sets, reps AND seconds
  SELECT * INTO v_programday_data
  FROM programday 
  WHERE id = p_programday_id;
  
  IF NOT FOUND THEN
    RAISE EXCEPTION 'Program day not found';
  END IF;
  
  -- Calculate total sets from program day
  v_total_sets := COALESCE(v_programday_data.sets1, 0) + 
                  COALESCE(v_programday_data.sets2, 0) + 
                  COALESCE(v_programday_data.sets3, 0) + 
                  COALESCE(v_programday_data.sets4, 0) + 
                  COALESCE(v_programday_data.sets5, 0);
  
  -- Calculate total reps: sets × reps for each exercise
  v_total_reps := COALESCE(v_programday_data.sets1, 0) * COALESCE(v_programday_data.reps1, 0) + 
                  COALESCE(v_programday_data.sets2, 0) * COALESCE(v_programday_data.reps2, 0) + 
                  COALESCE(v_programday_data.sets3, 0) * COALESCE(v_programday_data.reps3, 0) + 
                  COALESCE(v_programday_data.sets4, 0) * COALESCE(v_programday_data.reps4, 0) + 
                  COALESCE(v_programday_data.sets5, 0) * COALESCE(v_programday_data.reps5, 0);
  
  -- Calculate total seconds: sets × seconds for each exercise
  v_total_seconds := COALESCE(v_programday_data.sets1, 0) * COALESCE(v_programday_data.seconds1, 0) + 
                     COALESCE(v_programday_data.sets2, 0) * COALESCE(v_programday_data.seconds2, 0) + 
                     COALESCE(v_programday_data.sets3, 0) * COALESCE(v_programday_data.seconds3, 0) + 
                     COALESCE(v_programday_data.sets4, 0) * COALESCE(v_programday_data.seconds4, 0) + 
                     COALESCE(v_programday_data.sets5, 0) * COALESCE(v_programday_data.seconds5, 0);
  
  -- Check if already completed today using Tallinn timezone
  SELECT * INTO v_existing_today
  FROM userprogress 
  WHERE user_id = p_user_id 
    AND programday_id = p_programday_id 
    AND (completed_at AT TIME ZONE 'Europe/Tallinn')::date = v_today_tallinn;
    
  IF FOUND THEN
    RETURN jsonb_build_object(
      'success', false,
      'message', 'Already completed today',
      'completed_at', v_existing_today.completed_at
    );
  END IF;
  
  -- Mark as complete with proper sets, reps AND seconds tracking
  INSERT INTO userprogress (user_id, programday_id, completed_at, done, sets, total_sets, reps, total_reps, total_seconds)
  VALUES (p_user_id, p_programday_id, NOW(), true, v_total_sets, v_total_sets, v_total_reps, v_total_reps, v_total_seconds);
  
  RETURN jsonb_build_object(
    'success', true,
    'message', 'Program day completed',
    'completed_at', NOW(),
    'sets_completed', v_total_sets,
    'reps_completed', v_total_reps,
    'seconds_completed', v_total_seconds
  );
END;
$$;


