--
-- Name: end_session(uuid, uuid, uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.end_session(p_user_id uuid, p_program_id uuid, p_client_day_id uuid) RETURNS uuid
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
declare
  v_id uuid;
begin
  select id into v_id
  from public.workout_sessions
  where user_id = p_user_id
    and program_id = p_program_id
    and client_day_id = p_client_day_id
    and ended_at is null
  order by started_at desc
  limit 1;

  if v_id is not null then
    update public.workout_sessions
       set ended_at = coalesce(ended_at, now())
     where id = v_id;
  end if;

  return v_id;
end $$;


--
-- Name: ensure_admin_access(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.ensure_admin_access() RETURNS boolean
    LANGUAGE plpgsql STABLE SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
DECLARE
  current_user_id uuid;
  is_admin_user boolean := false;
BEGIN
  current_user_id := auth.uid();
  
  IF current_user_id IS NULL THEN
    RETURN false;
  END IF;
  
  -- Check using new secure admin function
  is_admin_user := public.is_admin_secure(current_user_id);
  
  -- Also check access overrides as fallback
  IF NOT is_admin_user THEN
    SELECT EXISTS(
      SELECT 1 
      FROM public.access_overrides 
      WHERE user_id = current_user_id 
        AND (expires_at IS NULL OR expires_at > now())
    ) INTO is_admin_user;
  END IF;
  
  RETURN COALESCE(is_admin_user, false);
END;
$$;


