--
-- Name: get_safe_subscriber_info(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.get_safe_subscriber_info(target_user_id uuid DEFAULT auth.uid()) RETURNS TABLE(id uuid, user_id uuid, email_masked text, subscription_tier text, subscription_end timestamp with time zone, status text, plan text, trial_ends_at timestamp with time zone, expires_at timestamp with time zone, paused boolean, subscribed boolean, created_at timestamp with time zone, updated_at timestamp with time zone)
    LANGUAGE plpgsql STABLE
    SET search_path TO 'public'
    AS $$
DECLARE
  current_user_id uuid;
  is_user_admin boolean;
BEGIN
  current_user_id := auth.uid();
  
  -- Check if current user is admin
  is_user_admin := is_admin();
  
  -- Security check: users can only see their own data unless admin
  IF current_user_id IS NULL THEN
    RETURN;
  END IF;
  
  IF target_user_id != current_user_id AND NOT is_user_admin THEN
    RETURN;
  END IF;
  
  -- Return data with appropriate masking
  RETURN QUERY
  SELECT 
    s.id,
    s.user_id,
    -- Mask email for non-admins
    CASE 
      WHEN is_user_admin THEN s.email 
      ELSE CONCAT(LEFT(s.email, 3), '***@', SPLIT_PART(s.email, '@', 2))
    END as email_masked,
    s.subscription_tier,
    s.subscription_end,
    s.status,
    s.plan,
    s.trial_ends_at,
    s.expires_at,
    s.paused,
    s.subscribed,
    s.created_at,
    s.updated_at
  FROM public.subscribers s
  WHERE s.user_id = target_user_id;
END;
$$;


