-- Name: FUNCTION get_safe_subscriber_info(target_user_id uuid); Type: COMMENT; Schema: public; Owner: -
--

COMMENT ON FUNCTION public.get_safe_subscriber_info(target_user_id uuid) IS 'Secure function to retrieve subscriber information with data masking for non-admin users. Uses SECURITY INVOKER to respect RLS policies.';


--
-- Name: get_user_current_program_day(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.get_user_current_program_day(p_user_id uuid) RETURNS TABLE(programday_id uuid, week integer, day integer, cycle_number integer, day_in_cycle integer, can_complete boolean)
    LANGUAGE plpgsql STABLE SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
DECLARE
  v_status RECORD;
  v_program_day RECORD;
BEGIN
  -- Get user status from static_starts
  SELECT * INTO v_status 
  FROM v_static_status 
  WHERE user_id = p_user_id;
  
  IF NOT FOUND THEN
    -- No program started yet
    RETURN;
  END IF;
  
  -- Get the program day for current position in cycle
  -- Use qualified column names to avoid ambiguity
  SELECT * INTO v_program_day
  FROM programday 
  WHERE programday.week = v_status.current_week_in_cycle 
    AND programday.day = v_status.current_weekday_in_cycle
  LIMIT 1;
  
  IF FOUND THEN
    RETURN QUERY SELECT 
      v_program_day.id,
      v_program_day.week,
      v_program_day.day,
      v_status.current_cycle::integer,
      v_status.current_day_in_cycle::integer,
      TRUE; -- Always can complete in static system
  END IF;
END;
$$;


--
-- Name: get_user_subscription_status(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.get_user_subscription_status(check_user_id uuid DEFAULT auth.uid()) RETURNS jsonb
    LANGUAGE plpgsql STABLE SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
DECLARE
  current_user_id uuid;
  subscription_info jsonb;
BEGIN
  current_user_id := auth.uid();
  
  -- Security check: users can only check their own status unless they're admin
  IF current_user_id IS NULL THEN
    RETURN jsonb_build_object('error', 'Not authenticated');
  END IF;
  
  IF check_user_id != current_user_id AND NOT is_admin() THEN
    RETURN jsonb_build_object('error', 'Access denied');
  END IF;
  
  -- Return only non-sensitive subscription information
  SELECT jsonb_build_object(
    'subscribed', subscribed,
    'status', status,
    'subscription_tier', subscription_tier,
    'trial_ends_at', trial_ends_at,
    'expires_at', expires_at,
    'paused', paused,
    'plan', plan
  )
  INTO subscription_info
  FROM public.subscribers
  WHERE user_id = check_user_id;
  
  RETURN COALESCE(subscription_info, jsonb_build_object('subscribed', false));
END;
$$;


