--
-- Name: is_admin_secure(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.is_admin_secure(_user_id uuid DEFAULT auth.uid()) RETURNS boolean
    LANGUAGE sql STABLE SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
  SELECT COALESCE(public.has_role(_user_id, 'admin'), false)
$$;


--
-- Name: is_allowed(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.is_allowed(uid uuid) RETURNS boolean
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
declare
  v_is_admin boolean := false;
  v_is_paid  boolean := false;
  v_override_ok boolean := false;

  v_status text;
  v_trial_ends timestamptz;
  v_expires timestamptz;
  v_paused boolean := false;
begin
  -- 1) Profiilist admin/is_paid
  select (role = 'admin'), is_paid
  into v_is_admin, v_is_paid
  from public.profiles
  where id = uid;

  if v_is_admin or v_is_paid then
    return true;
  end if;

  -- 2) Allowlist (access_overrides)
  select exists(
    select 1 from public.access_overrides ao
    where ao.user_id = uid
      and (ao.expires_at is null or ao.expires_at > now())
  ) into v_override_ok;

  if v_override_ok then
    return true;
  end if;

  -- 3) Trial / Subscription (kohanda oma skeemi järgi, kui veerud teistmoodi)
  select status, trial_ends_at, expires_at, coalesce(paused,false)
  into v_status, v_trial_ends, v_expires, v_paused
  from public.subscribers
  where user_id = uid
  limit 1;

  if not v_paused then
    if v_status = 'trialing' and v_trial_ends > now() then
      return true;
    end if;
    if v_status = 'active' and (v_expires is null or v_expires > now()) then
      return true;
    end if;
  end if;

  return false;
end;
$$;


--
-- Name: is_subscriber(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.is_subscriber(uid uuid) RETURNS boolean
    LANGUAGE sql STABLE
    SET search_path TO 'public'
    AS $$
  select exists(
    select 1
    from public.subscribers s
    where s.user_id = uid
      and coalesce(s.paused, false) = false
      and (
        (s.status = 'trialing' and coalesce(s.trial_ends_at, now() - interval '1 hour') > now())
        or
        (s.status = 'active' and (s.expires_at is null or s.expires_at > now()))
      )
  );
$$;


--
-- Name: make_current_user_admin(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.make_current_user_admin() RETURNS text
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
DECLARE
  current_user_id uuid;
  user_email text;
BEGIN
  -- Get current user ID
  current_user_id := auth.uid();
  
  IF current_user_id IS NULL THEN
    RETURN 'Error: No authenticated user found. Please log in first.';
  END IF;
  
  -- Get user email from auth.users
  SELECT email INTO user_email 
  FROM auth.users 
  WHERE id = current_user_id;
  
  -- Insert or update profile with admin role
  INSERT INTO public.profiles (id, email, role) 
  VALUES (current_user_id, user_email, 'admin') 
  ON CONFLICT (id) DO UPDATE SET 
    role = 'admin',
    email = COALESCE(EXCLUDED.email, profiles.email);
    
  RETURN 'Success: User ' || COALESCE(user_email, current_user_id::text) || ' is now an admin.';
END;
$$;


--
-- Name: mark_set_done(uuid, uuid, integer, text); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.mark_set_done(p_session_id uuid, p_client_item_id uuid, p_set_number integer, p_notes text DEFAULT NULL::text) RETURNS TABLE(rest_timer_id uuid, target_seconds integer)
    LANGUAGE plpgsql
    SET search_path TO 'public'
    AS $$
DECLARE v_target int; v_rt uuid; v_owner uuid;
BEGIN
  SELECT user_id INTO v_owner FROM workout_sessions WHERE id = p_session_id;
  IF NOT (is_admin() OR v_owner = auth.uid()) THEN RAISE EXCEPTION 'forbidden'; END IF;

  INSERT INTO set_logs(session_id, client_item_id, set_number, notes)
  VALUES (p_session_id, p_client_item_id, p_set_number, p_notes);

  SELECT rest_seconds INTO v_target FROM client_items WHERE id = p_client_item_id;
  IF v_target IS NULL THEN v_target := 60; END IF;

  INSERT INTO rest_timers(session_id, client_item_id, set_number, target_seconds)
  VALUES (p_session_id, p_client_item_id, p_set_number, v_target)
  RETURNING id INTO v_rt;

  RETURN QUERY SELECT v_rt, v_target;
END; 
$$;


--
-- Name: mark_set_done(uuid, uuid, uuid, uuid, integer, numeric, integer, text, integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.mark_set_done(p_session_id uuid, p_client_day_id uuid, p_client_item_id uuid, p_program_id uuid, p_reps_done integer DEFAULT NULL::integer, p_weight_kg_done numeric DEFAULT NULL::numeric, p_seconds_done integer DEFAULT NULL::integer, p_notes text DEFAULT NULL::text, p_max_sets integer DEFAULT NULL::integer) RETURNS TABLE(inserted boolean, id uuid, set_number integer, total_done integer)
    LANGUAGE plpgsql
    SET search_path TO 'public'
    AS $$
declare
  v_uid       uuid := auth.uid();
  v_done      int;
  v_setn      int;
  v_id        uuid;
  v_lock_key  bigint;
begin
  -- advisory lock for concurrency safety
  v_lock_key := ('x' || substr(md5(p_session_id::text || ':' || p_client_item_id::text), 1, 16))::bit(64)::bigint;
  perform pg_advisory_xact_lock(v_lock_key);

  -- count existing sets for this session + exercise
  select count(*) into v_done
  from public.set_logs
  where session_id = p_session_id
    and client_item_id = p_client_item_id;

  -- check max sets limit
  if p_max_sets is not null and v_done >= p_max_sets then
    return query
      select false, NULL::uuid, v_done, v_done;
    return;
  end if;

  v_setn := v_done + 1;

  -- insert new set with actual performance values
  insert into public.set_logs (
    session_id, client_day_id, client_item_id, program_id, user_id, set_number,
    reps_done, weight_kg_done, seconds_done, notes
  )
  values (
    p_session_id, p_client_day_id, p_client_item_id, p_program_id, v_uid, v_setn,
    p_reps_done, p_weight_kg_done, p_seconds_done, p_notes
  )
  returning id into v_id;

  return query
    select true, v_id, v_setn, v_setn;
end;
$$;


