--

CREATE FUNCTION public.set_logs_ensure_session() RETURNS trigger
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
declare
  v_sid uuid;
begin
  if new.session_id is not null then
    return new;
  end if;

  select id into v_sid
  from public.workout_sessions
  where user_id = new.user_id
    and program_id = new.program_id
    and client_day_id = new.client_day_id
    and ended_at is null
  order by started_at desc
  limit 1;

  if v_sid is null then
    insert into public.workout_sessions (user_id, program_id, client_day_id)
    values (new.user_id, new.program_id, new.client_day_id)
    returning id into v_sid;
  end if;

  new.session_id := v_sid;
  return new;
end $$;


