--
-- Name: start_pt_trial_3d(uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.start_pt_trial_3d(u uuid) RETURNS jsonb
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
DECLARE 
  now_ts timestamptz := now();
  v_uid  uuid := COALESCE(u, auth.uid());
BEGIN
  IF v_uid IS NULL THEN
    RAISE EXCEPTION 'forbidden: missing user id (pass u or call with a valid auth.uid())';
  END IF;

  -- create row or extend only if no active PT entitlement/trial
  IF NOT EXISTS (
    SELECT 1 FROM user_entitlements
    WHERE user_id = v_uid AND product = 'pt'
      AND (
        (status = 'trialing' AND COALESCE(trial_ends_at, '-infinity') > now_ts) OR
        (status = 'active'   AND (expires_at IS NULL OR expires_at > now_ts))
      )
  ) THEN
    INSERT INTO user_entitlements (user_id, product, status, started_at, trial_ends_at, paused, source, note)
    VALUES (v_uid, 'pt', 'trialing', now_ts, now_ts + interval '3 days', false, 'manual', '3d PT trial')
    ON CONFLICT (user_id, product) DO UPDATE
      SET status='trialing', trial_ends_at=EXCLUDED.trial_ends_at, started_at=now_ts, paused=false, updated_at=now_ts;
  END IF;

  RETURN jsonb_build_object(
    'status','ok',
    'row', (SELECT to_jsonb(ue) FROM user_entitlements ue WHERE ue.user_id=v_uid AND ue.product='pt')
  );
END $$;


--
-- Name: start_session(uuid, uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.start_session(p_client_program_id uuid, p_client_day_id uuid) RETURNS uuid
    LANGUAGE sql
    SET search_path TO 'public'
    AS $$
  WITH existing AS (
    SELECT id
    FROM public.workout_sessions
    WHERE user_id = auth.uid()
      AND client_program_id = p_client_program_id
      AND client_day_id     = p_client_day_id
      AND ended_at IS NULL
    LIMIT 1
  ),
  ins AS (
    INSERT INTO public.workout_sessions (user_id, client_program_id, client_day_id)
    SELECT auth.uid(), p_client_program_id, p_client_day_id
    WHERE NOT EXISTS (SELECT 1 FROM existing)
    RETURNING id
  )
  SELECT COALESCE((SELECT id FROM existing), (SELECT id FROM ins)) AS id;
$$;


--
-- Name: start_static_program(boolean); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.start_static_program(p_force boolean DEFAULT false) RETURNS date
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
declare
  v_uid          uuid;
  v_today_et     date;
  v_dow_et       int;
  v_this_monday  date;
  v_existing     date;
  v_start        date;
begin
  v_uid := auth.uid();
  if v_uid is null then
    raise exception 'start_static_program: not authenticated';
  end if;

  -- Tallinn local date + DOW
  v_today_et := (now() at time zone 'Europe/Tallinn')::date;
  v_dow_et   := extract(dow from (now() at time zone 'Europe/Tallinn'))::int; -- 0=Sun .. 1=Mon .. 6=Sat

  -- "This week Monday" in ET
  v_this_monday := (date_trunc('week', (now() at time zone 'Europe/Tallinn')) + interval '1 day')::date;

  -- We want the program to begin on MONDAY.
  -- If today is Monday -> start today; otherwise schedule for the NEXT Monday.
  if v_dow_et = 1 then
    v_start := v_today_et;               -- today (Monday)
  else
    v_start := v_this_monday + interval '7 days';
  end if;

  -- Existing start?
  select ss.start_monday
    into v_existing
  from public.static_starts ss
  where ss.user_id = v_uid;

  if v_existing is not null and not p_force then
    -- Keep old start; just return it
    return v_existing;
  end if;

  -- Upsert (force allows overwrite)
  insert into public.static_starts (user_id, start_monday)
  values (v_uid, v_start)
  on conflict (user_id) do update
    set start_monday = excluded.start_monday;

  return v_start;
end;
$$;


