--
-- Name: start_trial_once(uuid, text); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.start_trial_once(p_user uuid, p_email text) RETURNS jsonb
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public', 'extensions'
    AS $$
declare
  now_ts timestamptz := now();
begin
  -- ainult iseendale lubatud
  if p_user is distinct from auth.uid() then
    raise exception 'forbidden: can only start trial for yourself';
  end if;

  -- võta kindluse mõttes email auth.users tabelist
  select email into p_email from auth.users where id = p_user;

  -- loo profiil kui puudub
  insert into public.profiles (id, email)
  values (p_user, p_email)
  on conflict (id) do nothing;

  -- kui on maksev või periood kehtib, ära anna triali
  if exists (
    select 1 from public.profiles
    where id = p_user
      and (is_paid = true
           or (current_period_end is not null and current_period_end > now_ts))
  ) then
    return jsonb_build_object('status','paid');
  end if;

  -- kui trial juba kasutatud või aktiivne, lõpeta
  if exists (
    select 1 from public.profiles
    where id = p_user
      and (
        trial_used = true
        or (trial_ends_at is not null and trial_ends_at > now_ts)
      )
  ) then
    return jsonb_build_object('status','already_trialed');
  end if;

  -- käivita 1-päevane trial
  update public.profiles
  set trial_used = true,
      trial_ends_at = now_ts + interval '1 day',
      updated_at = now_ts
  where id = p_user;

  return jsonb_build_object(
    'status','trial_started',
    'trial_ends_at', (select trial_ends_at from public.profiles where id = p_user)
  );
end;
$$;


--
-- Name: test_admin_login(text); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.test_admin_login(test_email text) RETURNS jsonb
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
DECLARE
  admin_user_id uuid;
  result jsonb;
BEGIN
  -- Find admin user by email
  SELECT id INTO admin_user_id 
  FROM profiles 
  WHERE email = test_email AND role = 'admin';
  
  IF admin_user_id IS NULL THEN
    -- Try to find any user with this email and make them admin
    SELECT id INTO admin_user_id 
    FROM profiles 
    WHERE email = test_email;
    
    IF admin_user_id IS NOT NULL THEN
      UPDATE profiles SET role = 'admin' WHERE id = admin_user_id;
    END IF;
  END IF;
  
  -- Return debug info
  SELECT jsonb_build_object(
    'found_user', admin_user_id IS NOT NULL,
    'user_id', admin_user_id,
    'email', test_email,
    'conversations', (SELECT COUNT(*) FROM support_conversations),
    'active_conversations', (SELECT COUNT(*) FROM support_conversations WHERE status = 'active'),
    'messages', (SELECT COUNT(*) FROM support_messages),
    'profiles_count', (SELECT COUNT(*) FROM profiles)
  ) INTO result;
  
  RETURN result;
END;
$$;


