--

CREATE FUNCTION public.to_reps_text_from_defaults(reps_num integer, reps_txt text, seconds_num integer, seconds_txt text) RETURNS text
    LANGUAGE plpgsql IMMUTABLE
    SET search_path TO 'public'
    AS $$
declare v text;
begin
  if nullif(reps_txt,'') is not null then
    return reps_txt;
  elsif reps_num is not null then
    return reps_num::text || 'x';
  elsif nullif(seconds_txt,'') is not null then
    v := trim(seconds_txt);
    if right(v,1) = 's' then
      return v;
    else
      return v || 's';
    end if;
  elsif seconds_num is not null then
    return seconds_num::text || 's';
  else
    return null;
  end if;
end;
$$;


--
-- Name: track_user_event(text, jsonb, text, text); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.track_user_event(p_event_type text, p_event_data jsonb DEFAULT '{}'::jsonb, p_page_url text DEFAULT NULL::text, p_session_id text DEFAULT NULL::text) RETURNS uuid
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public'
    AS $$
DECLARE
    v_event_id uuid;
    v_user_id uuid := auth.uid();
BEGIN
    -- Ensure user is authenticated
    IF v_user_id IS NULL THEN
        RAISE EXCEPTION 'authentication required';
    END IF;
    
    -- Insert the event (only for authenticated user)
    INSERT INTO public.user_analytics_events (
        user_id, 
        event_type, 
        event_data, 
        page_url, 
        session_id
    )
    VALUES (
        v_user_id, 
        p_event_type, 
        p_event_data, 
        p_page_url, 
        p_session_id
    )
    RETURNING id INTO v_event_id;
    
    RETURN v_event_id;
END $$;


