--
-- Name: v_access_matrix; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.v_access_matrix WITH (security_invoker='true') AS
 WITH admin_users AS (
         SELECT p.id AS user_id,
            true AS is_admin,
            'profile_admin'::text AS reason
           FROM public.profiles p
          WHERE (p.role = 'admin'::text)
        UNION
         SELECT ur.user_id,
            true AS is_admin,
            'user_roles_admin'::text AS reason
           FROM public.user_roles ur
          WHERE (ur.role = 'admin'::public.app_role)
        UNION
         SELECT ao.user_id,
            true AS is_admin,
            'access_override'::text AS reason
           FROM public.access_overrides ao
          WHERE ((ao.expires_at IS NULL) OR (ao.expires_at > now()))
        ), entitlement_access AS (
         SELECT ue.user_id,
            bool_or(
                CASE
                    WHEN ((ue.product = 'static'::public.product_kind) AND (NOT ue.paused) AND (((ue.status = 'active'::text) AND ((ue.expires_at IS NULL) OR (ue.expires_at > now()))) OR ((ue.status = 'trialing'::text) AND (ue.trial_ends_at IS NOT NULL) AND (ue.trial_ends_at > now())))) THEN true
                    ELSE false
                END) AS can_static,
            bool_or(
                CASE
                    WHEN ((ue.product = 'pt'::public.product_kind) AND (NOT ue.paused) AND (((ue.status = 'active'::text) AND ((ue.expires_at IS NULL) OR (ue.expires_at > now()))) OR ((ue.status = 'trialing'::text) AND (ue.trial_ends_at IS NOT NULL) AND (ue.trial_ends_at > now())))) THEN true
                    ELSE false
                END) AS can_pt
           FROM public.user_entitlements ue
          GROUP BY ue.user_id
        ), all_users AS (
         SELECT p.id AS user_id
           FROM public.profiles p
        )
 SELECT u.user_id,
    COALESCE(a.is_admin, false) AS is_admin,
    (COALESCE(e.can_static, false) OR COALESCE(a.is_admin, false)) AS can_static,
    (COALESCE(e.can_pt, false) OR COALESCE(a.is_admin, false)) AS can_pt,
    COALESCE(a.reason, 'database_view'::text) AS reason
   FROM ((all_users u
     LEFT JOIN admin_users a ON ((a.user_id = u.user_id)))
     LEFT JOIN entitlement_access e ON ((e.user_id = u.user_id)));


