--
-- Name: v_program_analytics; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.v_program_analytics WITH (security_invoker='true') AS
 WITH program_stats AS (
         SELECT cp.id AS program_id,
            cp.title_override,
            cp.start_date,
            cp.duration_weeks,
            count(DISTINCT cd.id) AS total_days,
            count(DISTINCT ws.id) AS total_sessions,
            count(DISTINCT
                CASE
                    WHEN (ws.ended_at IS NOT NULL) THEN ws.id
                    ELSE NULL::uuid
                END) AS completed_sessions,
            avg(
                CASE
                    WHEN (ws.ended_at IS NOT NULL) THEN ws.duration_minutes
                    ELSE NULL::integer
                END) AS avg_session_duration,
            count(DISTINCT ws.user_id) AS unique_users,
            min(ws.started_at) AS first_session,
            max(ws.started_at) AS last_session
           FROM ((public.client_programs cp
             LEFT JOIN public.client_days cd ON ((cd.client_program_id = cp.id)))
             LEFT JOIN public.workout_sessions ws ON ((ws.client_program_id = cp.id)))
          GROUP BY cp.id, cp.title_override, cp.start_date, cp.duration_weeks
        ), dropoff_analysis AS (
         SELECT 1 AS most_common_dropoff_day
        )
 SELECT ps.program_id,
    ps.title_override,
    ps.start_date,
    ps.duration_weeks,
    ps.total_days,
    ps.total_sessions,
    ps.completed_sessions,
    ps.avg_session_duration,
    ps.unique_users,
    ps.first_session,
    ps.last_session,
        CASE
            WHEN (ps.total_sessions = 0) THEN (0)::numeric
            ELSE round((((ps.completed_sessions)::numeric / (ps.total_sessions)::numeric) * (100)::numeric), 1)
        END AS completion_rate,
    da.most_common_dropoff_day
   FROM (program_stats ps
     CROSS JOIN dropoff_analysis da);


--
-- Name: v_program_progress; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.v_program_progress WITH (security_invoker='true') AS
 WITH program_sessions AS (
         SELECT cp.id AS program_id,
            cp.assigned_to AS user_id,
            cp.start_date,
            cp.duration_weeks,
            cp.auto_progression_enabled,
            cp.status,
            cp.completed_at,
            count(DISTINCT ws.id) AS total_sessions,
            count(DISTINCT
                CASE
                    WHEN (ws.ended_at IS NOT NULL) THEN ws.id
                    ELSE NULL::uuid
                END) AS completed_sessions,
            count(DISTINCT cd.id) AS total_days,
            (EXTRACT(epoch FROM (now() - (cp.start_date)::timestamp with time zone)) / (((7 * 24) * 3600))::numeric) AS weeks_elapsed
           FROM ((public.client_programs cp
             LEFT JOIN public.client_days cd ON ((cd.client_program_id = cp.id)))
             LEFT JOIN public.workout_sessions ws ON ((ws.client_program_id = cp.id)))
          WHERE (cp.start_date IS NOT NULL)
          GROUP BY cp.id, cp.assigned_to, cp.start_date, cp.duration_weeks, cp.auto_progression_enabled, cp.status, cp.completed_at
        )
 SELECT program_id,
    user_id,
    start_date,
    duration_weeks,
    auto_progression_enabled,
    status,
    completed_at,
    weeks_elapsed,
        CASE
            WHEN ((total_sessions = 0) OR (total_days = 0)) THEN (0)::numeric
            ELSE round((((completed_sessions)::numeric / (total_days)::numeric) * (100)::numeric), 0)
        END AS progress_percentage,
        CASE
            WHEN (weeks_elapsed >= (duration_weeks)::numeric) THEN true
            ELSE false
        END AS is_due_for_completion
   FROM program_sessions;


--
-- Name: v_session_summary; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.v_session_summary WITH (security_invoker='true') AS
 SELECT ws.id AS session_id,
    ws.user_id,
    ws.client_program_id,
    ws.client_day_id,
    ws.started_at,
    ws.ended_at,
    ws.duration_minutes,
    count(DISTINCT sl.id) AS total_sets_completed,
    avg(en.rpe) AS avg_rpe,
    cd.title AS day_title,
    cp.title_override AS program_title
   FROM ((((public.workout_sessions ws
     LEFT JOIN public.set_logs sl ON ((sl.session_id = ws.id)))
     LEFT JOIN public.exercise_notes en ON ((en.session_id = ws.id)))
     LEFT JOIN public.client_days cd ON ((cd.id = ws.client_day_id)))
     LEFT JOIN public.client_programs cp ON ((cp.id = ws.client_program_id)))
  GROUP BY ws.id, ws.user_id, ws.client_program_id, ws.client_day_id, ws.started_at, ws.ended_at, ws.duration_minutes, cd.title, cp.title_override;


--
-- Name: v_static_status; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.v_static_status AS
 SELECT user_id,
    start_monday,
        CASE
            WHEN (start_monday > CURRENT_DATE) THEN 'pending'::text
            ELSE 'active'::text
        END AS status,
    (CURRENT_DATE - start_monday) AS days_since_start,
    floor((((CURRENT_DATE - start_monday) / 20))::double precision) AS current_cycle,
        CASE
            WHEN ((((CURRENT_DATE - start_monday) % 20) = 0) AND ((CURRENT_DATE - start_monday) > 0)) THEN 20
            ELSE GREATEST(1, (((CURRENT_DATE - start_monday) % 20) + 1))
        END AS current_day_in_cycle,
        CASE
            WHEN ((((CURRENT_DATE - start_monday) % 20) = 0) AND ((CURRENT_DATE - start_monday) > 0)) THEN (4)::numeric
            ELSE GREATEST((1)::numeric, ceil((((((CURRENT_DATE - start_monday) % 20) + 1))::numeric / 5.0)))
        END AS current_week_in_cycle,
        CASE
            WHEN ((((CURRENT_DATE - start_monday) % 20) = 0) AND ((CURRENT_DATE - start_monday) > 0)) THEN 5
            ELSE GREATEST(1, ((((CURRENT_DATE - start_monday) % 20) % 5) + 1))
        END AS current_weekday_in_cycle
   FROM public.static_starts ss;


--
-- Name: v_user_entitlement; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.v_user_entitlement WITH (security_invoker='on') AS
 SELECT user_id,
    product,
    status,
    started_at,
    trial_ends_at,
    expires_at,
    paused,
    source,
    note,
    created_at,
    updated_at,
        CASE
            WHEN paused THEN false
            WHEN ((status = 'trialing'::text) AND (COALESCE(trial_ends_at, '-infinity'::timestamp with time zone) > now())) THEN true
            WHEN ((status = 'active'::text) AND ((expires_at IS NULL) OR (expires_at > now()))) THEN true
            ELSE false
        END AS is_active
   FROM public.user_entitlements ue;


--
-- Name: v_user_weekly; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.v_user_weekly WITH (security_invoker='on') AS
 SELECT user_id,
    public.get_iso_week(started_at) AS iso_week,
    count(*) AS sessions_count,
    count(*) FILTER (WHERE (ended_at IS NOT NULL)) AS completed_sessions,
    sum(COALESCE(duration_minutes, 0)) AS total_minutes,
    avg(COALESCE(duration_minutes, 0)) AS avg_minutes_per_session
   FROM public.workout_sessions ws
  GROUP BY user_id, (public.get_iso_week(started_at));


--
-- Name: v_userprogress_with_day; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.v_userprogress_with_day WITH (security_invoker='on') AS
 SELECT up.id,
    up.user_id,
    up.programday_id,
    up.completed_at,
    up.created_at,
    up.reps,
    up.sets,
    up.done,
    up.total_sets,
    up.total_reps,
    up.total_seconds,
    up.updated_at,
    pd.week,
    pd.day,
    pd.title AS day_title
   FROM (public.userprogress up
     JOIN public.programday pd ON ((pd.id = up.programday_id)));


