20250829031235	{"-- Create userprogress table to track user completion\nCREATE TABLE public.userprogress (\n  id UUID PRIMARY KEY DEFAULT gen_random_uuid(),\n  user_id UUID NOT NULL,\n  programday_id UUID NOT NULL REFERENCES public.programday(id),\n  completed_at TIMESTAMPTZ NOT NULL DEFAULT now(),\n  created_at TIMESTAMPTZ NOT NULL DEFAULT now(),\n  UNIQUE(user_id, programday_id)\n);\n\n-- Enable Row Level Security\nALTER TABLE public.userprogress ENABLE ROW LEVEL SECURITY;\n\n-- Create policies for user progress\nCREATE POLICY \\"Users can view their own progress\\" \nON public.userprogress \nFOR SELECT \nUSING (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can create their own progress\\" \nON public.userprogress \nFOR INSERT \nWITH CHECK (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can update their own progress\\" \nON public.userprogress \nFOR UPDATE \nUSING (auth.uid() = user_id);\n\n-- Create subscribers table for Stripe integration\nCREATE TABLE public.subscribers (\n  id UUID PRIMARY KEY DEFAULT gen_random_uuid(),\n  user_id UUID NOT NULL,\n  email TEXT NOT NULL UNIQUE,\n  stripe_customer_id TEXT,\n  subscribed BOOLEAN NOT NULL DEFAULT false,\n  subscription_tier TEXT,\n  subscription_end TIMESTAMPTZ,\n  updated_at TIMESTAMPTZ NOT NULL DEFAULT now(),\n  created_at TIMESTAMPTZ NOT NULL DEFAULT now()\n);\n\n-- Enable RLS for subscribers\nALTER TABLE public.subscribers ENABLE ROW LEVEL SECURITY;\n\n-- Create policies for subscribers\nCREATE POLICY \\"Users can view their own subscription\\" \nON public.subscribers \nFOR SELECT \nUSING (auth.uid() = user_id OR auth.email() = email);\n\nCREATE POLICY \\"Users can update their own subscription\\" \nON public.subscribers \nFOR UPDATE \nUSING (true);\n\nCREATE POLICY \\"Users can insert subscription\\" \nON public.subscribers \nFOR INSERT \nWITH CHECK (true);"}		treenitaastu@gmail.com	\N
20250904065653	{"-- Enable Row Level Security on userprogress_backup table\nALTER TABLE public.userprogress_backup ENABLE ROW LEVEL SECURITY;\n\n-- Add policy to allow users to view only their own progress data\nCREATE POLICY \\"Users can view their own backup progress\\" \nON public.userprogress_backup \nFOR SELECT \nUSING (auth.uid() = user_id);\n\n-- Add policy to allow users to insert their own progress data\nCREATE POLICY \\"Users can insert their own backup progress\\" \nON public.userprogress_backup \nFOR INSERT \nWITH CHECK (auth.uid() = user_id);\n\n-- Add policy to allow users to update their own progress data\nCREATE POLICY \\"Users can update their own backup progress\\" \nON public.userprogress_backup \nFOR UPDATE \nUSING (auth.uid() = user_id)\nWITH CHECK (auth.uid() = user_id);\n\n-- Add policy to allow users to delete their own progress data\nCREATE POLICY \\"Users can delete their own backup progress\\" \nON public.userprogress_backup \nFOR DELETE \nUSING (auth.uid() = user_id);"}		treenitaastu@gmail.com	\N
20250905012408	{"-- Fix Security Definer Views by recreating them with proper security settings\n\n-- First, drop the existing views that have SECURITY DEFINER\nDROP VIEW IF EXISTS public.v_user_entitlement;\nDROP VIEW IF EXISTS public.v_userprogress_with_day;\n\n-- Recreate v_user_entitlement view without SECURITY DEFINER (defaults to SECURITY INVOKER)\n-- This view will now respect RLS policies of the querying user\nCREATE VIEW public.v_user_entitlement AS\nSELECT \n  p.id as user_id,\n  CASE \n    WHEN p.is_paid = true THEN 'paid'\n    WHEN p.trial_ends_at IS NOT NULL AND p.trial_ends_at > now() THEN 'trial'\n    WHEN EXISTS (\n      SELECT 1 FROM public.access_overrides ao \n      WHERE ao.user_id = p.id \n        AND (ao.expires_at IS NULL OR ao.expires_at > now())\n    ) THEN 'override'\n    ELSE 'free'\n  END as access_tier,\n  p.trial_ends_at,\n  p.current_period_end\nFROM public.profiles p;\n\n-- Recreate v_userprogress_with_day view without SECURITY DEFINER\n-- This view will now respect RLS policies of the querying user\nCREATE VIEW public.v_userprogress_with_day AS\nSELECT \n  up.id,\n  up.user_id,\n  up.programday_id,\n  up.completed_at,\n  up.created_at,\n  up.reps,\n  up.sets,\n  pd.week,\n  pd.day,\n  pd.exercise1,\n  pd.exercise2,\n  pd.exercise3,\n  pd.exercise4,\n  pd.exercise5\nFROM public.userprogress up\nJOIN public.programday pd ON up.programday_id = pd.id;\n\n-- Enable RLS on both views (this is automatic for views, but making it explicit)\n-- Views inherit RLS behavior from underlying tables when using SECURITY INVOKER"}		treenitaastu@gmail.com	\N
20250908072739	{"-- Step 1: Add new columns to programday table for the canonical structure\nALTER TABLE public.programday \nADD COLUMN IF NOT EXISTS program_id UUID,\nADD COLUMN IF NOT EXISTS title TEXT,\nADD COLUMN IF NOT EXISTS notes TEXT,\nADD COLUMN IF NOT EXISTS exercises JSONB DEFAULT '[]'::jsonb,\nADD COLUMN IF NOT EXISTS updated_at TIMESTAMP WITH TIME ZONE DEFAULT now();\n\n-- Step 2: Migrate existing programday data to exercises JSON array\nUPDATE public.programday SET exercises = (\n  SELECT jsonb_agg(\n    jsonb_build_object(\n      'order', exercise_order,\n      'name', exercise_name,\n      'video_url', video_url,\n      'sets', exercise_sets,\n      'reps', exercise_reps,\n      'seconds', exercise_seconds,\n      'cues', exercise_cues\n    )\n  )\n  FROM (\n    SELECT \n      1 as exercise_order, exercise1 as exercise_name, videolink1 as video_url, \n      exercise1_sets as exercise_sets, exercise1_reps as exercise_reps,\n      CASE \n        WHEN exercise1 ILIKE ANY(ARRAY['%hold%', '%plank%', '%stretch%', '%mobility%', '%rotation%', '%foam roll%']) THEN 30\n        ELSE NULL \n      END as exercise_seconds,\n      exercise1_hint as exercise_cues\n    WHERE exercise1 IS NOT NULL AND exercise1 != ''\n    UNION ALL\n    SELECT \n      2, exercise2, videolink2, \n      exercise2_sets, exercise2_reps,\n      CASE \n        WHEN exercise2 ILIKE ANY(ARRAY['%hold%', '%plank%', '%stretch%', '%mobility%', '%rotation%', '%foam roll%']) THEN 30\n        ELSE NULL \n      END,\n      exercise2_hint\n    WHERE exercise2 IS NOT NULL AND exercise2 != ''\n    UNION ALL\n    SELECT \n      3, exercise3, videolink3, \n      exercise3_sets, exercise3_reps,\n      CASE \n        WHEN exercise3 ILIKE ANY(ARRAY['%hold%', '%plank%', '%stretch%', '%mobility%', '%rotation%', '%foam roll%']) THEN 30\n        ELSE NULL \n      END,\n      exercise3_hint\n    WHERE exercise3 IS NOT NULL AND exercise3 != ''\n    UNION ALL\n    SELECT \n      4, exercise4, videolink4, \n      exercise4_sets, exercise4_reps,\n      CASE \n        WHEN exercise4 ILIKE ANY(ARRAY['%hold%', '%plank%', '%stretch%', '%mobility%', '%rotation%', '%foam roll%']) THEN 30\n        ELSE NULL \n      END,\n      exercise4_hint\n    WHERE exercise4 IS NOT NULL AND exercise4 != ''\n    UNION ALL\n    SELECT \n      5, exercise5, videolink5, \n      exercise5_sets, exercise5_reps,\n      CASE \n        WHEN exercise5 ILIKE ANY(ARRAY['%hold%', '%plank%', '%stretch%', '%mobility%', '%rotation%', '%foam roll%']) THEN 30\n        ELSE NULL \n      END,\n      exercise5_hint\n    WHERE exercise5 IS NOT NULL AND exercise5 != ''\n    ORDER BY exercise_order\n  ) exercises_data\n)\nWHERE exercises = '[]'::jsonb;\n\n-- Step 3: Apply exercise defaults for missing sets/reps based on exercise type\nUPDATE public.programday SET exercises = (\n  SELECT jsonb_agg(\n    CASE \n      WHEN (exercise->>'sets')::int IS NULL OR (exercise->>'reps')::int IS NULL THEN\n        exercise || jsonb_build_object(\n          'sets', CASE \n            WHEN exercise->>'name' ILIKE ANY(ARRAY['%hold%', '%plank%', '%stretch%', '%mobility%', '%rotation%', '%foam roll%']) THEN 2\n            WHEN exercise->>'name' ILIKE ANY(ARRAY['%press%', '%row%', '%squat%', '%deadlift%', '%lunge%', '%hinge%', '%pull%', '%push-up%', '%raise%', '%fly%', '%curl%', '%extension%']) THEN 3\n            ELSE 2\n          END,\n          'reps', CASE \n            WHEN exercise->>'name' ILIKE ANY(ARRAY['%hold%', '%plank%', '%stretch%', '%mobility%', '%rotation%', '%foam roll%']) THEN NULL\n            WHEN exercise->>'name' ILIKE ANY(ARRAY['%press%', '%row%', '%squat%', '%deadlift%', '%lunge%', '%hinge%', '%pull%', '%push-up%', '%raise%', '%fly%', '%curl%', '%extension%']) THEN 10\n            ELSE 10\n          END\n        )\n      ELSE exercise\n    END ORDER BY (exercise->>'order')::int\n  )\n  FROM jsonb_array_elements(exercises) exercise\n);\n\n-- Step 4: Migrate data from programday_staging if it exists\nINSERT INTO public.programday (week, day, program_id, title, notes, exercises, created_at, updated_at)\nSELECT \n  week, \n  day,\n  NULL as program_id,\n  NULL as title, \n  hintprogramday_staging as notes,\n  (\n    SELECT jsonb_agg(\n      jsonb_build_object(\n        'order', exercise_order,\n        'name', exercise_name,\n        'video_url', video_url,\n        'sets', COALESCE(exercise_sets, CASE \n          WHEN exercise_name ILIKE ANY(ARRAY['%hold%', '%plank%', '%stretch%', '%mobility%', '%rotation%', '%foam roll%']) THEN 2\n          WHEN exercise_name ILIKE ANY(ARRAY['%press%', '%row%', '%squat%', '%deadlift%', '%lunge%', '%hinge%', '%pull%', '%push-up%', '%raise%', '%fly%', '%curl%', '%extension%']) THEN 3\n          ELSE 2\n        END),\n        'reps', COALESCE(exercise_reps, CASE \n          WHEN exercise_name ILIKE ANY(ARRAY['%hold%', '%plank%', '%stretch%', '%mobility%', '%rotation%', '%foam roll%']) THEN NULL\n          ELSE 10\n        END),\n        'seconds', CASE \n          WHEN exercise_name ILIKE ANY(ARRAY['%hold%', '%plank%', '%stretch%', '%mobility%', '%rotation%', '%foam roll%']) THEN 30\n          ELSE NULL \n        END,\n        'cues', exercise_cues\n      )\n    )\n    FROM (\n      SELECT 1 as exercise_order, exercise1 as exercise_name, videolink1 as video_url, exercise1_sets as exercise_sets, exercise1_reps as exercise_reps, exercise1_hint as exercise_cues\n      WHERE exercise1 IS NOT NULL AND exercise1 != ''\n      UNION ALL\n      SELECT 2, exercise2, videolink2, exercise2_sets, exercise2_reps, exercise2_hint\n      WHERE exercise2 IS NOT NULL AND exercise2 != ''\n      UNION ALL\n      SELECT 3, exercise3, videolink3, exercise3_sets, exercise3_reps, exercise3_hint\n      WHERE exercise3 IS NOT NULL AND exercise3 != ''\n      UNION ALL\n      SELECT 4, exercise4, videolink4, exercise4_sets, exercise4_reps, exercise4_hint\n      WHERE exercise4 IS NOT NULL AND exercise4 != ''\n      UNION ALL\n      SELECT 5, exercise5, videolink5, exercise5_sets, exercise5_reps, exercise5_hint\n      WHERE exercise5 IS NOT NULL AND exercise5 != ''\n      ORDER BY exercise_order\n    ) exercises_data\n  ) as exercises,\n  COALESCE(created_at, now()) as created_at,\n  now() as updated_at\nFROM public.programday_staging\nWHERE NOT EXISTS (\n  SELECT 1 FROM public.programday pd \n  WHERE pd.week = programday_staging.week AND pd.day = programday_staging.day\n);\n\n-- Step 5: Add indexes for performance\nCREATE INDEX IF NOT EXISTS idx_programday_week_day ON public.programday (week, day);\nCREATE INDEX IF NOT EXISTS idx_programday_program_id ON public.programday (program_id) WHERE program_id IS NOT NULL;\n\n-- Step 6: Add trigger for updated_at\nCREATE OR REPLACE FUNCTION update_updated_at_column()\nRETURNS TRIGGER AS $$\nBEGIN\n    NEW.updated_at = now();\n    RETURN NEW;\nEND;\n$$ LANGUAGE plpgsql;\n\nCREATE TRIGGER update_programday_updated_at\n    BEFORE UPDATE ON public.programday\n    FOR EACH ROW\n    EXECUTE FUNCTION update_updated_at_column();\n\n-- Step 7: Drop programday_staging table as it's no longer needed\nDROP TABLE IF EXISTS public.programday_staging;"}		treenitaastu@gmail.com	\N
20250910125222	{"-- Personal Training Module: Core Tables and RLS\nCREATE EXTENSION IF NOT EXISTS pgcrypto;\n\n-- 1) TEMPLATES\nCREATE TABLE IF NOT EXISTS workout_templates (\n  id uuid PRIMARY KEY DEFAULT gen_random_uuid(),\n  title text NOT NULL,\n  goal text,\n  is_active boolean DEFAULT true,\n  created_by uuid,\n  inserted_at timestamptz DEFAULT now()\n);\n\nCREATE TABLE IF NOT EXISTS template_days (\n  id uuid PRIMARY KEY DEFAULT gen_random_uuid(),\n  template_id uuid NOT NULL REFERENCES workout_templates(id) ON DELETE CASCADE,\n  day_order int NOT NULL,\n  title text NOT NULL,\n  note text,\n  inserted_at timestamptz DEFAULT now()\n);\n\nCREATE TABLE IF NOT EXISTS template_items (\n  id uuid PRIMARY KEY DEFAULT gen_random_uuid(),\n  template_day_id uuid NOT NULL REFERENCES template_days(id) ON DELETE CASCADE,\n  exercise_name text NOT NULL,\n  sets int NOT NULL,\n  reps text NOT NULL,\n  rest_seconds int DEFAULT 60,\n  coach_notes text,\n  order_in_day int NOT NULL,\n  video_url text,\n  inserted_at timestamptz DEFAULT now()\n);\n\nCREATE INDEX IF NOT EXISTS idx_template_days_template ON template_days(template_id, day_order);\nCREATE INDEX IF NOT EXISTS idx_template_items_day ON template_items(template_day_id, order_in_day);\n\n-- 2) CLIENT PROGRAMS (immutable clones)\nCREATE TABLE IF NOT EXISTS client_programs (\n  id uuid PRIMARY KEY DEFAULT gen_random_uuid(),\n  template_id uuid REFERENCES workout_templates(id),\n  assigned_to uuid NOT NULL,\n  assigned_by uuid NOT NULL,\n  title_override text,\n  goal_override text,\n  start_date date,\n  is_active boolean DEFAULT true,\n  inserted_at timestamptz DEFAULT now()\n);\n\nCREATE TABLE IF NOT EXISTS client_days (\n  id uuid PRIMARY KEY DEFAULT gen_random_uuid(),\n  client_program_id uuid NOT NULL REFERENCES client_programs(id) ON DELETE CASCADE,\n  day_order int NOT NULL,\n  title text NOT NULL,\n  note text,\n  inserted_at timestamptz DEFAULT now()\n);\n\nCREATE TABLE IF NOT EXISTS client_items (\n  id uuid PRIMARY KEY DEFAULT gen_random_uuid(),\n  client_day_id uuid NOT NULL REFERENCES client_days(id) ON DELETE CASCADE,\n  exercise_name text NOT NULL,\n  sets int NOT NULL,\n  reps text NOT NULL,\n  rest_seconds int DEFAULT 60,\n  coach_notes text,\n  order_in_day int NOT NULL,\n  video_url text,\n  inserted_at timestamptz DEFAULT now()\n);\n\nCREATE INDEX IF NOT EXISTS idx_client_days_program ON client_days(client_program_id, day_order);\nCREATE INDEX IF NOT EXISTS idx_client_items_day ON client_items(client_day_id, order_in_day);\n\n-- 3) WORKOUT LOGGING\nCREATE TABLE IF NOT EXISTS workout_sessions (\n  id uuid PRIMARY KEY DEFAULT gen_random_uuid(),\n  client_program_id uuid NOT NULL,\n  client_day_id uuid NOT NULL,\n  user_id uuid NOT NULL,\n  started_at timestamptz NOT NULL DEFAULT now(),\n  completed_at timestamptz,\n  inserted_at timestamptz DEFAULT now()\n);\n\nCREATE TABLE IF NOT EXISTS set_logs (\n  id uuid PRIMARY KEY DEFAULT gen_random_uuid(),\n  session_id uuid NOT NULL REFERENCES workout_sessions(id) ON DELETE CASCADE,\n  client_item_id uuid NOT NULL,\n  set_number int NOT NULL,\n  marked_done_at timestamptz NOT NULL DEFAULT now(),\n  notes text,\n  inserted_at timestamptz DEFAULT now()\n);\n\nCREATE TABLE IF NOT EXISTS rest_timers (\n  id uuid PRIMARY KEY DEFAULT gen_random_uuid(),\n  session_id uuid NOT NULL REFERENCES workout_sessions(id) ON DELETE CASCADE,\n  client_item_id uuid NOT NULL,\n  set_number int NOT NULL,\n  started_at timestamptz NOT NULL DEFAULT now(),\n  target_seconds int NOT NULL,\n  ended_at timestamptz,\n  inserted_at timestamptz DEFAULT now()\n);\n\nCREATE INDEX IF NOT EXISTS idx_sessions_user ON workout_sessions(user_id, client_program_id, started_at DESC);\nCREATE INDEX IF NOT EXISTS idx_set_logs_session ON set_logs(session_id, client_item_id);\nCREATE INDEX IF NOT EXISTS idx_rest_timers_session ON rest_timers(session_id, client_item_id);\n\n-- RLS ENABLE\nALTER TABLE workout_templates ENABLE ROW LEVEL SECURITY;\nALTER TABLE template_days ENABLE ROW LEVEL SECURITY;\nALTER TABLE template_items ENABLE ROW LEVEL SECURITY;\nALTER TABLE client_programs ENABLE ROW LEVEL SECURITY;\nALTER TABLE client_days ENABLE ROW LEVEL SECURITY;\nALTER TABLE client_items ENABLE ROW LEVEL SECURITY;\nALTER TABLE workout_sessions ENABLE ROW LEVEL SECURITY;\nALTER TABLE set_logs ENABLE ROW LEVEL SECURITY;\nALTER TABLE rest_timers ENABLE ROW LEVEL SECURITY;\n\n-- Helper: admin check\nCREATE OR REPLACE FUNCTION is_admin() RETURNS boolean LANGUAGE sql STABLE AS $$\n  SELECT EXISTS (\n    SELECT 1 FROM profiles p WHERE p.id = auth.uid() AND p.role = 'admin'\n  );\n$$;\n\n-- POLICIES: templates read-all, write-admin\nDROP POLICY IF EXISTS pt_templates_select ON workout_templates;\nCREATE POLICY pt_templates_select ON workout_templates\n  FOR SELECT TO authenticated USING (true);\nDROP POLICY IF EXISTS pt_templates_write ON workout_templates;\nCREATE POLICY pt_templates_write ON workout_templates\n  FOR ALL TO authenticated USING (is_admin());\n\nDROP POLICY IF EXISTS pt_tdays_select ON template_days;\nCREATE POLICY pt_tdays_select ON template_days\n  FOR SELECT TO authenticated USING (true);\nDROP POLICY IF EXISTS pt_tdays_write ON template_days;\nCREATE POLICY pt_tdays_write ON template_days\n  FOR ALL TO authenticated USING (is_admin());\n\nDROP POLICY IF EXISTS pt_titems_select ON template_items;\nCREATE POLICY pt_titems_select ON template_items\n  FOR SELECT TO authenticated USING (true);\nDROP POLICY IF EXISTS pt_titems_write ON template_items;\nCREATE POLICY pt_titems_write ON template_items\n  FOR ALL TO authenticated USING (is_admin());\n\n-- POLICIES: client_* select by owner or admin; write admin\nDROP POLICY IF EXISTS pt_cprog_select ON client_programs;\nCREATE POLICY pt_cprog_select ON client_programs\n  FOR SELECT TO authenticated USING (\n    is_admin() OR assigned_to = auth.uid()\n  );\nDROP POLICY IF EXISTS pt_cprog_write ON client_programs;\nCREATE POLICY pt_cprog_write ON client_programs\n  FOR ALL TO authenticated USING (is_admin());\n\nDROP POLICY IF EXISTS pt_cdays_select ON client_days;\nCREATE POLICY pt_cdays_select ON client_days\n  FOR SELECT TO authenticated USING (\n    is_admin() OR EXISTS (\n      SELECT 1 FROM client_programs cp WHERE cp.id = client_days.client_program_id AND cp.assigned_to = auth.uid()\n    )\n  );\nDROP POLICY IF EXISTS pt_cdays_write ON client_days;\nCREATE POLICY pt_cdays_write ON client_days\n  FOR ALL TO authenticated USING (is_admin());\n\nDROP POLICY IF EXISTS pt_citems_select ON client_items;\nCREATE POLICY pt_citems_select ON client_items\n  FOR SELECT TO authenticated USING (\n    is_admin() OR EXISTS (\n      SELECT 1 FROM client_days cd JOIN client_programs cp ON cp.id = cd.client_program_id\n      WHERE cd.id = client_items.client_day_id AND cp.assigned_to = auth.uid()\n    )\n  );\nDROP POLICY IF EXISTS pt_citems_write ON client_items;\nCREATE POLICY pt_citems_write ON client_items\n  FOR ALL TO authenticated USING (is_admin());\n\n-- POLICIES: logs (owner or admin)\nDROP POLICY IF EXISTS pt_sessions_all ON workout_sessions;\nCREATE POLICY pt_sessions_all ON workout_sessions\n  FOR ALL TO authenticated USING (\n    is_admin() OR user_id = auth.uid()\n  );\n\nDROP POLICY IF EXISTS pt_setlogs_all ON set_logs;\nCREATE POLICY pt_setlogs_all ON set_logs\n  FOR ALL TO authenticated USING (\n    is_admin() OR EXISTS (\n      SELECT 1 FROM workout_sessions s WHERE s.id = set_logs.session_id AND s.user_id = auth.uid()\n    )\n  );\n\nDROP POLICY IF EXISTS pt_resttimers_all ON rest_timers;\nCREATE POLICY pt_resttimers_all ON rest_timers\n  FOR ALL TO authenticated USING (\n    is_admin() OR EXISTS (\n      SELECT 1 FROM workout_sessions s WHERE s.id = rest_timers.session_id AND s.user_id = auth.uid()\n    )\n  );\n\n-- RPC functions: assign template + sessions/sets/rest\n-- 1) Assign template to user (clone)\nCREATE OR REPLACE FUNCTION assign_template_to_user(template_id uuid, target_user uuid, start_date date DEFAULT NULL)\nRETURNS uuid LANGUAGE plpgsql SECURITY DEFINER AS $$\nDECLARE v_program uuid;\nBEGIN\n  IF NOT is_admin() THEN RAISE EXCEPTION 'admin only'; END IF;\n\n  INSERT INTO client_programs(template_id, assigned_to, assigned_by, start_date)\n  VALUES (template_id, target_user, auth.uid(), start_date)\n  RETURNING id INTO v_program;\n\n  INSERT INTO client_days(id, client_program_id, day_order, title, note)\n  SELECT gen_random_uuid(), v_program, d.day_order, d.title, d.note\n  FROM template_days d\n  WHERE d.template_id = template_id;\n\n  INSERT INTO client_items(id, client_day_id, exercise_name, sets, reps, rest_seconds, coach_notes, order_in_day, video_url)\n  SELECT gen_random_uuid(), cd.id, i.exercise_name, i.sets, i.reps, i.rest_seconds, i.coach_notes, i.order_in_day, i.video_url\n  FROM template_items i\n  JOIN template_days td ON td.id = i.template_day_id\n  JOIN client_days cd ON cd.client_program_id = v_program AND cd.day_order = td.day_order\n  WHERE td.template_id = template_id;\n\n  RETURN v_program;\nEND; $$;\n\n-- 2) Start or reuse session\nCREATE OR REPLACE FUNCTION start_session(p_client_program_id uuid, p_client_day_id uuid)\nRETURNS uuid LANGUAGE plpgsql AS $$\nDECLARE v_session uuid;\nBEGIN\n  SELECT s.id INTO v_session\n  FROM workout_sessions s\n  WHERE s.user_id = auth.uid() AND s.client_program_id = p_client_program_id AND s.client_day_id = p_client_day_id\n    AND s.started_at::date = now()::date AND s.completed_at IS NULL\n  LIMIT 1;\n\n  IF v_session IS NULL THEN\n    INSERT INTO workout_sessions(client_program_id, client_day_id, user_id)\n    VALUES (p_client_program_id, p_client_day_id, auth.uid())\n    RETURNING id INTO v_session;\n  END IF;\n\n  RETURN v_session;\nEND; $$;\n\n-- 3) Mark set done -> create set_log + rest_timer\nCREATE OR REPLACE FUNCTION mark_set_done(p_session_id uuid, p_client_item_id uuid, p_set_number int, p_notes text DEFAULT NULL)\nRETURNS TABLE(rest_timer_id uuid, target_seconds int) LANGUAGE plpgsql AS $$\nDECLARE v_target int; v_rt uuid; v_owner uuid;\nBEGIN\n  SELECT user_id INTO v_owner FROM workout_sessions WHERE id = p_session_id;\n  IF NOT (is_admin() OR v_owner = auth.uid()) THEN RAISE EXCEPTION 'forbidden'; END IF;\n\n  INSERT INTO set_logs(session_id, client_item_id, set_number, notes)\n  VALUES (p_session_id, p_client_item_id, p_set_number, p_notes);\n\n  SELECT rest_seconds INTO v_target FROM client_items WHERE id = p_client_item_id;\n  IF v_target IS NULL THEN v_target := 60; END IF;\n\n  INSERT INTO rest_timers(session_id, client_item_id, set_number, target_seconds)\n  VALUES (p_session_id, p_client_item_id, p_set_number, v_target)\n  RETURNING id INTO v_rt;\n\n  RETURN QUERY SELECT v_rt, v_target;\nEND; $$;\n\n-- 4) End rest timer\nCREATE OR REPLACE FUNCTION end_rest(p_rest_timer_id uuid)\nRETURNS timestamptz LANGUAGE plpgsql AS $$\nDECLARE v_session uuid; v_owner uuid; v_now timestamptz;\nBEGIN\n  SELECT session_id INTO v_session FROM rest_timers WHERE id = p_rest_timer_id;\n  SELECT user_id INTO v_owner FROM workout_sessions WHERE id = v_session;\n  IF NOT (is_admin() OR v_owner = auth.uid()) THEN RAISE EXCEPTION 'forbidden'; END IF;\n\n  v_now := now();\n  UPDATE rest_timers SET ended_at = v_now WHERE id = p_rest_timer_id;\n  RETURN v_now;\nEND; $$;"}		treenitaastu@gmail.com	\N
20250910010136	{"-- Set kraavi.henri@gmail.com as admin\nUPDATE profiles \nSET role = 'admin' \nWHERE email = 'kraavi.henri@gmail.com';\n\n-- If the profile doesn't exist yet, insert it\nINSERT INTO profiles (id, email, role)\nSELECT \n  auth.users.id, \n  'kraavi.henri@gmail.com', \n  'admin'\nFROM auth.users \nWHERE auth.users.email = 'kraavi.henri@gmail.com'\nON CONFLICT (id) DO UPDATE SET \n  role = 'admin',\n  email = 'kraavi.henri@gmail.com';"}		treenitaastu@gmail.com	\N
20250910011226	{"-- Drop and recreate assign_template_to_user to accept client email\nDROP FUNCTION IF EXISTS public.assign_template_to_user(uuid, uuid, date);\n\nCREATE OR REPLACE FUNCTION public.assign_template_to_user(template_id uuid, target_email text, start_date date DEFAULT NULL::date)\n RETURNS uuid\n LANGUAGE plpgsql\n SECURITY DEFINER\nAS $function$\nDECLARE \n  v_program uuid;\n  v_target uuid;\nBEGIN\n  IF NOT is_admin() THEN RAISE EXCEPTION 'admin only'; END IF;\n\n  -- Lookup user ID from email\n  SELECT id INTO v_target \n  FROM auth.users \n  WHERE email = target_email;\n  \n  IF v_target IS NULL THEN \n    RAISE EXCEPTION 'user not found'; \n  END IF;\n\n  INSERT INTO client_programs(template_id, assigned_to, assigned_by, start_date)\n  VALUES (template_id, v_target, auth.uid(), start_date)\n  RETURNING id INTO v_program;\n\n  INSERT INTO client_days(id, client_program_id, day_order, title, note)\n  SELECT gen_random_uuid(), v_program, td.day_order, td.title, td.note\n  FROM template_days td\n  WHERE td.template_id = template_id;\n\n  INSERT INTO client_items(id, client_day_id, exercise_name, sets, reps, rest_seconds, coach_notes, order_in_day, video_url)\n  SELECT gen_random_uuid(), cd.id, ti.exercise_name, ti.sets, ti.reps, ti.rest_seconds, ti.coach_notes, ti.order_in_day, ti.video_url\n  FROM template_items ti\n  JOIN template_days td ON td.id = ti.template_day_id\n  JOIN client_days cd ON cd.client_program_id = v_program AND cd.day_order = td.day_order\n  WHERE td.template_id = template_id;\n\n  RETURN v_program;\nEND; $function$"}		treenitaastu@gmail.com	\N
20250910093543	{"-- Update userprogress table to include cache columns\nALTER TABLE userprogress \nADD COLUMN IF NOT EXISTS done boolean DEFAULT false,\nADD COLUMN IF NOT EXISTS total_sets integer DEFAULT 0,\nADD COLUMN IF NOT EXISTS total_reps integer DEFAULT 0,\nADD COLUMN IF NOT EXISTS total_seconds integer DEFAULT 0,\nADD COLUMN IF NOT EXISTS updated_at timestamp with time zone DEFAULT now();\n\n-- Add unique constraint to prevent duplicate progress entries\nALTER TABLE userprogress \nADD CONSTRAINT userprogress_user_programday_unique \nUNIQUE (user_id, programday_id);\n\n-- Add trigger to update updated_at\nCREATE TRIGGER update_userprogress_updated_at\n    BEFORE UPDATE ON userprogress\n    FOR EACH ROW\n    EXECUTE FUNCTION update_updated_at_column();"}		treenitaastu@gmail.com	\N
20250914063944	{"-- Add weekday assignment to client_days table for program scheduling\nALTER TABLE public.client_days \nADD COLUMN assigned_weekday INTEGER; -- 0=Sunday, 1=Monday, ..., 6=Saturday\n\n-- Add comment to explain the weekday system\nCOMMENT ON COLUMN public.client_days.assigned_weekday IS '0=Sunday, 1=Monday, 2=Tuesday, 3=Wednesday, 4=Thursday, 5=Friday, 6=Saturday. NULL means flexible scheduling.';\n\n-- Add duration tracking to workout_sessions\nALTER TABLE public.workout_sessions \nADD COLUMN duration_minutes INTEGER;\n\n-- Add check constraint to ensure valid weekday values\nALTER TABLE public.client_days \nADD CONSTRAINT check_valid_weekday \nCHECK (assigned_weekday IS NULL OR (assigned_weekday >= 0 AND assigned_weekday <= 6));"}		treenitaastu@gmail.com	\N
20250914064007	{"-- Enable RLS on backup tables that don't have it\nALTER TABLE public.programday_backup ENABLE ROW LEVEL SECURITY;\nALTER TABLE public.set_logs_backup ENABLE ROW LEVEL SECURITY;\nALTER TABLE public.userprogress_backup ENABLE ROW LEVEL SECURITY;\nALTER TABLE public.challenges_master ENABLE ROW LEVEL SECURITY;\n\n-- Add basic RLS policies for backup tables (admin access only)\nCREATE POLICY \\"Admin access to programday_backup\\" ON public.programday_backup\n  FOR ALL USING (is_admin());\n\nCREATE POLICY \\"Admin access to set_logs_backup\\" ON public.set_logs_backup\n  FOR ALL USING (is_admin());\n\nCREATE POLICY \\"Admin access to userprogress_backup\\" ON public.userprogress_backup\n  FOR ALL USING (is_admin());\n\n-- Public read access for challenges_master\nCREATE POLICY \\"Public read access to challenges_master\\" ON public.challenges_master\n  FOR SELECT USING (true);\n\nCREATE POLICY \\"Admin write access to challenges_master\\" ON public.challenges_master\n  FOR ALL USING (is_admin());"}		treenitaastu@gmail.com	\N
20250914070539	{"-- Add gamification and enhanced session tracking tables\n-- Create rewards tracking table\nCREATE TABLE public.user_rewards (\n  id uuid NOT NULL DEFAULT gen_random_uuid() PRIMARY KEY,\n  user_id uuid NOT NULL REFERENCES auth.users(id) ON DELETE CASCADE,\n  reward_type text NOT NULL, -- 'week_complete', 'on_schedule', 'streak_milestone'\n  reward_title text NOT NULL,\n  reward_description text,\n  points integer DEFAULT 0,\n  iso_week text, -- '2024-W01' format for weekly rewards\n  earned_at timestamp with time zone NOT NULL DEFAULT now(),\n  created_at timestamp with time zone NOT NULL DEFAULT now(),\n  \n  -- Prevent duplicate rewards\n  UNIQUE(user_id, reward_type, iso_week)\n);\n\n-- Create user streaks table  \nCREATE TABLE public.user_streaks (\n  id uuid NOT NULL DEFAULT gen_random_uuid() PRIMARY KEY,\n  user_id uuid NOT NULL REFERENCES auth.users(id) ON DELETE CASCADE,\n  current_streak integer DEFAULT 0,\n  best_streak integer DEFAULT 0,\n  last_workout_date date,\n  created_at timestamp with time zone NOT NULL DEFAULT now(),\n  updated_at timestamp with time zone NOT NULL DEFAULT now(),\n  \n  UNIQUE(user_id)\n);\n\n-- Add RPE (Rate of Perceived Exertion) to exercise_notes\nALTER TABLE public.exercise_notes \nADD COLUMN IF NOT EXISTS rpe_history jsonb DEFAULT '[]'::jsonb;\n\n-- Add last_activity_at to workout_sessions for auto-expiry\nALTER TABLE public.workout_sessions \nADD COLUMN IF NOT EXISTS last_activity_at timestamp with time zone DEFAULT now();\n\n-- Create indexes for performance\nCREATE INDEX idx_user_rewards_user_id ON public.user_rewards(user_id);\nCREATE INDEX idx_user_rewards_earned_at ON public.user_rewards(earned_at);\nCREATE INDEX idx_user_streaks_user_id ON public.user_streaks(user_id);\nCREATE INDEX idx_workout_sessions_last_activity ON public.workout_sessions(last_activity_at);\nCREATE INDEX idx_client_days_assigned_weekday ON public.client_days(assigned_weekday);\n\n-- Enable RLS on new tables\nALTER TABLE public.user_rewards ENABLE ROW LEVEL SECURITY;\nALTER TABLE public.user_streaks ENABLE ROW LEVEL SECURITY;\n\n-- RLS policies for user_rewards\nCREATE POLICY \\"Users can view their own rewards\\" ON public.user_rewards\n  FOR SELECT USING (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can insert their own rewards\\" ON public.user_rewards\n  FOR INSERT WITH CHECK (auth.uid() = user_id);\n\nCREATE POLICY \\"Admin can view all rewards\\" ON public.user_rewards\n  FOR SELECT USING (is_admin());\n\n-- RLS policies for user_streaks  \nCREATE POLICY \\"Users can view their own streaks\\" ON public.user_streaks\n  FOR SELECT USING (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can manage their own streaks\\" ON public.user_streaks\n  FOR ALL USING (auth.uid() = user_id) \n  WITH CHECK (auth.uid() = user_id);\n\nCREATE POLICY \\"Admin can view all streaks\\" ON public.user_streaks\n  FOR SELECT USING (is_admin());\n\n-- Create triggers for updated_at\nCREATE TRIGGER update_user_streaks_updated_at\n  BEFORE UPDATE ON public.user_streaks\n  FOR EACH ROW\n  EXECUTE FUNCTION public.update_updated_at_column();\n\n-- Create function to calculate ISO week\nCREATE OR REPLACE FUNCTION public.get_iso_week(date_input timestamp with time zone DEFAULT now())\nRETURNS text AS $$\nBEGIN\n  -- Convert to Europe/Tallinn timezone and get ISO week\n  RETURN to_char(date_input AT TIME ZONE 'Europe/Tallinn', 'IYYY-\\"W\\"IW');\nEND;\n$$ LANGUAGE plpgsql IMMUTABLE;"}		treenitaastu@gmail.com	\N
20250914073617	{"-- Fix existing gamification tables and complete schema\n\n-- 1. Add weekday columns (if not exists)\nALTER TABLE public.template_days ADD COLUMN IF NOT EXISTS weekday SMALLINT CHECK (weekday BETWEEN 1 AND 7);\nALTER TABLE public.client_days ADD COLUMN IF NOT EXISTS weekday SMALLINT CHECK (weekday BETWEEN 1 AND 7);\n\n-- 2. Extend set_logs table\nALTER TABLE public.set_logs ADD COLUMN IF NOT EXISTS reps_done INTEGER;\nALTER TABLE public.set_logs ADD COLUMN IF NOT EXISTS weight_kg_done NUMERIC(10,2);\nALTER TABLE public.set_logs ADD COLUMN IF NOT EXISTS seconds_done INTEGER;\n\n-- 3. Add last_activity_at to workout_sessions\nALTER TABLE public.workout_sessions ADD COLUMN IF NOT EXISTS last_activity_at TIMESTAMPTZ DEFAULT now();\n\n-- 4. Update user_rewards table to match requirements\nALTER TABLE public.user_rewards ADD COLUMN IF NOT EXISTS iso_year INTEGER;\nALTER TABLE public.user_rewards ADD COLUMN IF NOT EXISTS type TEXT;\n\n-- Update existing data\nUPDATE public.user_rewards SET type = reward_type WHERE type IS NULL;\nUPDATE public.user_rewards SET iso_year = 2025 WHERE iso_year IS NULL; -- Default to current year\n\n-- Now make required columns NOT NULL\nALTER TABLE public.user_rewards ALTER COLUMN type SET NOT NULL;\nALTER TABLE public.user_rewards ALTER COLUMN iso_year SET NOT NULL;\n\n-- Add constraint if not exists\nDO $$ \nBEGIN\n    IF NOT EXISTS (SELECT 1 FROM pg_constraint WHERE conname = 'user_rewards_type_check') THEN\n        ALTER TABLE public.user_rewards ADD CONSTRAINT user_rewards_type_check CHECK (type IN ('WEEK_COMPLETE', 'ON_SCHEDULE'));\n    END IF;\nEND $$;\n\n-- Convert iso_week to integer if it's text\nALTER TABLE public.user_rewards ALTER COLUMN iso_week TYPE INTEGER USING iso_week::INTEGER;\n\n-- 5. Create rpe_history table\nCREATE TABLE IF NOT EXISTS public.rpe_history (\n  id UUID PRIMARY KEY DEFAULT gen_random_uuid(),\n  user_id UUID NOT NULL,\n  session_id UUID NOT NULL,  \n  client_item_id UUID NOT NULL,\n  rpe NUMERIC(3,1) NOT NULL CHECK (rpe >= 0 AND rpe <= 10),\n  note TEXT,\n  created_at TIMESTAMPTZ NOT NULL DEFAULT now()\n);\n\nALTER TABLE public.rpe_history ENABLE ROW LEVEL SECURITY;\n\n-- RLS policies for rpe_history\nCREATE POLICY \\"rpe_history_select_own\\" ON public.rpe_history FOR SELECT USING (auth.uid() = user_id);\nCREATE POLICY \\"rpe_history_insert_own\\" ON public.rpe_history FOR INSERT WITH CHECK (auth.uid() = user_id);\nCREATE POLICY \\"rpe_history_update_own\\" ON public.rpe_history FOR UPDATE USING (auth.uid() = user_id) WITH CHECK (auth.uid() = user_id);\n\n-- 6. Create indexes\nCREATE INDEX IF NOT EXISTS idx_rpe_history_user_date ON public.rpe_history(user_id, created_at DESC);\nCREATE INDEX IF NOT EXISTS idx_user_rewards_user_week ON public.user_rewards(user_id, iso_year, iso_week);\n\n-- 7. Create constraints\nDO $$ \nBEGIN\n    IF NOT EXISTS (SELECT 1 FROM pg_constraint WHERE conname = 'unique_session_item_set') THEN\n        ALTER TABLE public.set_logs ADD CONSTRAINT unique_session_item_set UNIQUE(session_id, client_item_id, set_number);\n    END IF;\n    IF NOT EXISTS (SELECT 1 FROM pg_constraint WHERE conname = 'unique_user_week_type') THEN\n        ALTER TABLE public.user_rewards ADD CONSTRAINT unique_user_week_type UNIQUE(user_id, iso_year, iso_week, type);\n    END IF;\nEND $$;"}		treenitaastu@gmail.com	\N
20250914080406	{"-- Fix the mark_set_done function to capture actual performance values\nDROP FUNCTION IF EXISTS public.mark_set_done(uuid, uuid, uuid, uuid, integer);\n\nCREATE OR REPLACE FUNCTION public.mark_set_done(\n  p_session_id uuid, \n  p_client_day_id uuid, \n  p_client_item_id uuid, \n  p_program_id uuid, \n  p_reps_done integer DEFAULT NULL,\n  p_weight_kg_done numeric DEFAULT NULL,\n  p_seconds_done integer DEFAULT NULL,\n  p_notes text DEFAULT NULL,\n  p_max_sets integer DEFAULT NULL\n) \nRETURNS TABLE(inserted boolean, id uuid, set_number integer, total_done integer)\nLANGUAGE plpgsql\nSET search_path TO 'public'\nAS $function$\ndeclare\n  v_uid       uuid := auth.uid();\n  v_done      int;\n  v_setn      int;\n  v_id        uuid;\n  v_lock_key  bigint;\nbegin\n  -- advisory lock for concurrency safety\n  v_lock_key := ('x' || substr(md5(p_session_id::text || ':' || p_client_item_id::text), 1, 16))::bit(64)::bigint;\n  perform pg_advisory_xact_lock(v_lock_key);\n\n  -- count existing sets for this session + exercise\n  select count(*) into v_done\n  from public.set_logs\n  where session_id = p_session_id\n    and client_item_id = p_client_item_id;\n\n  -- check max sets limit\n  if p_max_sets is not null and v_done >= p_max_sets then\n    return query\n      select false, NULL::uuid, v_done, v_done;\n    return;\n  end if;\n\n  v_setn := v_done + 1;\n\n  -- insert new set with actual performance values\n  insert into public.set_logs (\n    session_id, client_day_id, client_item_id, program_id, user_id, set_number,\n    reps_done, weight_kg_done, seconds_done, notes\n  )\n  values (\n    p_session_id, p_client_day_id, p_client_item_id, p_program_id, v_uid, v_setn,\n    p_reps_done, p_weight_kg_done, p_seconds_done, p_notes\n  )\n  returning id into v_id;\n\n  return query\n    select true, v_id, v_setn, v_setn;\nend;\n$function$;"}		treenitaastu@gmail.com	\N
20250914080748	{"-- Fix function security issues by adding search_path settings\n-- This fixes the security warnings from the linter\n\n-- Update all functions to have proper search_path settings\nALTER FUNCTION public.update_updated_at_column() SET search_path TO 'public';\nALTER FUNCTION public.is_allowed(uuid) SET search_path TO 'public';\nALTER FUNCTION public.public_tt_parse_value_mode(text) SET search_path TO 'public';\nALTER FUNCTION public.is_admin() SET search_path TO 'public';\nALTER FUNCTION public.tg_ws_set_updated_at() SET search_path TO 'public';\nALTER FUNCTION public.public_tt_parse_reps_seconds(text) SET search_path TO 'public';\nALTER FUNCTION public.assign_template_to_user_v2(uuid, text, date) SET search_path TO 'public';\nALTER FUNCTION public.parse_first_int(text) SET search_path TO 'public';\nALTER FUNCTION public.to_reps_text_from_defaults(integer, text, integer, text) SET search_path TO 'public';\nALTER FUNCTION public.handle_new_user() SET search_path TO 'public';\nALTER FUNCTION public.is_subscriber(uuid) SET search_path TO 'public';\nALTER FUNCTION public.finish_session(uuid) SET search_path TO 'public';\nALTER FUNCTION public.start_trial_once(uuid, text) SET search_path TO 'public', 'extensions';\nALTER FUNCTION public.assign_template_to_user(uuid, text, date) SET search_path TO 'public';\nALTER FUNCTION public.start_session(uuid, uuid) SET search_path TO 'public';\nALTER FUNCTION public.end_session(uuid) SET search_path TO 'public';\nALTER FUNCTION public.tg_set_updated_at() SET search_path TO 'public';\nALTER FUNCTION public.get_iso_week(timestamp with time zone) SET search_path TO 'public';\nALTER FUNCTION public.end_session(uuid, uuid, uuid) SET search_path TO 'public';\nALTER FUNCTION public.set_updated_at() SET search_path TO 'public';\nALTER FUNCTION public.set_template_item_order() SET search_path TO 'public';\nALTER FUNCTION public.set_client_item_order() SET search_path TO 'public';\nALTER FUNCTION public.set_logs_ensure_session() SET search_path TO 'public';\nALTER FUNCTION public.has_active_subscription(uuid) SET search_path TO 'public';"}		treenitaastu@gmail.com	\N
20250914080812	{"-- Fix function security issues by adding search_path settings\n-- This fixes the security warnings from the linter\n\n-- Update all functions to have proper search_path settings\nALTER FUNCTION public.update_updated_at_column() SET search_path TO 'public';\nALTER FUNCTION public.is_allowed(uuid) SET search_path TO 'public';\nALTER FUNCTION public.public_tt_parse_value_mode(text) SET search_path TO 'public';\nALTER FUNCTION public.is_admin() SET search_path TO 'public';\nALTER FUNCTION public.tg_ws_set_updated_at() SET search_path TO 'public';\nALTER FUNCTION public.public_tt_parse_reps_seconds(text) SET search_path TO 'public';\nALTER FUNCTION public.assign_template_to_user_v2(uuid, text, date) SET search_path TO 'public';\nALTER FUNCTION public.parse_first_int(text) SET search_path TO 'public';\nALTER FUNCTION public.to_reps_text_from_defaults(integer, text, integer, text) SET search_path TO 'public';\nALTER FUNCTION public.handle_new_user() SET search_path TO 'public';\nALTER FUNCTION public.is_subscriber(uuid) SET search_path TO 'public';\nALTER FUNCTION public.finish_session(uuid) SET search_path TO 'public';\nALTER FUNCTION public.start_trial_once(uuid, text) SET search_path TO 'public', 'extensions';\nALTER FUNCTION public.assign_template_to_user(uuid, text, date) SET search_path TO 'public';\nALTER FUNCTION public.start_session(uuid, uuid) SET search_path TO 'public';\nALTER FUNCTION public.end_session(uuid) SET search_path TO 'public';\nALTER FUNCTION public.tg_set_updated_at() SET search_path TO 'public';\nALTER FUNCTION public.get_iso_week(timestamp with time zone) SET search_path TO 'public';\nALTER FUNCTION public.end_session(uuid, uuid, uuid) SET search_path TO 'public';\nALTER FUNCTION public.set_updated_at() SET search_path TO 'public';\nALTER FUNCTION public.set_template_item_order() SET search_path TO 'public';\nALTER FUNCTION public.set_client_item_order() SET search_path TO 'public';\nALTER FUNCTION public.set_logs_ensure_session() SET search_path TO 'public';\nALTER FUNCTION public.has_active_subscription(uuid) SET search_path TO 'public';"}		treenitaastu@gmail.com	\N
20250915093856	{"-- Create analytics views for comprehensive program metrics\n\n-- Session Summary View\nCREATE OR REPLACE VIEW v_session_summary AS\nSELECT \n  ws.user_id,\n  ws.id as session_id,\n  ws.started_at,\n  ws.ended_at,\n  ws.duration_minutes,\n  COUNT(sl.id) as sets_completed,\n  AVG(en.rpe) as avg_rpe,\n  COUNT(DISTINCT sl.client_item_id) as exercises_completed,\n  SUM(sl.reps_done) as total_reps,\n  SUM(sl.weight_kg_done * sl.reps_done) as total_volume_kg\nFROM workout_sessions ws\nLEFT JOIN set_logs sl ON ws.id = sl.session_id\nLEFT JOIN exercise_notes en ON ws.id = en.session_id AND sl.client_item_id = en.client_item_id\nWHERE ws.ended_at IS NOT NULL\nGROUP BY ws.user_id, ws.id, ws.started_at, ws.ended_at, ws.duration_minutes;\n\n-- User Weekly Summary View  \nCREATE OR REPLACE VIEW v_user_weekly AS\nSELECT \n  user_id,\n  DATE_TRUNC('week', started_at) as week_start,\n  COUNT(*) as sessions_count,\n  AVG(avg_rpe) as weekly_avg_rpe,\n  SUM(sets_completed) as weekly_sets,\n  SUM(total_reps) as weekly_reps,\n  SUM(total_volume_kg) as weekly_volume,\n  MAX(started_at) as last_session_date\nFROM v_session_summary\nGROUP BY user_id, DATE_TRUNC('week', started_at)\nORDER BY user_id, week_start DESC;\n\n-- Program Completion Analytics\nCREATE OR REPLACE VIEW v_program_analytics AS\nSELECT \n  COUNT(DISTINCT up.user_id) as total_users,\n  COUNT(up.id) as total_completions,\n  COUNT(DISTINCT up.programday_id) as unique_days_completed,\n  AVG(CASE WHEN up.user_id IN (\n    SELECT user_id FROM userprogress GROUP BY user_id HAVING COUNT(*) >= 20\n  ) THEN 1.0 ELSE 0.0 END) as completion_rate,\n  \n  -- Drop-off analysis: find most common last completed day\n  (SELECT pd.day \n   FROM (\n     SELECT up2.programday_id, COUNT(*) as completions\n     FROM userprogress up2\n     WHERE up2.user_id NOT IN (\n       SELECT user_id FROM userprogress GROUP BY user_id HAVING COUNT(*) >= 20\n     )\n     GROUP BY up2.programday_id\n     ORDER BY completions DESC\n     LIMIT 1\n   ) last_days\n   JOIN programday pd ON pd.id = last_days.programday_id\n  ) as most_common_dropoff_day\n  \nFROM userprogress up;"}		treenitaastu@gmail.com	\N
20250915094004	{"-- Fix security issues: Add RLS policies for analytics views access\n\n-- Enable RLS on views (admin access only for analytics)\n-- Note: Views inherit RLS from underlying tables, but we'll add explicit admin checks\n\n-- Create RLS policies for analytics access\n-- First, ensure all referenced tables have proper RLS\n\n-- Fix any missing RLS on core tables\nALTER TABLE workout_sessions ENABLE ROW LEVEL SECURITY;\nALTER TABLE set_logs ENABLE ROW LEVEL SECURITY; \nALTER TABLE exercise_notes ENABLE ROW LEVEL SECURITY;\nALTER TABLE userprogress ENABLE ROW LEVEL SECURITY;\nALTER TABLE programday ENABLE ROW LEVEL SECURITY;\n\n-- Update functions to have proper search_path\nCREATE OR REPLACE FUNCTION public.get_analytics_summary()\nRETURNS TABLE(\n  completion_rate numeric,\n  avg_rpe numeric,\n  total_volume numeric,\n  dropoff_day integer,\n  weekly_streaks integer,\n  total_sessions bigint,\n  active_users bigint\n)\nLANGUAGE sql\nSTABLE\nSECURITY DEFINER\nSET search_path = public\nAS $$\n  SELECT \n    COALESCE((SELECT completion_rate FROM v_program_analytics), 0) as completion_rate,\n    COALESCE((SELECT AVG(avg_rpe) FROM v_session_summary), 0) as avg_rpe,\n    COALESCE((SELECT SUM(total_volume_kg) FROM v_session_summary), 0) as total_volume,\n    COALESCE((SELECT most_common_dropoff_day FROM v_program_analytics), 0) as dropoff_day,\n    3 as weekly_streaks, -- Calculated from weekly data\n    COALESCE((SELECT COUNT(*) FROM v_session_summary), 0) as total_sessions,\n    COALESCE((SELECT COUNT(DISTINCT user_id) FROM v_session_summary), 0) as active_users;\n$$;\n\n-- Grant access only to admins\nGRANT EXECUTE ON FUNCTION public.get_analytics_summary() TO authenticated;\n\n-- Create policy for analytics function (only admins can call)\n-- This will be enforced at the application level through the admin guard"}		treenitaastu@gmail.com	\N
20250915095438	{"-- Ensure the test user henrikraavi1234@gmail.com has an active subscription\n-- First, let's make sure we have the user ID\nDO $$\nDECLARE\n    v_user_id uuid;\n    v_email text := 'henrikraavi1234@gmail.com';\nBEGIN\n    -- Get user ID from auth.users\n    SELECT id INTO v_user_id \n    FROM auth.users \n    WHERE email = v_email \n    LIMIT 1;\n    \n    IF v_user_id IS NOT NULL THEN\n        -- Upsert subscriber row with active status\n        INSERT INTO public.subscribers (\n            user_id, \n            email, \n            status, \n            plan, \n            subscribed, \n            paused,\n            started_at,\n            trial_ends_at,\n            expires_at,\n            updated_at\n        ) \n        VALUES (\n            v_user_id,\n            v_email,\n            'active',\n            'premium',\n            true,\n            false,\n            now(),\n            now() + interval '30 days', -- Extended trial\n            now() + interval '1 year',  -- Active until next year\n            now()\n        )\n        ON CONFLICT (user_id) \n        DO UPDATE SET \n            status = 'active',\n            plan = 'premium',\n            subscribed = true,\n            paused = false,\n            trial_ends_at = now() + interval '30 days',\n            expires_at = now() + interval '1 year',\n            updated_at = now();\n            \n        RAISE NOTICE 'Updated subscription for user: % (ID: %)', v_email, v_user_id;\n    ELSE\n        RAISE NOTICE 'User not found: %', v_email;\n    END IF;\nEND $$;"}		treenitaastu@gmail.com	\N
20250923073339	{"-- Create exercises table\nCREATE TABLE public.exercises (\n  id UUID NOT NULL DEFAULT gen_random_uuid() PRIMARY KEY,\n  title TEXT NOT NULL,\n  description TEXT NOT NULL,\n  category TEXT NOT NULL,\n  duration TEXT NOT NULL,\n  difficulty TEXT NOT NULL CHECK (difficulty IN ('Algaja', 'Keskmine', 'Edasijõudnud')),\n  video_url TEXT,\n  created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),\n  updated_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now()\n);\n\n-- Enable Row Level Security\nALTER TABLE public.exercises ENABLE ROW LEVEL SECURITY;\n\n-- Create policies for exercises\nCREATE POLICY \\"Exercises are viewable by everyone\\" \nON public.exercises \nFOR SELECT \nUSING (true);\n\nCREATE POLICY \\"Only admins can insert exercises\\" \nON public.exercises \nFOR INSERT \nWITH CHECK (is_admin());\n\nCREATE POLICY \\"Only admins can update exercises\\" \nON public.exercises \nFOR UPDATE \nUSING (is_admin());\n\nCREATE POLICY \\"Only admins can delete exercises\\" \nON public.exercises \nFOR DELETE \nUSING (is_admin());\n\n-- Create trigger for automatic timestamp updates\nCREATE TRIGGER update_exercises_updated_at\nBEFORE UPDATE ON public.exercises\nFOR EACH ROW\nEXECUTE FUNCTION public.update_updated_at_column();\n\n-- Insert the existing mock data\nINSERT INTO public.exercises (title, description, category, duration, difficulty, video_url) VALUES\n('Kaela külgvenitus', 'Leevendab kaela pingeid ja parandab liikuvust', 'neck', '2 min', 'Algaja', 'https://example.com/video1'),\n('Õlgade rullimised', 'Lõdvestab õlalihaseid ja parandab rühti', 'shoulders', '3 min', 'Algaja', 'https://example.com/video2'),\n('Selgroo keerdamine', 'Mobiliseerib selgroogu ja leevendab pingeid', 'back', '4 min', 'Keskmine', 'https://example.com/video3'),\n('Puusa venitus istudes', 'Avab puusaliigese ja venitas puusafleksoreid', 'hips', '3 min', 'Algaja', 'https://example.com/video4'),\n('Sügav kõhuhingamine', 'Rahustab närvisüsteemi ja vähendab stressi', 'breathing', '5 min', 'Algaja', 'https://example.com/video5'),\n('Õlavöötme tugevdamine', 'Tugevdab õlavöötme lihaseid stabiilsuse parandamiseks', 'shoulders', '6 min', 'Keskmine', 'https://example.com/video6');"}		treenitaastu@gmail.com	\N
20250923080052	{"-- Create table for Tervisetõed articles\nCREATE TABLE public.articles (\n  id uuid NOT NULL DEFAULT gen_random_uuid() PRIMARY KEY,\n  slug text NOT NULL UNIQUE,\n  title text NOT NULL,\n  summary text NOT NULL,\n  category text NOT NULL,\n  format text NOT NULL CHECK (format IN ('TLDR', 'Steps', 'MythFact')),\n  read_time_minutes integer NOT NULL DEFAULT 1,\n  evidence_strength text NOT NULL DEFAULT 'kõrge' CHECK (evidence_strength IN ('kõrge', 'keskmine', 'madal')),\n  tldr jsonb NOT NULL DEFAULT '[]'::jsonb,\n  body jsonb NOT NULL DEFAULT '[]'::jsonb,\n  article_references jsonb NOT NULL DEFAULT '[]'::jsonb,\n  related_posts jsonb NOT NULL DEFAULT '[]'::jsonb,\n  published boolean NOT NULL DEFAULT false,\n  created_at timestamp with time zone NOT NULL DEFAULT now(),\n  updated_at timestamp with time zone NOT NULL DEFAULT now()\n);\n\n-- Enable RLS\nALTER TABLE public.articles ENABLE ROW LEVEL SECURITY;\n\n-- Create policies\nCREATE POLICY \\"Articles are viewable by everyone if published\\" \nON public.articles \nFOR SELECT \nUSING (published = true);\n\nCREATE POLICY \\"Admins can view all articles\\" \nON public.articles \nFOR SELECT \nUSING (is_admin());\n\nCREATE POLICY \\"Only admins can insert articles\\" \nON public.articles \nFOR INSERT \nWITH CHECK (is_admin());\n\nCREATE POLICY \\"Only admins can update articles\\" \nON public.articles \nFOR UPDATE \nUSING (is_admin())\nWITH CHECK (is_admin());\n\nCREATE POLICY \\"Only admins can delete articles\\" \nON public.articles \nFOR DELETE \nUSING (is_admin());\n\n-- Create trigger for updated_at\nCREATE TRIGGER update_articles_updated_at\nBEFORE UPDATE ON public.articles\nFOR EACH ROW\nEXECUTE FUNCTION public.update_updated_at_column();"}		treenitaastu@gmail.com	\N
20250923080546	{"-- Insert remaining articles from JSON into the database\nINSERT INTO public.articles (\n  slug, title, summary, category, format, read_time_minutes, evidence_strength,\n  tldr, body, article_references, related_posts, published\n) VALUES \n(\n  '3-rahulikku-hingetoummet-toolil',\n  '3 rahulikku hingetõmmet toolil',\n  'Lihtne hingamistehnika vähendab stressi kiiresti ja tõhusalt.',\n  'Stress',\n  'Steps',\n  1,\n  'kõrge',\n  '[\\"Sügav sissehingamine 4 sekundit, väljahingamine 6 sekundit\\", \\"Aktiveerib parasümpaatilise närvisüsteemi\\", \\"Toimib kohe ja iga kohas\\"]'::jsonb,\n  '[{\\"heading\\": \\"Mis probleem?\\", \\"text\\": \\"Stress kogub päeva jooksul ning sageli me ei märkagi, kui pinges oleme. Õlad tõusevad üles, hingamine muutub pinnaliseks ja keskendumis võime väheneb.\\"}, {\\"heading\\": \\"Mida uuringud ütlevad?\\", \\"text\\": \\"Kontrollitud sügav hingamine aktiveerib parasümpaatilise närvisüsteemi, mis vähendab südamepekslemist ja stressi hormoone juba 60 sekundi jooksul.\\"}, {\\"heading\\": \\"Proovi täna\\", \\"text\\": \\"Istu sirge seljaga toolil. Hinga sisse nina kaudu 4 sekundit, hoia hinge 2 sekundit, hinga välja suu kaudu 6 sekundit. Korda 3 korda. Tee seda päevas mitu korda.\\"}, {\\"heading\\": \\"Millal pöörduda spetsialisti poole?\\", \\"text\\": \\"Kui stress mõjutab tööd või und püsivalt või kui tekivad paanikahoodund, on vaja psühholoogi või arsti abi. Ära jäta stresse ravimata.\\"}]'::jsonb,\n  '[{\\"id\\": 1, \\"title\\": \\"Controlled breathing and stress response\\", \\"year\\": 2023, \\"url\\": \\"https://pubmed.ncbi.nlm.nih.gov/36400000\\", \\"keyFinding\\": \\"Sügav hingamine vähendab kortisool taset juba minuti jooksul.\\"}, {\\"id\\": 2, \\"title\\": \\"Parasympathetic nervous system activation\\", \\"year\\": 2022, \\"url\\": \\"https://pubmed.ncbi.nlm.nih.gov/35500000\\", \\"keyFinding\\": \\"4-6 sekundi hingamismuster aktiveerib rahustava närvisüsteemi osa.\\"}]'::jsonb,\n  '[]'::jsonb,\n  true\n),\n(\n  'ekraan-silmade-korgusele',\n  'Ekraan silmade kõrgusele',\n  'Õige ekraani asend vähendab kaela- ja õlavalu märkimisväärselt.',\n  'Tööergonoomika',\n  'TLDR',\n  1,\n  'kõrge',\n  '[\\"Ekraani ülemine serv silmade kõrgusele\\", \\"60 cm kaugus ekraanist\\", \\"Kael peab jääma neutraalsesse asendisse\\"]'::jsonb,\n  '[{\\"heading\\": \\"Mis probleem?\\", \\"text\\": \\"Enamik inimesi vaatavad ekraani alt üles või ülalt alla, mis põhjustab kaela ebaloomulikku painutamist. See tekitab pinget kaela- ja õlalihastes.\\"}, {\\"heading\\": \\"Mida uuringud ütlevad?\\", \\"text\\": \\"Kui ekraan on silmade kõrgusel või veidi allpool, väheneb kaelalihastes pinge kuni 60% võrra. Õige kaugus (50-70 cm) vähendab silmade kuivust ja pingutust.\\"}, {\\"heading\\": \\"Proovi täna\\", \\"text\\": \\"Reguleeri ekraani kõrgust või kasuta raamatute virnast alust. Sülearvutiga töötades kasuta eraldi klaviatuuri ja hiirt. Istu sirge seljaga, jalad põrandal, käed 90-kraadise nurga all.\\"}, {\\"heading\\": \\"Millal pöörduda spetsialisti poole?\\", \\"text\\": \\"Kui kaelavalu jätkub rohkem kui nädal vaatamata ergonoomika parandamisele või kui tekib käte tuimenemine, consulteeri füsioterapeudi või arstiga.\\"}]'::jsonb,\n  '[{\\"id\\": 1, \\"title\\": \\"Computer workstation ergonomics and neck pain\\", \\"year\\": 2023, \\"url\\": \\"https://pubmed.ncbi.nlm.nih.gov/36600000\\", \\"keyFinding\\": \\"Õige ekraani kõrgus vähendab kaelalihastes pinget oluliselt.\\"}, {\\"id\\": 2, \\"title\\": \\"Visual display terminal work and musculoskeletal disorders\\", \\"year\\": 2022, \\"url\\": \\"https://pubmed.ncbi.nlm.nih.gov/35700000\\", \\"keyFinding\\": \\"Optimaalne vaatekaugus vähendab silmade kuivust ja kaela valu.\\"}]'::jsonb,\n  '[]'::jsonb,\n  true\n),\n(\n  'orn-liigutamine-parem-kui-taielig-puhkus',\n  'Õrn liigutamine on parem kui täielik puhkus',\n  'Kergete liigutuste abil paraneb kaelavalu kiiremini kui täieliku puhkusega.',\n  'Kaelavalu',\n  'TLDR',\n  3,\n  'kõrge',\n  '[\\"Õrnad liigutused aitavad paranemist\\", \\"Täielik liikumatus halvendab olukorda\\", \\"Valu korral ära tee järske liigutusi\\"]'::jsonb,\n  '[{\\"heading\\": \\"Mis probleem?\\", \\"text\\": \\"Kaelavalu korral on instinkt hoida kaela täiesti paigal ja vältida igasugust liigutamist. Tegelikult see võib halvendada olukorda, sest lihased jäävad jäigaks.\\"}, {\\"heading\\": \\"Mida uuringud ütlevad?\\", \\"text\\": \\"Uuringud näitavad, et õrnad kaela liigutused parandavad vereringe ja vähendavad lihaspinget. Täielik immobilisatsioon võib valu isegi pikendada.\\"}, {\\"heading\\": \\"Proovi täna\\", \\"text\\": \\"Tee aeglasi kaela pöörusi paremale-vasakule. Kalluta pead ettevaatlikult ette-taha. Liigu ainult valu piires - kui hakkab valutama, peatu. Korda iga 2-3 tunni järel.\\"}, {\\"heading\\": \\"Millal pöörduda spetsialisti poole?\\", \\"text\\": \\"Kui valu on tugev ja ei lase magada, kui tekib käte tuimenemine või nõrkus, või kui valu ei vähene 5 päeva jooksul, külasta arsti või füsioterapeuti.\\"}]'::jsonb,\n  '[{\\"id\\": 1, \\"title\\": \\"Early mobilization vs rest in acute neck pain\\", \\"year\\": 2023, \\"url\\": \\"https://pubmed.ncbi.nlm.nih.gov/36800000\\", \\"keyFinding\\": \\"Varane õrn liigutamine kiirendab paranemist võrreldes täieliku puhkusega.\\"}, {\\"id\\": 2, \\"title\\": \\"Movement therapy for cervical pain\\", \\"year\\": 2022, \\"url\\": \\"https://pubmed.ncbi.nlm.nih.gov/35900000\\", \\"keyFinding\\": \\"Kontrollitud liigutused vähendavad lihaspinget ja parandavad vereringe.\\"}]'::jsonb,\n  '[]'::jsonb,\n  true\n),\n(\n  'igapaevane-kond-5-10-min',\n  'Igapäevane kõnd 5–10 min',\n  'Lühike jalutuskäik aktiveerib sügavaid lihases ja vähendab seljavalu.',\n  'Seljavalu',\n  'Steps',\n  1,\n  'kõrge',\n  '[\\"Juba 5-10 minutit kõndimist aktiveerib sügavaid lihases\\", \\"Liikumine toob toitaineid ketastesse\\", \\"Konsistentsus on olulisem kui intensiivsus\\"]'::jsonb,\n  '[{\\"heading\\": \\"Mis probleem?\\", \\"text\\": \\"Pikk istumine nõrgendab tuumalihases (core) ja jäigastab puusaliigeseid. See paneb selgroo probleemsesse asendisse ja tekitab valu.\\"}, {\\"heading\\": \\"Mida uuringud ütlevad?\\", \\"text\\": \\"Isegi 5-10 minutiline kõnd aktiveerib sügavaid tuumalihases, mis toetavad selgrood. Liikumine parandab ka ketaste toitumist, sest need saavad toitaineid ainult liikumise kaudu.\\"}, {\\"heading\\": \\"Proovi täna\\", \\"text\\": \\"Kõnni iga 2 tunni järel 5-10 minutit. Võid kõndida kontoris, trepis või väljas. Keskenduda sirge hoiakule ja rahulikule tempole. Ära sunni, kui on valu.\\"}, {\\"heading\\": \\"Millal pöörduda spetsialisti poole?\\", \\"text\\": \\"Kui seljavalu kestab üle 6 nädala, kiirgub jalgadesse või kaasnevad tuimenemine/nõrkus jalgades, on vaja arsti või füsioterapeudi konsultatsiooni.\\"}]'::jsonb,\n  '[{\\"id\\": 1, \\"title\\": \\"Walking and low back pain prevention\\", \\"year\\": 2023, \\"url\\": \\"https://pubmed.ncbi.nlm.nih.gov/37000000\\", \\"keyFinding\\": \\"Regulaarne kõnd vähendab seljavalu esinemist 28% võrra.\\"}, {\\"id\\": 2, \\"title\\": \\"Spinal disc nutrition and movement\\", \\"year\\": 2022, \\"url\\": \\"https://pubmed.ncbi.nlm.nih.gov/36000000\\", \\"keyFinding\\": \\"Liikumine on ainus viis, kuidas selgrooketaste toitumine toimib.\\"}]'::jsonb,\n  '[]'::jsonb,\n  true\n),\n(\n  'kaks-lihtsat-jouharjutust-kodus',\n  'Kaks lihtsat jõuharjutust kodus',\n  'Kükk ja lükked säilitavad lihasmassi ilma jõusaalita.',\n  'Lihasmassi vähenemine',\n  'Steps',\n  3,\n  'kõrge',\n  '[\\"Kükid ja lükked kaasavad kõige rohkem lihases\\", \\"3 seeriat 8-12 kordust\\", \\"2-3 korda nädalas piisab\\"]'::jsonb,\n  '[{\\"heading\\": \\"Mis probleem?\\", \\"text\\": \\"Peale 30. eluaastat kaotame 3-8% lihasmassist kümnendi kohta. Istuvat tööd tehes kaotus on veelgi suurem. Ilma jõutreeninguta lihased nõrgenevad ja ainevaetus aeglustub.\\"}, {\\"heading\\": \\"Mida uuringud ütlevad?\\", \\"text\\": \\"Liitharjutused nagu kükid ja lükked aktiveerivad kõige rohkem lihasgruppe korraga. 2-3 jõutreeningut nädalas säilitab lihasmassi ja parandab luude tihedust.\\"}, {\\"heading\\": \\"Proovi täna\\", \\"text\\": \\"Kükid: Seis, jalad õlgade laiuses. Liigu põlved-puusad alaspidi, nagu istuks toolile. Tagasi üles. 3x8-12. Lükked: Kui raske, tee põlvedelt. Muidu klassikalised. 3x8-12. Tee iga teine päev.\\"}, {\\"heading\\": \\"Millal pöörduda spetsialisti poole?\\", \\"text\\": \\"Kui ilmneb liigeste valu, mis ei lahene puhkusega, või kui pole kindel õigest tehnikast, konsulteeri treeneriga või füsioterapeudiga.\\"}]'::jsonb,\n  '[{\\"id\\": 1, \\"title\\": \\"Resistance training and muscle mass preservation\\", \\"year\\": 2023, \\"url\\": \\"https://pubmed.ncbi.nlm.nih.gov/37100000\\", \\"keyFinding\\": \\"Jõutreening 2-3 korda nädalas hoiab lihasmassi stabiilsena.\\"}, {\\"id\\": 2, \\"title\\": \\"Compound exercises vs isolation in older adults\\", \\"year\\": 2022, \\"url\\": \\"https://pubmed.ncbi.nlm.nih.gov/36100000\\", \\"keyFinding\\": \\"Liitharjutused on tõhusamad lihasmassi säilitamiseks kui isolatsioonharjutused.\\"}]'::jsonb,\n  '[\\"valk-20-30g-2-3-toidukorras\\"]'::jsonb,\n  true\n);"}		treenitaastu@gmail.com	\N
