\"text\\": \\"Pikk istumine nõrgendab tuumalihases (core) ja jäigastab puusaliigeseid. See paneb selgroo probleemsesse asendisse ja tekitab valu.\\"}, {\\"heading\\": \\"Mida uuringud ütlevad?\\", \\"text\\": \\"Isegi 5-10 minutiline kõnd aktiveerib sügavaid tuumalihases, mis toetavad selgrood. Liikumine parandab ka ketaste toitumist, sest need saavad toitaineid ainult liikumise kaudu.\\"}, {\\"heading\\": \\"Proovi täna\\", \\"text\\": \\"Kõnni iga 2 tunni järel 5-10 minutit. Võid kõndida kontoris, trepis või väljas. Keskenduda sirge hoiakule ja rahulikule tempole. Ära sunni, kui on valu.\\"}, {\\"heading\\": \\"Millal pöörduda spetsialisti poole?\\", \\"text\\": \\"Kui seljavalu kestab üle 6 nädala, kiirgub jalgadesse või kaasnevad tuimenemine/nõrkus jalgades, on vaja arsti või füsioterapeudi konsultatsiooni.\\"}]'::jsonb,\n  '[{\\"id\\": 1, \\"title\\": \\"Walking and low back pain prevention\\", \\"year\\": 2023, \\"url\\": \\"https://pubmed.ncbi.nlm.nih.gov/37000000\\", \\"keyFinding\\": \\"Regulaarne kõnd vähendab seljavalu esinemist 28% võrra.\\"}, {\\"id\\": 2, \\"title\\": \\"Spinal disc nutrition and movement\\", \\"year\\": 2022, \\"url\\": \\"https://pubmed.ncbi.nlm.nih.gov/36000000\\", \\"keyFinding\\": \\"Liikumine on ainus viis, kuidas selgrooketaste toitumine toimib.\\"}]'::jsonb,\n  '[]'::jsonb,\n  true\n),\n(\n  'kaks-lihtsat-jouharjutust-kodus',\n  'Kaks lihtsat jõuharjutust kodus',\n  'Kükk ja lükked säilitavad lihasmassi ilma jõusaalita.',\n  'Lihasmassi vähenemine',\n  'Steps',\n  3,\n  'kõrge',\n  '[\\"Kükid ja lükked kaasavad kõige rohkem lihases\\", \\"3 seeriat 8-12 kordust\\", \\"2-3 korda nädalas piisab\\"]'::jsonb,\n  '[{\\"heading\\": \\"Mis probleem?\\", \\"text\\": \\"Peale 30. eluaastat kaotame 3-8% lihasmassist kümnendi kohta. Istuvat tööd tehes kaotus on veelgi suurem. Ilma jõutreeninguta lihased nõrgenevad ja ainevaetus aeglustub.\\"}, {\\"heading\\": \\"Mida uuringud ütlevad?\\", \\"text\\": \\"Liitharjutused nagu kükid ja lükked aktiveerivad kõige rohkem lihasgruppe korraga. 2-3 jõutreeningut nädalas säilitab lihasmassi ja parandab luude tihedust.\\"}, {\\"heading\\": \\"Proovi täna\\", \\"text\\": \\"Kükid: Seis, jalad õlgade laiuses. Liigu põlved-puusad alaspidi, nagu istuks toolile. Tagasi üles. 3x8-12. Lükked: Kui raske, tee põlvedelt. Muidu klassikalised. 3x8-12. Tee iga teine päev.\\"}, {\\"heading\\": \\"Millal pöörduda spetsialisti poole?\\", \\"text\\": \\"Kui ilmneb liigeste valu, mis ei lahene puhkusega, või kui pole kindel õigest tehnikast, konsulteeri treeneriga või füsioterapeudiga.\\"}]'::jsonb,\n  '[{\\"id\\": 1, \\"title\\": \\"Resistance training and muscle mass preservation\\", \\"year\\": 2023, \\"url\\": \\"https://pubmed.ncbi.nlm.nih.gov/37100000\\", \\"keyFinding\\": \\"Jõutreening 2-3 korda nädalas hoiab lihasmassi stabiilsena.\\"}, {\\"id\\": 2, \\"title\\": \\"Compound exercises vs isolation in older adults\\", \\"year\\": 2022, \\"url\\": \\"https://pubmed.ncbi.nlm.nih.gov/36100000\\", \\"keyFinding\\": \\"Liitharjutused on tõhusamad lihasmassi säilitamiseks kui isolatsioonharjutused.\\"}]'::jsonb,\n  '[\\"valk-20-30g-2-3-toidukorras\\"]'::jsonb,\n  true\n) ON CONFLICT (slug) DO NOTHING;"}		treenitaastu@gmail.com	\N
20250923081139	{"-- Create a unified function to delete templates with proper cascade\nCREATE OR REPLACE FUNCTION public.admin_delete_template_cascade(p_template_id uuid)\nRETURNS jsonb\nLANGUAGE plpgsql\nSECURITY DEFINER\nAS $$\nDECLARE\n    v_deleted_programs int := 0;\n    v_deleted_days int := 0;\n    v_deleted_items int := 0;\nBEGIN\n    -- Only admins can delete templates\n    IF NOT is_admin() THEN\n        RAISE EXCEPTION 'forbidden: admin access required';\n    END IF;\n\n    -- Delete all client programs using this template and their related data\n    WITH deleted_programs AS (\n        DELETE FROM client_programs \n        WHERE template_id = p_template_id \n        RETURNING id\n    )\n    SELECT count(*) INTO v_deleted_programs FROM deleted_programs;\n\n    -- Delete template structure\n    WITH deleted_items AS (\n        DELETE FROM template_items \n        WHERE template_day_id IN (\n            SELECT id FROM template_days WHERE template_id = p_template_id\n        )\n        RETURNING id\n    )\n    SELECT count(*) INTO v_deleted_items FROM deleted_items;\n\n    WITH deleted_days AS (\n        DELETE FROM template_days \n        WHERE template_id = p_template_id \n        RETURNING id\n    )\n    SELECT count(*) INTO v_deleted_days FROM deleted_days;\n\n    -- Finally delete the template\n    DELETE FROM workout_templates WHERE id = p_template_id;\n\n    RETURN jsonb_build_object(\n        'success', true,\n        'deleted_programs', v_deleted_programs,\n        'deleted_days', v_deleted_days,\n        'deleted_items', v_deleted_items\n    );\nEND;\n$$;\n\n-- Create a unified function to delete client programs with proper cascade\nCREATE OR REPLACE FUNCTION public.admin_delete_client_program_cascade(p_program_id uuid)\nRETURNS jsonb\nLANGUAGE plpgsql\nSECURITY DEFINER\nAS $$\nDECLARE\n    v_deleted_sessions int := 0;\n    v_deleted_items int := 0;\n    v_deleted_days int := 0;\nBEGIN\n    -- Only admins can delete programs\n    IF NOT is_admin() THEN\n        RAISE EXCEPTION 'forbidden: admin access required';\n    END IF;\n\n    -- Delete workout sessions (this will cascade to set_logs, rest_timers)\n    WITH deleted_sessions AS (\n        DELETE FROM workout_sessions \n        WHERE client_program_id = p_program_id \n        RETURNING id\n    )\n    SELECT count(*) INTO v_deleted_sessions FROM deleted_sessions;\n\n    -- Delete client structure\n    WITH deleted_items AS (\n        DELETE FROM client_items \n        WHERE client_day_id IN (\n            SELECT id FROM client_days WHERE client_program_id = p_program_id\n        )\n        RETURNING id\n    )\n    SELECT count(*) INTO v_deleted_items FROM deleted_items;\n\n    WITH deleted_days AS (\n        DELETE FROM client_days \n        WHERE client_program_id = p_program_id \n        RETURNING id\n    )\n    SELECT count(*) INTO v_deleted_days FROM deleted_days;\n\n    -- Finally delete the program\n    DELETE FROM client_programs WHERE id = p_program_id;\n\n    RETURN jsonb_build_object(\n        'success', true,\n        'deleted_sessions', v_deleted_sessions,\n        'deleted_days', v_deleted_days,\n        'deleted_items', v_deleted_items\n    );\nEND;\n$$;"}		treenitaastu@gmail.com	\N
20250923081201	{"-- Fix search_path for the new functions I just created\nALTER FUNCTION public.admin_delete_template_cascade(uuid) SET search_path = 'public';\nALTER FUNCTION public.admin_delete_client_program_cascade(uuid) SET search_path = 'public';"}		treenitaastu@gmail.com	\N
20250923083011	{"-- Drop both views that depend on each other\nDROP VIEW IF EXISTS v_user_weekly CASCADE;\nDROP VIEW IF EXISTS v_session_summary CASCADE;\n\n-- Recreate v_session_summary with proper volume calculation\nCREATE VIEW v_session_summary AS\nSELECT \n    ws.id as session_id,\n    ws.user_id,\n    ws.started_at,\n    ws.ended_at,\n    ws.duration_minutes,\n    COALESCE(sl.total_reps, 0) as total_reps,\n    COALESCE(sl.total_volume_kg, 0) as total_volume_kg,\n    COALESCE(sl.exercises_completed, 0) as exercises_completed,\n    COALESCE(sl.sets_completed, 0) as sets_completed,\n    sl.avg_rpe\nFROM workout_sessions ws\nLEFT JOIN (\n    SELECT \n        session_id,\n        SUM(COALESCE(reps_done, 0)) as total_reps,\n        -- Volume calculation: sum of (weight * reps) for each set\n        SUM(COALESCE(weight_kg_done, 0) * COALESCE(reps_done, 0)) as total_volume_kg,\n        COUNT(DISTINCT client_item_id) as exercises_completed,\n        COUNT(*) as sets_completed,\n        -- Average RPE from exercise_notes for this session\n        (SELECT AVG(rpe) FROM exercise_notes en WHERE en.session_id = sl.session_id AND rpe IS NOT NULL) as avg_rpe\n    FROM set_logs sl\n    GROUP BY session_id\n) sl ON ws.id = sl.session_id;\n\n-- Recreate v_user_weekly with proper volume calculation\nCREATE VIEW v_user_weekly AS\nSELECT \n    vss.user_id,\n    date_trunc('week', vss.started_at AT TIME ZONE 'Europe/Tallinn') AT TIME ZONE 'Europe/Tallinn' as week_start,\n    COUNT(*) FILTER (WHERE vss.ended_at IS NOT NULL) as sessions_count,\n    SUM(vss.sets_completed) as weekly_sets,\n    SUM(vss.total_reps) as weekly_reps,\n    SUM(vss.total_volume_kg) as weekly_volume,\n    AVG(vss.avg_rpe) FILTER (WHERE vss.avg_rpe IS NOT NULL) as weekly_avg_rpe,\n    MAX(vss.ended_at) as last_session_date\nFROM v_session_summary vss\nWHERE vss.started_at >= CURRENT_DATE - INTERVAL '12 weeks'\nGROUP BY vss.user_id, date_trunc('week', vss.started_at AT TIME ZONE 'Europe/Tallinn');"}		treenitaastu@gmail.com	\N
20250923102010	{"-- Reset all users' static program start to last Monday for consistent tracking\n-- Today is Monday 2025-09-23, so last Monday was 2025-09-16\n\n-- Update all existing static starts to last Monday\nUPDATE static_starts \nSET start_monday = '2025-09-16'::date,\n    created_at = '2025-09-16 00:00:00+00'::timestamptz\nWHERE start_monday >= '2025-09-23'::date;\n\n-- Clear inconsistent progress data - keep only progress that makes sense\n-- (progress from last 7 days should be valid)\nDELETE FROM userprogress \nWHERE completed_at > '2025-09-23 23:59:59+00'::timestamptz\n   OR completed_at < '2025-09-16 00:00:00+00'::timestamptz;\n\n-- Insert static starts for any users who don't have one yet\n-- (users with 7-day trial should have a start date)\nINSERT INTO static_starts (user_id, start_monday, created_at)\nSELECT DISTINCT p.id, '2025-09-16'::date, '2025-09-16 00:00:00+00'::timestamptz\nFROM profiles p\nLEFT JOIN static_starts ss ON ss.user_id = p.id\nWHERE ss.user_id IS NULL\n  AND p.id IS NOT NULL;\n\n-- Verify the fix by showing current state\nSELECT \n  'static_starts_fixed' as check_type,\n  COUNT(*) as total_users,\n  MIN(start_monday) as earliest_start,\n  MAX(start_monday) as latest_start\nFROM static_starts;"}		treenitaastu@gmail.com	\N
20250923083040	{"-- Drop both views that depend on each other\nDROP VIEW IF EXISTS v_user_weekly CASCADE;\nDROP VIEW IF EXISTS v_session_summary CASCADE;\n\n-- Recreate v_session_summary with proper volume calculation\nCREATE VIEW v_session_summary AS\nSELECT \n    ws.id as session_id,\n    ws.user_id,\n    ws.started_at,\n    ws.ended_at,\n    ws.duration_minutes,\n    COALESCE(sl.total_reps, 0) as total_reps,\n    COALESCE(sl.total_volume_kg, 0) as total_volume_kg,\n    COALESCE(sl.exercises_completed, 0) as exercises_completed,\n    COALESCE(sl.sets_completed, 0) as sets_completed,\n    sl.avg_rpe\nFROM workout_sessions ws\nLEFT JOIN (\n    SELECT \n        session_id,\n        SUM(COALESCE(reps_done, 0)) as total_reps,\n        -- Volume calculation: sum of (weight * reps) for each set\n        SUM(COALESCE(weight_kg_done, 0) * COALESCE(reps_done, 0)) as total_volume_kg,\n        COUNT(DISTINCT client_item_id) as exercises_completed,\n        COUNT(*) as sets_completed,\n        -- Average RPE from exercise_notes for this session\n        (SELECT AVG(rpe) FROM exercise_notes en WHERE en.session_id = sl.session_id AND rpe IS NOT NULL) as avg_rpe\n    FROM set_logs sl\n    GROUP BY session_id\n) sl ON ws.id = sl.session_id;\n\n-- Recreate v_user_weekly with proper volume calculation\nCREATE VIEW v_user_weekly AS\nSELECT \n    vss.user_id,\n    date_trunc('week', vss.started_at AT TIME ZONE 'Europe/Tallinn') AT TIME ZONE 'Europe/Tallinn' as week_start,\n    COUNT(*) FILTER (WHERE vss.ended_at IS NOT NULL) as sessions_count,\n    SUM(vss.sets_completed) as weekly_sets,\n    SUM(vss.total_reps) as weekly_reps,\n    SUM(vss.total_volume_kg) as weekly_volume,\n    AVG(vss.avg_rpe) FILTER (WHERE vss.avg_rpe IS NOT NULL) as weekly_avg_rpe,\n    MAX(vss.ended_at) as last_session_date\nFROM v_session_summary vss\nWHERE vss.started_at >= CURRENT_DATE - INTERVAL '12 weeks'\nGROUP BY vss.user_id, date_trunc('week', vss.started_at AT TIME ZONE 'Europe/Tallinn');"}		treenitaastu@gmail.com	\N
20250923090855	{"-- Fix the admin functions to properly cast text to product_kind enum\n\n-- Drop the conflicting functions first\nDROP FUNCTION IF EXISTS public.admin_set_entitlement(uuid, product_kind, text, integer, text);\nDROP FUNCTION IF EXISTS public.admin_pause_entitlement(uuid, product_kind, boolean);\nDROP FUNCTION IF EXISTS public.admin_clear_entitlement(uuid, product_kind);\n\n-- Recreate admin_set_entitlement with proper text handling\nCREATE OR REPLACE FUNCTION public.admin_set_entitlement(\n    p_user uuid, \n    p_product text, \n    p_status text, \n    p_days integer DEFAULT NULL, \n    p_note text DEFAULT NULL\n)\nRETURNS void\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = 'public'\nAS $$\nDECLARE \n    v_until timestamptz := CASE WHEN p_days IS NULL THEN NULL ELSE now() + (p_days || ' days')::interval END;\nBEGIN\n    IF NOT is_admin() THEN RAISE EXCEPTION 'forbidden'; END IF;\n\n    INSERT INTO user_entitlements(user_id, product, status, started_at, trial_ends_at, expires_at, paused, source, note)\n    VALUES (p_user, p_product::product_kind, p_status, now(),\n            CASE WHEN p_status='trialing' THEN v_until ELSE NULL END,\n            CASE WHEN p_status='active'   THEN v_until ELSE NULL END,\n            false, 'manual', p_note)\n    ON CONFLICT(user_id, product) DO UPDATE\n        SET status=EXCLUDED.status,\n            trial_ends_at=EXCLUDED.trial_ends_at,\n            expires_at=EXCLUDED.expires_at,\n            paused=false,\n            note=COALESCE(EXCLUDED.note, user_entitlements.note),\n            updated_at=now();\nEND $$;\n\n-- Recreate admin_pause_entitlement with proper text handling\nCREATE OR REPLACE FUNCTION public.admin_pause_entitlement(\n    p_user uuid, \n    p_product text, \n    p_pause boolean DEFAULT true\n)\nRETURNS void\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = 'public'\nAS $$\nBEGIN\n    IF NOT is_admin() THEN RAISE EXCEPTION 'forbidden'; END IF;\n    \n    UPDATE user_entitlements\n    SET paused = p_pause,\n        updated_at = now()\n    WHERE user_id = p_user\n      AND product = p_product::product_kind;\nEND $$;\n\n-- Recreate admin_clear_entitlement with proper text handling  \nCREATE OR REPLACE FUNCTION public.admin_clear_entitlement(\n    p_user uuid, \n    p_product text\n)\nRETURNS void\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = 'public'\nAS $$\nBEGIN\n    IF NOT is_admin() THEN RAISE EXCEPTION 'forbidden'; END IF;\n    \n    DELETE FROM user_entitlements \n    WHERE user_id = p_user \n      AND product = p_product::product_kind;\nEND $$;"}		treenitaastu@gmail.com	\N
20250923090920	{"-- Fix the admin functions to properly cast text to product_kind enum\n\n-- Drop the conflicting functions first\nDROP FUNCTION IF EXISTS public.admin_set_entitlement(uuid, product_kind, text, integer, text);\nDROP FUNCTION IF EXISTS public.admin_pause_entitlement(uuid, product_kind, boolean);\nDROP FUNCTION IF EXISTS public.admin_clear_entitlement(uuid, product_kind);\n\n-- Recreate admin_set_entitlement with proper text handling\nCREATE OR REPLACE FUNCTION public.admin_set_entitlement(\n    p_user uuid, \n    p_product text, \n    p_status text, \n    p_days integer DEFAULT NULL, \n    p_note text DEFAULT NULL\n)\nRETURNS void\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = 'public'\nAS $$\nDECLARE \n    v_until timestamptz := CASE WHEN p_days IS NULL THEN NULL ELSE now() + (p_days || ' days')::interval END;\nBEGIN\n    IF NOT is_admin() THEN RAISE EXCEPTION 'forbidden'; END IF;\n\n    INSERT INTO user_entitlements(user_id, product, status, started_at, trial_ends_at, expires_at, paused, source, note)\n    VALUES (p_user, p_product::product_kind, p_status, now(),\n            CASE WHEN p_status='trialing' THEN v_until ELSE NULL END,\n            CASE WHEN p_status='active'   THEN v_until ELSE NULL END,\n            false, 'manual', p_note)\n    ON CONFLICT(user_id, product) DO UPDATE\n        SET status=EXCLUDED.status,\n            trial_ends_at=EXCLUDED.trial_ends_at,\n            expires_at=EXCLUDED.expires_at,\n            paused=false,\n            note=COALESCE(EXCLUDED.note, user_entitlements.note),\n            updated_at=now();\nEND $$;\n\n-- Recreate admin_pause_entitlement with proper text handling\nCREATE OR REPLACE FUNCTION public.admin_pause_entitlement(\n    p_user uuid, \n    p_product text, \n    p_pause boolean DEFAULT true\n)\nRETURNS void\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = 'public'\nAS $$\nBEGIN\n    IF NOT is_admin() THEN RAISE EXCEPTION 'forbidden'; END IF;\n    \n    UPDATE user_entitlements\n    SET paused = p_pause,\n        updated_at = now()\n    WHERE user_id = p_user\n      AND product = p_product::product_kind;\nEND $$;\n\n-- Recreate admin_clear_entitlement with proper text handling  \nCREATE OR REPLACE FUNCTION public.admin_clear_entitlement(\n    p_user uuid, \n    p_product text\n)\nRETURNS void\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = 'public'\nAS $$\nBEGIN\n    IF NOT is_admin() THEN RAISE EXCEPTION 'forbidden'; END IF;\n    \n    DELETE FROM user_entitlements \n    WHERE user_id = p_user \n      AND product = p_product::product_kind;\nEND $$;"}		treenitaastu@gmail.com	\N
20250923091458	{"-- Create analytics events table for detailed user tracking\nCREATE TABLE IF NOT EXISTS public.user_analytics_events (\n    id uuid PRIMARY KEY DEFAULT gen_random_uuid(),\n    user_id uuid NOT NULL,\n    event_type text NOT NULL,\n    event_data jsonb DEFAULT '{}',\n    page_url text,\n    user_agent text,\n    created_at timestamptz NOT NULL DEFAULT now(),\n    session_id text\n);\n\n-- Enable RLS\nALTER TABLE public.user_analytics_events ENABLE ROW LEVEL SECURITY;\n\n-- RLS policies for analytics events\nCREATE POLICY \\"users_can_insert_own_events\\" ON public.user_analytics_events\n    FOR INSERT WITH CHECK (user_id = auth.uid());\n\nCREATE POLICY \\"users_can_view_own_events\\" ON public.user_analytics_events\n    FOR SELECT USING (user_id = auth.uid());\n\nCREATE POLICY \\"admins_can_view_all_events\\" ON public.user_analytics_events\n    FOR SELECT USING (is_admin());\n\n-- Index for performance\nCREATE INDEX idx_user_analytics_events_user_id ON public.user_analytics_events(user_id);\nCREATE INDEX idx_user_analytics_events_type ON public.user_analytics_events(event_type);\nCREATE INDEX idx_user_analytics_events_created_at ON public.user_analytics_events(created_at);\n\n-- Function to easily track events\nCREATE OR REPLACE FUNCTION public.track_user_event(\n    p_event_type text,\n    p_event_data jsonb DEFAULT '{}',\n    p_page_url text DEFAULT NULL,\n    p_session_id text DEFAULT NULL\n)\nRETURNS uuid\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = 'public'\nAS $$\nDECLARE\n    v_event_id uuid;\nBEGIN\n    -- Insert the event\n    INSERT INTO public.user_analytics_events (\n        user_id, \n        event_type, \n        event_data, \n        page_url, \n        session_id\n    )\n    VALUES (\n        auth.uid(), \n        p_event_type, \n        p_event_data, \n        p_page_url, \n        p_session_id\n    )\n    RETURNING id INTO v_event_id;\n    \n    RETURN v_event_id;\nEND $$;"}		treenitaastu@gmail.com	\N
20250923101935	{"-- Reset all users' static program start to last Monday for consistent tracking\n-- Today is Monday 2025-09-23, so last Monday was 2025-09-16\n\n-- Update all existing static starts to last Monday\nUPDATE static_starts \nSET start_monday = '2025-09-16'::date,\n    created_at = '2025-09-16 00:00:00+00'::timestamptz\nWHERE start_monday >= '2025-09-23'::date;\n\n-- Clear inconsistent progress data - keep only progress that makes sense\n-- (progress from last 7 days should be valid)\nDELETE FROM userprogress \nWHERE completed_at > '2025-09-23 23:59:59+00'::timestamptz\n   OR completed_at < '2025-09-16 00:00:00+00'::timestamptz;\n\n-- Insert static starts for any users who don't have one yet\n-- (users with 7-day trial should have a start date)\nINSERT INTO static_starts (user_id, start_monday, created_at)\nSELECT DISTINCT p.id, '2025-09-16'::date, '2025-09-16 00:00:00+00'::timestamptz\nFROM profiles p\nLEFT JOIN static_starts ss ON ss.user_id = p.id\nWHERE ss.user_id IS NULL\n  AND p.id IS NOT NULL;\n\n-- Verify the fix by showing current state\nSELECT \n  'static_starts_fixed' as check_type,\n  COUNT(*) as total_users,\n  MIN(start_monday) as earliest_start,\n  MAX(start_monday) as latest_start\nFROM static_starts;"}		treenitaastu@gmail.com	\N
20250924071841	{"-- Phase 1: Security Fixes\n\n-- 1. Enable RLS on timezones table (currently missing RLS)\nALTER TABLE public.timezones ENABLE ROW LEVEL SECURITY;\n\n-- Create appropriate policies for timezones table (read-only for all authenticated users)\nCREATE POLICY \\"Timezones are readable by authenticated users\\" \nON public.timezones \nFOR SELECT \nTO authenticated\nUSING (true);\n\n-- 2. Fix search_path settings for functions that are missing them\n-- Fix admin_set_override function that has no search_path\nCREATE OR REPLACE FUNCTION public.admin_set_override(p_user uuid, p_product text, p_until timestamp with time zone)\n RETURNS void\n LANGUAGE plpgsql\n SECURITY DEFINER\n SET search_path = 'public'\nAS $function$\nbegin\n  IF NOT is_admin() THEN RAISE EXCEPTION 'forbidden'; END IF;\n  \n  insert into user_entitlements (user_id, product, status, started_at, expires_at, paused, source, note)\n  values (p_user, p_product, 'active', now(), p_until, false, 'override', 'admin override')\n  on conflict (user_id, product) do update\n    set status     = 'active',\n        expires_at = excluded.expires_at,\n        paused     = false,\n        source     = excluded.source,\n        note       = excluded.note,\n        updated_at = now();\nend;\n$function$;\n\n-- Fix has_column function search_path (currently uses pg_catalog, public which can be risky)\nCREATE OR REPLACE FUNCTION public.has_column(schemaname text, tablename text, colname text)\n RETURNS boolean\n LANGUAGE sql\n STABLE\n SET search_path = 'public'\nAS $function$\n  select exists (\n    select 1\n    from information_schema.columns\n    where table_schema = schemaname\n      and table_name   = tablename\n      and column_name  = colname\n  );\n$function$;\n\n-- 3. Review and fix potential security issues with SECURITY DEFINER functions\n-- Ensure all SECURITY DEFINER functions have proper authorization checks\n\n-- Fix track_user_event to ensure it only allows users to track their own events\nCREATE OR REPLACE FUNCTION public.track_user_event(p_event_type text, p_event_data jsonb DEFAULT '{}'::jsonb, p_page_url text DEFAULT NULL::text, p_session_id text DEFAULT NULL::text)\n RETURNS uuid\n LANGUAGE plpgsql\n SECURITY DEFINER\n SET search_path = 'public'\nAS $function$\nDECLARE\n    v_event_id uuid;\n    v_user_id uuid := auth.uid();\nBEGIN\n    -- Ensure user is authenticated\n    IF v_user_id IS NULL THEN\n        RAISE EXCEPTION 'authentication required';\n    END IF;\n    \n    -- Insert the event (only for authenticated user)\n    INSERT INTO public.user_analytics_events (\n        user_id, \n        event_type, \n        event_data, \n        page_url, \n        session_id\n    )\n    VALUES (\n        v_user_id, \n        p_event_type, \n        p_event_data, \n        p_page_url, \n        p_session_id\n    )\n    RETURNING id INTO v_event_id;\n    \n    RETURN v_event_id;\nEND $function$;\n\n-- Fix has_active_subscription to ensure proper auth check\nCREATE OR REPLACE FUNCTION public.has_active_subscription(u uuid)\n RETURNS boolean\n LANGUAGE sql\n SECURITY DEFINER\n SET search_path = 'public'\nAS $function$\n  -- Only allow checking own subscription or admin access\n  select CASE \n    WHEN u = auth.uid() OR is_admin() THEN\n      coalesce(p.is_paid, false)\n      or (p.current_period_end is not null and p.current_period_end > now())\n      or (p.trial_ends_at is not null and p.trial_ends_at > now())\n    ELSE false\n  END\n  from public.profiles p\n  where p.id = u;\n$function$;"}		treenitaastu@gmail.com	\N
20250924071950	{"-- Phase 1: Security Fixes (continued)\n\n-- Check if RLS is enabled on timezones (if not, enable it)\nDO $$\nBEGIN\n    IF NOT (SELECT relrowsecurity FROM pg_class WHERE relname = 'timezones' AND relnamespace = (SELECT oid FROM pg_namespace WHERE nspname = 'public')) THEN\n        ALTER TABLE public.timezones ENABLE ROW LEVEL SECURITY;\n    END IF;\nEND $$;\n\n-- 2. Fix search_path settings for functions that are missing them\n-- Fix admin_set_override function that has no search_path\nCREATE OR REPLACE FUNCTION public.admin_set_override(p_user uuid, p_product text, p_until timestamp with time zone)\n RETURNS void\n LANGUAGE plpgsql\n SECURITY DEFINER\n SET search_path = 'public'\nAS $function$\nbegin\n  IF NOT is_admin() THEN RAISE EXCEPTION 'forbidden'; END IF;\n  \n  insert into user_entitlements (user_id, product, status, started_at, expires_at, paused, source, note)\n  values (p_user, p_product, 'active', now(), p_until, false, 'override', 'admin override')\n  on conflict (user_id, product) do update\n    set status     = 'active',\n        expires_at = excluded.expires_at,\n        paused     = false,\n        source     = excluded.source,\n        note       = excluded.note,\n        updated_at = now();\nend;\n$function$;\n\n-- Fix has_column function search_path (currently uses pg_catalog, public which can be risky)\nCREATE OR REPLACE FUNCTION public.has_column(schemaname text, tablename text, colname text)\n RETURNS boolean\n LANGUAGE sql\n STABLE\n SET search_path = 'public'\nAS $function$\n  select exists (\n    select 1\n    from information_schema.columns\n    where table_schema = schemaname\n      and table_name   = tablename\n      and column_name  = colname\n  );\n$function$;\n\n-- 3. Review and fix potential security issues with SECURITY DEFINER functions\n-- Fix track_user_event to ensure it only allows users to track their own events\nCREATE OR REPLACE FUNCTION public.track_user_event(p_event_type text, p_event_data jsonb DEFAULT '{}'::jsonb, p_page_url text DEFAULT NULL::text, p_session_id text DEFAULT NULL::text)\n RETURNS uuid\n LANGUAGE plpgsql\n SECURITY DEFINER\n SET search_path = 'public'\nAS $function$\nDECLARE\n    v_event_id uuid;\n    v_user_id uuid := auth.uid();\nBEGIN\n    -- Ensure user is authenticated\n    IF v_user_id IS NULL THEN\n        RAISE EXCEPTION 'authentication required';\n    END IF;\n    \n    -- Insert the event (only for authenticated user)\n    INSERT INTO public.user_analytics_events (\n        user_id, \n        event_type, \n        event_data, \n        page_url, \n        session_id\n    )\n    VALUES (\n        v_user_id, \n        p_event_type, \n        p_event_data, \n        p_page_url, \n        p_session_id\n    )\n    RETURNING id INTO v_event_id;\n    \n    RETURN v_event_id;\nEND $function$;\n\n-- Fix has_active_subscription to ensure proper auth check\nCREATE OR REPLACE FUNCTION public.has_active_subscription(u uuid)\n RETURNS boolean\n LANGUAGE sql\n SECURITY DEFINER\n SET search_path = 'public'\nAS $function$\n  -- Only allow checking own subscription or admin access\n  select CASE \n    WHEN u = auth.uid() OR is_admin() THEN\n      coalesce(p.is_paid, false)\n      or (p.current_period_end is not null and p.current_period_end > now())\n      or (p.trial_ends_at is not null and p.trial_ends_at > now())\n    ELSE false\n  END\n  from public.profiles p\n  where p.id = u;\n$function$;"}		treenitaastu@gmail.com	\N
