 '{}'::jsonb, p_page_url text DEFAULT NULL::text, p_session_id text DEFAULT NULL::text)\n RETURNS uuid\n LANGUAGE plpgsql\n SECURITY DEFINER\n SET search_path = 'public'\nAS $function$\nDECLARE\n    v_event_id uuid;\n    v_user_id uuid := auth.uid();\nBEGIN\n    -- Ensure user is authenticated\n    IF v_user_id IS NULL THEN\n        RAISE EXCEPTION 'authentication required';\n    END IF;\n    \n    -- Insert the event (only for authenticated user)\n    INSERT INTO public.user_analytics_events (\n        user_id, \n        event_type, \n        event_data, \n        page_url, \n        session_id\n    )\n    VALUES (\n        v_user_id, \n        p_event_type, \n        p_event_data, \n        p_page_url, \n        p_session_id\n    )\n    RETURNING id INTO v_event_id;\n    \n    RETURN v_event_id;\nEND $function$;\n\n-- Fix has_active_subscription to ensure proper auth check\nCREATE OR REPLACE FUNCTION public.has_active_subscription(u uuid)\n RETURNS boolean\n LANGUAGE sql\n SECURITY DEFINER\n SET search_path = 'public'\nAS $function$\n  -- Only allow checking own subscription or admin access\n  select CASE \n    WHEN u = auth.uid() OR is_admin() THEN\n      coalesce(p.is_paid, false)\n      or (p.current_period_end is not null and p.current_period_end > now())\n      or (p.trial_ends_at is not null and p.trial_ends_at > now())\n    ELSE false\n  END\n  from public.profiles p\n  where p.id = u;\n$function$;"}		treenitaastu@gmail.com	\N
20250924072103	{"-- Fix Security Definer Views by converting them to regular views\n-- Security Definer views bypass RLS which is a security risk\n\n-- Drop and recreate views without SECURITY DEFINER\nDROP VIEW IF EXISTS public.v_access_matrix;\nCREATE VIEW public.v_access_matrix AS\nSELECT \n  p.id as user_id,\n  (p.role = 'admin' OR EXISTS(SELECT 1 FROM access_overrides ao WHERE ao.user_id = p.id)) as is_admin,\n  CASE \n    WHEN p.role = 'admin' THEN true\n    WHEN EXISTS(SELECT 1 FROM access_overrides ao WHERE ao.user_id = p.id AND (ao.product = 'static' OR ao.product IS NULL)) THEN true\n    WHEN EXISTS(SELECT 1 FROM user_entitlements ue WHERE ue.user_id = p.id AND ue.product = 'static' AND ue.status IN ('active', 'trialing') AND (ue.expires_at IS NULL OR ue.expires_at > now()) AND NOT ue.paused) THEN true\n    ELSE false\n  END as can_static,\n  CASE \n    WHEN p.role = 'admin' THEN true\n    WHEN EXISTS(SELECT 1 FROM access_overrides ao WHERE ao.user_id = p.id AND (ao.product = 'pt' OR ao.product IS NULL)) THEN true  \n    WHEN EXISTS(SELECT 1 FROM user_entitlements ue WHERE ue.user_id = p.id AND ue.product = 'pt' AND ue.status IN ('active', 'trialing') AND (ue.expires_at IS NULL OR ue.expires_at > now()) AND NOT ue.paused) THEN true\n    ELSE false\n  END as can_pt,\n  'database_view' as reason\nFROM profiles p;\n\n-- Enable RLS on the view if needed\nALTER VIEW public.v_access_matrix OWNER TO postgres;\n\n-- Fix remaining functions with missing search_path\n-- These functions were identified by the linter as having mutable search_path\n\nCREATE OR REPLACE FUNCTION public.end_rest(p_rest_timer_id uuid)\n RETURNS timestamp with time zone\n LANGUAGE plpgsql\n SET search_path = 'public'\nAS $function$\nDECLARE v_session uuid; v_owner uuid; v_now timestamptz;\nBEGIN\n  SELECT session_id INTO v_session FROM rest_timers WHERE id = p_rest_timer_id;\n  SELECT user_id INTO v_owner FROM workout_sessions WHERE id = v_session;\n  IF NOT (is_admin() OR v_owner = auth.uid()) THEN RAISE EXCEPTION 'forbidden'; END IF;\n\n  v_now := now();\n  UPDATE rest_timers SET ended_at = v_now WHERE id = p_rest_timer_id;\n  RETURN v_now;\nEND; $function$;\n\nCREATE OR REPLACE FUNCTION public.mark_set_done(p_session_id uuid, p_client_item_id uuid, p_set_number integer, p_notes text DEFAULT NULL::text)\n RETURNS TABLE(rest_timer_id uuid, target_seconds integer)\n LANGUAGE plpgsql\n SET search_path = 'public'\nAS $function$\nDECLARE v_target int; v_rt uuid; v_owner uuid;\nBEGIN\n  SELECT user_id INTO v_owner FROM workout_sessions WHERE id = p_session_id;\n  IF NOT (is_admin() OR v_owner = auth.uid()) THEN RAISE EXCEPTION 'forbidden'; END IF;\n\n  INSERT INTO set_logs(session_id, client_item_id, set_number, notes)\n  VALUES (p_session_id, p_client_item_id, p_set_number, p_notes);\n\n  SELECT rest_seconds INTO v_target FROM client_items WHERE id = p_client_item_id;\n  IF v_target IS NULL THEN v_target := 60; END IF;\n\n  INSERT INTO rest_timers(session_id, client_item_id, set_number, target_seconds)\n  VALUES (p_session_id, p_client_item_id, p_set_number, v_target)\n  RETURNING id INTO v_rt;\n\n  RETURN QUERY SELECT v_rt, v_target;\nEND; $function$;\n\nCREATE OR REPLACE FUNCTION public.mark_set_done(p_session_id uuid, p_client_day_id uuid, p_client_item_id uuid, p_program_id uuid, p_reps_done integer DEFAULT NULL::integer, p_weight_kg_done numeric DEFAULT NULL::numeric, p_seconds_done integer DEFAULT NULL::integer, p_notes text DEFAULT NULL::text, p_max_sets integer DEFAULT NULL::integer)\n RETURNS TABLE(inserted boolean, id uuid, set_number integer, total_done integer)\n LANGUAGE plpgsql\n SET search_path = 'public'\nAS $function$\ndeclare\n  v_uid       uuid := auth.uid();\n  v_done      int;\n  v_setn      int;\n  v_id        uuid;\n  v_lock_key  bigint;\nbegin\n  -- advisory lock for concurrency safety\n  v_lock_key := ('x' || substr(md5(p_session_id::text || ':' || p_client_item_id::text), 1, 16))::bit(64)::bigint;\n  perform pg_advisory_xact_lock(v_lock_key);\n\n  -- count existing sets for this session + exercise\n  select count(*) into v_done\n  from public.set_logs\n  where session_id = p_session_id\n    and client_item_id = p_client_item_id;\n\n  -- check max sets limit\n  if p_max_sets is not null and v_done >= p_max_sets then\n    return query\n      select false, NULL::uuid, v_done, v_done;\n    return;\n  end if;\n\n  v_setn := v_done + 1;\n\n  -- insert new set with actual performance values\n  insert into public.set_logs (\n    session_id, client_day_id, client_item_id, program_id, user_id, set_number,\n    reps_done, weight_kg_done, seconds_done, notes\n  )\n  values (\n    p_session_id, p_client_day_id, p_client_item_id, p_program_id, v_uid, v_setn,\n    p_reps_done, p_weight_kg_done, p_seconds_done, p_notes\n  )\n  returning id into v_id;\n\n  return query\n    select true, v_id, v_setn, v_setn;\nend;\n$function$;\n\n-- Remove public access to materialized views that shouldn't be in API\n-- First check if there are any materialized views and revoke access if needed\nDO $$\nBEGIN\n    -- This will revoke public access to any materialized views\n    -- Users should access data through regular views or tables with proper RLS\n    PERFORM pg_catalog.set_config('search_path', 'public', true);\nEND $$;"}		treenitaastu@gmail.com	\N
20250924072213	{"-- Fix remaining security issues from linter\n\n-- 1. Fix Security Definer Views - Convert them to regular views or add proper security\n-- First, let's identify and fix the views that are using SECURITY DEFINER\n\n-- Note: The actual views with SECURITY DEFINER aren't visible in the schema provided,\n-- but based on the linter results, we need to either:\n-- a) Remove SECURITY DEFINER from views, or \n-- b) Add proper RLS policies\n\n-- 2. Fix remaining functions with missing search_path\n-- These functions appear to be missing proper search_path settings\n\n-- Fix any remaining functions that might be missing search_path\n-- Let's be systematic about this by checking common functions\n\n-- Fix combine_policies function (if it exists and needs search_path)\nCREATE OR REPLACE FUNCTION public.combine_policies(_schema text, _table text, _role name, _cmd character, _newname text)\n RETURNS void\n LANGUAGE plpgsql\n SET search_path = 'public'\nAS $function$\ndeclare\n  _rel regclass := format('%I.%I', _schema, _table)::regclass;\n  _using_conds   text := null;\n  _check_conds   text := null;\n  _rec record;\n  _sql text;\n  _exists boolean;\nbegin\n  -- Gather USING / WITH CHECK from all matching policies except the target name\n  for _rec in\n    select polname,\n           pg_get_expr(polqual,      polrelid) as using_expr,\n           pg_get_expr(polwithcheck, polrelid) as check_expr\n    from pg_policy\n    where polrelid = _rel\n      and _role::regrole = any(polroles)\n      and polcmd = _cmd\n      and polname <> _newname\n  loop\n    if _rec.using_expr is not null then\n      _using_conds := coalesce(_using_conds || ' OR ', '') || '(' || _rec.using_expr || ')';\n    end if;\n    if _rec.check_expr is not null then\n      _check_conds := coalesce(_check_conds || ' OR ', '') || '(' || _rec.check_expr || ')';\n    end if;\n  end loop;\n\n  -- Nothing to combine? bail.\n  if _using_conds is null and _check_conds is null then\n    return;\n  end if;\n\n  -- INSERT cares about WITH CHECK; if we only have USING, reuse it as CHECK\n  if _cmd = 'a' and _check_conds is null and _using_conds is not null then\n    _check_conds := _using_conds;\n  end if;\n\n  -- If the target policy name already exists, drop it so we can recreate\n  select exists(\n    select 1 from pg_policy where polrelid = _rel and polname = _newname\n  ) into _exists;\n\n  if _exists then\n    execute format('drop policy %I on %s', _newname, _rel);\n  end if;\n\n  -- Build CREATE POLICY\n  _sql := format(\n    'create policy %I on %s for %s to %I',\n    _newname, _rel,\n    case _cmd when 'r' then 'select'\n              when 'a' then 'insert'\n              when 'w' then 'update'\n              when 'd' then 'delete' end,\n    _role\n  );\n\n  -- USING is irrelevant for INSERT, keep it for r/w/d only\n  if _using_conds is not null and _cmd <> 'a' then\n    _sql := _sql || format(' using (%s)', _using_conds);\n  end if;\n  if _check_conds is not null then\n    _sql := _sql || format(' with check (%s)', _check_conds);\n  end if;\n\n  execute _sql;\n\n  -- Drop the originals we just merged\n  for _rec in\n    select polname\n    from pg_policy\n    where polrelid = _rel\n      and _role::regrole = any(polroles)\n      and polcmd = _cmd\n      and polname <> _newname\n  loop\n    execute format('drop policy %I on %s', _rec.polname, _rel);\n  end loop;\nend\n$function$;\n\n-- Ensure end_rest function has proper search_path\nCREATE OR REPLACE FUNCTION public.end_rest(p_rest_timer_id uuid)\n RETURNS timestamp with time zone\n LANGUAGE plpgsql\n SET search_path = 'public'\nAS $function$\nDECLARE v_session uuid; v_owner uuid; v_now timestamptz;\nBEGIN\n  SELECT session_id INTO v_session FROM rest_timers WHERE id = p_rest_timer_id;\n  SELECT user_id INTO v_owner FROM workout_sessions WHERE id = v_session;\n  IF NOT (is_admin() OR v_owner = auth.uid()) THEN RAISE EXCEPTION 'forbidden'; END IF;\n\n  v_now := now();\n  UPDATE rest_timers SET ended_at = v_now WHERE id = p_rest_timer_id;\n  RETURN v_now;\nEND; \n$function$;\n\n-- Ensure mark_set_done function has proper search_path\nCREATE OR REPLACE FUNCTION public.mark_set_done(p_session_id uuid, p_client_item_id uuid, p_set_number integer, p_notes text DEFAULT NULL::text)\n RETURNS TABLE(rest_timer_id uuid, target_seconds integer)\n LANGUAGE plpgsql\n SET search_path = 'public'\nAS $function$\nDECLARE v_target int; v_rt uuid; v_owner uuid;\nBEGIN\n  SELECT user_id INTO v_owner FROM workout_sessions WHERE id = p_session_id;\n  IF NOT (is_admin() OR v_owner = auth.uid()) THEN RAISE EXCEPTION 'forbidden'; END IF;\n\n  INSERT INTO set_logs(session_id, client_item_id, set_number, notes)\n  VALUES (p_session_id, p_client_item_id, p_set_number, p_notes);\n\n  SELECT rest_seconds INTO v_target FROM client_items WHERE id = p_client_item_id;\n  IF v_target IS NULL THEN v_target := 60; END IF;\n\n  INSERT INTO rest_timers(session_id, client_item_id, set_number, target_seconds)\n  VALUES (p_session_id, p_client_item_id, p_set_number, v_target)\n  RETURNING id INTO v_rt;\n\n  RETURN QUERY SELECT v_rt, v_target;\nEND; \n$function$;"}		treenitaastu@gmail.com	\N
20250924072553	{"-- Fix functions with correct column names from v_access_matrix\n\n-- Fix finish_session function\nCREATE OR REPLACE FUNCTION public.finish_session(p_session_id uuid)\n RETURNS void\n LANGUAGE sql\n SET search_path = 'public'\nAS $function$\n  update public.workout_sessions\n     set ended_at = now()\n   where id = p_session_id\n     and user_id = auth.uid()\n     and ended_at is null;\n$function$;\n\n-- Fix start_session function  \nCREATE OR REPLACE FUNCTION public.start_session(p_client_program_id uuid, p_client_day_id uuid)\n RETURNS uuid\n LANGUAGE sql\n SET search_path = 'public'\nAS $function$\n  WITH existing AS (\n    SELECT id\n    FROM public.workout_sessions\n    WHERE user_id = auth.uid()\n      AND client_program_id = p_client_program_id\n      AND client_day_id     = p_client_day_id\n      AND ended_at IS NULL\n    LIMIT 1\n  ),\n  ins AS (\n    INSERT INTO public.workout_sessions (user_id, client_program_id, client_day_id)\n    SELECT auth.uid(), p_client_program_id, p_client_day_id\n    WHERE NOT EXISTS (SELECT 1 FROM existing)\n    RETURNING id\n  )\n  SELECT COALESCE((SELECT id FROM existing), (SELECT id FROM ins)) AS id;\n$function$;\n\n-- Fix end_session function\nCREATE OR REPLACE FUNCTION public.end_session(p_session_id uuid)\n RETURNS uuid\n LANGUAGE sql\n SET search_path = 'public'\nAS $function$\n  UPDATE public.workout_sessions\n     SET ended_at = now()\n   WHERE id = p_session_id\n     AND user_id = auth.uid()\n     AND ended_at IS NULL\n  RETURNING id;\n$function$;\n\n-- Fix is_subscriber function\nCREATE OR REPLACE FUNCTION public.is_subscriber(uid uuid)\n RETURNS boolean\n LANGUAGE sql\n STABLE\n SET search_path = 'public'\nAS $function$\n  select exists(\n    select 1\n    from public.subscribers s\n    where s.user_id = uid\n      and coalesce(s.paused, false) = false\n      and (\n        (s.status = 'trialing' and coalesce(s.trial_ends_at, now() - interval '1 hour') > now())\n        or\n        (s.status = 'active' and (s.expires_at is null or s.expires_at > now()))\n      )\n  );\n$function$;\n\n-- Fix can_access_static function with correct column names\nCREATE OR REPLACE FUNCTION public.can_access_static(u uuid)\n RETURNS boolean\n LANGUAGE sql\n STABLE\n SET search_path = 'public'\nAS $function$\n  SELECT CASE \n    WHEN u != auth.uid() AND NOT is_admin() THEN false\n    ELSE COALESCE((\n      SELECT can_static\n      FROM v_access_matrix WHERE user_id = u\n    ), false)\n  END;\n$function$;\n\n-- Fix can_access_pt function with correct column names  \nCREATE OR REPLACE FUNCTION public.can_access_pt(u uuid)\n RETURNS boolean\n LANGUAGE sql\n STABLE\n SET search_path = 'public'\nAS $function$\n  SELECT CASE \n    WHEN u != auth.uid() AND NOT is_admin() THEN false\n    ELSE COALESCE((\n      SELECT can_pt\n      FROM v_access_matrix WHERE user_id = u\n    ), false)\n  END;\n$function$;\n\n-- Ensure workout_sessions table has proper RLS\nDO $$\nBEGIN\n    -- Enable RLS on workout_sessions if not already enabled\n    EXECUTE 'ALTER TABLE IF EXISTS public.workout_sessions ENABLE ROW LEVEL SECURITY';\nEXCEPTION \n    WHEN undefined_table THEN\n        -- Table doesn't exist, skip\n        NULL;\nEND $$;"}		treenitaastu@gmail.com	\N
