20250924081216	{"-- Create support chat tables\nCREATE TABLE public.support_conversations (\n  id uuid NOT NULL DEFAULT gen_random_uuid() PRIMARY KEY,\n  user_id uuid NOT NULL REFERENCES auth.users(id) ON DELETE CASCADE,\n  status text NOT NULL DEFAULT 'active' CHECK (status IN ('active', 'closed', 'archived')),\n  created_at timestamp with time zone NOT NULL DEFAULT now(),\n  updated_at timestamp with time zone NOT NULL DEFAULT now(),\n  last_message_at timestamp with time zone NOT NULL DEFAULT now()\n);\n\nCREATE TABLE public.support_messages (\n  id uuid NOT NULL DEFAULT gen_random_uuid() PRIMARY KEY,\n  conversation_id uuid NOT NULL REFERENCES public.support_conversations(id) ON DELETE CASCADE,\n  sender_id uuid NOT NULL REFERENCES auth.users(id) ON DELETE CASCADE,\n  message text NOT NULL,\n  is_admin boolean NOT NULL DEFAULT false,\n  created_at timestamp with time zone NOT NULL DEFAULT now()\n);\n\n-- Enable RLS\nALTER TABLE public.support_conversations ENABLE ROW LEVEL SECURITY;\nALTER TABLE public.support_messages ENABLE ROW LEVEL SECURITY;\n\n-- Add indexes for performance\nCREATE INDEX idx_support_conversations_user_id ON public.support_conversations(user_id);\nCREATE INDEX idx_support_conversations_status ON public.support_conversations(status);\nCREATE INDEX idx_support_conversations_updated_at ON public.support_conversations(updated_at DESC);\nCREATE INDEX idx_support_messages_conversation_id ON public.support_messages(conversation_id);\nCREATE INDEX idx_support_messages_created_at ON public.support_messages(created_at);\n\n-- Add triggers for updated_at\nCREATE TRIGGER update_support_conversations_updated_at\n  BEFORE UPDATE ON public.support_conversations\n  FOR EACH ROW\n  EXECUTE FUNCTION public.update_updated_at_column();\n\n-- RLS Policies for support_conversations\n-- Users can view their own conversations\nCREATE POLICY \\"Users can view own conversations\\"\n  ON public.support_conversations\n  FOR SELECT\n  USING (user_id = auth.uid());\n\n-- Users can create conversations\nCREATE POLICY \\"Users can create conversations\\"\n  ON public.support_conversations\n  FOR INSERT\n  WITH CHECK (user_id = auth.uid());\n\n-- Users can update their own conversations\nCREATE POLICY \\"Users can update own conversations\\"\n  ON public.support_conversations\n  FOR UPDATE\n  USING (user_id = auth.uid())\n  WITH CHECK (user_id = auth.uid());\n\n-- Admins can view all conversations\nCREATE POLICY \\"Admins can view all conversations\\"\n  ON public.support_conversations\n  FOR SELECT\n  USING (is_admin());\n\n-- Admins can update all conversations\nCREATE POLICY \\"Admins can update all conversations\\"\n  ON public.support_conversations\n  FOR UPDATE\n  USING (is_admin());\n\n-- RLS Policies for support_messages\n-- Users can view messages in their conversations\nCREATE POLICY \\"Users can view messages in own conversations\\"\n  ON public.support_messages\n  FOR SELECT\n  USING (\n    EXISTS (\n      SELECT 1 FROM public.support_conversations sc\n      WHERE sc.id = support_messages.conversation_id\n      AND sc.user_id = auth.uid()\n    )\n  );\n\n-- Users can send messages in their conversations\nCREATE POLICY \\"Users can send messages in own conversations\\"\n  ON public.support_messages\n  FOR INSERT\n  WITH CHECK (\n    sender_id = auth.uid() AND\n    is_admin = false AND\n    EXISTS (\n      SELECT 1 FROM public.support_conversations sc\n      WHERE sc.id = support_messages.conversation_id\n      AND sc.user_id = auth.uid()\n    )\n  );\n\n-- Admins can view all messages\nCREATE POLICY \\"Admins can view all messages\\"\n  ON public.support_messages\n  FOR SELECT\n  USING (is_admin());\n\n-- Admins can send messages to any conversation\nCREATE POLICY \\"Admins can send messages\\"\n  ON public.support_messages\n  FOR INSERT\n  WITH CHECK (is_admin() AND sender_id = auth.uid() AND is_admin = true);\n\n-- Function to archive old conversations when creating new ones\nCREATE OR REPLACE FUNCTION public.archive_old_conversations()\nRETURNS TRIGGER AS $$\nBEGIN\n  -- Archive previous active conversations for this user\n  UPDATE public.support_conversations\n  SET status = 'archived',\n      updated_at = now()\n  WHERE user_id = NEW.user_id\n    AND status = 'active'\n    AND id != NEW.id;\n  \n  RETURN NEW;\nEND;\n$$ LANGUAGE plpgsql;\n\n-- Trigger to archive old conversations\nCREATE TRIGGER archive_old_conversations_trigger\n  AFTER INSERT ON public.support_conversations\n  FOR EACH ROW\n  EXECUTE FUNCTION public.archive_old_conversations();\n\n-- Function to update conversation timestamp when new message is added\nCREATE OR REPLACE FUNCTION public.update_conversation_timestamp()\nRETURNS TRIGGER AS $$\nBEGIN\n  UPDATE public.support_conversations\n  SET last_message_at = now(),\n      updated_at = now()\n  WHERE id = NEW.conversation_id;\n  \n  RETURN NEW;\nEND;\n$$ LANGUAGE plpgsql;\n\n-- Trigger to update conversation timestamp\nCREATE TRIGGER update_conversation_timestamp_trigger\n  AFTER INSERT ON public.support_messages\n  FOR EACH ROW\n  EXECUTE FUNCTION public.update_conversation_timestamp();\n\n-- Enable realtime for both tables\nALTER PUBLICATION supabase_realtime ADD TABLE public.support_conversations;\nALTER PUBLICATION supabase_realtime ADD TABLE public.support_messages;"}		treenitaastu@gmail.com	\N
20250924085526	{"-- Create admin setup function without conflicting with existing functions\n\n-- Create a helper function to set up admin access for the current user\nCREATE OR REPLACE FUNCTION public.make_current_user_admin()\n RETURNS text\n LANGUAGE plpgsql\n SECURITY DEFINER\n SET search_path = 'public'\nAS $function$\nDECLARE\n  current_user_id uuid;\n  user_email text;\nBEGIN\n  -- Get current user ID\n  current_user_id := auth.uid();\n  \n  IF current_user_id IS NULL THEN\n    RETURN 'Error: No authenticated user found. Please log in first.';\n  END IF;\n  \n  -- Get user email from auth.users\n  SELECT email INTO user_email \n  FROM auth.users \n  WHERE id = current_user_id;\n  \n  -- Insert or update profile with admin role\n  INSERT INTO public.profiles (id, email, role) \n  VALUES (current_user_id, user_email, 'admin') \n  ON CONFLICT (id) DO UPDATE SET \n    role = 'admin',\n    email = COALESCE(EXCLUDED.email, profiles.email);\n    \n  RETURN 'Success: User ' || COALESCE(user_email, current_user_id::text) || ' is now an admin.';\nEND;\n$function$;\n\n-- Add debugging function for troubleshooting\nCREATE OR REPLACE FUNCTION public.debug_auth_status()\n RETURNS jsonb\n LANGUAGE sql\n SECURITY DEFINER\n SET search_path = 'public'\nAS $function$\n  SELECT jsonb_build_object(\n    'auth_uid', auth.uid(),\n    'is_admin_no_param', is_admin(),\n    'profile_exists', EXISTS(SELECT 1 FROM profiles WHERE id = auth.uid()),\n    'profile_role', (SELECT role FROM profiles WHERE id = auth.uid()),\n    'has_access_override', EXISTS(SELECT 1 FROM access_overrides WHERE user_id = auth.uid()),\n    'conversations_count', (SELECT COUNT(*) FROM support_conversations),\n    'messages_count', (SELECT COUNT(*) FROM support_messages)\n  );\n$function$;"}		treenitaastu@gmail.com	\N
20250928111847	{"-- Drop and recreate analytics function with correct return type\n\n-- 1. Drop existing function\nDROP FUNCTION IF EXISTS public.get_analytics_summary();\n\n-- 2. Create new version with complete analytics data\nCREATE OR REPLACE FUNCTION public.get_analytics_summary()\nRETURNS TABLE(\n  total_sessions bigint,\n  active_users bigint, \n  completion_rate numeric,\n  avg_rpe numeric,\n  dropoff_day numeric,\n  total_volume numeric,\n  weekly_streaks bigint,\n  total_users bigint,\n  new_users_7d bigint,\n  workouts_started_7d bigint,\n  workouts_completed_7d bigint,\n  avg_sessions_per_user_7d numeric,\n  retention_day_7 numeric,\n  retention_day_30 numeric\n)\nLANGUAGE sql\nSECURITY DEFINER\nSET search_path TO 'public'\nAS $function$\n  with recent_sessions as (\n    select user_id, started_at::date as d\n    from workout_sessions\n    where started_at >= now() - interval '7 days'\n  ),\n  sessions_30 as (\n    select id, started_at::date as d, ended_at, user_id\n    from workout_sessions\n    where started_at >= now() - interval '30 days'\n  ),\n  sessions_7d as (\n    select id, user_id, ended_at\n    from workout_sessions\n    where started_at >= now() - interval '7 days'\n  )\n  select\n    (select count(*) from workout_sessions) as total_sessions,\n    (select count(distinct user_id) from recent_sessions) as active_users,\n    (\n      select coalesce(count(*) filter (where ended_at is not null)::numeric\n             / nullif(count(*),0), 0)\n      from sessions_30\n    ) as completion_rate,\n    (select avg(avg_rpe) from v_session_summary where avg_rpe is not null) as avg_rpe,\n    (\n      select avg(day)\n      from (\n        select user_id,\n               count(*) filter (where ended_at is not null) as days_done,\n               least(count(*),14) as day\n        from v_session_summary\n        group by user_id\n      ) t\n    ) as dropoff_day,\n    (select sum(total_volume_kg) from v_session_summary) as total_volume,\n    (\n      select count(*) from user_streaks us\n      where coalesce(us.current_streak,0) >= 7\n    ) as weekly_streaks,\n    (select count(*) from profiles) as total_users,\n    (select count(*) from profiles where created_at >= now() - interval '7 days') as new_users_7d,\n    (select count(*) from sessions_7d) as workouts_started_7d,\n    (select count(*) from sessions_7d where ended_at is not null) as workouts_completed_7d,\n    (\n      select case \n        when count(distinct user_id) > 0 \n        then count(*)::numeric / count(distinct user_id) \n        else 0 \n      end\n      from sessions_7d\n    ) as avg_sessions_per_user_7d,\n    (\n      select case \n        when (select count(*) from profiles) > 0 \n        then (select count(distinct user_id) from recent_sessions)::numeric / (select count(*) from profiles)\n        else 0 \n      end\n    ) as retention_day_7,\n    (\n      select case \n        when (select count(*) from profiles) > 0 \n        then (select count(distinct user_id) from sessions_30)::numeric / (select count(*) from profiles)\n        else 0 \n      end\n    ) as retention_day_30\n$function$;"}		treenitaastu@gmail.com	\N
20250924085645	{"-- Create admin setup function without conflicting with existing functions\n\n-- Create a helper function to set up admin access for the current user\nCREATE OR REPLACE FUNCTION public.make_current_user_admin()\n RETURNS text\n LANGUAGE plpgsql\n SECURITY DEFINER\n SET search_path = 'public'\nAS $function$\nDECLARE\n  current_user_id uuid;\n  user_email text;\nBEGIN\n  -- Get current user ID\n  current_user_id := auth.uid();\n  \n  IF current_user_id IS NULL THEN\n    RETURN 'Error: No authenticated user found. Please log in first.';\n  END IF;\n  \n  -- Get user email from auth.users\n  SELECT email INTO user_email \n  FROM auth.users \n  WHERE id = current_user_id;\n  \n  -- Insert or update profile with admin role\n  INSERT INTO public.profiles (id, email, role) \n  VALUES (current_user_id, user_email, 'admin') \n  ON CONFLICT (id) DO UPDATE SET \n    role = 'admin',\n    email = COALESCE(EXCLUDED.email, profiles.email);\n    \n  RETURN 'Success: User ' || COALESCE(user_email, current_user_id::text) || ' is now an admin.';\nEND;\n$function$;\n\n-- Add debugging function for troubleshooting\nCREATE OR REPLACE FUNCTION public.debug_auth_status()\n RETURNS jsonb\n LANGUAGE sql\n SECURITY DEFINER\n SET search_path = 'public'\nAS $function$\n  SELECT jsonb_build_object(\n    'auth_uid', auth.uid(),\n    'is_admin_no_param', is_admin(),\n    'profile_exists', EXISTS(SELECT 1 FROM profiles WHERE id = auth.uid()),\n    'profile_role', (SELECT role FROM profiles WHERE id = auth.uid()),\n    'has_access_override', EXISTS(SELECT 1 FROM access_overrides WHERE user_id = auth.uid()),\n    'conversations_count', (SELECT COUNT(*) FROM support_conversations),\n    'messages_count', (SELECT COUNT(*) FROM support_messages)\n  );\n$function$;"}		treenitaastu@gmail.com	\N
20250924090311	{"-- Create a test login function and improve admin access\nCREATE OR REPLACE FUNCTION public.test_admin_login(test_email text)\n RETURNS jsonb\n LANGUAGE plpgsql\n SECURITY DEFINER\n SET search_path = 'public'\nAS $function$\nDECLARE\n  admin_user_id uuid;\n  result jsonb;\nBEGIN\n  -- Find admin user by email\n  SELECT id INTO admin_user_id \n  FROM profiles \n  WHERE email = test_email AND role = 'admin';\n  \n  IF admin_user_id IS NULL THEN\n    -- Try to find any user with this email and make them admin\n    SELECT id INTO admin_user_id \n    FROM profiles \n    WHERE email = test_email;\n    \n    IF admin_user_id IS NOT NULL THEN\n      UPDATE profiles SET role = 'admin' WHERE id = admin_user_id;\n    END IF;\n  END IF;\n  \n  -- Return debug info\n  SELECT jsonb_build_object(\n    'found_user', admin_user_id IS NOT NULL,\n    'user_id', admin_user_id,\n    'email', test_email,\n    'conversations', (SELECT COUNT(*) FROM support_conversations),\n    'active_conversations', (SELECT COUNT(*) FROM support_conversations WHERE status = 'active'),\n    'messages', (SELECT COUNT(*) FROM support_messages),\n    'profiles_count', (SELECT COUNT(*) FROM profiles)\n  ) INTO result;\n  \n  RETURN result;\nEND;\n$function$;\n\n-- Ensure admin policies allow viewing all conversations\nDROP POLICY IF EXISTS \\"Admins can view all conversations\\" ON support_conversations;\nCREATE POLICY \\"Admins can view all conversations\\" \nON support_conversations \nFOR SELECT \nUSING (\n  EXISTS (\n    SELECT 1 FROM profiles p \n    WHERE p.id = auth.uid() AND p.role = 'admin'\n  ) \n  OR \n  EXISTS (\n    SELECT 1 FROM access_overrides ao \n    WHERE ao.user_id = auth.uid() \n    AND (ao.expires_at IS NULL OR ao.expires_at > now())\n  )\n);\n\n-- Ensure admin policies allow viewing all messages\nDROP POLICY IF EXISTS \\"Admins can view all messages\\" ON support_messages;\nCREATE POLICY \\"Admins can view all messages\\" \nON support_messages \nFOR SELECT \nUSING (\n  EXISTS (\n    SELECT 1 FROM profiles p \n    WHERE p.id = auth.uid() AND p.role = 'admin'\n  ) \n  OR \n  EXISTS (\n    SELECT 1 FROM access_overrides ao \n    WHERE ao.user_id = auth.uid() \n    AND (ao.expires_at IS NULL OR ao.expires_at > now())\n  )\n);"}		treenitaastu@gmail.com	\N
20250924094116	{"-- Fix v_static_status view and related issues (corrected)\n\n-- 1. Create the missing v_static_status view\nDROP VIEW IF EXISTS public.v_static_status;\n\nCREATE VIEW public.v_static_status AS\nSELECT \n  p.id as user_id,\n  ss.start_monday IS NOT NULL as is_started,\n  ss.start_monday::text as start_monday,\n  -- Calculate allowed programday_id based on start date and current date\n  CASE \n    WHEN ss.start_monday IS NULL THEN NULL\n    ELSE (\n      SELECT pd.id \n      FROM programday pd\n      WHERE pd.week = LEAST(\n        CEIL((EXTRACT(EPOCH FROM (CURRENT_DATE::timestamp - ss.start_monday::timestamp)) / 86400 + 1) / 7.0)::int,\n        4\n      )\n      AND pd.day = LEAST(\n        CASE EXTRACT(DOW FROM CURRENT_DATE::timestamp)\n          WHEN 0 THEN 5  -- Sunday -> Friday (last workday)\n          WHEN 6 THEN 5  -- Saturday -> Friday (last workday)\n          ELSE EXTRACT(DOW FROM CURRENT_DATE::timestamp)::int  -- Monday=1, Friday=5\n        END,\n        5\n      )\n      ORDER BY pd.week, pd.day\n      LIMIT 1\n    )\n  END as allowed_programday_id\nFROM profiles p\nLEFT JOIN static_starts ss ON ss.user_id = p.id;\n\n-- Grant permissions\nGRANT SELECT ON public.v_static_status TO authenticated;"}		treenitaastu@gmail.com	\N
20250924100502	{"-- Simplify articles table to be like a simple blog\n-- Remove complex jsonb columns that cause crashes\nALTER TABLE articles \nDROP COLUMN IF EXISTS tldr,\nDROP COLUMN IF EXISTS body,\nDROP COLUMN IF EXISTS article_references,\nDROP COLUMN IF EXISTS related_posts;\n\n-- Add simple blog-style columns\nALTER TABLE articles \nADD COLUMN content TEXT NOT NULL DEFAULT '',\nADD COLUMN excerpt TEXT,\nADD COLUMN tags TEXT[] DEFAULT '{}',\nADD COLUMN featured_image_url TEXT,\nADD COLUMN author TEXT DEFAULT 'Admin',\nADD COLUMN meta_description TEXT;"}		treenitaastu@gmail.com	\N
20250924101230	{"-- Add sample articles with real content\nINSERT INTO articles (\n  slug, title, summary, content, excerpt, category, format, \n  read_time_minutes, evidence_strength, tags, author, \n  meta_description, published\n) VALUES \n(\n  'vee-joomine-ja-metabolism',\n  'Kuidas vee joomine kiirendab metabolismi',\n  'Piisav vee tarbimine võib tõsta ainevahetust kuni 30% võrra ja aidata kaalu langetamisel.',\n  'Vesi on meie keha kõige olulisem aine. Uuringud näitavad, et 500ml vee joomine võib tõsta ainevahetust 10-30% võrra järgneva 30-40 minuti jooksul.\n\nKuidas vesi metabolismi mõjutab:\n\n• **Termoregulatsioon** - Keha kulutab energiat vee soojendamiseks keha temperatuurini\n• **Rakufunktsioonid** - Kõik ainevahetuprotsessid vajavad vett toimumiseks  \n• **Toksiinide väljutamine** - Vesi aitab kahjulikke aineid kehast välja viia\n• **Näljaäratundmine** - Sageli segi aetakse janu ja näljatunnet\n\nSoovitused:\n- Joo 8-10 klaasi vett päevas\n- Alusta päeva klaasi veega\n- Joo vett enne söömist\n- Lisa vette sidrunilõiku maitse jaoks\n\nMärkused:\nLiigne vee joomine võib olla kahjulik. Kuula oma keha signaalide.',\n  'Uuring näitab, et vee joomine tõstab ainevahetust märkimisväärselt.',\n  'Toitumine',\n  'TLDR',\n  3,\n  'kõrge',\n  ARRAY['vesi', 'metabolism', 'kaalulangetus'],\n  'Dr. Mari Kask',\n  'Kuidas vee joomine kiirendab metabolismi ja aitab kaalu langetada - teaduspõhised soovitused.',\n  true\n),\n(\n  'magamise-kvaliteet-ja-tervis',\n  'Kvaliteetse une 7 reeglid',\n  'Head uneharjumused parandavad mälu, immuunsust ja vaimset tervist ning pikendavad eluiga.',\n  '**Miks on uni oluline?**\n\nUne ajal toimuvad kehas olulised taastumis- ja puhastusprotsessid. Aju puhastab end toksiinidest, lihased taastuvad ja mälu konsolideerub.\n\n**7 kvaliteetse une reeglit:**\n\n1. **Regulaarne unerütm**\n   Minge magama ja ärgake igal päeval samal ajal, ka nädalavahetustel.\n\n2. **Optimaalne magamistoa keskkond**\n   - Temperatuur 16-19°C\n   - Pimedus (kasutage kardinaid või silmamask)\n   - Vaikus või valge müra\n\n3. **Ekraanide vältimine**\n   Lõpetage ekraanide kasutamine 1-2 tundi enne magamaminekut.\n\n4. **Päikesvalgus hommikul**\n   15-30 minutit päikesvalgust hommikul reguleerib tsirkaadset rütmi.\n\n5. **Kohvi piiramine**\n   Viimane kohvitass mitte hiljem kui 6 tundi enne magamaminekut.\n\n6. **Õhtune rutiin**\n   Looge rahulik õhtune rutiin - lugemine, meditsioon või kergvenitus.\n\n7. **Liikumine, kuid mitte hilja**\n   Regulaarne liikumine parandab une kvaliteeti, kuid mitte 3 tundi enne magamaminekut.',\n  'Kvaliteetne uni on tervislik elustiili alustala.',\n  'Magamine',\n  'Steps',\n  5,\n  'kõrge',\n  ARRAY['uni', 'tervis', 'energia'],\n  'Dr. Peep Laanoja',\n  'Kvaliteetse une 7 reeglil - teaduspõhised nõuanded parema une saamiseks.',\n  true\n),\n(\n  'tooli-ergonoomika-kontoris',\n  'Kuidas istuda tervislikult kontoris',\n  'Õige istumisasend ja regulaarsed pausid vähendavad selja- ja kaelavalusid ning parandavad produktiivsust.',\n  'Kontoris istumisega kaasnevad terviseriskid on reaalsed, kuid neid saab lihtsate muudatustega vähendada.\n\n**Õige istumisasend:**\n\n• **Jalad** - mõlemad jalad maas, põlved 90° nurga all\n• **Selg** - sirge, õlad lõdvad  \n• **Käed** - küünarnukid 90° nurga all, randmed neutraalasendis\n• **Ekraan** - silmade kõrgusel, käsivarre kaugusel\n\n**Regulaarsed pausid:**\n- Iga 30 minuti järel 30-sekundiline paus\n- Iga tunni järel 5-minutiline kõndimine\n- Kasutage \\"20-20-20 reeglit\\": iga 20 minuti järel vaata 20 sekundi jooksul 20 meetri kaugusele\n\n**Töökeskkonna optimeerimine:**\n- Reguleeritav tool ja laud\n- Hea valgustus (vältida ekraani peegeldust)\n- Dokumentide alus ekraani kõrval\n- Klaviatuur ja hiir õigel kõrgusel\n\n**Liikumise integreerimine:**\n- Seisulaud osa päevast\n- Telefonikõned jalutades\n- Trepid lifti asemel\n- Kaugemale parkimine\n\n**Hoiatused:**\nKui valu püsib rohkem kui nädalas, konsulteeri arstiga.',\n  'Õige kontorikeskkond ennetab terviseprobleeme.',\n  'Tööergonoomika',\n  'Steps',\n  4,\n  'kõrge',\n  ARRAY['ergonoomika', 'kontor', 'seljavalu'],\n  'Ergonoomika Keskus',\n  'Kuidas istuda tervislikult kontoris - praktilised nõuanded õigeks töökeskkonnaks.',\n  true\n),\n(\n  'lihasmassi-kaitse-vanusega',\n  'Miks me kaotame lihast vanusega',\n  'Pärast 30. eluaastat kaotame aastas 3-8% lihasmassist. Õige trenn ja toitumine aitavad seda protsessi aeglustada.',\n  '**Sarkopenia - vältimatu protsess?**\n\nLihasmassi vähenemine vanusega (sarkopenia) algab juba 30. eluaastatel. See pole vältimatu saatus - õige lähenemisega saab seda märkimisväärselt aeglustada.\n\n**Miks see toimub:**\n- Valkude süntees väheneb\n- Anaboolsete hormoonide tase langeb  \n- Füüsiline aktiivsus väheneb\n- Toitumine muutub ebapiisavaks\n\n**Tagajärjed:**\n- Nõrgem jõud ja vastupidavus\n- Suurem vigastuste risk\n- Aeglasem metabolism\n- Halvem elukvaliteet\n\n**Kuidas seda ennetada:**\n\n1. **Jõutreening**\n   - 2-3 korda nädalas\n   - Kõik suured lihasgrupid\n   - Progressiivne üleraskus\n\n2. **Piisav valk**\n   - 1,2-1,6g/kg kehakaalust päevas\n   - Jaotada ühtlaselt päeva peale\n   - Kvaliteetsed valguallikad\n\n3. **Aktiivsus**\n   - Igapäevane liikumine\n   - Vältige pikka istumist\n   - Märkige samme ja aktiivsust\n\n**Oluline märkus:**\nAlustage aeglaselt ja konsulteerige arstiga enne intensiivse treeningu alustamist, eriti kui teil on tervisprobleeme.',\n  'Lihasmassi kaitsmine on võimalik õige lähenemisega.',\n  'Lihasmassi vähenemine',\n  'MythFact',\n  4,\n  'kõrge',\n  ARRAY['sarkopenia', 'jõutreening', 'vananemine'],\n  'Spordimeditsiin OÜ',\n  'Miks me kaotame lihast vanusega ja kuidas seda ennetada - teaduspõhised lahendused.',\n  true\n),\n(\n  'stress-ja-seedekulgla',\n  'Kuidas stress mõjutab seedimist',\n  'Kroniline stress häirib seedetrakti tööd, põhjustades kõhuvalu, ülekülma ja muid seedeprobleeme.',\n  '**Stress-seedetrakti seos**\n\nMeie sool ja aju on tihedalt seotud närvisüsteemi kaudu. See tähendab, et stress mõjutab otseselt seedimist.\n\n**Stressi mõju seedimisele:**\n\n• **Seedenõgre vähenemine** - Stress vähendab mao- ja kõhunäärme mahlade tootmist\n• **Liikuvuse muutused** - Sool võib liiga kiiresti või aeglaselt töötada\n• **Mikroflora häirumine** - Kahjulike bakterite kasv, kasulike vähenemine\n• **Läbilaskvuse suurenemine** - \\"Lekkiv sool\\" võimaldab toksiinidel verre pääseda\n\n**Sümptomid:**\n- Kõhuvalu või -ebamugavus\n- Kõhulahtisus või kõhukinnisus\n- Ülekülm ja tuulsusvalu\n- Sügatistega probleemid\n\n**Leevendamise viisid:**\n\n1. **Stressijuhtimine**\n   - Meditsioon ja hingamisharjutused\n   - Regulaarne uni ja puhkus\n   - Füüsiline aktiivsus\n\n2. **Toitumine**\n   - Korrapärased söögid\n   - Kiudainerikad toidud\n   - Probiotikumide lisamine\n   - Alkoholi ja kofeini piiramine\n\n3. **Eluviis**\n   - Söögiaegne keskendumine toidule\n   - Aeglane söömine ja põhjalik närimine\n   - Piisav vee joomine\n\n**Millal arsti juurde:**\nKui sümptomid kestavad üle 2 nädala või halvenevad.',\n  'Stress ja seedimisprobleemid on omavahel seotud.',\n  'Stress',\n  'TLDR',\n  3,\n  'keskmine',\n  ARRAY['stress', 'seedimisprobleemid', 'kõht'],\n  'Toitumisnõustaja Eve Parts',\n  'Kuidas stress mõjutab seedimist ja milliseid samme teha seedeprobleemide leevendamiseks.',\n  true\n),\n(\n  'kaelavalu-ennetamine-kodus',\n  'Kaelavalu ennetamine kodus töötades',\n  'Lihtsa harjutuste ja töökeskkonna muutustega saab vähendada kaelavalude tekkimist kaugtöö ajal.',\n  '**Kaugtöö ja kaelavalu**\n\nCOVID-19 pandeemia järel on kaugtöö muutunud tavaliseks, kuid kahjuks on suurenenud ka kaela- ja õlavalude esinemine.\n\n**Peamised põhjused:**\n- Vale monitor või sülearvuti asukoht\n- Ebasobiv tool või laud\n- Pikaaegne sama asendis püsimine\n- Stress ja pingetunne\n\n**Kiired lahendused:**\n\n**1. Töökeskkond**\n- Ekraan silmade kõrgusel\n- Välisklaviatuur sülearvutile\n- Dokumendibaar ekraani kõrval\n- Piisav valgus\n\n**2. Regulaarsed pausid**\nTee iga 30 minuti järel:\n- 10 kaela pööramist mõlemas suunas\n- Õlgade kergtamine ja langetamine\n- Lõualihaste venitamine\n\n**3. Venimisharjutused (3x päevas):**\n\n*Kaela külgvenitus:*\n- Pea kallutamine küljele\n- Hoid 20 sekundit\n- Korda mõlemas suunas\n\n*Lõua tõmbamine:*\n- Loo \\"topeltlõug\\"\n- Hoid 5 sekundit\n- Korda 10 korda\n\n*Õlgade rullutamine:*\n- Suured ringid tagapoole\n- 10 korda\n\n**Millal muret tunda:**\nKui valu kiirgub kätte, on tugev peavalu või tuimus, konsulteeri arstiga.',\n  'Kaelavalu on kaugtöö ajal sage probleem.',\n  'Kaelavalu',\n  'Steps',\n  4,\n  'keskmine',\n  ARRAY['kaelavalu', 'kaugtöö', 'ergonoomika'],\n  'Füsioterapeut Margo Raud',\n  'Kuidas ennetada kaelavalusid kodus töötades - praktilised harjutused ja nõuanded.',\n  true\n);"}		treenitaastu@gmail.com	\N
20250924101408	{"-- Add more diverse health articles\nINSERT INTO articles (\n  slug, title, summary, content, excerpt, category, format, \n  read_time_minutes, evidence_strength, tags, author, \n  meta_description, published\n) VALUES \n(\n  'proteiini-vajadus-sportimisel',\n  'Kui palju valku vajab sportlane',\n  'Sportijate valkude vajadus on 1,2-2,2g/kg kehakaalust päevas, sõltuvalt trenni intensiivsusest ja eesmärkidest.',\n  '**Valkude roll sportlase organismis**\n\nValgud on ehitusmaterjal lihasele ja aitavad taastumisprotsessidel. Sportijate vajadused on tavainimestest kõrgemad.\n\n**Valkude vajadus treeningu järgi:**\n\n• **Vastupidavussport** (jooksmine, ujumine): 1,2-1,4 g/kg\n• **Jõutreening** (kehatreening, kulturism): 1,6-2,2 g/kg  \n• **Segarehasport** (jalgpall, tennis): 1,4-1,7 g/kg\n• **Tavalise inimese vajadus**: 0,8-1,0 g/kg\n\n**Parimad valguallikad:**\n- Liha, kala, linnuliha\n- Munad ja piimatooted\n- Kaunviljad ja pähklid\n- Valgupulber (vajaduse korral)\n\n**Ajakava:**\n- 20-30g valku iga 3-4 tunni järel\n- 30-45g valku 2 tunni jooksul pärast treeningut\n- Kaseiinvalk enne und (aeglane imendumine)\n\n**Märkused:**\nLiigne valk (üle 3g/kg) ei anna lisahüvet ja koormab neerusid. Tasakaalustatud toitumine on võti.\n\n**Praktilised näpunäited:**\n- 100g kanarinnahast ≈ 23g valku\n- 1 muna ≈ 6g valku  \n- 1 klaas piima ≈ 8g valku\n- 30g mandleid ≈ 6g valku',\n  'Sportijate valkude vajadus sõltub trenni tüübist ja intensiivsusest.',\n  'Toitumine',\n  'TLDR',\n  4,\n  'kõrge',\n  ARRAY['valk', 'sport', 'toitumine', 'treening'],\n  'Sporditeadlane Dr. Karin Alev',\n  'Kui palju valku vajab sportlane - teaduspõhised soovitused erinevate spordialade jaoks.',\n  true\n),\n(\n  'plangi-harjutus-tuumiku-tugevdamiseks',\n  'Plank - täiuslik harjutus tuumikule',\n  'Plank-harjutus tugevdab kogu keha tuumikut ja parandab rühti vaid 30 sekundiga päevas.',\n  '**Miks plank on nii efektiivne?**\n\nPlank aktiveerib kogu keha tuumiku - kõhulihased, seljalihased