20250924093214	{"-- Fix Security Definer Views by adding SECURITY INVOKER option\n-- This ensures views respect RLS policies of the querying user rather than the view creator\n\n-- Drop all views first to handle dependencies\nDROP VIEW IF EXISTS public.v_user_weekly CASCADE;\nDROP VIEW IF EXISTS public.v_userprogress_with_day CASCADE;  \nDROP VIEW IF EXISTS public.v_user_entitlement CASCADE;\nDROP VIEW IF EXISTS public.v_static_status CASCADE;\nDROP VIEW IF EXISTS public.v_session_summary CASCADE;\nDROP VIEW IF EXISTS public.v_program_analytics CASCADE;\nDROP VIEW IF EXISTS public.v_client_programs_admin CASCADE;\nDROP VIEW IF EXISTS public.v_access_matrix CASCADE;\n\n-- Recreate all views with security_invoker=on\n\n-- 1. v_access_matrix\nCREATE VIEW public.v_access_matrix \nWITH (security_invoker=on)\nAS\nSELECT \n    id AS user_id,\n    ((role = 'admin'::text) OR (EXISTS ( SELECT 1\n           FROM access_overrides ao\n          WHERE (ao.user_id = p.id)))) AS is_admin,\n        CASE\n            WHEN (role = 'admin'::text) THEN true\n            WHEN (EXISTS ( SELECT 1\n               FROM access_overrides ao\n              WHERE ((ao.user_id = p.id) AND ((ao.product = 'static'::product_kind) OR (ao.product IS NULL))))) THEN true\n            WHEN (EXISTS ( SELECT 1\n               FROM user_entitlements ue\n              WHERE ((ue.user_id = p.id) AND (ue.product = 'static'::product_kind) AND (ue.status = ANY (ARRAY['active'::text, 'trialing'::text])) AND ((ue.expires_at IS NULL) OR (ue.expires_at > now())) AND (NOT ue.paused)))) THEN true\n            ELSE false\n        END AS can_static,\n        CASE\n            WHEN (role = 'admin'::text) THEN true\n            WHEN (EXISTS ( SELECT 1\n               FROM access_overrides ao\n              WHERE ((ao.user_id = p.id) AND ((ao.product = 'pt'::product_kind) OR (ao.product IS NULL))))) THEN true\n            WHEN (EXISTS ( SELECT 1\n               FROM user_entitlements ue\n              WHERE ((ue.user_id = p.id) AND (ue.product = 'pt'::product_kind) AND (ue.status = ANY (ARRAY['active'::text, 'trialing'::text])) AND ((ue.expires_at IS NULL) OR (ue.expires_at > now())) AND (NOT ue.paused)))) THEN true\n            ELSE false\n        END AS can_pt,\n    'database_view'::text AS reason\nFROM profiles p;\n\n-- 2. v_client_programs_admin  \nCREATE VIEW public.v_client_programs_admin \nWITH (security_invoker=on)\nAS\nSELECT \n    cp.id,\n    cp.template_id,\n    cp.assigned_to,\n    cp.assigned_by,\n    cp.start_date,\n    cp.is_active,\n    cp.inserted_at,\n    p.email AS assigned_to_email,\n    t.title AS template_title\nFROM ((client_programs cp\n     LEFT JOIN profiles p ON ((p.id = cp.assigned_to)))\n     LEFT JOIN workout_templates t ON ((t.id = cp.template_id)));\n\n-- 3. v_program_analytics\nCREATE VIEW public.v_program_analytics \nWITH (security_invoker=on)\nAS\nSELECT \n    count(DISTINCT user_id) AS total_users,\n    count(id) AS total_completions,\n    count(DISTINCT programday_id) AS unique_days_completed,\n    avg(\n        CASE\n            WHEN (user_id IN ( SELECT userprogress.user_id\n               FROM userprogress\n              GROUP BY userprogress.user_id\n             HAVING (count(*) >= 20))) THEN 1.0\n            ELSE 0.0\n        END) AS completion_rate,\n    ( SELECT pd.day\n           FROM (( SELECT up2.programday_id,\n                    count(*) AS completions\n                   FROM userprogress up2\n                  WHERE (NOT (up2.user_id IN ( SELECT userprogress.user_id\n                           FROM userprogress\n                          GROUP BY userprogress.user_id\n                         HAVING (count(*) >= 20))))\n                  GROUP BY up2.programday_id\n                  ORDER BY (count(*)) DESC\n                 LIMIT 1) last_days\n             JOIN programday pd ON ((pd.id = last_days.programday_id)))) AS most_common_dropoff_day\nFROM userprogress up;\n\n-- 4. v_session_summary\nCREATE VIEW public.v_session_summary \nWITH (security_invoker=on)\nAS\nSELECT \n    ws.id AS session_id,\n    ws.user_id,\n    ws.started_at,\n    ws.ended_at,\n    ws.duration_minutes,\n    COALESCE(sl.total_reps, (0)::bigint) AS total_reps,\n    COALESCE(sl.total_volume_kg, (0)::numeric) AS total_volume_kg,\n    COALESCE(sl.exercises_completed, (0)::bigint) AS exercises_completed,\n    COALESCE(sl.sets_completed, (0)::bigint) AS sets_completed,\n    sl.avg_rpe\nFROM (workout_sessions ws\n     LEFT JOIN ( SELECT sl_1.session_id,\n            sum(COALESCE(sl_1.reps_done, 0)) AS total_reps,\n            sum((COALESCE(sl_1.weight_kg_done, (0)::numeric) * (COALESCE(sl_1.reps_done, 0))::numeric)) AS total_volume_kg,\n            count(DISTINCT sl_1.client_item_id) AS exercises_completed,\n            count(*) AS sets_completed,\n            ( SELECT avg(en.rpe) AS avg\n                   FROM exercise_notes en\n                  WHERE ((en.session_id = sl_1.session_id) AND (en.rpe IS NOT NULL))) AS avg_rpe\n           FROM set_logs sl_1\n          GROUP BY sl_1.session_id) sl ON ((ws.id = sl.session_id)));\n\n-- 5. v_static_status\nCREATE VIEW public.v_static_status \nWITH (security_invoker=on)\nAS\nSELECT \n    p.id AS user_id,\n    (ss.start_monday IS NOT NULL) AS is_started,\n    (ss.start_monday)::text AS start_monday,\n        CASE\n            WHEN (ss.start_monday IS NULL) THEN NULL::uuid\n            ELSE ( SELECT pd.id\n               FROM programday pd\n              WHERE ((pd.week = 1) AND (pd.day = 1))\n             LIMIT 1)\n        END AS current_programday_id,\n        CASE\n            WHEN (ss.start_monday IS NULL) THEN 0\n            ELSE (((date_part('days'::text, (now() - (ss.start_monday)::timestamp with time zone)) / (7)::double precision))::integer + 1)\n        END AS current_week,\n        CASE\n            WHEN (ss.start_monday IS NULL) THEN 0\n            ELSE (((date_part('dow'::text, now()) + (6)::double precision))::integer % 7)\n        END AS current_day_of_week,\n        CASE\n            WHEN (ss.start_monday IS NULL) THEN NULL::text\n            ELSE 'static'::text\n        END AS program_type\nFROM (profiles p\n     LEFT JOIN static_starts ss ON ((ss.user_id = p.id)));\n\n-- 6. v_user_entitlement\nCREATE VIEW public.v_user_entitlement \nWITH (security_invoker=on)\nAS\nSELECT \n    ue.user_id,\n    ue.product,\n    ue.status,\n    ue.started_at,\n    ue.trial_ends_at,\n    ue.expires_at,\n    ue.paused,\n    ue.source,\n    ue.note,\n    ue.created_at,\n    ue.updated_at,\n        CASE\n            WHEN ue.paused THEN false\n            WHEN ((ue.status = 'trialing'::text) AND (COALESCE(ue.trial_ends_at, '-infinity'::timestamp with time zone) > now())) THEN true\n            WHEN ((ue.status = 'active'::text) AND ((ue.expires_at IS NULL) OR (ue.expires_at > now()))) THEN true\n            ELSE false\n        END AS is_active\nFROM user_entitlements ue;\n\n-- 7. v_user_weekly  \nCREATE VIEW public.v_user_weekly \nWITH (security_invoker=on)\nAS\nSELECT \n    ws.user_id,\n    get_iso_week(ws.started_at) AS iso_week,\n    count(*) AS sessions_count,\n    count(*) FILTER (WHERE (ws.ended_at IS NOT NULL)) AS completed_sessions,\n    sum(COALESCE(ws.duration_minutes, 0)) AS total_minutes,\n    avg(COALESCE(ws.duration_minutes, 0)) AS avg_minutes_per_session\nFROM workout_sessions ws\nGROUP BY ws.user_id, (get_iso_week(ws.started_at));\n\n-- 8. v_userprogress_with_day\nCREATE VIEW public.v_userprogress_with_day \nWITH (security_invoker=on)\nAS\nSELECT \n    up.*,\n    pd.week,\n    pd.day,\n    pd.title AS day_title\nFROM (userprogress up\n     JOIN programday pd ON ((pd.id = up.programday_id)));"}		treenitaastu@gmail.com	\N
20250924093230	{"-- Fix Security Definer Views by adding SECURITY INVOKER option\n-- This ensures views respect RLS policies of the querying user rather than the view creator\n\n-- Drop all views first to handle dependencies\nDROP VIEW IF EXISTS public.v_user_weekly CASCADE;\nDROP VIEW IF EXISTS public.v_userprogress_with_day CASCADE;  \nDROP VIEW IF EXISTS public.v_user_entitlement CASCADE;\nDROP VIEW IF EXISTS public.v_static_status CASCADE;\nDROP VIEW IF EXISTS public.v_session_summary CASCADE;\nDROP VIEW IF EXISTS public.v_program_analytics CASCADE;\nDROP VIEW IF EXISTS public.v_client_programs_admin CASCADE;\nDROP VIEW IF EXISTS public.v_access_matrix CASCADE;\n\n-- Recreate all views with security_invoker=on\n\n-- 1. v_access_matrix\nCREATE VIEW public.v_access_matrix \nWITH (security_invoker=on)\nAS\nSELECT \n    id AS user_id,\n    ((role = 'admin'::text) OR (EXISTS ( SELECT 1\n           FROM access_overrides ao\n          WHERE (ao.user_id = p.id)))) AS is_admin,\n        CASE\n            WHEN (role = 'admin'::text) THEN true\n            WHEN (EXISTS ( SELECT 1\n               FROM access_overrides ao\n              WHERE ((ao.user_id = p.id) AND ((ao.product = 'static'::product_kind) OR (ao.product IS NULL))))) THEN true\n            WHEN (EXISTS ( SELECT 1\n               FROM user_entitlements ue\n              WHERE ((ue.user_id = p.id) AND (ue.product = 'static'::product_kind) AND (ue.status = ANY (ARRAY['active'::text, 'trialing'::text])) AND ((ue.expires_at IS NULL) OR (ue.expires_at > now())) AND (NOT ue.paused)))) THEN true\n            ELSE false\n        END AS can_static,\n        CASE\n            WHEN (role = 'admin'::text) THEN true\n            WHEN (EXISTS ( SELECT 1\n               FROM access_overrides ao\n              WHERE ((ao.user_id = p.id) AND ((ao.product = 'pt'::product_kind) OR (ao.product IS NULL))))) THEN true\n            WHEN (EXISTS ( SELECT 1\n               FROM user_entitlements ue\n              WHERE ((ue.user_id = p.id) AND (ue.product = 'pt'::product_kind) AND (ue.status = ANY (ARRAY['active'::text, 'trialing'::text])) AND ((ue.expires_at IS NULL) OR (ue.expires_at > now())) AND (NOT ue.paused)))) THEN true\n            ELSE false\n        END AS can_pt,\n    'database_view'::text AS reason\nFROM profiles p;\n\n-- 2. v_client_programs_admin  \nCREATE VIEW public.v_client_programs_admin \nWITH (security_invoker=on)\nAS\nSELECT \n    cp.id,\n    cp.template_id,\n    cp.assigned_to,\n    cp.assigned_by,\n    cp.start_date,\n    cp.is_active,\n    cp.inserted_at,\n    p.email AS assigned_to_email,\n    t.title AS template_title\nFROM ((client_programs cp\n     LEFT JOIN profiles p ON ((p.id = cp.assigned_to)))\n     LEFT JOIN workout_templates t ON ((t.id = cp.template_id)));\n\n-- 3. v_program_analytics\nCREATE VIEW public.v_program_analytics \nWITH (security_invoker=on)\nAS\nSELECT \n    count(DISTINCT user_id) AS total_users,\n    count(id) AS total_completions,\n    count(DISTINCT programday_id) AS unique_days_completed,\n    avg(\n        CASE\n            WHEN (user_id IN ( SELECT userprogress.user_id\n               FROM userprogress\n              GROUP BY userprogress.user_id\n             HAVING (count(*) >= 20))) THEN 1.0\n            ELSE 0.0\n        END) AS completion_rate,\n    ( SELECT pd.day\n           FROM (( SELECT up2.programday_id,\n                    count(*) AS completions\n                   FROM userprogress up2\n                  WHERE (NOT (up2.user_id IN ( SELECT userprogress.user_id\n                           FROM userprogress\n                          GROUP BY userprogress.user_id\n                         HAVING (count(*) >= 20))))\n                  GROUP BY up2.programday_id\n                  ORDER BY (count(*)) DESC\n                 LIMIT 1) last_days\n             JOIN programday pd ON ((pd.id = last_days.programday_id)))) AS most_common_dropoff_day\nFROM userprogress up;\n\n-- 4. v_session_summary\nCREATE VIEW public.v_session_summary \nWITH (security_invoker=on)\nAS\nSELECT \n    ws.id AS session_id,\n    ws.user_id,\n    ws.started_at,\n    ws.ended_at,\n    ws.duration_minutes,\n    COALESCE(sl.total_reps, (0)::bigint) AS total_reps,\n    COALESCE(sl.total_volume_kg, (0)::numeric) AS total_volume_kg,\n    COALESCE(sl.exercises_completed, (0)::bigint) AS exercises_completed,\n    COALESCE(sl.sets_completed, (0)::bigint) AS sets_completed,\n    sl.avg_rpe\nFROM (workout_sessions ws\n     LEFT JOIN ( SELECT sl_1.session_id,\n            sum(COALESCE(sl_1.reps_done, 0)) AS total_reps,\n            sum((COALESCE(sl_1.weight_kg_done, (0)::numeric) * (COALESCE(sl_1.reps_done, 0))::numeric)) AS total_volume_kg,\n            count(DISTINCT sl_1.client_item_id) AS exercises_completed,\n            count(*) AS sets_completed,\n            ( SELECT avg(en.rpe) AS avg\n                   FROM exercise_notes en\n                  WHERE ((en.session_id = sl_1.session_id) AND (en.rpe IS NOT NULL))) AS avg_rpe\n           FROM set_logs sl_1\n          GROUP BY sl_1.session_id) sl ON ((ws.id = sl.session_id)));\n\n-- 5. v_static_status\nCREATE VIEW public.v_static_status \nWITH (security_invoker=on)\nAS\nSELECT \n    p.id AS user_id,\n    (ss.start_monday IS NOT NULL) AS is_started,\n    (ss.start_monday)::text AS start_monday,\n        CASE\n            WHEN (ss.start_monday IS NULL) THEN NULL::uuid\n            ELSE ( SELECT pd.id\n               FROM programday pd\n              WHERE ((pd.week = 1) AND (pd.day = 1))\n             LIMIT 1)\n        END AS current_programday_id,\n        CASE\n            WHEN (ss.start_monday IS NULL) THEN 0\n            ELSE (((date_part('days'::text, (now() - (ss.start_monday)::timestamp with time zone)) / (7)::double precision))::integer + 1)\n        END AS current_week,\n        CASE\n            WHEN (ss.start_monday IS NULL) THEN 0\n            ELSE (((date_part('dow'::text, now()) + (6)::double precision))::integer % 7)\n        END AS current_day_of_week,\n        CASE\n            WHEN (ss.start_monday IS NULL) THEN NULL::text\n            ELSE 'static'::text\n        END AS program_type\nFROM (profiles p\n     LEFT JOIN static_starts ss ON ((ss.user_id = p.id)));\n\n-- 6. v_user_entitlement\nCREATE VIEW public.v_user_entitlement \nWITH (security_invoker=on)\nAS\nSELECT \n    ue.user_id,\n    ue.product,\n    ue.status,\n    ue.started_at,\n    ue.trial_ends_at,\n    ue.expires_at,\n    ue.paused,\n    ue.source,\n    ue.note,\n    ue.created_at,\n    ue.updated_at,\n        CASE\n            WHEN ue.paused THEN false\n            WHEN ((ue.status = 'trialing'::text) AND (COALESCE(ue.trial_ends_at, '-infinity'::timestamp with time zone) > now())) THEN true\n            WHEN ((ue.status = 'active'::text) AND ((ue.expires_at IS NULL) OR (ue.expires_at > now()))) THEN true\n            ELSE false\n        END AS is_active\nFROM user_entitlements ue;\n\n-- 7. v_user_weekly  \nCREATE VIEW public.v_user_weekly \nWITH (security_invoker=on)\nAS\nSELECT \n    ws.user_id,\n    get_iso_week(ws.started_at) AS iso_week,\n    count(*) AS sessions_count,\n    count(*) FILTER (WHERE (ws.ended_at IS NOT NULL)) AS completed_sessions,\n    sum(COALESCE(ws.duration_minutes, 0)) AS total_minutes,\n    avg(COALESCE(ws.duration_minutes, 0)) AS avg_minutes_per_session\nFROM workout_sessions ws\nGROUP BY ws.user_id, (get_iso_week(ws.started_at));\n\n-- 8. v_userprogress_with_day\nCREATE VIEW public.v_userprogress_with_day \nWITH (security_invoker=on)\nAS\nSELECT \n    up.*,\n    pd.week,\n    pd.day,\n    pd.title AS day_title\nFROM (userprogress up\n     JOIN programday pd ON ((pd.id = up.programday_id)));"}		treenitaastu@gmail.com	\N
20250924093657	{"-- Fix critical RLS policies for template access control\n-- Currently template_days and template_items allow public access (true) which is a security risk\n\n-- Drop existing overly permissive policies\nDROP POLICY IF EXISTS \\"pt_tdays_select\\" ON public.template_days;\nDROP POLICY IF EXISTS \\"pt_tdays_insert\\" ON public.template_days;\nDROP POLICY IF EXISTS \\"pt_tdays_update\\" ON public.template_days;\nDROP POLICY IF EXISTS \\"pt_tdays_delete\\" ON public.template_days;\n\nDROP POLICY IF EXISTS \\"pt_titems_select\\" ON public.template_items;\nDROP POLICY IF EXISTS \\"pt_titems_insert\\" ON public.template_items;\nDROP POLICY IF EXISTS \\"pt_titems_update\\" ON public.template_items;\nDROP POLICY IF EXISTS \\"pt_titems_delete\\" ON public.template_items;\n\n-- Create new restrictive policies for template_days (only admins and authorized coaches)\nCREATE POLICY \\"template_days_select_admin_only\\" \nON public.template_days \nFOR SELECT \nUSING (is_admin());\n\nCREATE POLICY \\"template_days_insert_admin_only\\" \nON public.template_days \nFOR INSERT \nWITH CHECK (is_admin());\n\nCREATE POLICY \\"template_days_update_admin_only\\" \nON public.template_days \nFOR UPDATE \nUSING (is_admin())\nWITH CHECK (is_admin());\n\nCREATE POLICY \\"template_days_delete_admin_only\\" \nON public.template_days \nFOR DELETE \nUSING (is_admin());\n\n-- Create new restrictive policies for template_items (only admins and authorized coaches)\nCREATE POLICY \\"template_items_select_admin_only\\" \nON public.template_items \nFOR SELECT \nUSING (is_admin());\n\nCREATE POLICY \\"template_items_insert_admin_only\\" \nON public.template_items \nFOR INSERT \nWITH CHECK (is_admin());\n\nCREATE POLICY \\"template_items_update_admin_only\\" \nON public.template_items \nFOR UPDATE \nUSING (is_admin())\nWITH CHECK (is_admin());\n\nCREATE POLICY \\"template_items_delete_admin_only\\" \nON public.template_items \nFOR DELETE \nUSING (is_admin());\n\n-- Add server-side admin validation function with better security\nCREATE OR REPLACE FUNCTION public.ensure_admin_access()\nRETURNS boolean\nLANGUAGE plpgsql\nSECURITY DEFINER\nSTABLE\nSET search_path = public\nAS $$\nDECLARE\n  current_user_id uuid;\n  is_admin_user boolean := false;\nBEGIN\n  -- Get current authenticated user\n  current_user_id := auth.uid();\n  \n  -- Return false if no authenticated user\n  IF current_user_id IS NULL THEN\n    RETURN false;\n  END IF;\n  \n  -- Check if user is admin via profiles table\n  SELECT (role = 'admin') \n  INTO is_admin_user\n  FROM public.profiles \n  WHERE id = current_user_id;\n  \n  -- Check if user has admin override access\n  IF NOT is_admin_user THEN\n    SELECT EXISTS(\n      SELECT 1 \n      FROM public.access_overrides \n      WHERE user_id = current_user_id \n        AND (expires_at IS NULL OR expires_at > now())\n    ) INTO is_admin_user;\n  END IF;\n  \n  RETURN COALESCE(is_admin_user, false);\nEND;\n$$;\n\n-- Enhanced admin check function with logging for security audit\nCREATE OR REPLACE FUNCTION public.validate_admin_action(action_type text)\nRETURNS boolean\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = public\nAS $$\nDECLARE\n  current_user_id uuid;\n  user_email text;\n  is_valid_admin boolean;\nBEGIN\n  current_user_id := auth.uid();\n  \n  -- Log the admin action attempt\n  IF current_user_id IS NOT NULL THEN\n    SELECT email INTO user_email FROM auth.users WHERE id = current_user_id;\n    \n    -- You could add audit logging here if needed\n    -- INSERT INTO admin_audit_log(user_id, user_email, action_type, attempted_at) \n    -- VALUES (current_user_id, user_email, action_type, now());\n  END IF;\n  \n  -- Check admin access\n  is_valid_admin := ensure_admin_access();\n  \n  RETURN is_valid_admin;\nEND;\n$$;"}		treenitaastu@gmail.com	\N
20250924094219	{"-- CRITICAL SECURITY FIX: Secure subscribers table from data theft\n-- Issue: Duplicate RLS policies and potential public access to customer emails and Stripe IDs\n\n-- First, drop all existing policies to start clean\nDROP POLICY IF EXISTS \\"Users can view their own subscription\\" ON public.subscribers;\nDROP POLICY IF EXISTS \\"subs_admin_write\\" ON public.subscribers;\nDROP POLICY IF EXISTS \\"subs_select_self\\" ON public.subscribers;\n\n-- Ensure RLS is enabled (should already be, but being explicit)\nALTER TABLE public.subscribers ENABLE ROW LEVEL SECURITY;\n\n-- Create secure SELECT policy - users can only see their own subscription data\nCREATE POLICY \\"subscribers_select_own_only\\" \nON public.subscribers \nFOR SELECT \nUSING (user_id = auth.uid());\n\n-- Create secure admin SELECT policy for admin access\nCREATE POLICY \\"subscribers_select_admin_only\\" \nON public.subscribers \nFOR SELECT \nUSING (is_admin());\n\n-- Admin can insert/update/delete (for subscription management)\nCREATE POLICY \\"subscribers_insert_admin_only\\" \nON public.subscribers \nFOR INSERT \nWITH CHECK (is_admin());\n\nCREATE POLICY \\"subscribers_update_admin_only\\" \nON public.subscribers \nFOR UPDATE \nUSING (is_admin())\nWITH CHECK (is_admin());\n\nCREATE POLICY \\"subscribers_delete_admin_only\\" \nON public.subscribers \nFOR DELETE \nUSING (is_admin());\n\n-- Create secure function to check subscription status without exposing sensitive data\nCREATE OR REPLACE FUNCTION public.get_user_subscription_status(check_user_id uuid DEFAULT auth.uid())\nRETURNS jsonb\nLANGUAGE plpgsql\nSECURITY DEFINER\nSTABLE\nSET search_path = public\nAS $$\nDECLARE\n  current_user_id uuid;\n  subscription_info jsonb;\nBEGIN\n  current_user_id := auth.uid();\n  \n  -- Security check: users can only check their own status unless they're admin\n  IF current_user_id IS NULL THEN\n    RETURN jsonb_build_object('error', 'Not authenticated');\n  END IF;\n  \n  IF check_user_id != current_user_id AND NOT is_admin() THEN\n    RETURN jsonb_build_object('error', 'Access denied');\n  END IF;\n  \n  -- Return only non-sensitive subscription information\n  SELECT jsonb_build_object(\n    'subscribed', subscribed,\n    'status', status,\n    'subscription_tier', subscription_tier,\n    'trial_ends_at', trial_ends_at,\n    'expires_at', expires_at,\n    'paused', paused,\n    'plan', plan\n  )\n  INTO subscription_info\n  FROM public.subscribers\n  WHERE user_id = check_user_id;\n  \n  RETURN COALESCE(subscription_info, jsonb_build_object('subscribed', false));\nEND;\n$$;\n\n-- Create audit log function for sensitive data access (optional, can be enabled later)\nCREATE OR REPLACE FUNCTION public.audit_subscriber_access()\nRETURNS trigger\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = public\nAS $$\nBEGIN\n  -- Log access to sensitive subscriber data for security monitoring\n  -- This is disabled by default but can be enabled by creating the audit table\n  \n  IF EXISTS (SELECT 1 FROM information_schema.tables WHERE table_name = 'security_audit_log') THEN\n    INSERT INTO security_audit_log (\n      user_id, \n      action, \n      table_name, \n      accessed_user_id, \n      timestamp,\n      ip_address\n    ) VALUES (\n      auth.uid(),\n      TG_OP,\n      'subscribers',\n      CASE WHEN TG_OP IN ('INSERT', 'UPDATE') THEN NEW.user_id ELSE OLD.user_id END,\n      now(),\n      current_setting('request.header.x-forwarded-for', true)\n    );\n  END IF;\n  \n  RETURN CASE WHEN TG_OP = 'DELETE' THEN OLD ELSE NEW END;\nEND;\n$$;\n\n-- Security enhancement: Create view that masks sensitive data for non-admin access\nCREATE OR REPLACE VIEW public.v_safe_subscribers AS\nSELECT \n  id,\n  user_id,\n  -- Mask email for non-admins\n  CASE \n    WHEN is_admin() THEN email \n    ELSE CONCAT(LEFT(email, 3), '***@', SPLIT_PART(email, '@', 2))\n  END as email,\n  -- Hide Stripe customer ID for non-admins\n  CASE \n    WHEN is_admin() THEN stripe_customer_id \n    ELSE NULL \n  END as stripe_customer_id,\n  subscribed,\n  subscription_tier,\n  subscription_end,\n  status,\n  plan,\n  trial_ends_at,\n  expires_at,\n  paused,\n  created_at,\n  updated_at\nFROM public.subscribers\nWHERE user_id = auth.uid() OR is_admin();\n\n-- Grant appropriate permissions on the view\nGRANT SELECT ON public.v_safe_subscribers TO authenticated;\nREVOKE ALL ON public.v_safe_subscribers FROM anon, public;\n\n-- Add comment documenting the security measures\nCOMMENT ON TABLE public.subscribers IS 'SENSITIVE DATA: Contains customer emails and Stripe IDs. Access restricted to user''s own data only. Use v_safe_subscribers view for safer access.';\n\nCOMMENT ON VIEW public.v_safe_subscribers IS 'Secure view of subscribers table that masks sensitive data for non-admin users. Preferred for most application use cases.';"}		treenitaastu@gmail.com	\N
20250924094312	{"-- Fix Security Definer View issue by replacing view with SECURITY INVOKER approach\n-- The previous view was flagged as using SECURITY DEFINER which can bypass RLS\n\n-- Drop the problematic view\nDROP VIEW IF EXISTS public.v_safe_subscribers;\n\n-- Create a secure function instead of a view to avoid SECURITY DEFINER issues\nCREATE OR REPLACE FUNCTION public.get_safe_subscriber_info(target_user_id uuid DEFAULT auth.uid())\nRETURNS TABLE(\n  id uuid,\n  user_id uuid,\n  email_masked text,\n  subscription_tier text,\n  subscription_end timestamptz,\n  status text,\n  plan text,\n  trial_ends_at timestamptz,\n  expires_at timestamptz,\n  paused boolean,\n  subscribed boolean,\n  created_at timestamptz,\n  updated_at timestamptz\n)\nLANGUAGE plpgsql\nSECURITY INVOKER  -- Use SECURITY INVOKER instead of DEFINER\nSTABLE\nSET search_path = public\nAS $$\nDECLARE\n  current_user_id uuid;\n  is_user_admin boolean;\nBEGIN\n  current_user_id := auth.uid();\n  \n  -- Check if current user is admin\n  is_user_admin := is_admin();\n  \n  -- Security check: users can only see their own data unless admin\n  IF current_user_id IS NULL THEN\n    RETURN;\n  END IF;\n  \n  IF target_user_id != current_user_id AND NOT is_user_admin THEN\n    RETURN;\n  END IF;\n  \n  -- Return data with appropriate masking\n  RETURN QUERY\n  SELECT \n    s.id,\n    s.user_id,\n    -- Mask email for non-admins\n    CASE \n      WHEN is_user_admin THEN s.email \n      ELSE CONCAT(LEFT(s.email, 3), '***@', SPLIT_PART(s.email, '@', 2))\n    END as email_masked,\n    s.subscription_tier,\n    s.subscription_end,\n    s.status,\n    s.plan,\n    s.trial_ends_at,\n    s.expires_at,\n    s.paused,\n    s.subscribed,\n    s.created_at,\n    s.updated_at\n  FROM public.subscribers s\n  WHERE s.user_id = target_user_id;\nEND;\n$$;\n\n-- Grant execute permission to authenticated users\nGRANT EXECUTE ON FUNCTION public.get_safe_subscriber_info(uuid) TO authenticated;\nREVOKE ALL ON FUNCTION public.get_safe_subscriber_info(uuid) FROM anon, public;\n\n-- Add documentation\nCOMMENT ON FUNCTION public.get_safe_subscriber_info(uuid) IS 'Secure function to retrieve subscriber information with data masking for non-admin users. Uses SECURITY INVOKER to respect RLS policies.';"}		treenitaastu@gmail.com	\N
20250926081419	{"-- Phase 1: Fix Critical Profile Role Privilege Escalation Vulnerability\n-- Create user_roles table for proper role management\n\n-- Create role enum (check if exists first)\nDO $$\nBEGIN\n    IF NOT EXISTS (SELECT 1 FROM pg_type WHERE typname = 'app_role') THEN\n        CREATE TYPE public.app_role AS ENUM ('admin', 'moderator', 'user');\n    END IF;\nEND$$;\n\n-- Create user_roles table\nCREATE TABLE IF NOT EXISTS public.user_roles (\n    id uuid PRIMARY KEY DEFAULT gen_random_uuid(),\n    user_id uuid REFERENCES auth.users(id) ON DELETE CASCADE NOT NULL,\n    role app_role NOT NULL DEFAULT 'user',\n    granted_by uuid REFERENCES auth.users(id),\n    granted_at timestamp with time zone DEFAULT now(),\n    created_at timestamp with time zone DEFAULT now(),\n    updated_at timestamp with time zone DEFAULT now(),\n    UNIQUE (user_id, role)\n);\n\n-- Enable RLS on user_roles\nALTER TABLE public.user_roles ENABLE ROW LEVEL SECURITY;\n\n-- Create security definer function to check roles (prevents RLS recursion)\nCREATE OR REPLACE FUNCTION public.has_role(_user_id uuid, _role app_role)\nRETURNS boolean\nLANGUAGE sql\nSTABLE\nSECURITY DEFINER\nSET search_path = public\nAS $$\n  SELECT EXISTS (\n    SELECT 1\n    FROM public.user_roles\n    WHERE user_id = _user_id\n      AND role = _role\n  )\n$$;\n\n-- Create function to check if user is admin using new system\nCREATE OR REPLACE FUNCTION public.is_admin_secure(_user_id uuid DEFAULT auth.uid())\nRETURNS boolean\nLANGUAGE sql\nSTABLE\nSECURITY DEFINER\nSET search_path = public\nAS $$\n  SELECT COALESCE(public.has_role(_user_id, 'admin'), false)\n$$;\n\n-- Migrate existing admin users from profiles table to user_roles\nINSERT INTO public.user_roles (user_id, role, granted_at)\nSELECT id, 'admin'::app_role, created_at\nFROM public.profiles \nWHERE role = 'admin'\nON CONFLICT (user_id, role) DO NOTHING;\n\n-- Create RLS policies for user_roles table\nDROP POLICY IF EXISTS \\"Users can view own roles\\" ON public.user_roles;\nCREATE POLICY \\"Users can view own roles\\"\nON public.user_roles\nFOR SELECT\nTO authenticated\nUSING (user_id = auth.uid());\n\nDROP POLICY IF EXISTS \\"Admins can view all roles\\" ON public.user_roles;\nCREATE POLICY \\"Admins can view all roles\\"\nON public.user_roles\nFOR SELECT\nTO authenticated  \nUSING (public.has_role(auth.uid(), 'admin'));\n\nDROP POLICY IF EXISTS \\"Admins can manage roles\\" ON public.user_roles;\nCREATE POLICY \\"Admins can manage roles\\"\nON public.user_roles\nFOR ALL\nTO authenticated\nUSING (public.has_role(auth.uid(), 'admin'))\nWITH CHECK (public.has_role(auth.uid(), 'admin'));\n\n-- Remove role update capability from profiles table completely\nDROP POLICY IF EXISTS \\"profiles_update_own\\" ON public.profiles;\nDROP POLICY IF EXISTS \\"profiles_update_own_no_role\\" ON public.profiles;\n\n-- Create restricted policy that excludes role column updates\nCREATE POLICY \\"profiles_update_own_no_role\\"\nON public.profiles\nFOR UPDATE\nTO authenticated\nUSING (id = auth.uid())\nWITH CHECK (id = auth.uid());\n\n-- Add trigger to prevent role changes on profiles table\nCREATE OR REPLACE FUNCTION public.prevent_role_changes()\nRETURNS trigger\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = public\nAS $$\nBEGIN\n  -- Prevent any changes to the role column\n  IF OLD.role IS DISTINCT FROM NEW.role THEN\n    RAISE EXCEPTION 'Role changes not allowed. Use user_roles table instead.';\n  END IF;\n  RETURN NEW;\nEND;\n$$;\n\nDROP TRIGGER IF EXISTS prevent_profile_role_changes ON public.profiles;\nCREATE TRIGGER prevent_profile_role_changes\nBEFORE UPDATE ON public.profiles\nFOR EACH ROW\nEXECUTE FUNCTION public.prevent_role_changes();\n\n-- Update trigger for user_roles\nCREATE OR REPLACE FUNCTION public.set_updated_at_user_roles()\nRETURNS trigger\nLANGUAGE plpgsql\nSET search_path = public\nAS $$\nBEGIN\n  NEW.updated_at = now();\n  RETURN NEW;\nEND;\n$$;\n\nDROP TRIGGER IF EXISTS update_user_roles_updated_at ON public.user_roles;\nCREATE TRIGGER update_user_roles_updated_at\nBEFORE UPDATE ON public.user_roles\nFOR EACH ROW\nEXECUTE FUNCTION public.set_updated_at_user_roles();\n\n-- Update is_admin function to use new secure system\nCREATE OR REPLACE FUNCTION public.is_admin()\nRETURNS boolean\nLANGUAGE sql\nSTABLE\nSET search_path = public\nAS $$\n  SELECT public.is_admin_secure(auth.uid())\n$$;"}		treenitaastu@gmail.com	\N
20250926081528	{"-- Fix remaining security issues from linter\n\n-- Fix functions missing SET search_path\nCREATE OR REPLACE FUNCTION public.ensure_admin_access()\nRETURNS boolean\nLANGUAGE plpgsql\nSTABLE SECURITY DEFINER\nSET search_path = public\nAS $$\nDECLARE\n  current_user_id uuid;\n  is_admin_user boolean := false;\nBEGIN\n  current_user_id := auth.uid();\n  \n  IF current_user_id IS NULL THEN\n    RETURN false;\n  END IF;\n  \n  -- Check using new secure admin function\n  is_admin_user := public.is_admin_secure(current_user_id);\n  \n  -- Also check access overrides as fallback\n  IF NOT is_admin_user THEN\n    SELECT EXISTS(\n      SELECT 1 \n      FROM public.access_overrides \n      WHERE user_id = current_user_id \n        AND (expires_at IS NULL OR expires_at > now())\n    ) INTO is_admin_user;\n  END IF;\n  \n  RETURN COALESCE(is_admin_user, false);\nEND;\n$$;\n\nCREATE OR REPLACE FUNCTION public.validate_admin_action(action_type text)\nRETURNS boolean\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = public\nAS $$\nDECLARE\n  current_user_id uuid;\n  user_email text;\n  is_valid_admin boolean;\nBEGIN\n  current_user_id := auth.uid();\n  \n  IF current_user_id IS NOT NULL THEN\n    SELECT email INTO user_email FROM auth.users WHERE id = current_user_id;\n    \n    -- Enhanced audit logging\n    IF EXISTS (SELECT 1 FROM information_schema.tables WHERE table_name = 'admin_audit_log') THEN\n      INSERT INTO admin_audit_log(user_id, user_email, action_type, attempted_at) \n      VALUES (current_user_id, user_email, action_type, now());\n    END IF;\n  END IF;\n  \n  is_valid_admin := public.ensure_admin_access();\n  \n  RETURN is_valid_admin;\nEND;\n$$;"}		treenitaastu@gmail.com	\N
20250926084020	{"-- Fix v_static_status view to properly calculate current program day per user\nDROP VIEW IF EXISTS v_static_status;\n\nCREATE VIEW v_static_status AS\nWITH user_start_info AS (\n  SELECT \n    ss.user_id,\n    ss.start_monday,\n    -- Calculate days elapsed since start (excluding weekends)\n    CASE \n      WHEN EXTRACT(dow FROM now() AT TIME ZONE 'Europe/Tallinn') IN (0, 6) THEN \n        -- If today is weekend, count to last Friday\n        (SELECT COUNT(*) FROM generate_series(\n          ss.start_monday::date, \n          (now() AT TIME ZONE 'Europe/Tallinn')::date - INTERVAL '1 day' * \n          CASE EXTRACT(dow FROM now() AT TIME ZONE 'Europe/Tallinn')\n            WHEN 0 THEN 1  -- Sunday, go back to Friday\n            WHEN 6 THEN 0  -- Saturday, go back to Friday\n          END, \n          '1 day'\n        ) AS d WHERE EXTRACT(dow FROM d) NOT IN (0, 6))\n      ELSE\n        -- Count workdays from start to today\n        (SELECT COUNT(*) FROM generate_series(\n          ss.start_monday::date, \n          (now() AT TIME ZONE 'Europe/Tallinn')::date, \n          '1 day'\n        ) AS d WHERE EXTRACT(dow FROM d) NOT IN (0, 6))\n    END AS workdays_since_start,\n    -- Current day of week in Tallinn timezone\n    EXTRACT(dow FROM now() AT TIME ZONE 'Europe/Tallinn')::int AS current_day_of_week\n  FROM static_starts ss\n),\nuser_progress AS (\n  SELECT \n    up.user_id,\n    COUNT(DISTINCT up.programday_id) as completed_count,\n    ARRAY_AGG(DISTINCT pd.week ORDER BY pd.week) as completed_weeks,\n    MAX(pd.week) as max_completed_week,\n    MAX(CASE WHEN pd.week = (SELECT MAX(pd2.week) FROM programday pd2 JOIN userprogress up2 ON pd2.id = up2.programday_id WHERE up2.user_id = up.user_id) THEN pd.day ELSE 0 END) as max_completed_day_in_last_week\n  FROM userprogress up\n  JOIN programday pd ON up.programday_id = pd.id\n  GROUP BY up.user_id\n),\nnext_available_day AS (\n  SELECT \n    usi.user_id,\n    usi.start_monday,\n    usi.workdays_since_start,\n    usi.current_day_of_week,\n    -- Calculate which program week and day should be available\n    CASE \n      -- If weekend, allow last Friday's day or next Monday's day\n      WHEN usi.current_day_of_week IN (0, 6) THEN \n        COALESCE(up.max_completed_week, 1)\n      -- If workday, calculate based on workdays elapsed\n      ELSE\n        LEAST(((usi.workdays_since_start - 1) / 5) + 1, 4)\n    END AS current_week,\n    CASE \n      WHEN usi.current_day_of_week IN (0, 6) THEN \n        -- Weekend: allow completing the last available day\n        GREATEST(COALESCE(up.max_completed_day_in_last_week, 1), 1)\n      ELSE\n        -- Workday: calculate current day\n        LEAST(((usi.workdays_since_start - 1) % 5) + 1, 5)\n    END AS current_day,\n    up.completed_count\n  FROM user_start_info usi\n  LEFT JOIN user_progress up ON usi.user_id = up.user_id\n)\nSELECT \n  nad.user_id,\n  true as is_started,\n  'static' as program_type,\n  nad.start_monday,\n  nad.current_week,\n  nad.current_day_of_week,\n  -- Find the actual programday_id for current week/day\n  (SELECT pd.id \n   FROM programday pd \n   WHERE pd.week = nad.current_week \n     AND pd.day = CASE \n       WHEN nad.current_day_of_week IN (0, 6) THEN \n         -- Weekend: find next uncompleted day or current day\n         (SELECT COALESCE(\n           (SELECT MIN(pd2.day) \n            FROM programday pd2 \n            WHERE pd2.week = nad.current_week \n              AND NOT EXISTS (\n                SELECT 1 FROM userprogress up \n                WHERE up.user_id = nad.user_id AND up.programday_id = pd2.id\n              )\n           ),\n           nad.current_day\n         ))\n       ELSE nad.current_day\n     END\n   LIMIT 1) as current_programday_id\nFROM next_available_day nad\nWHERE nad.user_id IS NOT NULL;"}		treenitaastu@gmail.com	\N
20250926085342	{"-- Create training journal table for clients to log their thoughts and experiences\nCREATE TABLE public.training_journal (\n  id UUID NOT NULL DEFAULT gen_random_uuid() PRIMARY KEY,\n  user_id UUID NOT NULL REFERENCES auth.users(id) ON DELETE CASCADE,\n  session_id UUID REFERENCES public.workout_sessions(id) ON DELETE CASCADE,\n  client_program_id UUID REFERENCES public.client_programs(id) ON DELETE CASCADE,\n  title TEXT NOT NULL DEFAULT '',\n  content TEXT NOT NULL DEFAULT '',\n  mood INTEGER CHECK (mood >= 1 AND mood <= 5), -- 1=very bad, 5=excellent\n  energy_level INTEGER CHECK (energy_level >= 1 AND energy_level <= 5),\n  motivation INTEGER CHECK (motivation >= 1 AND motivation <= 5),\n  created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),\n  updated_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now()\n);\n\n-- Enable RLS on training journal\nALTER TABLE public.training_journal ENABLE ROW LEVEL SECURITY;\n\n-- Policies for training journal\nCREATE POLICY \\"Users can view their own journal entries\\" \nON public.training_journal \nFOR SELECT \nUSING (user_id = auth.uid());\n\nCREATE POLICY \\"Users can create their own journal entries\\" \nON public.training_journal \nFOR INSERT \nWITH CHECK (user_id = auth.uid());\n\nCREATE POLICY \\"Users can update their own journal entries\\" \nON public.training_journal \nFOR UPDATE \nUSING (user_id = auth.uid())\nWITH CHECK (user_id = auth.uid());\n\nCREATE POLICY \\"Users can delete their own journal entries\\" \nON public.training_journal \nFOR DELETE \nUSING (user_id = auth.uid());\n\n-- Admins can view all journal entries for client management\nCREATE POLICY \\"Admins can view all journal entries\\" \nON public.training_journal \nFOR SELECT \nUSING (is_admin());\n\n-- Add updated_at trigger\nCREATE TRIGGER update_training_journal_updated_at\nBEFORE UPDATE ON public.training_journal\nFOR EACH ROW\nEXECUTE FUNCTION public.update_updated_at_column();"}		treenitaastu@gmail.com	\N
