t_self\\" ON public.access_overrides\nFOR SELECT USING (user_id = (select auth.uid()));\n\n-- Fix user_entitlements policies\nDROP POLICY IF EXISTS \\"ue_select_self_or_admin\\" ON public.user_entitlements;\nCREATE POLICY \\"ue_select_self_or_admin\\" ON public.user_entitlements\nFOR SELECT USING ((user_id = (select auth.uid())) OR is_admin());\n\nDROP POLICY IF EXISTS \\"ue_admin_write\\" ON public.user_entitlements;\nCREATE POLICY \\"ue_admin_write\\" ON public.user_entitlements\nFOR ALL USING (is_admin()) WITH CHECK (is_admin());\n\n-- Fix user_analytics_events policies\nDROP POLICY IF EXISTS \\"users_can_insert_own_events\\" ON public.user_analytics_events;\nCREATE POLICY \\"users_can_insert_own_events\\" ON public.user_analytics_events\nFOR INSERT WITH CHECK (user_id = (select auth.uid()));\n\nDROP POLICY IF EXISTS \\"users_can_view_own_events\\" ON public.user_analytics_events;\nCREATE POLICY \\"users_can_view_own_events\\" ON public.user_analytics_events\nFOR SELECT USING (user_id = (select auth.uid()));\n\nDROP POLICY IF EXISTS \\"admins_can_view_all_events\\" ON public.user_analytics_events;\nCREATE POLICY \\"admins_can_view_all_events\\" ON public.user_analytics_events\nFOR SELECT USING (is_admin());\n\n-- Fix rpe_history policies\nDROP POLICY IF EXISTS \\"rpe_select_self\\" ON public.rpe_history;\nCREATE POLICY \\"rpe_select_self\\" ON public.rpe_history\nFOR SELECT USING (user_id = (select auth.uid()));\n\nDROP POLICY IF EXISTS \\"rpe_insert_self\\" ON public.rpe_history;\nCREATE POLICY \\"rpe_insert_self\\" ON public.rpe_history\nFOR INSERT WITH CHECK (user_id = (select auth.uid()));\n\nDROP POLICY IF EXISTS \\"rpe_update_self\\" ON public.rpe_history;\nCREATE POLICY \\"rpe_update_self\\" ON public.rpe_history\nFOR UPDATE USING (user_id = (select auth.uid())) WITH CHECK (user_id = (select auth.uid()));\n\n-- Fix training_journal policies\nDROP POLICY IF EXISTS \\"Users can view their own journal entries\\" ON public.training_journal;\nCREATE POLICY \\"Users can view their own journal entries\\" ON public.training_journal\nFOR SELECT USING (user_id = (select auth.uid()));\n\nDROP POLICY IF EXISTS \\"Users can create their own journal entries\\" ON public.training_journal;\nCREATE POLICY \\"Users can create their own journal entries\\" ON public.training_journal\nFOR INSERT WITH CHECK (user_id = (select auth.uid()));\n\nDROP POLICY IF EXISTS \\"Users can update their own journal entries\\" ON public.training_journal;\nCREATE POLICY \\"Users can update their own journal entries\\" ON public.training_journal\nFOR UPDATE USING (user_id = (select auth.uid())) WITH CHECK (user_id = (select auth.uid()));\n\nDROP POLICY IF EXISTS \\"Users can delete their own journal entries\\" ON public.training_journal;\nCREATE POLICY \\"Users can delete their own journal entries\\" ON public.training_journal\nFOR DELETE USING (user_id = (select auth.uid()));\n\nDROP POLICY IF EXISTS \\"Admins can view all journal entries\\" ON public.training_journal;\nCREATE POLICY \\"Admins can view all journal entries\\" ON public.training_journal\nFOR SELECT USING (is_admin());\n\n-- Fix challenge_logs policies\nDROP POLICY IF EXISTS \\"challenge_logs_select_own\\" ON public.challenge_logs;\nCREATE POLICY \\"challenge_logs_select_own\\" ON public.challenge_logs\nFOR SELECT USING (user_id = (select auth.uid()));\n\nDROP POLICY IF EXISTS \\"challenge_logs_insert_own\\" ON public.challenge_logs;\nCREATE POLICY \\"challenge_logs_insert_own\\" ON public.challenge_logs\nFOR INSERT WITH CHECK (user_id = (select auth.uid()));\n\nDROP POLICY IF EXISTS \\"challenge_logs_update_own\\" ON public.challenge_logs;\nCREATE POLICY \\"challenge_logs_update_own\\" ON public.challenge_logs\nFOR UPDATE USING (user_id = (select auth.uid())) WITH CHECK (user_id = (select auth.uid()));\n\nDROP POLICY IF EXISTS \\"challenge_logs_delete_own\\" ON public.challenge_logs;\nCREATE POLICY \\"challenge_logs_delete_own\\" ON public.challenge_logs\nFOR DELETE USING (user_id = (select auth.uid()));\n\n-- Fix user_rewards policies\nDROP POLICY IF EXISTS \\"Users can insert their own rewards\\" ON public.user_rewards;\nCREATE POLICY \\"Users can insert their own rewards\\" ON public.user_rewards\nFOR INSERT WITH CHECK (user_id = (select auth.uid()));\n\nDROP POLICY IF EXISTS \\"user_rewards_select\\" ON public.user_rewards;\nCREATE POLICY \\"user_rewards_select\\" ON public.user_rewards\nFOR SELECT USING ((user_id = (select auth.uid())) OR (EXISTS (\n  SELECT 1 FROM profiles pr\n  WHERE pr.id = (select auth.uid()) AND COALESCE(pr.role, '') = 'admin'\n)));\n\n-- Fix subscribers policies - keep admin and own separate for security\nDROP POLICY IF EXISTS \\"subscribers_select_own_only\\" ON public.subscribers;\nCREATE POLICY \\"subscribers_select_own_only\\" ON public.subscribers\nFOR SELECT USING (user_id = (select auth.uid()));\n\n-- Fix set_logs and exercise_notes policies\nDROP POLICY IF EXISTS \\"sl_select_owner_or_admin\\" ON public.set_logs;\nCREATE POLICY \\"sl_select_owner_or_admin\\" ON public.set_logs\nFOR SELECT USING (EXISTS (\n  SELECT 1 FROM workout_sessions ws\n  WHERE ws.id = set_logs.session_id \n    AND ((ws.user_id = (select auth.uid())) OR is_admin((select auth.uid())))\n));\n\nDROP POLICY IF EXISTS \\"sl_insert_owner_or_admin\\" ON public.set_logs;\nCREATE POLICY \\"sl_insert_owner_or_admin\\" ON public.set_logs\nFOR INSERT WITH CHECK (EXISTS (\n  SELECT 1 FROM workout_sessions ws\n  WHERE ws.id = set_logs.session_id \n    AND ((ws.user_id = (select auth.uid())) OR is_admin((select auth.uid())))\n));\n\nDROP POLICY IF EXISTS \\"en_select_owner_or_admin\\" ON public.exercise_notes;\nCREATE POLICY \\"en_select_owner_or_admin\\" ON public.exercise_notes\nFOR SELECT USING (EXISTS (\n  SELECT 1 FROM workout_sessions ws\n  WHERE ws.id = exercise_notes.session_id \n    AND ((ws.user_id = (select auth.uid())) OR is_admin((select auth.uid())))\n));\n\nDROP POLICY IF EXISTS \\"exercise_notes_insert_own\\" ON public.exercise_notes;\nCREATE POLICY \\"exercise_notes_insert_own\\" ON public.exercise_notes\nFOR INSERT WITH CHECK (user_id = (select auth.uid()));\n\nDROP POLICY IF EXISTS \\"exercise_notes_update_own\\" ON public.exercise_notes;\nCREATE POLICY \\"exercise_notes_update_own\\" ON public.exercise_notes\nFOR UPDATE USING (user_id = (select auth.uid())) WITH CHECK (user_id = (select auth.uid()));\n\nDROP POLICY IF EXISTS \\"exercise_notes_delete_own\\" ON public.exercise_notes;\nCREATE POLICY \\"exercise_notes_delete_own\\" ON public.exercise_notes\nFOR DELETE USING (user_id = (select auth.uid()));\n\n-- Fix rest_timers policies\nDROP POLICY IF EXISTS \\"pt_resttimers_all\\" ON public.rest_timers;\nCREATE POLICY \\"pt_resttimers_all\\" ON public.rest_timers\nFOR ALL USING (user_id = (select auth.uid())) WITH CHECK (user_id = (select auth.uid()));\n\n-- Fix template policies\nDROP POLICY IF EXISTS \\"td_select_admin\\" ON public.template_days;\nCREATE POLICY \\"td_select_admin\\" ON public.template_days\nFOR SELECT USING (is_admin((select auth.uid())));\n\nDROP POLICY IF EXISTS \\"ti_select_admin\\" ON public.template_items;\nCREATE POLICY \\"ti_select_admin\\" ON public.template_items\nFOR SELECT USING (is_admin((select auth.uid())));\n\n-- Fix support system policies\nDROP POLICY IF EXISTS \\"Users can view own conversations\\" ON public.support_conversations;\nCREATE POLICY \\"Users can view own conversations\\" ON public.support_conversations\nFOR SELECT USING (user_id = (select auth.uid()));\n\nDROP POLICY IF EXISTS \\"Users can create conversations\\" ON public.support_conversations;\nCREATE POLICY \\"Users can create conversations\\" ON public.support_conversations\nFOR INSERT WITH CHECK (user_id = (select auth.uid()));\n\nDROP POLICY IF EXISTS \\"Users can update own conversations\\" ON public.support_conversations;\nCREATE POLICY \\"Users can update own conversations\\" ON public.support_conversations\nFOR UPDATE USING (user_id = (select auth.uid())) WITH CHECK (user_id = (select auth.uid()));\n\nDROP POLICY IF EXISTS \\"Users can send messages in own conversations\\" ON public.support_messages;\nCREATE POLICY \\"Users can send messages in own conversations\\" ON public.support_messages\nFOR INSERT WITH CHECK ((sender_id = (select auth.uid())) AND (is_admin = false) AND (EXISTS (\n  SELECT 1 FROM support_conversations sc\n  WHERE sc.id = support_messages.conversation_id AND sc.user_id = (select auth.uid())\n)));\n\nDROP POLICY IF EXISTS \\"Users can view messages in own conversations\\" ON public.support_messages;\nCREATE POLICY \\"Users can view messages in own conversations\\" ON public.support_messages\nFOR SELECT USING (EXISTS (\n  SELECT 1 FROM support_conversations sc\n  WHERE sc.id = support_messages.conversation_id AND sc.user_id = (select auth.uid())\n));\n\nDROP POLICY IF EXISTS \\"Admins can send messages\\" ON public.support_messages;\nCREATE POLICY \\"Admins can send messages\\" ON public.support_messages\nFOR INSERT WITH CHECK (is_admin() AND (sender_id = (select auth.uid())) AND (is_admin = true));\n\n-- PART 3: Consolidate Multiple Permissive Policies (Performance Improvement)\n-- Use the combine_policies function to merge policies for better performance\n\n-- Combine access_overrides policies\nSELECT combine_policies('public', 'access_overrides', 'authenticated', 'r', 'access_overrides_select_combined');\n\n-- Combine profiles policies  \nSELECT combine_policies('public', 'profiles', 'authenticated', 'r', 'profiles_select_combined');\n\n-- Combine client_programs policies\nSELECT combine_policies('public', 'client_programs', 'authenticated', 'r', 'client_programs_select_combined');\nSELECT combine_policies('public', 'client_programs', 'authenticated', 'a', 'client_programs_insert_combined');\nSELECT combine_policies('public', 'client_programs', 'authenticated', 'w', 'client_programs_update_combined');\n\n-- Combine client_days policies\nSELECT combine_policies('public', 'client_days', 'authenticated', 'r', 'client_days_select_combined');\n\n-- Combine client_items policies\nSELECT combine_policies('public', 'client_items', 'authenticated', 'r', 'client_items_select_combined');\n\n-- Combine static_starts policies\nSELECT combine_policies('public', 'static_starts', 'authenticated', 'r', 'static_starts_select_combined');\nSELECT combine_policies('public', 'static_starts', 'authenticated', 'a', 'static_starts_insert_combined');\nSELECT combine_policies('public', 'static_starts', 'authenticated', 'w', 'static_starts_update_combined');\n\n-- Combine subscribers policies\nSELECT combine_policies('public', 'subscribers', 'authenticated', 'r', 'subscribers_select_combined');\n\n-- Combine support_conversations policies\nSELECT combine_policies('public', 'support_conversations', 'authenticated', 'r', 'support_conversations_select_combined');\nSELECT combine_policies('public', 'support_conversations', 'authenticated', 'w', 'support_conversations_update_combined');\n\n-- Combine support_messages policies\nSELECT combine_policies('public', 'support_messages', 'authenticated', 'r', 'support_messages_select_combined');\n\n-- Update statistics after policy changes\nANALYZE public.profiles;\nANALYZE public.client_programs;\nANALYZE public.client_days;\nANALYZE public.client_items;\nANALYZE public.static_starts;\nANALYZE public.subscribers;\nANALYZE public.user_analytics_events;\nANALYZE public.training_journal;\nANALYZE public.support_conversations;\nANALYZE public.support_messages;"}		treenitaastu@gmail.com	\N
20250927112453	{"-- Create custom habits table for users\nCREATE TABLE public.custom_habits (\n    id UUID DEFAULT gen_random_uuid() PRIMARY KEY,\n    user_id UUID NOT NULL REFERENCES auth.users(id) ON DELETE CASCADE,\n    title TEXT NOT NULL CHECK (char_length(title) <= 100),\n    icon_name TEXT NOT NULL DEFAULT 'CheckCircle' CHECK (char_length(icon_name) <= 50),\n    is_active BOOLEAN NOT NULL DEFAULT true,\n    sort_order INTEGER NOT NULL DEFAULT 0,\n    created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),\n    updated_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),\n    \n    CONSTRAINT unique_user_habit_title UNIQUE(user_id, title)\n);\n\n-- Enable RLS\nALTER TABLE public.custom_habits ENABLE ROW LEVEL SECURITY;\n\n-- RLS policies for custom habits\nCREATE POLICY \\"Users can manage their own custom habits\\"\nON public.custom_habits\nFOR ALL\nUSING (user_id = auth.uid())\nWITH CHECK (user_id = auth.uid());\n\n-- Trigger for updated_at\nCREATE TRIGGER update_custom_habits_updated_at\n    BEFORE UPDATE ON public.custom_habits\n    FOR EACH ROW\n    EXECUTE FUNCTION public.update_updated_at_column();\n\n-- Add index for performance\nCREATE INDEX idx_custom_habits_user_id ON public.custom_habits(user_id);\nCREATE INDEX idx_custom_habits_user_active ON public.custom_habits(user_id, is_active);\n\n-- Insert some default habits for new users (these will be customizable)\n-- We'll handle this in the application code when users first visit"}		treenitaastu@gmail.com	\N
20250927090052	{"-- Update articles with proper Estonian content, authors, and mobile optimization\n\n-- 1. Update articles with missing content and improve Estonian language\n\n-- Stress article - Author: Henri Kraavi (füsioterapeut)\nUPDATE articles \nSET \n  content = '# Lihtne hingamise tehnika stressi leevendamiseks\n\nStress on kaasaegne katk, mis mõjutab igapäevaselt miljoneid inimesi. Õnneks on üks kõige tõhusam vahend stressiga toimetulekuks täiesti tasuta ja alati saadaval - õige hingamine.\n\n## Miks hingamine toimib?\n\nKui me elame stressi all, muutub meie hingamine pinnaliseks ja kiiremaks. See hoiab kehade \\"võitle või põgene\\" seisundis aktiivsena. Sügav ja aeglane hingamine aktiveerib aga parasümpaatilise närvisüsteemi - see on meie keha loomuliku rahustavai süsteem.\n\n## Tehnika samm-sammult\n\n**1. Samm: Valmistamine**\n- Istu mugavalt toolil või seisa sirgena\n- Aseta üks käsi rinnale, teine kõhule\n- Sule silmad või vaata rahulikult ette\n\n**2. Samm: Hingamise rütm**\n- Hinga sisse nina kaudu 4 sekundit\n- Hoia hinge kinni 2 sekundit  \n- Hinga välja suukaudu 6 sekundit\n- Korda seda 3 korda\n\n**3. Samm: Keskendumise**\n- Tunneta, kuidas kõhul olev käsi tõuseb sissehingamisel\n- Lase õlgadel langeda väljahingamisel\n- Kui mõtted hajuvad, suuna tähelepanu tagasi hingamisele\n\n## Millal kasutada?\n\n- **Hommikul** - päeva rahulikuks alustamiseks\n- **Tööpausides** - pingete leevendamiseks\n- **Enne olulist sündmust** - närvilisuse vähendamiseks\n- **Õhtul** - parem uni\n\n## Teaduslik taust\n\nUuringud näitavad, et kontrollitud hingamine:\n- Vähendab stressi hormooni kortisool taset 45% võrra\n- Aeglustab südamepulssi juba 60 sekundi jooksul\n- Parandab tähelepanu ja keskendumist\n- Tugevdab immuunsüsteemi\n\n## Järgmised sammud\n\nAlusta ühe korra päevas. Kui tunned, et tehnika on omandatud, kasuta seda iga kord, kui märkad stressitekkimist. Meenuta - järjepidevus on olulisem kui täiuslikkus.',\n  author = 'Henri Kraavi, füsioterapeut',\n  read_time_minutes = 4\nWHERE slug = '3-rahulikku-hingetoummet-toolil';\n\n-- Work ergonomics article - Author: Henri Kraavi (füsioterapeut)  \nUPDATE articles \nSET \n  content = '# Ekraani õige asend - lihtne muudatus, suur mõju\n\nEnamik meist veedab ekraani ees 6-8 tundi päevas, kuid harvad teavad, et vale ekraani asend võib põhjustada kroonilisi kaela- ja õlavalud.\n\n## Probleem, mida me ei märka\n\nKui ekraan on liiga madal, painutame me kaela pidevalt alla. See tekitab pinget kaelalihastesse ja võib põhjustada:\n- Pingsust kaela tagaosas\n- Õlgade tõusmist\n- Peavalu õhtu poole\n- Silmade väsimust\n\n## Õige seadistus sammhaaval\n\n**1. Ekraani kõrgus**\n- Ekraani ülemine serv peab olema silmade kõrgusel või veidi allpool\n- Vaatekaugus 50-70 cm (sirutatud käe pikkus)\n- Ekraan täisnurga all - mitte kaldu\n\n**2. Istumise asend**\n- Jalad kindlalt põrandal (kasuta vajaduse korral jalaaluust)\n- Selg toetub toolile\n- Käed 90-kraadise nurga all klaviatuuri juures\n\n**3. Sülearvuti kasutajatele**\n- Kasuta eraldi klaviatuuri ja hiirt\n- Tõsta sülearvuti raamatute või spetsiaalse aluse abil kõrgemale\n- Väldi pikka tööd sülearvutiga ilma täiendavate vahenditeta\n\n## Kiired parandused täna\n\n**Kodus:**\n- Virna raamatud ekraani alla\n- Reguleeri tooli kõrgust\n- Aseta ekraan akna vastas peegelduste vältimiseks\n\n**Kontoris:**\n- Palu IT-tugiliikmelt monitorikätt\n- Kasuta reguleeritavat monitori alustu\n- Seadista ekraani kallutus 10-20 kraadi tahapoole\n\n## 20-20-20 reegel\n\nIga 20 minuti järel:\n- Vaata 20 sekundit\n- Midagi, mis on vähemalt 20 meetri kaugusel\n- See annab silmadele puhkuse ja vähendab pingeid\n\n## Märguanded, millal muutused on vajalikud\n\n- Kaelale tuleb tihti käega toetamine\n- Õhtul on õlad pinges\n- Tekib korrapärane peavalu\n- Silmad on kuivad või sügelevad\n\n## Pikaajalised kasu\n\nÕige ekraani asend:\n- Vähendab kaelalihaste pinget 60% võrra\n- Parandab töö produktiivsust\n- Vähendab krooniliste valuedene arengut\n- Parandab meeleolu ja energia taset',\n  author = 'Henri Kraavi, füsioterapeut',\n  read_time_minutes = 5\nWHERE slug = 'ekraan-silmade-korgusele';\n\n-- Neck pain article - Author: Henri Kraavi (füsioterapeut)\nUPDATE articles \nSET \n  content = '# Kaelavalu korral - liikumine, mitte jäikus\n\nKaelavalu korral on loomulik instinkt hoida kaela täiesti paigal. Tegelikult võib see olukorda halvendada. Õrnad liigutused aitavad kiiremini paranemise.\n\n## Miks liikumine aitab?\n\nVale uskumus on, et valu korral peab hoida kaetud kohta täiesti liikumatu. Tegelikult:\n\n**Liikumine parandab:**\n- Vereringe kaetud alal\n- Lihaste elastsust\n- Toitainete jõudmist koeudesse\n- Jäikuse ja krahmi vähenemist\n\n**Liikumatus halvendab:**\n- Lihased muutuvad jäigaks\n- Vereringe aeglustub\n- Valu võib püsida kauem\n- Liikuvusel piirangle suureneb\n\n## Õrnad harjutused päevaks\n\n**Hommikul (5 minutit):**\n\n1. **Aeglase kaela pöörused**\n   - Pööra pead aeglaselt paremale (5 sek)\n   - Tagasi keskele\n   - Pööra vasakule (5 sek)\n   - Korda 3 korda\n\n2. **Pea kaldutamine**\n   - Kalduta pead ettevaatlikult vasakule õlale\n   - Hoia 10 sekundit\n   - Tagasi keskele, siis paremale\n   - Korda 3 korda mõlemale poole\n\n**Päeva jooksul (iga 2 tunid):**\n\n3. **Õlgade tõstmine**\n   - Tõsta mõlemad õlg aeglaselt üles\n   - Hoia 5 sekundit\n   - Lase aeglaselt alla\n   - Korda 5 korda\n\n## Millal mitte liigutada\n\n**Peate koheselt:**\n- Tugev valu, mis ei lase magada\n- Kätes tuimenemine või torkivad tunnetus\n- Peavalu koos iiveldusega\n- Palaviku olemasolu\n\n## Lisaabinõud\n\n**Soojendamine:**\n- Soe dušš 10 minutit\n- Soe kompress 15 minutit\n- Põgujõhv massees\n\n**Vältyda:**\n- Järsked liigutused\n- Rasket kott ühe õla peal kandmine\n- Pikk ekraani vaatamine (ilma pausindeta)\n- Matta äärne magamine\n\n## Millal pöörduda arsti poole?\n\n- Valu kestab üle 5 päeva\n- Valu kiirgub kätte\n- Tekib käte nõrkust\n- Peavalu muutub tugevamaks\n\n## Ennetamine tulevikuks\n\n- Hoia ekraan silmade kõrgusel\n- Tee regulaarselt kaelaharjutusi\n- Kasuta ergonoomlise padjast\n- Väldi äkilisi pea liigutusi\n\nMeenuta: valu on signaale, kuid kerge liikumise valu ei tohiks oluliselt suurendada. Kuula oma keha ja ära sunni.',\n  author = 'Henri Kraavi, füsioterapeut',\n  read_time_minutes = 4\nWHERE slug = 'orn-liigutamine-parem-kui-taielig-puhkus';\n\n-- Back pain walking article - Author: Henri Kraavi (füsioterapeut)\nUPDATE articles \nSET \n  content = '# 5-10 minutit kõndimist päevas - selgroole terviseks\n\nSeljavalu on tihti seotud liiga pika istumisega. Lihtsa lahendus võib olla lihtsam, kui arvada - regulaarne lühike kõnd.\n\n## Miks istumine kahjustab selga?\n\nPikk istumine:\n- Nõrgestab kerekeskme lihases (sügavaid kõhu- ja seljalihased)\n- Lühendab puusa painutaja lihases\n- Paneb selgroo ebaloomuliku kõveruse\n- Vähendab ketaste toitumus\n\n## Kuidas kõnd aitab?\n\n**Lihastore aktiveerimine:**\nKõndomise käigus aktiveeruvad automaatselt:\n- Sügavaid kõhulihased (transversus abdominis)\n- Väikese seljalihastest (multifidus)\n- Põhjalihased\n- Diafragma\n\nNeed lihased töötavad koos, moodustades loomuliku tugivöö selgroole.\n\n**Ketaste toitumus:**\nSelgrooketastel puuduvad veresooned. Nad saavad toitaines ainult liikumise kaudu - kui asetub ja lahenus rõhk ketastele.\n\n## Praktilise juhend\n\n**Millal kõndida:**\n- Iga 2 tunni järel 5-10 minutit\n- Pärast pikka istumist\n- Hommikul ärkamise järel\n- Lõunapausil\n\n**Kuidas kõndida:**\n- Rahulik tempo - ei pea kiirustama\n- Sirge selg, mitte ettepoole kummartunud\n- Loomulik sammu pikkus\n- Hingamise vaba ja sügav\n\n**Kus kõndida:**\n- Kontoris edasi-tagasi\n- Trepis üles-alla\n- Väljas - värske õhk lisabonus\n- Isegi kodus toast tuppa\n\n## Märguandest, et liikumine aitab\n\nEnamik inimeste märkavad jaba esimalese nädala jooksul:\n- Seljavalu väheneb\n- Istumise on mugavam\n- Parem tuju ja energia\n- Ununemist üldine jäikus\n\n## Täiendavad näpunäited\n\n**Töö juures:**\n- Määra telefon (alarm 2 tunni järel)\n- Tee kõnd osa koosolekutest (kui võimalik)\n- Kasuta trenistada kaugemale parkimist\n- Võta lifte asemel trepid\n\n**Kõndimi teksti:**\n- Alusta väikeses - 5 minutit piisab\n- Järlepidevuse on olulisem kui intensiivsus\n- Ära muretseepikkuse üle, keskenduma regulaarsustele\n- Kui selg valutab, kõndimise võib valu leevendada\n\n## Millal olla ettevaatlik\n\n**Väldi kõndimist, kui:**\n- Valu kiirgub jalgadesse\n- Jalgtanud tuimenemine\n- Kõndite põhjustab tugevust valu\n\nSellisel juhtumil pöörduge füsioterapeudi või arsti poole.\n\n## Teadustlik taust\n\nUuringud on näidanud:\n- 30 minutit kõndimist 5 päeval nädalas vähendab seljavalu riski 28%\n- Regulaarne kerge liikumine ennetab ketas degeneratsiooni\n- Kõndomise on üks tõhusaim viis kerekeskme tugevdamiseks\n\nAlusta juba täna - sinu selgroog tänab sind!',\n  author = 'Henri Kraavi, füsioterapeut',\n  read_time_minutes = 5\nWHERE slug = 'igapaevane-kond-5-10-min';\n\n-- Exercise article - Author: Henri Leetma (treener)\nUPDATE articles \nSET \n  content = '# Kaks harjutust, mis säilitavad lihasmassi\n\nPeale 30. eluaastat kaotame lihases keskmiselt 3-8% kümnendi kohta. Kahe lihtsa harjutusega saab selle protsessii märkimisväärselt aeglustada.\n\n## Miks just kükid ja lükked?\n\nNeed on **liitharjutused** - nad kaasavad korraga mitmeid suur lihasgruppe:\n\n**Kükid aktiveerivad:**\n- Reielihases (quadriceps, hamstrings)\n- Tuharalihased (glutes)\n- Kerekeskme lihases\n- Säärelihases stabilisaatori\n\n**Lükked aktiveerivad:**\n- Rindalihases\n- Õlalihases\n- Käsivarsi tagumisi\n- Kerekeskme stabilisaatori\n\n## Õige kükki tehnika\n\n**Algseis:**\n- Jalg õlgade laiuses\n- Varbad veidi väljapoole\n- Keha kaal kande keskossa\n- Vaata otse ette\n\n**Liikuvus:**\n1. Alusta liigutust puusa tagapoole lükkamisega\n2. Lase põlved järgneda - nad liiguvad varbaste suunas\n3. Laskuge, kuni reied on põrandaga paralleelselt\n4. Tugev vajutamine kandadelt - tagasi üles\n\n**Levinud vead:**\n- Põlved liiguvad sisse poole\n- Kannast kaal varbaste osale\n- Selg kummardub liiga palju ette\n\n## Õige lügede tehnika\n\n**Põrandalt (raske variant):**\n- Käed õlgade laiuses\n- Kehakandidaat kanne sirge joon\n- Lase rind põrandasilma\n- Tugev lüke tagasi üles\n\n**Põlvedelt (kergem variant):**\n- Sama nagu põrandalt, kuid toetu põlvedele\n- Hoia keha sirge päast põlvedeni\n- Keskenduma aeglasele liigutusele\n\n**Vaid altpoolt (kõige kergem):**\n- Käed seinal\n- Seisa kaugemal seinal\n- Lükka ennast seinal vasi ja tagasi\n\n## Treeningkava algajatedele\n\n**Näd 1-2:**\n- Kükid: 2 seerias x 8 kordust\n- Lükked: 2 seerias x 5-8 kordust\n- Puhkus seeriad vahele: 1-2 minutit\n- Sagedus: 3 korda nädalas\n\n**Näd 3-4:**\n- Kükid: 3 seeriad x 8-12 kordust\n- Lükked: 3 seeriad x 6-10 kordust\n- Puhkus: 1-2 minutit\n- Sagedus: 3 korda nädalas\n\n**Edasijõudnutele:**\n- Lisa raskes (seljakott, hantelad)\n- Suurenda kordusicohti\n- Lae variantse (hüpe kükid, diamond lükked)\n\n## Progressioori näpunäited\n\n**Kükide raskendamiseks:**\n- Hoia käed rindel (rist)\n- Kasuta seljakotti\n- Tee aeglasemalt (3 sek alla, 1 sek üles)\n- Proovi ühe jalaga kükkil\n\n**Lügede raskendamiseks:**\n- Tõsta jalad toolile\n- Lisa käte alla raskus\n- Muutee kätet positsioon (kitsas, lai)\n- Diamond lükked (käed rombi kujul)\n\n## Milline resultaat oodata?\n\n**2-4 nädala pärast:**\n- Parem jõud igapäevaste toimetustest\n- Tugev kerekeskme\n- Parem ryhtu\n\n**2-3 kuu pärast:**\n- Märgatav lihasmassi kasvu\n- Paremat luude tihedus\n- Kiirelema aineivahetusel\n\n## Sagedasemid küsimused\n\n**Kui tihti treeni?**\n3 korda nädalas on optimaalne. Ütlemage ja raskendamist vahele puhkusepäeva.\n\n**Kas see piisab?**\nLihasmassi säilitamiseks jah. Suurema massi kasvu saavutamiseks on vaja rohkem harjutusi ja raskust.\n\n**Millal lisada raskust?**\nKui suudad teha 12+ kordust kergelt.\n\nAlusta täna - sinu 50-aasta vanuse kehass tänab sind!',\n  author = 'Henri Leetma, treener',\n  read_time_minutes = 5\nWHERE slug = 'kaks-lihtsat-jouharjutust-kodus';"}		treenitaastu@gmail.com	\N
20250927090329	{"-- Update remaining articles with improved Estonian, proper authors, and mobile optimization\n\n-- Protein article - Author: Henri Leetma (treener) - fix language and use \\"kere\\" instead of \\"tuumik\\"\nUPDATE articles \nSET \n  content = REPLACE(REPLACE(content, 'tuumik', 'kere'), 'organismis', 'kehas'),\n  author = 'Henri Leetma, treener',\n  read_time_minutes = 4\nWHERE slug = 'proteiini-vajadus-sportimisel';\n\n-- Blue light article - Author: Henri Kraavi (füsioterapeut) - improve content and language\nUPDATE articles \nSET \n  author = 'Henri Kraavi, füsioterapeut',\n  read_time_minutes = 4\nWHERE slug = 'sinise-valguse-moju-unele';\n\n-- Dehydration article - Author: Henri Kraavi (füsioterapeut) - nutrition related but health focused\nUPDATE articles \nSET \n  author = 'Henri Kraavi, füsioterapeut',\n  read_time_minutes = 3\nWHERE slug = 'dehudratsioon-ja-energia';\n\n-- Update evening movement article with better content and author\nUPDATE articles \nSET \n  content = '# 10 minutit õhtust liikumist parema une jaoks\n\nÕhtune ekraaniajane diivanil on muutunud normaalsuseks, kuid lihtsamas 10-minutiline liikumine võib muuta une kvaliteeti märkimisväärselt.\n\n## Probleem, mis meid tabab õhtuti\n\nPärast pikka päeva:\n- Keha on jäik ja lihased pinges\n- Meel on kiire ja rahutud \n- Seedimine on aeglane\n- Stress kogub kehase\n\nSee kõik mõjutab und - raske on magama jääda ja uni pole puhkav.\n\n## Miks liikumine õhtul aitab?\n\n**Füüsiline pool:**\n- Parandab vereringe \n- Lõdvestab pingeid lihases\n- Aitab toitu seedida\n- Valmistab keha puhkuseks ette\n\n**Vaimne pool:**\n- Vähendab stressi hormoone\n- Rahustab närvisüsteemi  \n- Aitab päevast \\"välja lülituda\\"\n- Parandab meeleolu\n\n## 10-minutiline õhtune rutiin\n\n**1. Aeglane jalutuskäik (4 minutit)**\n- Rahulik tempo, ei pea kiirustama\n- Sügav hingamine nina kaudu\n- Vaata ümbrisse, mitte telefoni\n- Kui ilm halb, siis kodus toast tuppa\n\n**2. Kerged venimised (4 minutit)**\n- Kaela pöörused paremale-vasakule (30 sek)\n- Õlgade tõstmine üles-alla (30 sek)  \n- Keha pooleks ette-taha kõigutamine (1 min)\n- Käte sirutamine üle pea (30 sek)\n- Jalga tõstmine ja painutamine (1,5 min)\n\n**3. Hingamisharjutused (2 minutit)**\n- Sügav sissehingamine 4 sekundit\n- Väljahingamine 6 sekundit  \n- Keskenduma hingamise rütmile\n- Lase mõtetel rahulikult voolata\n\n## Millal mitte teha intensiivset treeningut?\n\n**Väldi õhtul (2-3 tundi enne und):**\n- Raskemat jõutreeningut\n- Kiireid jooksmist või jalgrattaga sõitu\n- Võistluslikku sporti\n- Kõike, mis paneb südame kiiresti lööma\n\nNeed tõstavad keha temperatuuri ja äratavad närvisüsteemi, mis teeb magamis jäämise raskemaks.\n\n## Märguandist, et see toimib\n\nJaba esimaste päevade järel märkad:\n- Kiirem magamise jäämine\n- Vähem öiste ärkamiste\n- Parem tuju hommikul\n- Vähem jäikus kehas\n\n## Täiendavad näpunäited\n\n**Aeg:**\n- Alusta 2-3 tundi enne und\n- Ära jäta liiga hilja - keha vajab aega rahunemiseks\n\n**Keskkond:**  \n- Hämar valgus (mitte hele)\n- Värske õhk võimaluse korral\n- Rahulik muusika või vaikus\n\n**Riietus:**\n- Mugavad riided\n- Ei pea olema spordi riides\n- Oluline on mugavus\n\n## Kui see ei aita?\n\nKui peale 2 nädalast katsemine:\n- Uneprobleemid jätkuvad\n- Magamise jäämine on endiselt raske  \n- Ärkad öösiti tihti üles\n\nSiis võib olla tegemist uneapnoe või muu unehäirega. Küsi arsti nõu.\n\n## Teaduslik taust\n\nUuringud on näidanud:\n- Kerge liikumine õhtul parandab une kvaliteeti 23% võrra\n- Vähendab magamise jäämise aega keskmiselt 8 minutit\n- Suurendab sügava une faasi kestust\n\nAlusta jaba täna õhtul - sinu keha ja meel tänavad sind!',\n  author = 'Henri Kraavi, füsioterapeut',\n  read_time_minutes = 4\nWHERE slug = '10-min-ohtul-loeb';\n\n-- Update screen-free hour article with better author\nUPDATE articles \nSET \n  author = 'Henri Kraavi, füsioterapeut',\n  read_time_minutes = 3\nWHERE slug = 'ekraanivaba-tund-enne-und';\n\n-- Update protein article with better Estonian and proper content structure\nUPDATE articles \nSET \n  content = '# Valkude vajadus sportlastel - teaduslik lähenemis\n\nValk on lihasmassi ehitusmaterjal ja taastumise alus. Sportijate vajadused on tavainseedlüe vastast märkimisväärselt kõrgemad.\n\n## Valkude vajadus erinud sporti abil\n\n**Vastupidavussport** (jooksmine, ujumine, jalgrattasõit):\n- 1,2-1,4 g/kg kehakaalust päevas\n- Aitab lihasmassi säilitada pikka treeningute korral\n\n**Jõutreening** (raskustega treenimine):\n- 1,6-2,2 g/kg kehakaalust päevas  \n- Toetab lihasmassi kasvatamise ja taastumist\n\n**Meeskondi sport** (jalgpall, korvpall, tennis):\n- 1,4-1,7 g/kg kehakaalust päevas\n- Kombinatsioon vastupidavuse- ja jõunõuetset\n\n**Tavaline aktiivne inimene:**\n- 1,0-1,2 g/kg kehakaalust päevas\n- Põhivajaduse katmiseks\n\n## Parimad valguallikad sportlastele\n\n**Kiire imendumine (treeningut järel):**\n- Valkupulber vadaku või piimaga\n- Kreeka jogurt\n- Munad \n- Kala\n\n**Aeglane imendumine (enne und):**\n- Kaseiinvalk\n- Toorjuust\n- Pähklid\n- Linnuliha\n\n**Taimse valkud:**\n- Kaunviljad (oad, läätsed, kikerhernes)\n- Pähklid ja seemned\n- Quinoa\n- Tofuse ja tempeh\n\n## Ajakava optimaalse valkude tarbimiseks\n\n**Hommik:**\n- 25-30g valku esimalese tunni jooksul\n- Näide: 2 muna + slice leimavas\n\n**Treeningut eel (1-2 tundi):**\n- 15-20g kergesti seeduva valku\n- Näide: banaan + valkupulber\n\n**Treeningut järel (30 min jooksul):**\n- 30-45g kõrge kvaliteediga valku\n- Näide: valkupulber + süsivesikud\n\n**Õhtu:**\n- 20-25g aeglasese imendumisega valku\n- Näide: toorjuustase või kaseiinvalk\n\n## Praktilise näpunaid\n\n**Valkude kogused tavatoidus:**\n- 100g kanarinna ≈ 23g valku\n- 1 suur muna ≈ 6g valku\n- 1 klaass piima ≈ 8g valku  \n- 30g mandleid ≈ 6g valku\n- 100g lõheast ≈ 25g valku\n\n**Kas valkupulber on vajalik?**\nEi ole kohustuslik, kuid abistab kui:\n- Raske saada piisavalt valku toidust\n- Vajad kiiret valku treeningut järel  \n- Reisid palju\n- Oled taimetoitlane\n\n## Märguansid liigase valkude tarbimist\n\n**Üle 3g/kg kehakaalust:**\n- Ei anna lisahüvest\n- Koormab neere ja maksa\n- Võib tekitada seedimisprobleeme\n- Kasulike raiskamist\n\n## Erialuseid sportlased\n\n**Naissoost sportlased:**\n- Sama grammise vajadus kg kohta\n- Tähelepanu kalgiumile ja raudale\n- Hormoonalde tööringe toetamine\n\n**Nooruk sportlased:**\n- Vajadus kuni 2,4 g/kg\n- Kasvamise toetamines\n- Kualiteetne toid eelistatavam \n\n**Veteran sportlased (50+):**\n- Kuni 2,0 g/kg vanusega seotud lihasmassi käo tõkestamiseks\n- Aminohavade täielikkus oluline\n\n## Kokkuvõte\n\nÕige valkude tarbimine:\n- Toetab treeningut eesmärke\n- Kiirendab taastumist\n- Säilitab tervislikku kehakoostist\n- Parandab športi tulemusi\n\nAlusta täna - planeeri oma valkude tarbimine ette ning jälgigaa regulaarsust!',\n  author = 'Henri Leetma, treener',\n  read_time_minutes = 5\nWHERE slug = 'proteiini-vajadus-sportimisel';\n\n-- Update plank article - need to add content first\nUPDATE articles \nSET \n  content = '# Plank - üks harjutus, mis tugevdab kogu kere\n\nPlank on üks tõhusaim harjutus kerekeskme tugevdamiseks. Lihtne teha, kuid uskumatult efektiivne kui tehnika on õige.\n\n## Miks plank on nii tõhus?\n\nPlank aktiveerib korraga:\n- **Sügavaid kõhulihases** - toetavad selgroog sisemiselt\n- **Seljalihas** - hoidavad ryhtu\n- **Õlalihas ja rindalihases** - stabiliseerivad ülemist keha  \n- **Tuharalihases** - toetavad puusa\n\nSee töötamist koos loob tugeva \\"korsetil\\" selgroole.\n\n## Õige planki tehnika\n\n**Algseis:**\n- Käed õlgade all, randmed sirged\n- Varbastu toetu põrandale  \n- Keha moodustab sirge joone päast kandadeni\n- Vaata alla põrandale\n\n**Õige asend:**\n1. **Kerekeskmes** - pinguta kõhulihases nagu keegi plaanib sulle kõhtu lüüa\n2. **Puusad** - ei tohi rippuda alla ega tõusta üles\n3. **Õlad** - otse käte kohal, mitte ette või taha\n4. **Pea** - neutraalses asendis, kael sirge\n\n## Levinud vead ja kuidas neid vältida\n\n**Vale puusa asend:**\n- ❌ Puusad ripavad alla → seljavalu\n- ❌ Puusad liiga kõrgel → vähem tööd kerekeskmele\n- ✅ Sirge joon päast kandadeni\n\n**Vale õlgade asend:**\n- ❌ Õlad ette või taha → käsivarsi väsimus\n- ✅ Õlad otse käte kohal\n\n**Vale hingamine:**\n- ❌ Hingewekiire ja pinda\n- ✅ Sügav ja rahuliku hingamine\n\n## Progressioon algajastele\n\n**Nädal 1-2: Põlvedelt plank**\n- Toeta põlvedele, mitte varbastele\n- Hoia 15-30 sekundit\n- 3 seeriat\n- Keskenduma tehnikale\n\n**Nädal 3-4: Täis plank**\n- Varbastelest toetu\n- Hoia 20-45 sekundit  \n- 3 seeriat\n- Järgmiseks päevaks pauzi\n\n**Nädal 5+: Progressioon**\n- Suurenda hoidmise aega\n- Lisa raskust (seljakott)\n- Proovi erinevad planki variandid\n\n## Planki variandid\n\n**Külgplank:**\n- Ühele kyljele pööramiset\n- Tugev kõrvalihas tööks\n- Hoia 15-30 sekundit mõlemal küljel\n\n**Dünaamiline plank:**\n- Tõsta vaheldushti üht kätta\n- Või üht jalga\n- Lisab koordinatsiooni element\n\n**Ülematanty plank:**\n- Käed sirged, mitte küünarnukkidel\n- Raskema variant\n- Hoia sirge keha asend\n\n## Kui kaua hoida planki?\n\n**Algajad:** 15-30 sekundit, fookus tehnikale\n**Kesktase:** 45-90 sekundit, 2-3 seeriat\n**Edasijõudnud:** 2+ minutit või raskemad variandid\n\nOluline: kvaliteet on olulisem kui aeg. Parem 30 sekundit õige tehnikaga kui 2 minutit vale asendis.\n\n## Millal planki teha?\n\n- **Treening eel** - kerekeskme aktiveerimine\n- **Treening lõpus** - tugevdamine\n- **Kodusse** - igakordsel\n- **Hommikul** - päeva energiliseks alustamiseks\n\n## Märguandid õigest tehnikast\n\nÕige plank võiks tunda:\n- Kerget põletamine kõhulihastelles\n- Stabiilsus kogu kehas  \n- Kontrollitud hingaminet\n- Keskendunnat ööde\n\nVale plank põhjustab:\n- Valu selinad või kaelas\n- Liiga palju rasksust käsivartelles\n- Ebamugavus  \n- Hingamise raskused\n\n## Teaduslik taust\n\nUuringud näitavad:\n- Plank aktiveerib sügavaid kõhulihases 2-3 korda rohkem kui tavalised kõhu harjutused\n- Regulaarne plank (3x nädalas) parandab ryhtu 4 nädala jooksul\n- Vähendab seljavalu riski kuni 40%\n\nAlusta täna planki harjutamisega - sinu selgroog tänab sind!',\n  author = 'Henri Leetma, treener',\n  read_time_minutes = 5\nWHERE content LIKE '%Mis on plank?%' OR title LIKE '%plank%' OR slug LIKE '%plank%';\n\n-- If plank article doesn't exist with that pattern, try updating by content pattern\nUPDATE articles \nSET \n  content = '# Plank - üks harjutus, mis tugevdab kogu kere\n\nPlank on üks tõhusaim harjutus kerekeskme tugevdamiseks. Lihtne teha, kuid uskumatult efektiivne kui tehnika on õige.\n\n## Miks plank on nii tõhus?\n\nPlank aktiveerib korraga:\n- **Sügavaid kõhulihases** - toetavad selgroog sisemiselt\n- **Seljalihas** - hoidavad ryhtu\n- **Õlalihas ja rindalihases** - stabiliseerivad ülemist keha  \n- **Tuharalihases** - toetavad puusa\n\nSee töötamist koos loob tugeva \\"korsetil\\" selgroole.\n\n## Õige planki tehnika\n\n**Algseis:**\n- Käed õlgade all, randmed sirged\n- Varbastu toetu põrandale  \n- Keha moodustab sirge joone päast kandadeni\n- Vaata alla põrandale\n\n**Õige asend:**\n1. **Kerekeskmes** - pinguta kõhulihases nagu keegi plaanib sulle kõhtu lüüa\n2. **Puusad** - ei tohi rippuda alla ega tõusta üles\n3. **Õlad** - otse käte kohal, mitte ette või taha\n4. **Pea** - neutraalses asendis, kael sirge',\n  author = 'Henri Leetma, treener',\n  read_time_minutes = 5\nWHERE content LIKE '%plank aktiveerib%' OR content LIKE '%Plank aktiveerib%';"}		treenitaastu@gmail.com	\N
20250928101417	{"-- Create booking_requests table for Google Calendar integration\nCREATE TYPE booking_status AS ENUM ('pending', 'confirmed', 'cancelled', 'completed');\nCREATE TYPE service_type AS ENUM ('initial_assessment', 'personal_program', 'monthly_support');\n\nCREATE TABLE public.booking_requests (\n    id UUID PRIMARY KEY DEFAULT gen_random_uuid(),\n    user_id UUID REFERENCES auth.users(id) ON DELETE CASCADE NOT NULL,\n    service_type service_type NOT NULL,\n    preferred_date TIMESTAMP WITH TIME ZONE NOT NULL,\n    duration_minutes INTEGER NOT NULL DEFAULT 60,\n    status booking_status NOT NULL DEFAULT 'pending',\n    google_event_id TEXT,\n    stripe_payment_intent_id TEXT,\n    client_name TEXT NOT NULL,\n    client_email TEXT NOT NULL,\n    client_phone TEXT,\n    pre_meeting_info JSONB DEFAULT '{}',\n    admin_notes TEXT,\n    created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),\n    updated_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now()\n);\n\n-- Enable RLS\nALTER TABLE public.booking_requests ENABLE ROW LEVEL SECURITY;\n\n-- Policies\nCREATE POLICY \\"Users can view their own bookings\\" \nON public.booking_requests \nFOR SELECT \nUSING (user_id = auth.uid());\n\nCREATE POLICY \\"Users can create their own bookings\\" \nON public.booking_requests \nFOR INSERT \nWITH CHECK (user_id = auth.uid());\n\nCREATE POLICY \\"Users can update their own bookings\\" \nON public.booking_requests \nFOR UPDATE \nUSING (user_id = auth.uid());\n\nCREATE POLICY \\"Admins can view all bookings\\" \nON public.booking_requests \nFOR SELECT \nUSING (is_admin());\n\nCREATE POLICY \\"Admins can update all bookings\\" \nON public.booking_requests \nFOR UPDATE \nUSING (is_admin());\n\n-- Trigger for updated_at\nCREATE TRIGGER update_booking_requests_updated_at\n    BEFORE UPDATE ON public.booking_requests\n    FOR EACH ROW\n    EXECUTE FUNCTION public.update_updated_at_column();"}		treenitaastu@gmail.com	\N
20250928104921	{"-- Phase 1: Enhance client_programs table for smart progression\nALTER TABLE public.client_programs \nADD COLUMN duration_weeks integer DEFAULT 4,\nADD COLUMN auto_progression_enabled boolean DEFAULT true,\nADD COLUMN status text DEFAULT 'active' CHECK (status IN ('active', 'completed', 'archived')),\nADD COLUMN completed_at timestamp with time zone NULL,\nADD COLUMN progression_parameters jsonb DEFAULT '{\n  \\"rpe_target_min\\": 6,\n  \\"rpe_target_max\\": 8,\n  \\"weight_increment_percentage\\": 5,\n  \\"rep_increment\\": 1,\n  \\"consistency_threshold\\": 3\n}'::jsonb;\n\n-- Create index for efficient queries\nCREATE INDEX idx_client_programs_status ON public.client_programs(status);\nCREATE INDEX idx_client_programs_completed_at ON public.client_programs(completed_at);\n\n-- Create a view for program analytics\nCREATE OR REPLACE VIEW public.v_program_progress AS\nSELECT \n  cp.id as program_id,\n  cp.assigned_to as user_id,\n  cp.start_date,\n  cp.duration_weeks,\n  cp.status,\n  cp.completed_at,\n  cp.auto_progression_enabled,\n  -- Calculate weeks elapsed since start\n  CASE \n    WHEN cp.start_date IS NULL THEN 0\n    ELSE CEIL(EXTRACT(EPOCH FROM (COALESCE(cp.completed_at, NOW()) - cp.start_date)) / (7 * 24 * 3600))\n  END as weeks_elapsed,\n  -- Calculate progress percentage\n  CASE \n    WHEN cp.duration_weeks IS NULL OR cp.duration_weeks = 0 THEN 0\n    WHEN cp.start_date IS NULL THEN 0\n    ELSE LEAST(100, ROUND(\n      (EXTRACT(EPOCH FROM (COALESCE(cp.completed_at, NOW()) - cp.start_date)) / (7 * 24 * 3600)) \n      / cp.duration_weeks * 100, 1\n    ))\n  END as progress_percentage,\n  -- Program completion status\n  CASE \n    WHEN cp.status = 'completed' THEN true\n    WHEN cp.start_date IS NULL THEN false\n    ELSE (EXTRACT(EPOCH FROM (NOW() - cp.start_date)) / (7 * 24 * 3600)) >= cp.duration_weeks\n  END as is_due_for_completion\nFROM public.client_programs cp;\n\n-- Create function to analyze RPE and suggest progressions\nCREATE OR REPLACE FUNCTION public.analyze_exercise_progression(\n  p_client_item_id UUID,\n  p_weeks_back INTEGER DEFAULT 1\n)\nRETURNS JSONB\nLANGUAGE plpgsql\nSTABLE\nSECURITY DEFINER\nSET search_path = public\nAS $$\nDECLARE\n  v_avg_rpe NUMERIC;\n  v_session_count INTEGER;\n  v_current_weight NUMERIC;\n  v_current_reps TEXT;\n  v_suggestion JSONB;\n  v_rpe_target_min NUMERIC := 6;\n  v_rpe_target_max NUMERIC := 8;\n  v_weight_increment NUMERIC := 5;\nBEGIN\n  -- Get average RPE for the exercise over the specified weeks\n  SELECT \n    AVG(en.rpe),\n    COUNT(DISTINCT ws.id)\n  INTO v_avg_rpe, v_session_count\n  FROM exercise_notes en\n  JOIN workout_sessions ws ON ws.id = en.session_id\n  WHERE en.client_item_id = p_client_item_id\n    AND en.rpe IS NOT NULL\n    AND ws.started_at >= NOW() - (p_weeks_back || ' weeks')::INTERVAL;\n\n  -- Get current exercise parameters\n  SELECT weight_kg, reps \n  INTO v_current_weight, v_current_reps\n  FROM client_items \n  WHERE id = p_client_item_id;\n\n  -- If not enough data, return no change\n  IF v_avg_rpe IS NULL OR v_session_count < 2 THEN\n    RETURN jsonb_build_object(\n      'action', 'maintain',\n      'reason', 'insufficient_data',\n      'current_weight', v_current_weight,\n      'current_reps', v_current_reps,\n      'avg_rpe', v_avg_rpe,\n      'session_count', v_session_count\n    );\n  END IF;\n\n  -- Analyze and suggest progression\n  IF v_avg_rpe < v_rpe_target_min THEN\n    -- Too easy, increase intensity\n    v_suggestion := jsonb_build_object(\n      'action', 'increase_weight',\n      'reason', 'rpe_too_low',\n      'current_weight', v_current_weight,\n      'suggested_weight', CASE \n        WHEN v_current_weight IS NOT NULL THEN ROUND(v_current_weight * (1 + v_weight_increment/100), 1)\n        ELSE NULL\n      END,\n      'current_reps', v_current_reps,\n      'avg_rpe', ROUND(v_avg_rpe, 1),\n      'session_count', v_session_count\n    );\n  ELSIF v_avg_rpe > v_rpe_target_max THEN\n    -- Too hard, decrease intensity or maintain\n    v_suggestion := jsonb_build_object(\n      'action', 'decrease_weight',\n      'reason', 'rpe_too_high', \n      'current_weight', v_current_weight,\n      'suggested_weight', CASE \n        WHEN v_current_weight IS NOT NULL THEN ROUND(v_current_weight * (1 - v_weight_increment/100), 1)\n        ELSE NULL\n      END,\n      'current_reps', v_current_reps,\n      'avg_rpe', ROUND(v_avg_rpe, 1),\n      'session_count', v_session_count\n    );\n  ELSE\n    -- Perfect range, maintain current intensity\n    v_suggestion := jsonb_build_object(\n      'action', 'maintain',\n      'reason', 'rpe_optimal',\n      'current_weight', v_current_weight,\n      'current_reps', v_current_reps,\n      'avg_rpe', ROUND(v_avg_rpe, 1),\n      'session_count', v_session_count\n    );\n  END IF;\n\n  RETURN v_suggestion;\nEND;\n$$;\n\n-- Create function to auto-progress a program\nCREATE OR REPLACE FUNCTION public.auto_progress_program(p_program_id UUID)\nRETURNS JSONB\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = public\nAS $$\nDECLARE\n  v_program_record RECORD;\n  v_item_record RECORD;\n  v_progression JSONB;\n  v_updates_made INTEGER := 0;\n  v_results JSONB := '[]'::jsonb;\nBEGIN\n  -- Check if program exists and has auto-progression enabled\n  SELECT * INTO v_program_record\n  FROM client_programs \n  WHERE id = p_program_id \n    AND auto_progression_enabled = true \n    AND status = 'active';\n    \n  IF NOT FOUND THEN\n    RETURN jsonb_build_object(\n      'success', false,\n      'reason', 'program_not_found_or_disabled',\n      'updates_made', 0\n    );\n  END IF;\n\n  -- Loop through all exercises in the program\n  FOR v_item_record IN \n    SELECT ci.*, cd.client_program_id\n    FROM client_items ci\n    JOIN client_days cd ON cd.id = ci.client_day_id\n    WHERE cd.client_program_id = p_program_id\n  LOOP\n    -- Analyze progression for this exercise\n    v_progression := analyze_exercise_progression(v_item_record.id, 1);\n    \n    -- Apply progression if suggested\n    IF (v_progression->>'action') = 'increase_weight' AND (v_progression->>'suggested_weight') IS NOT NULL THEN\n      UPDATE client_items \n      SET weight_kg = (v_progression->>'suggested_weight')::NUMERIC\n      WHERE id = v_item_record.id;\n      v_updates_made := v_updates_made + 1;\n    ELSIF (v_progression->>'action') = 'decrease_weight' AND (v_progression->>'suggested_weight') IS NOT NULL THEN\n      UPDATE client_items \n      SET weight_kg = (v_progression->>'suggested_weight')::NUMERIC\n      WHERE id = v_item_record.id;\n      v_updates_made := v_updates_made + 1;\n    END IF;\n    \n    -- Add to results\n    v_results := v_results || jsonb_build_object(\n      'exercise_name', v_item_record.exercise_name,\n      'item_id', v_item_record.id,\n      'progression', v_progression\n    );\n  END LOOP;\n\n  RETURN jsonb_build_object(\n    'success', true,\n    'program_id', p_program_id,\n    'updates_made', v_updates_made,\n    'progressions', v_results\n  );\nEND;\n$$;\n\n-- Create function to complete programs that are due\nCREATE OR REPLACE FUNCTION public.complete_due_programs()\nRETURNS JSONB\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = public\nAS $$\nDECLARE\n  v_completed_count INTEGER := 0;\n  v_program_record RECORD;\nBEGIN\n  -- Find and complete programs that are due\n  FOR v_program_record IN\n    SELECT id, assigned_to, duration_weeks, start_date\n    FROM client_programs\n    WHERE status = 'active'\n      AND start_date IS NOT NULL\n      AND EXTRACT(EPOCH FROM (NOW() - start_date)) / (7 * 24 * 3600) >= duration_weeks\n  LOOP\n    -- Mark program as completed\n    UPDATE client_programs \n    SET \n      status = 'completed',\n      completed_at = NOW()\n    WHERE id = v_program_record.id;\n    \n    v_completed_count := v_completed_count + 1;\n  END LOOP;\n\n  RETURN jsonb_build_object(\n    'completed_programs', v_completed_count,\n    'timestamp', NOW()\n  );\nEND;\n$$;"}		treenitaastu@gmail.com	\N
20250928105051	{"-- Create indexes for efficient queries (if they don't exist)\nCREATE INDEX IF NOT EXISTS idx_client_programs_status ON public.client_programs(status);\nCREATE INDEX IF NOT EXISTS idx_client_programs_completed_at ON public.client_programs(completed_at);\n\n-- Create a view for program analytics\nCREATE OR REPLACE VIEW public.v_program_progress AS\nSELECT \n  cp.id as program_id,\n  cp.assigned_to as user_id,\n  cp.start_date,\n  cp.duration_weeks,\n  cp.status,\n  cp.completed_at,\n  cp.auto_progression_enabled,\n  -- Calculate weeks elapsed since start\n  CASE \n    WHEN cp.start_date IS NULL THEN 0\n    ELSE CEIL(EXTRACT(EPOCH FROM (COALESCE(cp.completed_at, NOW()) - cp.start_date)) / (7 * 24 * 3600))\n  END as weeks_elapsed,\n  -- Calculate progress percentage\n  CASE \n    WHEN cp.duration_weeks IS NULL OR cp.duration_weeks = 0 THEN 0\n    WHEN cp.start_date IS NULL THEN 0\n    ELSE LEAST(100, ROUND(\n      (EXTRACT(EPOCH FROM (COALESCE(cp.completed_at, NOW()) - cp.start_date)) / (7 * 24 * 3600)) \n      / cp.duration_weeks * 100, 1\n    ))\n  END as progress_percentage,\n  -- Program completion status\n  CASE \n    WHEN cp.status = 'completed' THEN true\n    WHEN cp.start_date IS NULL THEN false\n    ELSE (EXTRACT(EPOCH FROM (NOW() - cp.start_date)) / (7 * 24 * 3600)) >= cp.duration_weeks\n  END as is_due_for_completion\nFROM public.client_programs cp;\n\n-- Create function to analyze RPE and suggest progressions\nCREATE OR REPLACE FUNCTION public.analyze_exercise_progression(\n  p_client_item_id UUID,\n  p_weeks_back INTEGER DEFAULT 1\n)\nRETURNS JSONB\nLANGUAGE plpgsql\nSTABLE\nSECURITY DEFINER\nSET search_path = public\nAS $$\nDECLARE\n  v_avg_rpe NUMERIC;\n  v_session_count INTEGER;\n  v_current_weight NUMERIC;\n  v_current_reps TEXT;\n  v_suggestion JSONB;\n  v_rpe_target_min NUMERIC := 6;\n  v_rpe_target_max NUMERIC := 8;\n  v_weight_increment NUMERIC := 5;\nBEGIN\n  -- Get average RPE for the exercise over the specified weeks\n  SELECT \n    AVG(en.rpe),\n    COUNT(DISTINCT ws.id)\n  INTO v_avg_rpe, v_session_count\n  FROM exercise_notes en\n  JOIN workout_sessions ws ON ws.id = en.session_id\n  WHERE en.client_item_id = p_client_item_id\n    AND en.rpe IS NOT NULL\n    AND ws.started_at >= NOW() - (p_weeks_back || ' weeks')::INTERVAL;\n\n  -- Get current exercise parameters\n  SELECT weight_kg, reps \n  INTO v_current_weight, v_current_reps\n  FROM client_items \n  WHERE id = p_client_item_id;\n\n  -- If not enough data, return no change\n  IF v_avg_rpe IS NULL OR v_session_count < 2 THEN\n    RETURN jsonb_build_object(\n      'action', 'maintain',\n      'reason', 'insufficient_data',\n      'current_weight', v_current_weight,\n      'current_reps', v_current_reps,\n      'avg_rpe', v_avg_rpe,\n      'session_count', v_session_count\n    );\n  END IF;\n\n  -- Analyze and suggest progression\n  IF v_avg_rpe < v_rpe_target_min THEN\n    -- Too easy, increase intensity\n    v_suggestion := jsonb_build_object(\n      'action', 'increase_weight',\n      'reason', 'rpe_too_low',\n      'current_weight', v_current_weight,\n      'suggested_weight', CASE \n        WHEN v_current_weight IS NOT NULL THEN ROUND(v_current_weight * (1 + v_weight_increment/100), 1)\n        ELSE NULL\n      END,\n      'current_reps', v_current_reps,\n      'avg_rpe', ROUND(v_avg_rpe, 1),\n      'session_count', v_session_count\n    );\n  ELSIF v_avg_rpe > v_rpe_target_max THEN\n    -- Too hard, decrease intensity or maintain\n    v_suggestion := jsonb_build_object(\n      'action', 'decrease_weight',\n      'reason', 'rpe_too_high', \n      'current_weight', v_current_weight,\n      'suggested_weight', CASE \n        WHEN v_current_weight IS NOT NULL THEN ROUND(v_current_weight * (1 - v_weight_increment/100), 1)\n        ELSE NULL\n      END,\n      'current_reps', v_current_reps,\n      'avg_rpe', ROUND(v_avg_rpe, 1),\n      'session_count', v_session_count\n    );\n  ELSE\n    -- Perfect range, maintain current intensity\n    v_suggestion := jsonb_build_object(\n      'action', 'maintain',\n      'reason', 'rpe_optimal',\n      'current_weight', v_current_weight,\n      'current_reps', v_current_reps,\n      'avg_rpe', ROUND(v_avg_rpe, 1),\n      'session_count', v_session_count\n    );\n  END IF;\n\n  RETURN v_suggestion;\nEND;\n$$;\n\n-- Create function to auto-progress a program\nCREATE OR REPLACE FUNCTION public.auto_progress_program(p_program_id UUID)\nRETURNS JSONB\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = public\nAS $$\nDECLARE\n  v_program_record RECORD;\n  v_item_record RECORD;\n  v_progression JSONB;\n  v_updates_made INTEGER := 0;\n  v_results JSONB := '[]'::jsonb;\nBEGIN\n  -- Check if program exists and has auto-progression enabled\n  SELECT * INTO v_program_record\n  FROM client_programs \n  WHERE id = p_program_id \n    AND auto_progression_enabled = true \n    AND status = 'active';\n    \n  IF NOT FOUND THEN\n    RETURN jsonb_build_object(\n      'success', false,\n      'reason', 'program_not_found_or_disabled',\n      'updates_made', 0\n    );\n  END IF;\n\n  -- Loop through all exercises in the program\n  FOR v_item_record IN \n    SELECT ci.*, cd.client_program_id\n    FROM client_items ci\n    JOIN client_days cd ON cd.id = ci.client_day_id\n    WHERE cd.client_program_id = p_program_id\n  LOOP\n    -- Analyze progression for this exercise\n    v_progression := analyze_exercise_progression(v_item_record.id, 1);\n    \n    -- Apply progression if suggested\n    IF (v_progression->>'action') = 'increase_weight' AND (v_progression->>'suggested_weight') IS NOT NULL THEN\n      UPDATE client_items \n      SET weight_kg = (v_progression->>'suggested_weight')::NUMERIC\n      WHERE id = v_item_record.id;\n      v_updates_made := v_updates_made + 1;\n    ELSIF (v_progression->>'action') = 'decrease_weight' AND (v_progression->>'suggested_weight') IS NOT NULL THEN\n      UPDATE client_items \n      SET weight_kg = (v_progression->>'suggested_weight')::NUMERIC\n      WHERE id = v_item_record.id;\n      v_updates_made := v_updates_made + 1;\n    END IF;\n    \n    -- Add to results\n    v_results := v_results || jsonb_build_object(\n      'exercise_name', v_item_record.exercise_name,\n      'item_id', v_item_record.id,\n      'progression', v_progression\n    );\n  END LOOP;\n\n  RETURN jsonb_build_object(\n    'success', true,\n    'program_id', p_program_id,\n    'updates_made', v_updates_made,\n    'progressions', v_results\n  );\nEND;\n$$;\n\n-- Create function to complete programs that are due\nCREATE OR REPLACE FUNCTION public.complete_due_programs()\nRETURNS JSONB\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = public\nAS $$\nDECLARE\n  v_completed_count INTEGER := 0;\n  v_program_record RECORD;\nBEGIN\n  -- Find and complete programs that are due\n  FOR v_program_record IN\n    SELECT id, assigned_to, duration_weeks, start_date\n    FROM client_programs\n    WHERE status = 'active'\n      AND start_date IS NOT NULL\n      AND EXTRACT(EPOCH FROM (NOW() - start_date)) / (7 * 24 * 3600) >= duration_weeks\n  LOOP\n    -- Mark program as completed\n    UPDATE client_programs \n    SET \n      status = 'completed',\n      completed_at = NOW()\n    WHERE id = v_program_record.id;\n    \n    v_completed_count := v_completed_count + 1;\n  END LOOP;\n\n  RETURN jsonb_build_object(\n    'completed_programs', v_completed_count,\n    'timestamp', NOW()\n  );\nEND;\n$$;"}		treenitaastu@gmail.com	\N
20250928105241	{"-- Fix functions without proper search_path configuration\n\n-- Update trigger functions to have search_path\nCREATE OR REPLACE FUNCTION public.archive_old_conversations()\nRETURNS trigger\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = public\nAS $$\nBEGIN\n  -- Archive previous active conversations for this user\n  UPDATE public.support_conversations\n  SET status = 'archived',\n      updated_at = now()\n  WHERE user_id = NEW.user_id\n    AND status = 'active'\n    AND id != NEW.id;\n  \n  RETURN NEW;\nEND;\n$$;\n\nCREATE OR REPLACE FUNCTION public.set_owner_uid()\nRETURNS trigger\nLANGUAGE plpgsql\nSET search_path = public\nAS $$\nBEGIN\n  IF TG_OP = 'INSERT' AND NEW.user_id IS NULL THEN\n    NEW.user_id := auth.uid();\n  END IF;\n  RETURN NEW;\nEND;\n$$;\n\nCREATE OR REPLACE FUNCTION public.set_updated_at()\nRETURNS trigger\nLANGUAGE plpgsql\nSET search_path = public\nAS $$\nBEGIN\n  NEW.updated_at = now();\n  RETURN NEW;\nEND;\n$$;\n\nCREATE OR REPLACE FUNCTION public.set_updated_at_user_roles()\nRETURNS trigger\nLANGUAGE plpgsql\nSET search_path = public\nAS $$\nBEGIN\n  NEW.updated_at = now();\n  RETURN NEW;\nEND;\n$$;\n\nCREATE OR REPLACE FUNCTION public.set_client_item_order()\nRETURNS trigger\nLANGUAGE plpgsql\nSET search_path = public\nAS $$\nBEGIN\n  IF NEW.order_in_day IS NULL THEN\n    SELECT COALESCE(MAX(order_in_day),0) + 1\n      INTO NEW.order_in_day\n      FROM public.client_items\n     WHERE client_day_id = NEW.client_day_id;\n  END IF;\n  RETURN NEW;\nEND;\n$$;\n\nCREATE OR REPLACE FUNCTION public.set_template_item_order()\nRETURNS trigger\nLANGUAGE plpgsql\nSET search_path = public\nAS $$\nBEGIN\n  IF NEW.order_in_day IS NULL THEN\n    SELECT COALESCE(MAX(order_in_day),0) + 1\n      INTO NEW.order_in_day\n      FROM public.template_items\n     WHERE template_day_id = NEW.template_day_id;\n  END IF;\n  RETURN NEW;\nEND;\n$$;\n\n-- Update utility functions\nCREATE OR REPLACE FUNCTION public.parse_first_int(txt text)\nRETURNS integer\nLANGUAGE plpgsql\nIMMUTABLE\nSET search_path = public\nAS $$\nDECLARE m text;\nBEGIN\n  IF txt IS NULL THEN RETURN NULL; END IF;\n  m := (regexp_match(txt, '(\\\\d+)'))[1];\n  RETURN m::int;\nEXCEPTION WHEN OTHERS THEN\n  RETURN NULL;\nEND;\n$$;\n\nCREATE OR REPLACE FUNCTION public.get_iso_week(date_input timestamp with time zone DEFAULT now())\nRETURNS text\nLANGUAGE plpgsql\nIMMUTABLE\nSET search_path = public\nAS $$\nBEGIN\n  -- Convert to Europe/Tallinn timezone and get ISO week\n  RETURN to_char(date_input AT TIME ZONE 'Europe/Tallinn', 'IYYY-\\"W\\"IW');\nEND;\n$$;\n\nCREATE OR REPLACE FUNCTION public.public_tt_parse_reps_seconds(txt text)\nRETURNS jsonb\nLANGUAGE plpgsql\nSET search_path = public\nAS $$\nDECLARE\n  t text := lower(coalesce(txt,''));\n  v int := null; \n  mm int; ss int;\nBEGIN\n  IF t = '' THEN RETURN NULL; END IF;\n\n  -- mm:ss -> seconds\n  IF position(':' in t) > 0 THEN\n    mm := coalesce(nullif(regexp_replace(t, '^(\\\\d+):\\\\d+$', '\\\\1'), '')::int, 0);\n    ss := coalesce(nullif(regexp_replace(t, '^\\\\d+:(\\\\d+)$', '\\\\1'), '')::int, 0);\n    RETURN jsonb_build_object('seconds', mm*60 + ss);\n  END IF;\n\n  -- \\"30s\\", \\"45 sek\\", \\"45 s\\"\n  IF t ~ '(\\\\d+)\\\\s*(s|sek)\\\\b' THEN\n    v := ((regexp_match(t, '(\\\\d+)'))[1])::int;\n    RETURN jsonb_build_object('seconds', v);\n  END IF;\n\n  -- vahemik -> min, loeme kordusteks\n  IF t ~ '(\\\\d+)\\\\s*[–-]\\\\s*(\\\\d+)' THEN\n    v := ((regexp_match(t, '(\\\\d+)'))[1])::int;\n    RETURN jsonb_build_object('reps', v);\n  END IF;\n\n  -- \\"12x\\", \\"12\\", \\"9 kordust\\", \\"12 korda\\"\n  IF t ~ '(\\\\d+)\\\\s*(x|×|korda|kordust)?\\\\b' THEN\n    v := ((regexp_match(t, '(\\\\d+)'))[1])::int;\n    RETURN jsonb_build_object('reps', v);\n  END IF;\n\n  -- fallback: esimene number -> reps\n  IF t ~ '(\\\\d+)' THEN\n    v := ((regexp_match(t, '(\\\\d+)'))[1])::int;\n    RETURN jsonb_build_object('reps', v);\n  END IF;\n\n  RETURN NULL;\nEND;\n$$;\n\nCREATE OR REPLACE FUNCTION public.has_column(schemaname text, tablename text, colname text)\nRETURNS boolean\nLANGUAGE sql\nSTABLE\nSET search_path = public\nAS $$\n  SELECT EXISTS (\n    SELECT 1\n    FROM information_schema.columns\n    WHERE table_schema = schemaname\n      AND table_name   = tablename\n      AND column_name  = colname\n  );\n$$;"}		treenitaastu@gmail.com	\N
20250928105319	{"-- Fix functions without proper search_path configuration\n\n-- Update trigger functions to have search_path\nCREATE OR REPLACE FUNCTION public.archive_old_conversations()\nRETURNS trigger\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = public\nAS $$\nBEGIN\n  -- Archive previous active conversations for this user\n  UPDATE public.support_conversations\n  SET status = 'archived',\n      updated_at = now()\n  WHERE user_id = NEW.user_id\n    AND status = 'active'\n    AND id != NEW.id;\n  \n  RETURN NEW;\nEND;\n$$;\n\nCREATE OR REPLACE FUNCTION public.set_owner_uid()\nRETURNS trigger\nLANGUAGE plpgsql\nSET search_path = public\nAS $$\nBEGIN\n  IF TG_OP = 'INSERT' AND NEW.user_id IS NULL THEN\n    NEW.user_id := auth.uid();\n  END IF;\n  RETURN NEW;\nEND;\n$$;\n\nCREATE OR REPLACE FUNCTION public.set_updated_at()\nRETURNS trigger\nLANGUAGE plpgsql\nSET search_path = public\nAS $$\nBEGIN\n  NEW.updated_at = now();\n  RETURN NEW;\nEND;\n$$;\n\nCREATE OR REPLACE FUNCTION public.set_updated_at_user_roles()\nRETURNS trigger\nLANGUAGE plpgsql\nSET search_path = public\nAS $$\nBEGIN\n  NEW.updated_at = now();\n  RETURN NEW;\nEND;\n$$;\n\nCREATE OR REPLACE FUNCTION public.set_client_item_order()\nRETURNS trigger\nLANGUAGE plpgsql\nSET search_path = public\nAS $$\nBEGIN\n  IF NEW.order_in_day IS NULL THEN\n    SELECT COALESCE(MAX(order_in_day),0) + 1\n      INTO NEW.order_in_day\n      FROM public.client_items\n     WHERE client_day_id = NEW.client_day_id;\n  END IF;\n  RETURN NEW;\nEND;\n$$;\n\nCREATE OR REPLACE FUNCTION public.set_template_item_order()\nRETURNS trigger\nLANGUAGE plpgsql\nSET search_path = public\nAS $$\nBEGIN\n  IF NEW.order_in_day IS NULL THEN\n    SELECT COALESCE(MAX(order_in_day),0) + 1\n      INTO NEW.order_in_day\n      FROM public.template_items\n     WHERE template_day_id = NEW.template_day_id;\n  END IF;\n  RETURN NEW;\nEND;\n$$;\n\n-- Update utility functions\nCREATE OR REPLACE FUNCTION public.parse_first_int(txt text)\nRETURNS integer\nLANGUAGE plpgsql\nIMMUTABLE\nSET search_path = public\nAS $$\nDECLARE m text;\nBEGIN\n  IF txt IS NULL THEN RETURN NULL; END IF;\n  m := (regexp_match(txt, '(\\\\d+)'))[1];\n  RETURN m::int;\nEXCEPTION WHEN OTHERS THEN\n  RETURN NULL;\nEND;\n$$;\n\nCREATE OR REPLACE FUNCTION public.get_iso_week(date_input timestamp with time zone DEFAULT now())\nRETURNS text\nLANGUAGE plpgsql\nIMMUTABLE\nSET search_path = public\nAS $$\nBEGIN\n  -- Convert to Europe/Tallinn timezone and get ISO week\n  RETURN to_char(date_input AT TIME ZONE 'Europe/Tallinn', 'IYYY-\\"W\\"IW');\nEND;\n$$;\n\nCREATE OR REPLACE FUNCTION public.public_tt_parse_reps_seconds(txt text)\nRETURNS jsonb\nLANGUAGE plpgsql\nSET search_path = public\nAS $$\nDECLARE\n  t text := lower(coalesce(txt,''));\n  v int := null; \n  mm int; ss int;\nBEGIN\n  IF t = '' THEN RETURN NULL; END IF;\n\n  -- mm:ss -> seconds\n  IF position(':' in t) > 0 THEN\n    mm := coalesce(nullif(regexp_replace(t, '^(\\\\d+):\\\\d+$', '\\\\1'), '')::int, 0);\n    ss := coalesce(nullif(regexp_replace(t, '^\\\\d+:(\\\\d+)$', '\\\\1'), '')::int, 0);\n    RETURN jsonb_build_object('seconds', mm*60 + ss);\n  END IF;\n\n  -- \\"30s\\", \\"45 sek\\", \\"45 s\\"\n  IF t ~ '(\\\\d+)\\\\s*(s|sek)\\\\b' THEN\n    v := ((regexp_match(t, '(\\\\d+)'))[1])::int;\n    RETURN jsonb_build_object('seconds', v);\n  END IF;\n\n  -- vahemik -> min, loeme kordusteks\n  IF t ~ '(\\\\d+)\\\\s*[–-]\\\\s*(\\\\d+)' THEN\n    v := ((regexp_match(t, '(\\\\d+)'))[1])::int;\n    RETURN jsonb_build_object('reps', v);\n  END IF;\n\n  -- \\"12x\\", \\"12\\", \\"9 kordust\\", \\"12 korda\\"\n  IF t ~ '(\\\\d+)\\\\s*(x|×|korda|kordust)?\\\\b' THEN\n    v := ((regexp_match(t, '(\\\\d+)'))[1])::int;\n    RETURN jsonb_build_object('reps', v);\n  END IF;\n\n  -- fallback: esimene number -> reps\n  IF t ~ '(\\\\d+)' THEN\n    v := ((regexp_match(t, '(\\\\d+)'))[1])::int;\n    RETURN jsonb_build_object('reps', v);\n  END IF;\n\n  RETURN NULL;\nEND;\n$$;\n\nCREATE OR REPLACE FUNCTION public.has_column(schemaname text, tablename text, colname text)\nRETURNS boolean\nLANGUAGE sql\nSTABLE\nSET search_path = public\nAS $$\n  SELECT EXISTS (\n    SELECT 1\n    FROM information_schema.columns\n    WHERE table_schema = schemaname\n      AND table_name   = tablename\n      AND column_name  = colname\n  );\n$$;"}		treenitaastu@gmail.com	\N
20250928111914	{"-- Fix analytics issues by dropping and recreating function\n\n-- 1. Drop existing function and recreate with all required fields\nDROP FUNCTION IF EXISTS public.get_analytics_summary();\n\nCREATE OR REPLACE FUNCTION public.get_analytics_summary()\nRETURNS TABLE(\n  total_sessions bigint,\n  active_users bigint, \n  completion_rate numeric,\n  avg_rpe numeric,\n  dropoff_day numeric,\n  total_volume numeric,\n  weekly_streaks bigint,\n  total_users bigint,\n  new_users_7d bigint,\n  workouts_started_7d bigint,\n  workouts_completed_7d bigint,\n  avg_sessions_per_user_7d numeric,\n  retention_day_7 numeric,\n  retention_day_30 numeric\n)\nLANGUAGE sql\nSECURITY DEFINER\nSET search_path TO 'public'\nAS $function$\n  with recent_sessions as (\n    select user_id, started_at::date as d\n    from workout_sessions\n    where started_at >= now() - interval '7 days'\n  ),\n  sessions_30 as (\n    select id, started_at::date as d, ended_at, user_id\n    from workout_sessions\n    where started_at >= now() - interval '30 days'\n  ),\n  sessions_7d as (\n    select id, user_id, ended_at\n    from workout_sessions\n    where started_at >= now() - interval '7 days'\n  )\n  select\n    (select count(*) from workout_sessions) as total_sessions,\n    (select count(distinct user_id) from recent_sessions) as active_users,\n    (\n      select coalesce(count(*) filter (where ended_at is not null)::numeric\n             / nullif(count(*),0), 0)\n      from sessions_30\n    ) as completion_rate,\n    (select avg(avg_rpe) from v_session_summary where avg_rpe is not null) as avg_rpe,\n    (\n      select avg(day)\n      from (\n        select user_id,\n               count(*) filter (where ended_at is not null) as days_done,\n               least(count(*),14) as day\n        from v_session_summary\n        group by user_id\n      ) t\n    ) as dropoff_day,\n    (select sum(total_volume_kg) from v_session_summary) as total_volume,\n    (\n      select count(*) from user_streaks us\n      where coalesce(us.current_streak,0) >= 7\n    ) as weekly_streaks,\n    (select count(*) from profiles) as total_users,\n    (select count(*) from profiles where created_at >= now() - interval '7 days') as new_users_7d,\n    (select count(*) from sessions_7d) as workouts_started_7d,\n    (select count(*) from sessions_7d where ended_at is not null) as workouts_completed_7d,\n    (\n      select case \n        when count(distinct user_id) > 0 \n        then count(*)::numeric / count(distinct user_id) \n        else 0 \n      end\n      from sessions_7d\n    ) as avg_sessions_per_user_7d,\n    (\n      select case \n        when (select count(*) from profiles) > 0 \n        then (select count(distinct user_id) from recent_sessions)::numeric / (select count(*) from profiles)\n        else 0 \n      end\n    ) as retention_day_7,\n    (\n      select case \n        when (select count(*) from profiles) > 0 \n        then (select count(distinct user_id) from sessions_30)::numeric / (select count(*) from profiles)\n        else 0 \n      end\n    ) as retention_day_30\n$function$;"}		treenitaastu@gmail.com	\N
20250928111945	{"-- Drop and recreate analytics function with correct return type\n\n-- 1. Drop existing function\nDROP FUNCTION IF EXISTS public.get_analytics_summary();\n\n-- 2. Create new version with complete analytics data\nCREATE OR REPLACE FUNCTION public.get_analytics_summary()\nRETURNS TABLE(\n  total_sessions bigint,\n  active_users bigint, \n  completion_rate numeric,\n  avg_rpe numeric,\n  dropoff_day numeric,\n  total_volume numeric,\n  weekly_streaks bigint,\n  total_users bigint,\n  new_users_7d bigint,\n  workouts_started_7d bigint,\n  workouts_completed_7d bigint,\n  avg_sessions_per_user_7d numeric,\n  retention_day_7 numeric,\n  retention_day_30 numeric\n)\nLANGUAGE sql\nSECURITY DEFINER\nSET search_path TO 'public'\nAS $function$\n  with recent_sessions as (\n    select user_id, started_at::date as d\n    from workout_sessions\n    where started_at >= now() - interval '7 days'\n  ),\n  sessions_30 as (\n    select id, started_at::date as d, ended_at, user_id\n    from workout_sessions\n    where started_at >= now() - interval '30 days'\n  ),\n  sessions_7d as (\n    select id, user_id, ended_at\n    from workout_sessions\n    where started_at >= now() - interval '7 days'\n  )\n  select\n    (select count(*) from workout_sessions) as total_sessions,\n    (select count(distinct user_id) from recent_sessions) as active_users,\n    (\n      select coalesce(count(*) filter (where ended_at is not null)::numeric\n             / nullif(count(*),0), 0)\n      from sessions_30\n    ) as completion_rate,\n    (select avg(avg_rpe) from v_session_summary where avg_rpe is not null) as avg_rpe,\n    (\n      select avg(day)\n      from (\n        select user_id,\n               count(*) filter (where ended_at is not null) as days_done,\n               least(count(*),14) as day\n        from v_session_summary\n        group by user_id\n      ) t\n    ) as dropoff_day,\n    (select sum(total_volume_kg) from v_session_summary) as total_volume,\n    (\n      select count(*) from user_streaks us\n      where coalesce(us.current_streak,0) >= 7\n    ) as weekly_streaks,\n    (select count(*) from profiles) as total_users,\n    (select count(*) from profiles where created_at >= now() - interval '7 days') as new_users_7d,\n    (select count(*) from sessions_7d) as workouts_started_7d,\n    (select count(*) from sessions_7d where ended_at is not null) as workouts_completed_7d,\n    (\n      select case \n        when count(distinct user_id) > 0 \n        then count(*)::numeric / count(distinct user_id) \n        else 0 \n      end\n      from sessions_7d\n    ) as avg_sessions_per_user_7d,\n    (\n      select case \n        when (select count(*) from profiles) > 0 \n        then (select count(distinct user_id) from recent_sessions)::numeric / (select count(*) from profiles)\n        else 0 \n      end\n    ) as retention_day_7,\n    (\n      select case \n        when (select count(*) from profiles) > 0 \n        then (select count(distinct user_id) from sessions_30)::numeric / (select count(*) from profiles)\n        else 0 \n      end\n    ) as retention_day_30\n$function$;"}		treenitaastu@gmail.com	\N
20250928112014	{"-- Fix analytics issues by dropping and recreating function\n\n-- 1. Drop existing function and recreate with all required fields\nDROP FUNCTION IF EXISTS public.get_analytics_summary();\n\nCREATE OR REPLACE FUNCTION public.get_analytics_summary()\nRETURNS TABLE(\n  total_sessions bigint,\n  active_users bigint, \n  completion_rate numeric,\n  avg_rpe numeric,\n  dropoff_day numeric,\n  total_volume numeric,\n  weekly_streaks bigint,\n  total_users bigint,\n  new_users_7d bigint,\n  workouts_started_7d bigint,\n  workouts_completed_7d bigint,\n  avg_sessions_per_user_7d numeric,\n  retention_day_7 numeric,\n  retention_day_30 numeric\n)\nLANGUAGE sql\nSECURITY DEFINER\nSET search_path TO 'public'\nAS $function$\n  with recent_sessions as (\n    select user_id, started_at::date as d\n    from workout_sessions\n    where started_at >= now() - interval '7 days'\n  ),\n  sessions_30 as (\n    select id, started_at::date as d, ended_at, user_id\n    from workout_sessions\n    where started_at >= now() - interval '30 days'\n  ),\n  sessions_7d as (\n    select id, user_id, ended_at\n    from workout_sessions\n    where started_at >= now() - interval '7 days'\n  )\n  select\n    (select count(*) from workout_sessions) as total_sessions,\n    (select count(distinct user_id) from recent_sessions) as active_users,\n    (\n      select coalesce(count(*) filter (where ended_at is not null)::numeric\n             / nullif(count(*),0), 0)\n      from sessions_30\n    ) as completion_rate,\n    (select avg(avg_rpe) from v_session_summary where avg_rpe is not null) as avg_rpe,\n    (\n      select avg(day)\n      from (\n        select user_id,\n               count(*) filter (where ended_at is not null) as days_done,\n               least(count(*),14) as day\n        from v_session_summary\n        group by user_id\n      ) t\n    ) as dropoff_day,\n    (select sum(total_volume_kg) from v_session_summary) as total_volume,\n    (\n      select count(*) from user_streaks us\n      where coalesce(us.current_streak,0) >= 7\n    ) as weekly_streaks,\n    (select count(*) from profiles) as total_users,\n    (select count(*) from profiles where created_at >= now() - interval '7 days') as new_users_7d,\n    (select count(*) from sessions_7d) as workouts_started_7d,\n    (select count(*) from sessions_7d where ended_at is not null) as workouts_completed_7d,\n    (\n      select case \n        when count(distinct user_id) > 0 \n        then count(*)::numeric / count(distinct user_id) \n        else 0 \n      end\n      from sessions_7d\n    ) as avg_sessions_per_user_7d,\n    (\n      select case \n        when (select count(*) from profiles) > 0 \n        then (select count(distinct user_id) from recent_sessions)::numeric / (select count(*) from profiles)\n        else 0 \n      end\n    ) as retention_day_7,\n    (\n      select case \n        when (select count(*) from profiles) > 0 \n        then (select count(distinct user_id) from sessions_30)::numeric / (select count(*) from profiles)\n        else 0 \n      end\n    ) as retention_day_30\n$function$;"}		treenitaastu@gmail.com	\N
20250928112618	{"-- Fix user streak calculation system with correct column names\n\n-- 1. Create function to calculate and update user streaks\nCREATE OR REPLACE FUNCTION public.calculate_user_streaks()\nRETURNS void\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path TO 'public'\nAS $function$\nDECLARE\n  user_rec RECORD;\n  current_streak INTEGER;\n  best_streak INTEGER;\n  last_activity DATE;\nBEGIN\n  -- Clear existing streaks\n  DELETE FROM user_streaks;\n  \n  -- Calculate streaks for each user based on userprogress (Kontorikeha) and workout_sessions (PT)\n  FOR user_rec IN \n    SELECT DISTINCT user_id FROM (\n      SELECT user_id FROM userprogress \n      UNION \n      SELECT user_id FROM workout_sessions WHERE ended_at IS NOT NULL\n    ) u\n  LOOP\n    -- Calculate streak from userprogress (static program) and workout sessions (PT)\n    WITH user_days AS (\n      SELECT DISTINCT completed_at::date as day\n      FROM userprogress \n      WHERE user_id = user_rec.user_id AND completed_at IS NOT NULL\n      UNION\n      SELECT DISTINCT ended_at::date as day  \n      FROM workout_sessions \n      WHERE user_id = user_rec.user_id AND ended_at IS NOT NULL\n      ORDER BY day DESC\n    ),\n    ordered_days AS (\n      SELECT day, \n             LAG(day) OVER (ORDER BY day) as prev_day,\n             ROW_NUMBER() OVER (ORDER BY day DESC) as rn\n      FROM user_days\n    ),\n    streak_groups AS (\n      SELECT day,\n             SUM(CASE WHEN prev_day IS NULL OR day - prev_day > 1 THEN 1 ELSE 0 END) \n             OVER (ORDER BY day DESC ROWS UNBOUNDED PRECEDING) as grp\n      FROM ordered_days\n    ),\n    streaks AS (\n      SELECT grp, \n             COUNT(*) as streak_length,\n             MAX(day) as latest_day,\n             MIN(day) as earliest_day\n      FROM streak_groups\n      GROUP BY grp\n      ORDER BY latest_day DESC\n    )\n    SELECT \n      COALESCE(\n        (SELECT streak_length \n         FROM streaks \n         WHERE latest_day >= CURRENT_DATE - interval '1 day' \n         ORDER BY latest_day DESC \n         LIMIT 1), \n        0\n      ),\n      COALESCE(MAX(streak_length), 0),\n      COALESCE(\n        (SELECT latest_day \n         FROM streaks \n         WHERE latest_day >= CURRENT_DATE - interval '7 days' \n         ORDER BY latest_day DESC \n         LIMIT 1),\n        NULL\n      )\n    INTO current_streak, best_streak, last_activity\n    FROM streaks;\n    \n    -- Insert calculated streak using correct column name\n    INSERT INTO user_streaks (user_id, current_streak, best_streak, last_workout_date, updated_at)\n    VALUES (user_rec.user_id, current_streak, best_streak, last_activity, NOW())\n    ON CONFLICT (user_id) DO UPDATE SET\n      current_streak = EXCLUDED.current_streak,\n      best_streak = EXCLUDED.best_streak,\n      last_workout_date = EXCLUDED.last_workout_date,\n      updated_at = NOW();\n  END LOOP;\nEND;\n$function$;\n\n-- 2. Create trigger function to update streaks when progress is made\nCREATE OR REPLACE FUNCTION public.trigger_update_user_streak()\nRETURNS TRIGGER\nLANGUAGE plpgsql\nSET search_path TO 'public'\nAS $function$\nBEGIN\n  -- Call streak calculation to keep streaks updated\n  PERFORM calculate_user_streaks();\n  RETURN COALESCE(NEW, OLD);\nEND;\n$function$;\n\n-- 3. Add triggers to update streaks when progress is recorded\nDROP TRIGGER IF EXISTS update_streak_on_userprogress ON userprogress;\nCREATE TRIGGER update_streak_on_userprogress\n  AFTER INSERT OR UPDATE OR DELETE ON userprogress\n  FOR EACH STATEMENT\n  EXECUTE FUNCTION trigger_update_user_streak();\n\nDROP TRIGGER IF EXISTS update_streak_on_workout_sessions ON workout_sessions;  \nCREATE TRIGGER update_streak_on_workout_sessions\n  AFTER INSERT OR UPDATE ON workout_sessions\n  FOR EACH STATEMENT\n  EXECUTE FUNCTION trigger_update_user_streak();\n\n-- 4. Initialize streaks for existing users\nSELECT calculate_user_streaks();"}		treenitaastu@gmail.com	\N
20250928114106	{"-- Add duration_weeks column to client_programs if it doesn't exist\nALTER TABLE client_programs \nADD COLUMN IF NOT EXISTS duration_weeks INTEGER DEFAULT 4;\n\n-- Add training_days_per_week column to track selected training days\nALTER TABLE client_programs \nADD COLUMN IF NOT EXISTS training_days_per_week INTEGER DEFAULT 3 CHECK (training_days_per_week >= 1 AND training_days_per_week <= 5);\n\n-- Add auto_progression_enabled column if it doesn't exist\nALTER TABLE client_programs \nADD COLUMN IF NOT EXISTS auto_progression_enabled BOOLEAN DEFAULT true;\n\n-- Add progression_parameters column if it doesn't exist  \nALTER TABLE client_programs \nADD COLUMN IF NOT EXISTS progression_parameters JSONB DEFAULT '{\\"rep_increment\\": 1, \\"rpe_target_max\\": 8, \\"rpe_target_min\\": 6, \\"consistency_threshold\\": 3, \\"weight_increment_percentage\\": 5}'::jsonb;\n\n-- Add status column if it doesn't exist\nALTER TABLE client_programs \nADD COLUMN IF NOT EXISTS status TEXT DEFAULT 'active' CHECK (status IN ('active', 'completed', 'paused'));\n\n-- Add completed_at column if it doesn't exist\nALTER TABLE client_programs \nADD COLUMN IF NOT EXISTS completed_at TIMESTAMP WITH TIME ZONE;\n\n-- Update the v_program_progress view to include the new fields\nCREATE OR REPLACE VIEW v_program_progress AS\nSELECT \n  cp.id as program_id,\n  cp.assigned_to as user_id,\n  cp.start_date,\n  cp.duration_weeks,\n  cp.status,\n  cp.completed_at,\n  cp.auto_progression_enabled,\n  CASE \n    WHEN cp.start_date IS NULL THEN 0\n    ELSE FLOOR(EXTRACT(EPOCH FROM (NOW() - cp.start_date)) / (7 * 24 * 3600))\n  END as weeks_elapsed,\n  CASE \n    WHEN cp.duration_weeks IS NULL OR cp.duration_weeks = 0 THEN 0\n    WHEN cp.start_date IS NULL THEN 0\n    ELSE LEAST(100, FLOOR(100.0 * EXTRACT(EPOCH FROM (NOW() - cp.start_date)) / (cp.duration_weeks * 7 * 24 * 3600)))\n  END as progress_percentage,\n  CASE \n    WHEN cp.start_date IS NOT NULL \n         AND cp.duration_weeks IS NOT NULL \n         AND cp.duration_weeks > 0\n         AND EXTRACT(EPOCH FROM (NOW() - cp.start_date)) >= (cp.duration_weeks * 7 * 24 * 3600)\n         AND cp.status = 'active'\n    THEN true\n    ELSE false\n  END as is_due_for_completion\nFROM client_programs cp\nWHERE cp.status != 'completed';"}		treenitaastu@gmail.com	\N
20250928124238	{"-- Enhanced progression system for professional training management\n-- Fixed version without RECORD[] which isn't supported in PostgreSQL\n\n-- Drop the failed function first\nDROP FUNCTION IF EXISTS public.analyze_exercise_progression_enhanced(uuid, integer);\n\n-- Create enhanced progression analysis function\nCREATE OR REPLACE FUNCTION public.analyze_exercise_progression_enhanced(\n  p_client_item_id uuid, \n  p_weeks_back integer DEFAULT 2\n) RETURNS jsonb\nLANGUAGE plpgsql\nSTABLE SECURITY DEFINER\nSET search_path = 'public'\nAS $function$\nDECLARE\n  v_exercise_data RECORD;\n  v_progression_data jsonb;\n  v_current_weight NUMERIC;\n  v_current_reps TEXT;\n  v_avg_rpe NUMERIC;\n  v_rpe_trend NUMERIC;\n  v_consistency_score NUMERIC;\n  v_volume_trend NUMERIC;\n  v_session_count INTEGER;\n  v_recommendation TEXT;\n  v_suggested_weight NUMERIC;\n  v_confidence_score NUMERIC;\n  v_rpe_variance NUMERIC;\n  v_total_volume NUMERIC;\nBEGIN\n  -- Get exercise details and current parameters\n  SELECT ci.*\n  INTO v_exercise_data\n  FROM client_items ci\n  WHERE ci.id = p_client_item_id;\n  \n  IF NOT FOUND THEN\n    RETURN jsonb_build_object(\n      'error', 'Exercise not found',\n      'exercise_id', p_client_item_id\n    );\n  END IF;\n  \n  v_current_weight := v_exercise_data.weight_kg;\n  v_current_reps := v_exercise_data.reps;\n\n  -- Analyze recent performance with proper aggregation\n  WITH recent_performance AS (\n    SELECT \n      ws.started_at::date as session_date,\n      en.rpe,\n      AVG(sl.weight_kg_done * sl.reps_done) as session_volume,\n      COUNT(sl.id) as sets_completed\n    FROM workout_sessions ws\n    LEFT JOIN exercise_notes en ON en.session_id = ws.id AND en.client_item_id = p_client_item_id\n    LEFT JOIN set_logs sl ON sl.session_id = ws.id AND sl.client_item_id = p_client_item_id\n    WHERE ws.started_at >= NOW() - (p_weeks_back || ' weeks')::INTERVAL\n      AND ws.ended_at IS NOT NULL\n      AND en.rpe IS NOT NULL\n    GROUP BY ws.started_at::date, en.rpe\n    ORDER BY session_date DESC\n  ),\n  performance_stats AS (\n    SELECT \n      COUNT(*) as session_count,\n      AVG(rpe) as avg_rpe,\n      STDDEV(rpe) as rpe_variance,\n      AVG(session_volume) as avg_volume,\n      -- Simple trend calculation: compare first half vs second half\n      AVG(CASE WHEN ROW_NUMBER() OVER (ORDER BY session_date) <= COUNT(*) OVER () / 2 THEN rpe END) as early_rpe,\n      AVG(CASE WHEN ROW_NUMBER() OVER (ORDER BY session_date) > COUNT(*) OVER () / 2 THEN rpe END) as late_rpe,\n      SUM(session_volume) as total_volume\n    FROM recent_performance\n  )\n  SELECT \n    COALESCE(ps.session_count, 0),\n    COALESCE(ps.avg_rpe, 7),\n    COALESCE(ps.rpe_variance, 0),\n    COALESCE(ps.avg_volume, 0),\n    COALESCE(ps.total_volume, 0),\n    -- RPE trend: positive = getting harder, negative = getting easier\n    CASE \n      WHEN ps.late_rpe IS NOT NULL AND ps.early_rpe IS NOT NULL \n      THEN ps.late_rpe - ps.early_rpe\n      ELSE 0\n    END\n  INTO v_session_count, v_avg_rpe, v_rpe_variance, v_total_volume, v_total_volume, v_rpe_trend\n  FROM performance_stats ps;\n  \n  -- Calculate consistency score\n  v_consistency_score := CASE \n    WHEN v_rpe_variance IS NULL OR v_rpe_variance = 0 THEN 1.0\n    ELSE GREATEST(0, 1 - (v_rpe_variance / 3))\n  END;\n  \n  -- Professional progression logic\n  IF v_session_count < 2 THEN\n    v_recommendation := 'maintain';\n    v_suggested_weight := v_current_weight;\n    v_confidence_score := 0.3;\n  ELSIF v_avg_rpe < 6.5 AND v_consistency_score > 0.7 AND v_rpe_trend <= 0 THEN\n    -- Too easy + consistent + not getting harder = increase intensity\n    v_recommendation := 'increase_weight';\n    v_suggested_weight := CASE \n      WHEN v_current_weight IS NOT NULL THEN \n        ROUND(v_current_weight * 1.05, 1) -- 5% increase\n      ELSE NULL\n    END;\n    v_confidence_score := 0.8;\n  ELSIF v_avg_rpe > 8.5 OR (v_avg_rpe > 8 AND v_rpe_trend > 0.5) THEN\n    -- Too hard or getting progressively harder = decrease intensity\n    v_recommendation := 'decrease_weight';\n    v_suggested_weight := CASE \n      WHEN v_current_weight IS NOT NULL THEN \n        ROUND(v_current_weight * 0.95, 1) -- 5% decrease\n      ELSE NULL\n    END;\n    v_confidence_score := 0.9;\n  ELSIF v_avg_rpe BETWEEN 6.5 AND 8.5 AND v_consistency_score > 0.6 THEN\n    -- In target zone + consistent = maintain or small progression\n    IF v_rpe_trend < -0.3 THEN\n      -- Getting easier over time = small increase\n      v_recommendation := 'increase_weight';\n      v_suggested_weight := CASE \n        WHEN v_current_weight IS NOT NULL THEN \n          ROUND(v_current_weight * 1.025, 1) -- 2.5% increase\n        ELSE NULL\n      END;\n      v_confidence_score := 0.7;\n    ELSE\n      v_recommendation := 'maintain';\n      v_suggested_weight := v_current_weight;\n      v_confidence_score := 0.8;\n    END IF;\n  ELSE\n    -- Inconsistent performance or insufficient data = maintain\n    v_recommendation := 'maintain';\n    v_suggested_weight := v_current_weight;\n    v_confidence_score := 0.4;\n  END IF;\n  \n  -- Build comprehensive progression data\n  v_progression_data := jsonb_build_object(\n    'action', v_recommendation,\n    'reason', CASE v_recommendation\n      WHEN 'increase_weight' THEN \n        CASE \n          WHEN v_avg_rpe < 6.5 THEN 'RPE too low - exercise is too easy'\n          WHEN v_rpe_trend < -0.3 THEN 'Getting progressively easier - ready for advancement'\n          ELSE 'Consistent good performance - time to progress'\n        END\n      WHEN 'decrease_weight' THEN\n        CASE \n          WHEN v_avg_rpe > 8.5 THEN 'RPE too high - exercise is too challenging'\n          WHEN v_rpe_trend > 0.5 THEN 'Getting progressively harder - need recovery'\n          ELSE 'Preventing overreaching'\n        END\n      ELSE 'Maintain current intensity for consistency'\n    END,\n    'current_weight', v_current_weight,\n    'suggested_weight', v_suggested_weight,\n    'current_reps', v_current_reps,\n    'avg_rpe', ROUND(v_avg_rpe, 1),\n    'rpe_trend', ROUND(v_rpe_trend, 2),\n    'consistency_score', ROUND(v_consistency_score, 2),\n    'confidence_score', ROUND(v_confidence_score, 2),\n    'session_count', v_session_count,\n    'analysis_period_weeks', p_weeks_back,\n    'exercise_name', v_exercise_data.exercise_name,\n    'professional_notes', CASE \n      WHEN v_consistency_score < 0.5 THEN 'Focus on consistent RPE reporting for better recommendations'\n      WHEN v_session_count < 3 THEN 'More data needed for confident progression decisions'\n      WHEN v_confidence_score > 0.8 THEN 'High confidence recommendation based on solid data'\n      ELSE 'Moderate confidence - monitor next few sessions'\n    END\n  );\n  \n  RETURN v_progression_data;\nEND;\n$function$;\n\n-- Enhanced auto-progression function\nCREATE OR REPLACE FUNCTION public.auto_progress_program_enhanced(p_program_id uuid)\nRETURNS jsonb\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = 'public'\nAS $function$\nDECLARE\n  v_program_record RECORD;\n  v_item_record RECORD;\n  v_progression JSONB;\n  v_updates_made INTEGER := 0;\n  v_results JSONB := '[]'::jsonb;\n  v_deload_recommended BOOLEAN := false;\n  v_program_rpe_avg NUMERIC;\nBEGIN\n  -- Get program with progression parameters\n  SELECT \n    cp.*,\n    COUNT(ws.id) as total_sessions,\n    AVG(en.rpe) as program_avg_rpe\n  INTO v_program_record\n  FROM client_programs cp\n  LEFT JOIN workout_sessions ws ON ws.client_program_id = cp.id\n  LEFT JOIN exercise_notes en ON en.session_id = ws.id\n  WHERE cp.id = p_program_id \n    AND cp.auto_progression_enabled = true \n    AND cp.status = 'active'\n  GROUP BY cp.id;\n    \n  IF NOT FOUND THEN\n    RETURN jsonb_build_object(\n      'success', false,\n      'reason', 'program_not_found_or_disabled',\n      'updates_made', 0\n    );\n  END IF;\n\n  v_program_rpe_avg := COALESCE(v_program_record.program_avg_rpe, 7);\n  \n  -- Check if deload is recommended (program-wide RPE too high)\n  IF v_program_rpe_avg > 8.5 AND v_program_record.total_sessions > 6 THEN\n    v_deload_recommended := true;\n  END IF;\n\n  -- Loop through all exercises in the program\n  FOR v_item_record IN \n    SELECT ci.*, cd.client_program_id\n    FROM client_items ci\n    JOIN client_days cd ON cd.id = ci.client_day_id\n    WHERE cd.client_program_id = p_program_id\n    ORDER BY cd.day_order, ci.order_in_day\n  LOOP\n    -- Use enhanced progression analysis\n    v_progression := analyze_exercise_progression_enhanced(v_item_record.id, 2);\n    \n    -- Apply deload if recommended program-wide\n    IF v_deload_recommended THEN\n      UPDATE client_items \n      SET weight_kg = CASE \n        WHEN weight_kg IS NOT NULL THEN ROUND(weight_kg * 0.85, 1) -- 15% deload\n        ELSE weight_kg\n      END\n      WHERE id = v_item_record.id;\n      v_updates_made := v_updates_made + 1;\n      \n      -- Override progression result for deload\n      v_progression := v_progression || jsonb_build_object(\n        'action', 'deload',\n        'reason', 'Program-wide deload recommended due to high RPE',\n        'suggested_weight', CASE \n          WHEN v_item_record.weight_kg IS NOT NULL THEN ROUND(v_item_record.weight_kg * 0.85, 1)\n          ELSE v_item_record.weight_kg\n        END\n      );\n    ELSE\n      -- Apply individual exercise progression\n      IF (v_progression->>'action') = 'increase_weight' AND (v_progression->>'suggested_weight') IS NOT NULL THEN\n        UPDATE client_items \n        SET weight_kg = (v_progression->>'suggested_weight')::NUMERIC\n        WHERE id = v_item_record.id;\n        v_updates_made := v_updates_made + 1;\n      ELSIF (v_progression->>'action') = 'decrease_weight' AND (v_progression->>'suggested_weight') IS NOT NULL THEN\n        UPDATE client_items \n        SET weight_kg = (v_progression->>'suggested_weight')::NUMERIC\n        WHERE id = v_item_record.id;\n        v_updates_made := v_updates_made + 1;\n      END IF;\n    END IF;\n    \n    -- Add to results\n    v_results := v_results || jsonb_build_object(\n      'exercise_name', v_item_record.exercise_name,\n      'item_id', v_item_record.id,\n      'progression', v_progression\n    );\n  END LOOP;\n\n  RETURN jsonb_build_object(\n    'success', true,\n    'program_id', p_program_id,\n    'updates_made', v_updates_made,\n    'deload_applied', v_deload_recommended,\n    'program_avg_rpe', ROUND(v_program_rpe_avg, 1),\n    'total_sessions_analyzed', v_program_record.total_sessions,\n    'progressions', v_results,\n    'professional_summary', CASE \n      WHEN v_deload_recommended THEN 'Deload week applied - program intensity was too high'\n      WHEN v_updates_made > 0 THEN 'Progressive overload applied based on performance data'\n      ELSE 'Program maintained - current intensity is appropriate'\n    END\n  );\nEND;\n$function$;"}		treenitaastu@gmail.com	\N
