ight,\n    'current_reps', v_current_reps,\n    'avg_rpe', ROUND(v_avg_rpe, 1),\n    'rpe_trend', ROUND(v_rpe_trend, 2),\n    'consistency_score', ROUND(v_consistency_score, 2),\n    'confidence_score', ROUND(v_confidence_score, 2),\n    'session_count', v_session_count,\n    'analysis_period_weeks', p_weeks_back,\n    'exercise_name', v_exercise_data.exercise_name,\n    'professional_notes', CASE \n      WHEN v_consistency_score < 0.5 THEN 'Focus on consistent RPE reporting for better recommendations'\n      WHEN v_session_count < 3 THEN 'More data needed for confident progression decisions'\n      WHEN v_confidence_score > 0.8 THEN 'High confidence recommendation based on solid data'\n      ELSE 'Moderate confidence - monitor next few sessions'\n    END\n  );\n  \n  RETURN v_progression_data;\nEND;\n$function$;\n\n-- Enhanced auto-progression function\nCREATE OR REPLACE FUNCTION public.auto_progress_program_enhanced(p_program_id uuid)\nRETURNS jsonb\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = 'public'\nAS $function$\nDECLARE\n  v_program_record RECORD;\n  v_item_record RECORD;\n  v_progression JSONB;\n  v_updates_made INTEGER := 0;\n  v_results JSONB := '[]'::jsonb;\n  v_deload_recommended BOOLEAN := false;\n  v_program_rpe_avg NUMERIC;\nBEGIN\n  -- Get program with progression parameters\n  SELECT \n    cp.*,\n    COUNT(ws.id) as total_sessions,\n    AVG(en.rpe) as program_avg_rpe\n  INTO v_program_record\n  FROM client_programs cp\n  LEFT JOIN workout_sessions ws ON ws.client_program_id = cp.id\n  LEFT JOIN exercise_notes en ON en.session_id = ws.id\n  WHERE cp.id = p_program_id \n    AND cp.auto_progression_enabled = true \n    AND cp.status = 'active'\n  GROUP BY cp.id;\n    \n  IF NOT FOUND THEN\n    RETURN jsonb_build_object(\n      'success', false,\n      'reason', 'program_not_found_or_disabled',\n      'updates_made', 0\n    );\n  END IF;\n\n  v_program_rpe_avg := COALESCE(v_program_record.program_avg_rpe, 7);\n  \n  -- Check if deload is recommended (program-wide RPE too high)\n  IF v_program_rpe_avg > 8.5 AND v_program_record.total_sessions > 6 THEN\n    v_deload_recommended := true;\n  END IF;\n\n  -- Loop through all exercises in the program\n  FOR v_item_record IN \n    SELECT ci.*, cd.client_program_id\n    FROM client_items ci\n    JOIN client_days cd ON cd.id = ci.client_day_id\n    WHERE cd.client_program_id = p_program_id\n    ORDER BY cd.day_order, ci.order_in_day\n  LOOP\n    -- Use enhanced progression analysis\n    v_progression := analyze_exercise_progression_enhanced(v_item_record.id, 2);\n    \n    -- Apply deload if recommended program-wide\n    IF v_deload_recommended THEN\n      UPDATE client_items \n      SET weight_kg = CASE \n        WHEN weight_kg IS NOT NULL THEN ROUND(weight_kg * 0.85, 1) -- 15% deload\n        ELSE weight_kg\n      END\n      WHERE id = v_item_record.id;\n      v_updates_made := v_updates_made + 1;\n      \n      -- Override progression result for deload\n      v_progression := v_progression || jsonb_build_object(\n        'action', 'deload',\n        'reason', 'Program-wide deload recommended due to high RPE',\n        'suggested_weight', CASE \n          WHEN v_item_record.weight_kg IS NOT NULL THEN ROUND(v_item_record.weight_kg * 0.85, 1)\n          ELSE v_item_record.weight_kg\n        END\n      );\n    ELSE\n      -- Apply individual exercise progression\n      IF (v_progression->>'action') = 'increase_weight' AND (v_progression->>'suggested_weight') IS NOT NULL THEN\n        UPDATE client_items \n        SET weight_kg = (v_progression->>'suggested_weight')::NUMERIC\n        WHERE id = v_item_record.id;\n        v_updates_made := v_updates_made + 1;\n      ELSIF (v_progression->>'action') = 'decrease_weight' AND (v_progression->>'suggested_weight') IS NOT NULL THEN\n        UPDATE client_items \n        SET weight_kg = (v_progression->>'suggested_weight')::NUMERIC\n        WHERE id = v_item_record.id;\n        v_updates_made := v_updates_made + 1;\n      END IF;\n    END IF;\n    \n    -- Add to results\n    v_results := v_results || jsonb_build_object(\n      'exercise_name', v_item_record.exercise_name,\n      'item_id', v_item_record.id,\n      'progression', v_progression\n    );\n  END LOOP;\n\n  RETURN jsonb_build_object(\n    'success', true,\n    'program_id', p_program_id,\n    'updates_made', v_updates_made,\n    'deload_applied', v_deload_recommended,\n    'program_avg_rpe', ROUND(v_program_rpe_avg, 1),\n    'total_sessions_analyzed', v_program_record.total_sessions,\n    'progressions', v_results,\n    'professional_summary', CASE \n      WHEN v_deload_recommended THEN 'Deload week applied - program intensity was too high'\n      WHEN v_updates_made > 0 THEN 'Progressive overload applied based on performance data'\n      ELSE 'Program maintained - current intensity is appropriate'\n    END\n  );\nEND;\n$function$;"}		treenitaastu@gmail.com	\N
20250928012727	{"-- Fix program integrity issues by cleaning up programs without days or days without items\n\n-- First, identify and log problematic programs\nCREATE TEMP TABLE temp_program_issues AS\nSELECT \n  cp.id as program_id,\n  cp.assigned_to,\n  CASE WHEN cd.id IS NULL THEN 'NO_DAYS' ELSE 'HAS_DAYS' END as day_status,\n  CASE WHEN ci.id IS NULL AND cd.id IS NOT NULL THEN 'DAYS_NO_ITEMS' ELSE 'HAS_ITEMS' END as item_status\nFROM client_programs cp\nLEFT JOIN client_days cd ON cd.client_program_id = cp.id\nLEFT JOIN client_items ci ON ci.client_day_id = cd.id\nWHERE cd.id IS NULL OR (cd.id IS NOT NULL AND ci.id IS NULL);\n\n-- Create a function to fix program integrity\nCREATE OR REPLACE FUNCTION fix_program_integrity()\nRETURNS TEXT\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = public\nAS $$\nDECLARE\n  result_msg TEXT := '';\n  programs_deleted INT := 0;\n  days_deleted INT := 0;\nBEGIN\n  -- Delete programs that have no days (they are essentially empty/broken)\n  WITH deleted_programs AS (\n    DELETE FROM client_programs cp\n    WHERE NOT EXISTS (\n      SELECT 1 FROM client_days cd WHERE cd.client_program_id = cp.id\n    )\n    RETURNING id\n  )\n  SELECT COUNT(*) INTO programs_deleted FROM deleted_programs;\n  \n  -- Delete days that have no items (they are essentially empty/broken)  \n  WITH deleted_days AS (\n    DELETE FROM client_days cd\n    WHERE NOT EXISTS (\n      SELECT 1 FROM client_items ci WHERE ci.client_day_id = cd.id\n    )\n    RETURNING id\n  )\n  SELECT COUNT(*) INTO days_deleted FROM deleted_days;\n  \n  result_msg := 'Cleaned up ' || programs_deleted || ' empty programs and ' || days_deleted || ' empty days';\n  \n  RETURN result_msg;\nEND;\n$$;\n\n-- Execute the cleanup\nSELECT fix_program_integrity();\n\n-- Add constraint to prevent future integrity issues\n-- Ensure client_programs always have at least one day after creation\nCREATE OR REPLACE FUNCTION ensure_program_has_days()\nRETURNS TRIGGER\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = public\nAS $$\nBEGIN\n  -- This trigger will be called AFTER template assignment\n  -- We'll just log for now and let the application handle validation\n  RETURN NULL;\nEND;\n$$;"}		treenitaastu@gmail.com	\N
20250928013128	{"-- Fix booking RLS policies to allow edge functions to create bookings\n\n-- Add a policy for edge functions (service role) to create bookings\nCREATE POLICY \\"Edge functions can create bookings\\" \nON public.booking_requests \nFOR INSERT \nTO service_role\nWITH CHECK (true);\n\n-- Also ensure the confirm-booking edge function can update bookings\nCREATE POLICY \\"Edge functions can update bookings\\" \nON public.booking_requests \nFOR UPDATE \nTO service_role\nUSING (true)\nWITH CHECK (true);\n\n-- Create a function to validate booking data (for additional security)\nCREATE OR REPLACE FUNCTION validate_booking_insert()\nRETURNS TRIGGER\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = public\nAS $$\nBEGIN\n  -- Ensure required fields are present\n  IF NEW.user_id IS NULL OR NEW.client_name IS NULL OR NEW.client_email IS NULL THEN\n    RAISE EXCEPTION 'Missing required booking fields';\n  END IF;\n  \n  -- Validate email format\n  IF NEW.client_email !~ '^[A-Za-z0-9._%+-]+@[A-Za-z0-9.-]+\\\\.[A-Za-z]{2,}$' THEN\n    RAISE EXCEPTION 'Invalid email format';\n  END IF;\n  \n  -- Validate service type\n  IF NEW.service_type NOT IN ('initial_assessment', 'personal_program', 'monthly_support') THEN\n    RAISE EXCEPTION 'Invalid service type';\n  END IF;\n  \n  -- Set defaults\n  NEW.status = COALESCE(NEW.status, 'pending');\n  NEW.duration_minutes = COALESCE(NEW.duration_minutes, 60);\n  \n  RETURN NEW;\nEND;\n$$;\n\n-- Add trigger to validate booking data\nDROP TRIGGER IF EXISTS validate_booking_trigger ON booking_requests;\nCREATE TRIGGER validate_booking_trigger\n  BEFORE INSERT OR UPDATE ON booking_requests\n  FOR EACH ROW\n  EXECUTE FUNCTION validate_booking_insert();"}		treenitaastu@gmail.com	\N
20250928014519	{"-- Fix SECURITY DEFINER view issues by removing the problematic views and recreating them properly\n\n-- Drop the problematic security definer views first\nDROP VIEW IF EXISTS v_access_matrix CASCADE;\nDROP VIEW IF EXISTS v_program_analytics CASCADE;\n\n-- Recreate v_access_matrix without SECURITY DEFINER (will use INVOKER rights)\nCREATE VIEW v_access_matrix AS\nWITH admin_users AS (\n  SELECT p.id as user_id, true as is_admin, 'profile_admin' as reason\n  FROM profiles p \n  WHERE p.role = 'admin'\n  \n  UNION\n  \n  SELECT ur.user_id, true as is_admin, 'user_roles_admin' as reason\n  FROM user_roles ur \n  WHERE ur.role = 'admin'\n  \n  UNION\n  \n  SELECT ao.user_id, true as is_admin, 'access_override' as reason\n  FROM access_overrides ao\n  WHERE ao.expires_at IS NULL OR ao.expires_at > now()\n),\nentitlement_access AS (\n  SELECT \n    ue.user_id,\n    bool_or(\n      CASE WHEN ue.product = 'static' \n           AND NOT ue.paused \n           AND (\n             (ue.status = 'active' AND (ue.expires_at IS NULL OR ue.expires_at > now())) OR\n             (ue.status = 'trialing' AND ue.trial_ends_at IS NOT NULL AND ue.trial_ends_at > now())\n           )\n      THEN true ELSE false END\n    ) as can_static,\n    bool_or(\n      CASE WHEN ue.product = 'pt' \n           AND NOT ue.paused \n           AND (\n             (ue.status = 'active' AND (ue.expires_at IS NULL OR ue.expires_at > now())) OR\n             (ue.status = 'trialing' AND ue.trial_ends_at IS NOT NULL AND ue.trial_ends_at > now())\n           )\n      THEN true ELSE false END\n    ) as can_pt\n  FROM user_entitlements ue\n  GROUP BY ue.user_id\n),\nall_users AS (\n  SELECT p.id as user_id FROM profiles p\n)\nSELECT \n  u.user_id,\n  COALESCE(a.is_admin, false) as is_admin,\n  COALESCE(e.can_static, false) OR COALESCE(a.is_admin, false) as can_static,\n  COALESCE(e.can_pt, false) OR COALESCE(a.is_admin, false) as can_pt,\n  COALESCE(a.reason, 'database_view') as reason\nFROM all_users u\nLEFT JOIN admin_users a ON a.user_id = u.user_id\nLEFT JOIN entitlement_access e ON e.user_id = u.user_id;\n\n-- Recreate v_program_analytics without SECURITY DEFINER  \nCREATE VIEW v_program_analytics AS\nWITH program_stats AS (\n  SELECT \n    cp.id as program_id,\n    cp.title_override,\n    cp.start_date,\n    cp.duration_weeks,\n    COUNT(DISTINCT cd.id) as total_days,\n    COUNT(DISTINCT ws.id) as total_sessions,\n    COUNT(DISTINCT CASE WHEN ws.ended_at IS NOT NULL THEN ws.id END) as completed_sessions,\n    AVG(CASE WHEN ws.ended_at IS NOT NULL THEN ws.duration_minutes END) as avg_session_duration,\n    COUNT(DISTINCT ws.user_id) as unique_users,\n    MIN(ws.started_at) as first_session,\n    MAX(ws.started_at) as last_session\n  FROM client_programs cp\n  LEFT JOIN client_days cd ON cd.client_program_id = cp.id\n  LEFT JOIN workout_sessions ws ON ws.client_program_id = cp.id\n  GROUP BY cp.id, cp.title_override, cp.start_date, cp.duration_weeks\n),\ndropoff_analysis AS (\n  SELECT \n    1 as most_common_dropoff_day -- Simplified for now\n)\nSELECT \n  ps.*,\n  CASE \n    WHEN ps.total_sessions = 0 THEN 0\n    ELSE ROUND((ps.completed_sessions::numeric / ps.total_sessions::numeric) * 100, 1)\n  END as completion_rate,\n  da.most_common_dropoff_day\nFROM program_stats ps\nCROSS JOIN dropoff_analysis da;"}		treenitaastu@gmail.com	\N
20250928014547	{"-- Fix remaining SECURITY DEFINER views\n\n-- Check what views still have SECURITY DEFINER\nSELECT schemaname, viewname, definition \nFROM pg_views \nWHERE schemaname = 'public' \n  AND definition LIKE '%SECURITY DEFINER%';\n\n-- Find and fix remaining security definer views\nDROP VIEW IF EXISTS v_client_programs_admin CASCADE;\nDROP VIEW IF EXISTS v_program_progress CASCADE;\n\n-- Recreate v_client_programs_admin without SECURITY DEFINER\nCREATE VIEW v_client_programs_admin AS\nSELECT \n  cp.id,\n  cp.template_id,\n  cp.assigned_to,\n  cp.assigned_by,\n  cp.start_date,\n  cp.is_active,\n  cp.title_override,\n  cp.duration_weeks,\n  cp.auto_progression_enabled,\n  cp.status,\n  cp.completed_at,\n  cp.inserted_at,\n  wt.title as template_title,\n  wt.goal as template_goal,\n  p_assigned.email as assigned_to_email,\n  p_assigned_by.email as assigned_by_email\nFROM client_programs cp\nLEFT JOIN workout_templates wt ON wt.id = cp.template_id\nLEFT JOIN profiles p_assigned ON p_assigned.id = cp.assigned_to\nLEFT JOIN profiles p_assigned_by ON p_assigned_by.id = cp.assigned_by;\n\n-- Recreate v_program_progress without SECURITY DEFINER\nCREATE VIEW v_program_progress AS\nWITH program_sessions AS (\n  SELECT \n    cp.id as program_id,\n    cp.assigned_to as user_id,\n    cp.start_date,\n    cp.duration_weeks,\n    cp.auto_progression_enabled,\n    cp.status,\n    cp.completed_at,\n    COUNT(DISTINCT ws.id) as total_sessions,\n    COUNT(DISTINCT CASE WHEN ws.ended_at IS NOT NULL THEN ws.id END) as completed_sessions,\n    COUNT(DISTINCT cd.id) as total_days,\n    EXTRACT(EPOCH FROM (NOW() - cp.start_date)) / (7 * 24 * 3600) as weeks_elapsed\n  FROM client_programs cp\n  LEFT JOIN client_days cd ON cd.client_program_id = cp.id  \n  LEFT JOIN workout_sessions ws ON ws.client_program_id = cp.id\n  WHERE cp.start_date IS NOT NULL\n  GROUP BY cp.id, cp.assigned_to, cp.start_date, cp.duration_weeks, cp.auto_progression_enabled, cp.status, cp.completed_at\n)\nSELECT \n  program_id,\n  user_id,\n  start_date,\n  duration_weeks,\n  auto_progression_enabled,\n  status,\n  completed_at,\n  weeks_elapsed,\n  CASE \n    WHEN total_sessions = 0 OR total_days = 0 THEN 0\n    ELSE ROUND((completed_sessions::numeric / total_days::numeric) * 100, 0)\n  END as progress_percentage,\n  CASE \n    WHEN weeks_elapsed >= duration_weeks THEN true\n    ELSE false\n  END as is_due_for_completion\nFROM program_sessions;"}		treenitaastu@gmail.com	\N
20250928015816	{"-- Fix the calculate_user_streaks function to avoid unsafe DELETE operations\n\nCREATE OR REPLACE FUNCTION public.calculate_user_streaks()\nRETURNS void\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path TO 'public'\nAS $function$\nDECLARE\n  user_rec RECORD;\n  current_streak INTEGER;\n  best_streak INTEGER;\n  last_activity DATE;\nBEGIN\n  -- Calculate streaks for each user based on userprogress (Kontorikeha) and workout_sessions (PT)\n  FOR user_rec IN \n    SELECT DISTINCT user_id FROM (\n      SELECT user_id FROM userprogress \n      UNION \n      SELECT user_id FROM workout_sessions WHERE ended_at IS NOT NULL\n    ) u\n  LOOP\n    -- Calculate streak from userprogress (static program) and workout sessions (PT)\n    WITH user_days AS (\n      SELECT DISTINCT completed_at::date as day\n      FROM userprogress \n      WHERE user_id = user_rec.user_id AND completed_at IS NOT NULL\n      UNION\n      SELECT DISTINCT ended_at::date as day  \n      FROM workout_sessions \n      WHERE user_id = user_rec.user_id AND ended_at IS NOT NULL\n      ORDER BY day DESC\n    ),\n    ordered_days AS (\n      SELECT day, \n             LAG(day) OVER (ORDER BY day) as prev_day,\n             ROW_NUMBER() OVER (ORDER BY day DESC) as rn\n      FROM user_days\n    ),\n    streak_groups AS (\n      SELECT day,\n             SUM(CASE WHEN prev_day IS NULL OR day - prev_day > 1 THEN 1 ELSE 0 END) \n             OVER (ORDER BY day DESC ROWS UNBOUNDED PRECEDING) as grp\n      FROM ordered_days\n    ),\n    streaks AS (\n      SELECT grp, \n             COUNT(*) as streak_length,\n             MAX(day) as latest_day,\n             MIN(day) as earliest_day\n      FROM streak_groups\n      GROUP BY grp\n      ORDER BY latest_day DESC\n    )\n    SELECT \n      COALESCE(\n        (SELECT streak_length \n         FROM streaks \n         WHERE latest_day >= CURRENT_DATE - interval '1 day' \n         ORDER BY latest_day DESC \n         LIMIT 1), \n        0\n      ),\n      COALESCE(MAX(streak_length), 0),\n      COALESCE(\n        (SELECT latest_day \n         FROM streaks \n         WHERE latest_day >= CURRENT_DATE - interval '7 days' \n         ORDER BY latest_day DESC \n         LIMIT 1),\n        NULL\n      )\n    INTO current_streak, best_streak, last_activity\n    FROM streaks;\n    \n    -- Insert or update calculated streak for this specific user only\n    INSERT INTO user_streaks (user_id, current_streak, best_streak, last_workout_date, updated_at)\n    VALUES (user_rec.user_id, current_streak, best_streak, last_activity, NOW())\n    ON CONFLICT (user_id) DO UPDATE SET\n      current_streak = EXCLUDED.current_streak,\n      best_streak = EXCLUDED.best_streak,\n      last_workout_date = EXCLUDED.last_workout_date,\n      updated_at = NOW();\n  END LOOP;\nEND;\n$function$;\n\n-- Also create an optimized version that only updates specific users' streaks\nCREATE OR REPLACE FUNCTION public.update_user_streak(target_user_id UUID)\nRETURNS void\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path TO 'public'\nAS $function$\nDECLARE\n  current_streak INTEGER;\n  best_streak INTEGER;\n  last_activity DATE;\nBEGIN\n  -- Calculate streak for the specific user only\n  WITH user_days AS (\n    SELECT DISTINCT completed_at::date as day\n    FROM userprogress \n    WHERE user_id = target_user_id AND completed_at IS NOT NULL\n    UNION\n    SELECT DISTINCT ended_at::date as day  \n    FROM workout_sessions \n    WHERE user_id = target_user_id AND ended_at IS NOT NULL\n    ORDER BY day DESC\n  ),\n  ordered_days AS (\n    SELECT day, \n           LAG(day) OVER (ORDER BY day) as prev_day,\n           ROW_NUMBER() OVER (ORDER BY day DESC) as rn\n    FROM user_days\n  ),\n  streak_groups AS (\n    SELECT day,\n           SUM(CASE WHEN prev_day IS NULL OR day - prev_day > 1 THEN 1 ELSE 0 END) \n           OVER (ORDER BY day DESC ROWS UNBOUNDED PRECEDING) as grp\n    FROM ordered_days\n  ),\n  streaks AS (\n    SELECT grp, \n           COUNT(*) as streak_length,\n           MAX(day) as latest_day,\n           MIN(day) as earliest_day\n    FROM streak_groups\n    GROUP BY grp\n    ORDER BY latest_day DESC\n  )\n  SELECT \n    COALESCE(\n      (SELECT streak_length \n       FROM streaks \n       WHERE latest_day >= CURRENT_DATE - interval '1 day' \n       ORDER BY latest_day DESC \n       LIMIT 1), \n      0\n    ),\n    COALESCE(MAX(streak_length), 0),\n    COALESCE(\n      (SELECT latest_day \n       FROM streaks \n       WHERE latest_day >= CURRENT_DATE - interval '7 days' \n       ORDER BY latest_day DESC \n       LIMIT 1),\n      NULL\n    )\n  INTO current_streak, best_streak, last_activity\n  FROM streaks;\n  \n  -- Insert or update calculated streak for this specific user\n  INSERT INTO user_streaks (user_id, current_streak, best_streak, last_workout_date, updated_at)\n  VALUES (target_user_id, current_streak, best_streak, last_activity, NOW())\n  ON CONFLICT (user_id) DO UPDATE SET\n    current_streak = EXCLUDED.current_streak,\n    best_streak = EXCLUDED.best_streak,\n    last_workout_date = EXCLUDED.last_workout_date,\n    updated_at = NOW();\nEND;\n$function$;"}		treenitaastu@gmail.com	\N
20250928015947	{"-- Final fix for any remaining Security Definer issues and database optimization\n\n-- Ensure all views are recreated without SECURITY DEFINER properties\nDROP VIEW IF EXISTS public.v_access_matrix CASCADE;\nDROP VIEW IF EXISTS public.v_program_analytics CASCADE;\nDROP VIEW IF EXISTS public.v_client_programs_admin CASCADE;\nDROP VIEW IF EXISTS public.v_program_progress CASCADE;\nDROP VIEW IF EXISTS public.v_session_summary CASCADE;\n\n-- Recreate all views with explicit SECURITY INVOKER (default, but making it explicit)\nCREATE VIEW public.v_access_matrix \nWITH (security_invoker=true)\nAS\nWITH admin_users AS (\n  SELECT p.id as user_id, true as is_admin, 'profile_admin' as reason\n  FROM profiles p \n  WHERE p.role = 'admin'\n  \n  UNION\n  \n  SELECT ur.user_id, true as is_admin, 'user_roles_admin' as reason\n  FROM user_roles ur \n  WHERE ur.role = 'admin'\n  \n  UNION\n  \n  SELECT ao.user_id, true as is_admin, 'access_override' as reason\n  FROM access_overrides ao\n  WHERE ao.expires_at IS NULL OR ao.expires_at > now()\n),\nentitlement_access AS (\n  SELECT \n    ue.user_id,\n    bool_or(\n      CASE WHEN ue.product = 'static' \n           AND NOT ue.paused \n           AND (\n             (ue.status = 'active' AND (ue.expires_at IS NULL OR ue.expires_at > now())) OR\n             (ue.status = 'trialing' AND ue.trial_ends_at IS NOT NULL AND ue.trial_ends_at > now())\n           )\n      THEN true ELSE false END\n    ) as can_static,\n    bool_or(\n      CASE WHEN ue.product = 'pt' \n           AND NOT ue.paused \n           AND (\n             (ue.status = 'active' AND (ue.expires_at IS NULL OR ue.expires_at > now())) OR\n             (ue.status = 'trialing' AND ue.trial_ends_at IS NOT NULL AND ue.trial_ends_at > now())\n           )\n      THEN true ELSE false END\n    ) as can_pt\n  FROM user_entitlements ue\n  GROUP BY ue.user_id\n),\nall_users AS (\n  SELECT p.id as user_id FROM profiles p\n)\nSELECT \n  u.user_id,\n  COALESCE(a.is_admin, false) as is_admin,\n  COALESCE(e.can_static, false) OR COALESCE(a.is_admin, false) as can_static,\n  COALESCE(e.can_pt, false) OR COALESCE(a.is_admin, false) as can_pt,\n  COALESCE(a.reason, 'database_view') as reason\nFROM all_users u\nLEFT JOIN admin_users a ON a.user_id = u.user_id\nLEFT JOIN entitlement_access e ON e.user_id = u.user_id;\n\n-- Recreate v_client_programs_admin\nCREATE VIEW public.v_client_programs_admin \nWITH (security_invoker=true)\nAS\nSELECT \n  cp.id,\n  cp.template_id,\n  cp.assigned_to,\n  cp.assigned_by,\n  cp.start_date,\n  cp.is_active,\n  cp.title_override,\n  cp.duration_weeks,\n  cp.auto_progression_enabled,\n  cp.status,\n  cp.completed_at,\n  cp.inserted_at,\n  wt.title as template_title,\n  wt.goal as template_goal,\n  p_assigned.email as assigned_to_email,\n  p_assigned_by.email as assigned_by_email\nFROM client_programs cp\nLEFT JOIN workout_templates wt ON wt.id = cp.template_id\nLEFT JOIN profiles p_assigned ON p_assigned.id = cp.assigned_to\nLEFT JOIN profiles p_assigned_by ON p_assigned_by.id = cp.assigned_by;\n\n-- Recreate v_program_progress\nCREATE VIEW public.v_program_progress \nWITH (security_invoker=true)\nAS\nWITH program_sessions AS (\n  SELECT \n    cp.id as program_id,\n    cp.assigned_to as user_id,\n    cp.start_date,\n    cp.duration_weeks,\n    cp.auto_progression_enabled,\n    cp.status,\n    cp.completed_at,\n    COUNT(DISTINCT ws.id) as total_sessions,\n    COUNT(DISTINCT CASE WHEN ws.ended_at IS NOT NULL THEN ws.id END) as completed_sessions,\n    COUNT(DISTINCT cd.id) as total_days,\n    EXTRACT(EPOCH FROM (NOW() - cp.start_date)) / (7 * 24 * 3600) as weeks_elapsed\n  FROM client_programs cp\n  LEFT JOIN client_days cd ON cd.client_program_id = cp.id  \n  LEFT JOIN workout_sessions ws ON ws.client_program_id = cp.id\n  WHERE cp.start_date IS NOT NULL\n  GROUP BY cp.id, cp.assigned_to, cp.start_date, cp.duration_weeks, cp.auto_progression_enabled, cp.status, cp.completed_at\n)\nSELECT \n  program_id,\n  user_id,\n  start_date,\n  duration_weeks,\n  auto_progression_enabled,\n  status,\n  completed_at,\n  weeks_elapsed,\n  CASE \n    WHEN total_sessions = 0 OR total_days = 0 THEN 0\n    ELSE ROUND((completed_sessions::numeric / total_days::numeric) * 100, 0)\n  END as progress_percentage,\n  CASE \n    WHEN weeks_elapsed >= duration_weeks THEN true\n    ELSE false\n  END as is_due_for_completion\nFROM program_sessions;\n\n-- Recreate v_program_analytics\nCREATE VIEW public.v_program_analytics \nWITH (security_invoker=true)\nAS\nWITH program_stats AS (\n  SELECT \n    cp.id as program_id,\n    cp.title_override,\n    cp.start_date,\n    cp.duration_weeks,\n    COUNT(DISTINCT cd.id) as total_days,\n    COUNT(DISTINCT ws.id) as total_sessions,\n    COUNT(DISTINCT CASE WHEN ws.ended_at IS NOT NULL THEN ws.id END) as completed_sessions,\n    AVG(CASE WHEN ws.ended_at IS NOT NULL THEN ws.duration_minutes END) as avg_session_duration,\n    COUNT(DISTINCT ws.user_id) as unique_users,\n    MIN(ws.started_at) as first_session,\n    MAX(ws.started_at) as last_session\n  FROM client_programs cp\n  LEFT JOIN client_days cd ON cd.client_program_id = cp.id\n  LEFT JOIN workout_sessions ws ON ws.client_program_id = cp.id\n  GROUP BY cp.id, cp.title_override, cp.start_date, cp.duration_weeks\n),\ndropoff_analysis AS (\n  SELECT \n    1 as most_common_dropoff_day\n)\nSELECT \n  ps.*,\n  CASE \n    WHEN ps.total_sessions = 0 THEN 0\n    ELSE ROUND((ps.completed_sessions::numeric / ps.total_sessions::numeric) * 100, 1)\n  END as completion_rate,\n  da.most_common_dropoff_day\nFROM program_stats ps\nCROSS JOIN dropoff_analysis da;\n\n-- Recreate v_session_summary  \nCREATE VIEW public.v_session_summary\nWITH (security_invoker=true)\nAS\nSELECT \n  ws.id as session_id,\n  ws.user_id,\n  ws.client_program_id,\n  ws.client_day_id,\n  ws.started_at,\n  ws.ended_at,\n  ws.duration_minutes,\n  COUNT(DISTINCT sl.id) as total_sets_completed,\n  AVG(en.rpe) as avg_rpe,\n  cd.title as day_title,\n  cp.title_override as program_title\nFROM workout_sessions ws\nLEFT JOIN set_logs sl ON sl.session_id = ws.id\nLEFT JOIN exercise_notes en ON en.session_id = ws.id\nLEFT JOIN client_days cd ON cd.id = ws.client_day_id\nLEFT JOIN client_programs cp ON cp.id = ws.client_program_id\nGROUP BY ws.id, ws.user_id, ws.client_program_id, ws.client_day_id, ws.started_at, ws.ended_at, ws.duration_minutes, cd.title, cp.title_override;"}		treenitaastu@gmail.com	\N
20250928020012	{"-- Fix the calculate_user_streaks function to avoid unsafe DELETE operations\n\nCREATE OR REPLACE FUNCTION public.calculate_user_streaks()\nRETURNS void\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path TO 'public'\nAS $function$\nDECLARE\n  user_rec RECORD;\n  current_streak INTEGER;\n  best_streak INTEGER;\n  last_activity DATE;\nBEGIN\n  -- Calculate streaks for each user based on userprogress (Kontorikeha) and workout_sessions (PT)\n  FOR user_rec IN \n    SELECT DISTINCT user_id FROM (\n      SELECT user_id FROM userprogress \n      UNION \n      SELECT user_id FROM workout_sessions WHERE ended_at IS NOT NULL\n    ) u\n  LOOP\n    -- Calculate streak from userprogress (static program) and workout sessions (PT)\n    WITH user_days AS (\n      SELECT DISTINCT completed_at::date as day\n      FROM userprogress \n      WHERE user_id = user_rec.user_id AND completed_at IS NOT NULL\n      UNION\n      SELECT DISTINCT ended_at::date as day  \n      FROM workout_sessions \n      WHERE user_id = user_rec.user_id AND ended_at IS NOT NULL\n      ORDER BY day DESC\n    ),\n    ordered_days AS (\n      SELECT day, \n             LAG(day) OVER (ORDER BY day) as prev_day,\n             ROW_NUMBER() OVER (ORDER BY day DESC) as rn\n      FROM user_days\n    ),\n    streak_groups AS (\n      SELECT day,\n             SUM(CASE WHEN prev_day IS NULL OR day - prev_day > 1 THEN 1 ELSE 0 END) \n             OVER (ORDER BY day DESC ROWS UNBOUNDED PRECEDING) as grp\n      FROM ordered_days\n    ),\n    streaks AS (\n      SELECT grp, \n             COUNT(*) as streak_length,\n             MAX(day) as latest_day,\n             MIN(day) as earliest_day\n      FROM streak_groups\n      GROUP BY grp\n      ORDER BY latest_day DESC\n    )\n    SELECT \n      COALESCE(\n        (SELECT streak_length \n         FROM streaks \n         WHERE latest_day >= CURRENT_DATE - interval '1 day' \n         ORDER BY latest_day DESC \n         LIMIT 1), \n        0\n      ),\n      COALESCE(MAX(streak_length), 0),\n      COALESCE(\n        (SELECT latest_day \n         FROM streaks \n         WHERE latest_day >= CURRENT_DATE - interval '7 days' \n         ORDER BY latest_day DESC \n         LIMIT 1),\n        NULL\n      )\n    INTO current_streak, best_streak, last_activity\n    FROM streaks;\n    \n    -- Insert or update calculated streak for this specific user only\n    INSERT INTO user_streaks (user_id, current_streak, best_streak, last_workout_date, updated_at)\n    VALUES (user_rec.user_id, current_streak, best_streak, last_activity, NOW())\n    ON CONFLICT (user_id) DO UPDATE SET\n      current_streak = EXCLUDED.current_streak,\n      best_streak = EXCLUDED.best_streak,\n      last_workout_date = EXCLUDED.last_workout_date,\n      updated_at = NOW();\n  END LOOP;\nEND;\n$function$;\n\n-- Also create an optimized version that only updates specific users' streaks\nCREATE OR REPLACE FUNCTION public.update_user_streak(target_user_id UUID)\nRETURNS void\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path TO 'public'\nAS $function$\nDECLARE\n  current_streak INTEGER;\n  best_streak INTEGER;\n  last_activity DATE;\nBEGIN\n  -- Calculate streak for the specific user only\n  WITH user_days AS (\n    SELECT DISTINCT completed_at::date as day\n    FROM userprogress \n    WHERE user_id = target_user_id AND completed_at IS NOT NULL\n    UNION\n    SELECT DISTINCT ended_at::date as day  \n    FROM workout_sessions \n    WHERE user_id = target_user_id AND ended_at IS NOT NULL\n    ORDER BY day DESC\n  ),\n  ordered_days AS (\n    SELECT day, \n           LAG(day) OVER (ORDER BY day) as prev_day,\n           ROW_NUMBER() OVER (ORDER BY day DESC) as rn\n    FROM user_days\n  ),\n  streak_groups AS (\n    SELECT day,\n           SUM(CASE WHEN prev_day IS NULL OR day - prev_day > 1 THEN 1 ELSE 0 END) \n           OVER (ORDER BY day DESC ROWS UNBOUNDED PRECEDING) as grp\n    FROM ordered_days\n  ),\n  streaks AS (\n    SELECT grp, \n           COUNT(*) as streak_length,\n           MAX(day) as latest_day,\n           MIN(day) as earliest_day\n    FROM streak_groups\n    GROUP BY grp\n    ORDER BY latest_day DESC\n  )\n  SELECT \n    COALESCE(\n      (SELECT streak_length \n       FROM streaks \n       WHERE latest_day >= CURRENT_DATE - interval '1 day' \n       ORDER BY latest_day DESC \n       LIMIT 1), \n      0\n    ),\n    COALESCE(MAX(streak_length), 0),\n    COALESCE(\n      (SELECT latest_day \n       FROM streaks \n       WHERE latest_day >= CURRENT_DATE - interval '7 days' \n       ORDER BY latest_day DESC \n       LIMIT 1),\n      NULL\n    )\n  INTO current_streak, best_streak, last_activity\n  FROM streaks;\n  \n  -- Insert or update calculated streak for this specific user\n  INSERT INTO user_streaks (user_id, current_streak, best_streak, last_workout_date, updated_at)\n  VALUES (target_user_id, current_streak, best_streak, last_activity, NOW())\n  ON CONFLICT (user_id) DO UPDATE SET\n    current_streak = EXCLUDED.current_streak,\n    best_streak = EXCLUDED.best_streak,\n    last_workout_date = EXCLUDED.last_workout_date,\n    updated_at = NOW();\nEND;\n$function$;"}		treenitaastu@gmail.com	\N
20250928023353	{"-- Add RIR (Reps in Reserve) field to exercise_notes table\nALTER TABLE exercise_notes ADD COLUMN rir_done smallint;\n\n-- Add comment to explain the field\nCOMMENT ON COLUMN exercise_notes.rir_done IS 'Reps in Reserve - how many more reps the user could have done (0-5+)';"}		treenitaastu@gmail.com	\N
20250928040015	{"-- Drop and recreate get_analytics_summary function to fix analytics\nDROP FUNCTION IF EXISTS public.get_analytics_summary();\n\nCREATE OR REPLACE FUNCTION public.get_analytics_summary()\nRETURNS TABLE(\n  total_users bigint,\n  active_users bigint, \n  new_users_7d bigint,\n  avg_sessions_per_user_7d numeric,\n  completion_rate numeric,\n  avg_rpe numeric,\n  workouts_started_7d bigint,\n  workouts_completed_7d bigint,\n  dropoff_day numeric,\n  retention_day_7 numeric,\n  retention_day_30 numeric\n)\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path TO 'public'\nAS $$\nBEGIN\n  -- Use the existing admin_analytics function which has the same data\n  RETURN QUERY \n  SELECT \n    aa.totalusers as total_users,\n    aa.activeusers7d as active_users,\n    aa.newusers7d as new_users_7d,\n    aa.avgsessionsperuser7d as avg_sessions_per_user_7d,\n    aa.completionrate30d as completion_rate,\n    aa.avgrpe7d as avg_rpe,\n    aa.workoutsstarted7d as workouts_started_7d,\n    aa.workoutscompleted7d as workouts_completed_7d,\n    aa.dropoffdaymean as dropoff_day,\n    aa.retentionday7 as retention_day_7,\n    aa.retentionday30 as retention_day_30\n  FROM public.admin_analytics() aa;\nEND;\n$$;\n\nGRANT EXECUTE ON FUNCTION public.get_analytics_summary() TO authenticated;"}		treenitaastu@gmail.com	\N
20250928040112	{"-- Create a simplified analytics function that works for all users\nDROP FUNCTION IF EXISTS public.get_analytics_summary();\n\nCREATE OR REPLACE FUNCTION public.get_analytics_summary()\nRETURNS TABLE(\n  total_users bigint,\n  active_users bigint, \n  new_users_7d bigint,\n  avg_sessions_per_user_7d numeric,\n  completion_rate numeric,\n  avg_rpe numeric,\n  workouts_started_7d bigint,\n  workouts_completed_7d bigint,\n  dropoff_day numeric,\n  retention_day_7 numeric,\n  retention_day_30 numeric\n)\nLANGUAGE plpgsql\nSTABLE\nSET search_path TO 'public'\nAS $$\nDECLARE\n  now_ts      timestamptz := now();\n  since7      timestamptz := now() - interval '7 days';\n  since30     timestamptz := now() - interval '30 days';\n  _total_users bigint;\n  _active_users7d bigint;\n  _new_users7d bigint;\n  _sessions7d bigint;\n  _sessions30_started bigint;\n  _sessions30_completed bigint;\n  _avg_sessions_per_user_7d numeric;\n  _completion_rate_30d numeric;\n  _avg_rpe_7d numeric;\n  _workouts_started_7d bigint;\n  _workouts_completed_7d bigint;\n  _dropoff_day_mean numeric;\n  _retention7 numeric;\n  _retention30 numeric;\nBEGIN\n  -- Total users\n  SELECT count(*) INTO _total_users FROM public.profiles;\n\n  -- Active users in last 7 days\n  SELECT count(DISTINCT ws.user_id) INTO _active_users7d\n  FROM public.workout_sessions ws\n  WHERE ws.started_at >= since7;\n\n  -- New users in last 7 days\n  SELECT count(*) INTO _new_users7d\n  FROM public.profiles p\n  WHERE p.created_at >= since7;\n\n  -- Session counts\n  SELECT count(*) INTO _workouts_started_7d\n  FROM public.workout_sessions ws\n  WHERE ws.started_at >= since7;\n\n  SELECT count(*) INTO _workouts_completed_7d\n  FROM public.workout_sessions ws\n  WHERE ws.ended_at is not null and ws.ended_at >= since7;\n\n  SELECT count(*) INTO _sessions7d\n  FROM public.workout_sessions ws\n  WHERE ws.started_at >= since7;\n\n  SELECT\n    count(*) filter (where ws.started_at >= since30)               as started30,\n    count(*) filter (where ws.ended_at is not null and ws.ended_at >= since30) as completed30\n  INTO _sessions30_started, _sessions30_completed\n  FROM public.workout_sessions ws;\n\n  -- Rates\n  _avg_sessions_per_user_7d := case when _active_users7d > 0\n    then (_sessions7d::numeric / _active_users7d::numeric)\n    else 0 end;\n\n  _completion_rate_30d := case when _sessions30_started > 0\n    then (_sessions30_completed::numeric / _sessions30_started::numeric)\n    else 0 end;\n\n  -- Avg RPE (use session summary or exercise notes)\n  SELECT avg(en.rpe)::numeric INTO _avg_rpe_7d\n  FROM exercise_notes en\n  JOIN workout_sessions ws ON ws.id = en.session_id\n  WHERE ws.started_at >= since7 \n    AND en.rpe is not null \n    AND en.rpe > 0;\n\n  -- Dropoff: placeholder value  \n  _dropoff_day_mean := 3.5;\n\n  -- Retention approximations:\n  _retention7 := case when _total_users > 0\n    then (_active_users7d::numeric / _total_users::numeric)\n    else 0 end;\n\n  -- users active in last 30 days\n  SELECT count(distinct ws.user_id) INTO _sessions30_started\n  FROM public.workout_sessions ws\n  WHERE ws.started_at >= since30;\n\n  _retention30 := case when _total_users > 0\n    then (_sessions30_started::numeric / _total_users::numeric)\n    else 0 end;\n\n  RETURN QUERY\n    SELECT\n      _total_users,\n      _active_users7d,\n      _new_users7d,\n      coalesce(_avg_sessions_per_user_7d, 0),\n      coalesce(_completion_rate_30d, 0),\n      coalesce(_avg_rpe_7d, 0),\n      _workouts_started_7d,\n      _workouts_completed_7d,\n      _dropoff_day_mean,\n      coalesce(_retention7, 0),\n      coalesce(_retention30, 0);\nEND;\n$$;\n\nGRANT EXECUTE ON FUNCTION public.get_analytics_summary() TO authenticated;"}		treenitaastu@gmail.com	\N
20250928040726	{"-- Drop and recreate get_analytics_summary function with total volume\nDROP FUNCTION IF EXISTS public.get_analytics_summary();\n\nCREATE OR REPLACE FUNCTION public.get_analytics_summary()\nRETURNS TABLE(\n  total_users bigint,\n  active_users bigint,\n  new_users_7d bigint,\n  avg_sessions_per_user_7d numeric,\n  completion_rate numeric,\n  avg_rpe numeric,\n  workouts_started_7d bigint,\n  workouts_completed_7d bigint,\n  dropoff_day numeric,\n  retention_day_7 numeric,\n  retention_day_30 numeric,\n  total_volume_kg numeric\n)\nLANGUAGE plpgsql\nSTABLE SECURITY DEFINER\nSET search_path TO 'public'\nAS $$\nDECLARE\n  result_row record;\n  total_vol numeric := 0;\nBEGIN\n  -- Call existing admin_analytics function\n  SELECT * INTO result_row FROM admin_analytics() LIMIT 1;\n  \n  -- Calculate total volume from set logs (last 30 days)\n  SELECT COALESCE(SUM(sl.weight_kg_done * sl.reps_done), 0)\n  INTO total_vol\n  FROM set_logs sl\n  WHERE sl.weight_kg_done IS NOT NULL \n    AND sl.reps_done IS NOT NULL\n    AND sl.marked_done_at >= NOW() - INTERVAL '30 days';\n  \n  RETURN QUERY SELECT \n    result_row.totalusers,\n    result_row.activeusers7d,\n    result_row.newusers7d,\n    result_row.avgsessionsperuser7d,\n    result_row.completionrate30d,\n    result_row.avgrpe7d,\n    result_row.workoutsstarted7d,\n    result_row.workoutscompleted7d,\n    result_row.dropoffdaymean,\n    result_row.retentionday7,\n    result_row.retentionday30,\n    total_vol;\nEND;\n$$;"}		treenitaastu@gmail.com	\N
20250928040925	{"-- Create user-friendly analytics summary function\nDROP FUNCTION IF EXISTS public.get_analytics_summary();\n\nCREATE OR REPLACE FUNCTION public.get_analytics_summary()\nRETURNS TABLE(\n  total_users bigint,\n  active_users bigint,\n  new_users_7d bigint,\n  avg_sessions_per_user_7d numeric,\n  completion_rate numeric,\n  avg_rpe numeric,\n  workouts_started_7d bigint,\n  workouts_completed_7d bigint,\n  dropoff_day numeric,\n  retention_day_7 numeric,\n  retention_day_30 numeric,\n  total_volume_kg numeric\n)\nLANGUAGE plpgsql\nSTABLE SECURITY DEFINER\nSET search_path TO 'public'\nAS $$\nDECLARE\n  current_user_id uuid := auth.uid();\n  total_vol numeric := 0;\n  started_7d bigint := 0;\n  completed_7d bigint := 0;\n  avg_rpe_val numeric := 0;\nBEGIN\n  -- For non-authenticated users, return empty data\n  IF current_user_id IS NULL THEN\n    RETURN QUERY SELECT \n      0::bigint, 0::bigint, 0::bigint, 0::numeric, 0::numeric, 0::numeric,\n      0::bigint, 0::bigint, 0::numeric, 0::numeric, 0::numeric, 0::numeric;\n    RETURN;\n  END IF;\n\n  -- Calculate user-specific total volume from set logs (last 30 days)\n  SELECT COALESCE(SUM(sl.weight_kg_done * sl.reps_done), 0)\n  INTO total_vol\n  FROM set_logs sl\n  WHERE sl.user_id = current_user_id\n    AND sl.weight_kg_done IS NOT NULL \n    AND sl.reps_done IS NOT NULL\n    AND sl.marked_done_at >= NOW() - INTERVAL '30 days';\n\n  -- Calculate user-specific workout stats (last 7 days)\n  SELECT \n    COUNT(*) FILTER (WHERE ws.started_at >= NOW() - INTERVAL '7 days'),\n    COUNT(*) FILTER (WHERE ws.ended_at IS NOT NULL AND ws.ended_at >= NOW() - INTERVAL '7 days')\n  INTO started_7d, completed_7d\n  FROM workout_sessions ws\n  WHERE ws.user_id = current_user_id;\n\n  -- Calculate user-specific average RPE (last 7 days)\n  SELECT COALESCE(AVG(en.rpe), 0)\n  INTO avg_rpe_val\n  FROM exercise_notes en\n  JOIN workout_sessions ws ON ws.id = en.session_id\n  WHERE en.user_id = current_user_id \n    AND en.rpe IS NOT NULL\n    AND ws.started_at >= NOW() - INTERVAL '7 days';\n\n  -- Return user-specific analytics\n  RETURN QUERY SELECT \n    1::bigint as total_users, -- User count (self)\n    CASE WHEN started_7d > 0 THEN 1::bigint ELSE 0::bigint END as active_users, -- Active in last 7 days\n    0::bigint as new_users_7d, -- Not applicable for single user\n    started_7d::numeric as avg_sessions_per_user_7d, -- Sessions for this user\n    CASE WHEN started_7d > 0 THEN (completed_7d::numeric / started_7d::numeric) ELSE 0::numeric END as completion_rate,\n    avg_rpe_val,\n    started_7d,\n    completed_7d,\n    0::numeric as dropoff_day, -- Not applicable for single user\n    CASE WHEN started_7d > 0 THEN 1::numeric ELSE 0::numeric END as retention_day_7,\n    0::numeric as retention_day_30, -- Simplified for now\n    total_vol;\nEND;\n$$;"}		treenitaastu@gmail.com	\N
20250928041057	{"-- Create user-friendly analytics summary function\nDROP FUNCTION IF EXISTS public.get_analytics_summary();\n\nCREATE OR REPLACE FUNCTION public.get_analytics_summary()\nRETURNS TABLE(\n  total_users bigint,\n  active_users bigint,\n  new_users_7d bigint,\n  avg_sessions_per_user_7d numeric,\n  completion_rate numeric,\n  avg_rpe numeric,\n  workouts_started_7d bigint,\n  workouts_completed_7d bigint,\n  dropoff_day numeric,\n  retention_day_7 numeric,\n  retention_day_30 numeric,\n  total_volume_kg numeric\n)\nLANGUAGE plpgsql\nSTABLE SECURITY DEFINER\nSET search_path TO 'public'\nAS $$\nDECLARE\n  current_user_id uuid := auth.uid();\n  total_vol numeric := 0;\n  started_7d bigint := 0;\n  completed_7d bigint := 0;\n  avg_rpe_val numeric := 0;\nBEGIN\n  -- For non-authenticated users, return empty data\n  IF current_user_id IS NULL THEN\n    RETURN QUERY SELECT \n      0::bigint, 0::bigint, 0::bigint, 0::numeric, 0::numeric, 0::numeric,\n      0::bigint, 0::bigint, 0::numeric, 0::numeric, 0::numeric, 0::numeric;\n    RETURN;\n  END IF;\n\n  -- Calculate user-specific total volume from set logs (last 30 days)\n  SELECT COALESCE(SUM(sl.weight_kg_done * sl.reps_done), 0)\n  INTO total_vol\n  FROM set_logs sl\n  WHERE sl.user_id = current_user_id\n    AND sl.weight_kg_done IS NOT NULL \n    AND sl.reps_done IS NOT NULL\n    AND sl.marked_done_at >= NOW() - INTERVAL '30 days';\n\n  -- Calculate user-specific workout stats (last 7 days)\n  SELECT \n    COUNT(*) FILTER (WHERE ws.started_at >= NOW() - INTERVAL '7 days'),\n    COUNT(*) FILTER (WHERE ws.ended_at IS NOT NULL AND ws.ended_at >= NOW() - INTERVAL '7 days')\n  INTO started_7d, completed_7d\n  FROM workout_sessions ws\n  WHERE ws.user_id = current_user_id;\n\n  -- Calculate user-specific average RPE (last 7 days)\n  SELECT COALESCE(AVG(en.rpe), 0)\n  INTO avg_rpe_val\n  FROM exercise_notes en\n  JOIN workout_sessions ws ON ws.id = en.session_id\n  WHERE en.user_id = current_user_id \n    AND en.rpe IS NOT NULL\n    AND ws.started_at >= NOW() - INTERVAL '7 days';\n\n  -- Return user-specific analytics\n  RETURN QUERY SELECT \n    1::bigint as total_users, -- User count (self)\n    CASE WHEN started_7d > 0 THEN 1::bigint ELSE 0::bigint END as active_users, -- Active in last 7 days\n    0::bigint as new_users_7d, -- Not applicable for single user\n    started_7d::numeric as avg_sessions_per_user_7d, -- Sessions for this user\n    CASE WHEN started_7d > 0 THEN (completed_7d::numeric / started_7d::numeric) ELSE 0::numeric END as completion_rate,\n    avg_rpe_val,\n    started_7d,\n    completed_7d,\n    0::numeric as dropoff_day, -- Not applicable for single user\n    CASE WHEN started_7d > 0 THEN 1::numeric ELSE 0::numeric END as retention_day_7,\n    0::numeric as retention_day_30, -- Simplified for now\n    total_vol;\nEND;\n$$;"}		treenitaastu@gmail.com	\N
20250928050707	{"-- Create optimized progression algorithm\nCREATE OR REPLACE FUNCTION public.analyze_exercise_progression_optimized(\n  p_client_item_id uuid, \n  p_weeks_back integer DEFAULT 3\n) RETURNS jsonb\nLANGUAGE plpgsql\nSTABLE SECURITY DEFINER\nSET search_path TO 'public'\nAS $function$\nDECLARE\n  v_exercise_data RECORD;\n  v_current_weight NUMERIC;\n  v_current_reps TEXT;\n  v_exercise_type TEXT := 'isolation'; -- default\n  v_session_count INTEGER;\n  v_avg_rpe NUMERIC;\n  v_avg_rir NUMERIC;\n  v_rpe_trend NUMERIC;\n  v_volume_trend NUMERIC;\n  v_consistency_score NUMERIC;\n  v_confidence_score NUMERIC;\n  v_recommendation TEXT;\n  v_suggested_weight NUMERIC;\n  v_suggested_reps TEXT;\n  v_deload_needed BOOLEAN := false;\n  v_base_increment NUMERIC := 0.05; -- 5% base increment\n  v_compound_exercises TEXT[] := ARRAY[\n    'squat', 'deadlift', 'bench press', 'overhead press', 'row', 'pull up', 'chin up',\n    'dip', 'lunge', 'bulgarian split squat', 'hip thrust', 'romanian deadlift'\n  ];\nBEGIN\n  -- Get exercise details\n  SELECT ci.*\n  INTO v_exercise_data\n  FROM client_items ci\n  WHERE ci.id = p_client_item_id;\n  \n  IF NOT FOUND THEN\n    RETURN jsonb_build_object(\n      'error', 'Exercise not found',\n      'exercise_id', p_client_item_id\n    );\n  END IF;\n  \n  v_current_weight := v_exercise_data.weight_kg;\n  v_current_reps := v_exercise_data.reps;\n  \n  -- Determine exercise type based on name\n  IF EXISTS (\n    SELECT 1 FROM unnest(v_compound_exercises) AS compound_ex\n    WHERE LOWER(v_exercise_data.exercise_name) LIKE '%' || compound_ex || '%'\n  ) THEN\n    v_exercise_type := 'compound';\n    v_base_increment := 0.025; -- 2.5% for compound exercises\n  END IF;\n\n  -- Analyze recent performance with RPE and RIR data\n  WITH recent_sessions AS (\n    SELECT \n      ws.started_at::date as session_date,\n      en.rpe,\n      en.rir_done,\n      AVG(sl.weight_kg_done * sl.reps_done) as session_volume,\n      COUNT(sl.id) as sets_completed,\n      ROW_NUMBER() OVER (ORDER BY ws.started_at DESC) as session_rank\n    FROM workout_sessions ws\n    LEFT JOIN exercise_notes en ON en.session_id = ws.id AND en.client_item_id = p_client_item_id\n    LEFT JOIN set_logs sl ON sl.session_id = ws.id AND sl.client_item_id = p_client_item_id\n    WHERE ws.started_at >= NOW() - (p_weeks_back || ' weeks')::INTERVAL\n      AND ws.ended_at IS NOT NULL\n      AND (en.rpe IS NOT NULL OR en.rir_done IS NOT NULL)\n      AND sl.id IS NOT NULL\n    GROUP BY ws.started_at::date, en.rpe, en.rir_done\n    ORDER BY ws.started_at DESC\n  ),\n  performance_stats AS (\n    SELECT \n      COUNT(*) as session_count,\n      AVG(rpe) as avg_rpe,\n      AVG(rir_done) as avg_rir,\n      STDDEV(rpe) as rpe_variance,\n      AVG(session_volume) as avg_volume,\n      -- Trend analysis: compare recent vs earlier sessions\n      AVG(CASE WHEN session_rank <= 3 THEN rpe END) as recent_rpe,\n      AVG(CASE WHEN session_rank > 3 THEN rpe END) as earlier_rpe,\n      AVG(CASE WHEN session_rank <= 3 THEN session_volume END) as recent_volume,\n      AVG(CASE WHEN session_rank > 3 THEN session_volume END) as earlier_volume\n    FROM recent_sessions\n  )\n  SELECT \n    COALESCE(ps.session_count, 0),\n    COALESCE(ps.avg_rpe, 7),\n    COALESCE(ps.avg_rir, 2),\n    COALESCE(ps.rpe_variance, 0),\n    CASE \n      WHEN ps.recent_rpe IS NOT NULL AND ps.earlier_rpe IS NOT NULL \n      THEN ps.recent_rpe - ps.earlier_rpe\n      ELSE 0\n    END,\n    CASE \n      WHEN ps.recent_volume IS NOT NULL AND ps.earlier_volume IS NOT NULL AND ps.earlier_volume > 0\n      THEN (ps.recent_volume - ps.earlier_volume) / ps.earlier_volume\n      ELSE 0\n    END\n  INTO v_session_count, v_avg_rpe, v_avg_rir, v_consistency_score, v_rpe_trend, v_volume_trend\n  FROM performance_stats ps;\n  \n  -- Calculate consistency score (inverse of RPE variance)\n  v_consistency_score := CASE \n    WHEN v_consistency_score IS NULL OR v_consistency_score = 0 THEN 1.0\n    ELSE GREATEST(0, 1 - (v_consistency_score / 2))\n  END;\n  \n  -- Check for deload need (high RPE trend across multiple exercises)\n  WITH program_rpe AS (\n    SELECT AVG(en.rpe) as program_avg_rpe\n    FROM exercise_notes en\n    JOIN workout_sessions ws ON ws.id = en.session_id\n    JOIN client_items ci ON ci.id = en.client_item_id\n    JOIN client_days cd ON cd.id = ci.client_day_id\n    WHERE cd.client_program_id = (\n      SELECT cd2.client_program_id \n      FROM client_items ci2 \n      JOIN client_days cd2 ON cd2.id = ci2.client_day_id \n      WHERE ci2.id = p_client_item_id\n    )\n    AND ws.started_at >= NOW() - '1 week'::INTERVAL\n    AND en.rpe IS NOT NULL\n  )\n  SELECT (program_avg_rpe > 8.5) INTO v_deload_needed FROM program_rpe;\n  \n  -- Calculate confidence score based on data quality\n  v_confidence_score := CASE\n    WHEN v_session_count >= 6 THEN 0.9\n    WHEN v_session_count >= 4 THEN 0.8\n    WHEN v_session_count >= 2 THEN 0.6\n    ELSE 0.3\n  END * v_consistency_score;\n  \n  -- Progression decision logic\n  IF v_session_count < 2 OR v_confidence_score < 0.5 THEN\n    v_recommendation := 'maintain';\n    v_suggested_weight := v_current_weight;\n    v_suggested_reps := v_current_reps;\n  ELSIF v_deload_needed THEN\n    v_recommendation := 'deload';\n    v_suggested_weight := CASE \n      WHEN v_current_weight IS NOT NULL THEN ROUND(v_current_weight * 0.9, 1)\n      ELSE NULL\n    END;\n    v_suggested_reps := v_current_reps;\n  ELSIF (v_avg_rpe < 6.5 OR (v_avg_rir > 3 AND v_avg_rpe < 7.5)) AND v_rpe_trend <= 0 THEN\n    -- Too easy: low RPE or high RIR and not getting harder\n    v_recommendation := 'increase_weight';\n    v_suggested_weight := CASE \n      WHEN v_current_weight IS NOT NULL THEN \n        ROUND(v_current_weight * (1 + v_base_increment), 1)\n      ELSE NULL\n    END;\n    v_suggested_reps := v_current_reps;\n  ELSIF v_avg_rpe > 8.5 OR (v_avg_rir < 1 AND v_avg_rpe > 8) OR v_rpe_trend > 0.5 THEN\n    -- Too hard: high RPE, low RIR, or getting progressively harder\n    v_recommendation := 'decrease_weight';\n    v_suggested_weight := CASE \n      WHEN v_current_weight IS NOT NULL THEN \n        ROUND(v_current_weight * (1 - v_base_increment), 1)\n      ELSE NULL\n    END;\n    v_suggested_reps := v_current_reps;\n  ELSIF v_avg_rpe BETWEEN 6.5 AND 8.5 AND v_avg_rir BETWEEN 1 AND 3 THEN\n    -- Optimal zone: consider micro-progression or maintain\n    IF v_rpe_trend < -0.2 AND v_volume_trend > 0.1 THEN\n      -- Getting easier and volume increasing = micro-progression\n      v_recommendation := 'micro_increase';\n      v_suggested_weight := CASE \n        WHEN v_current_weight IS NOT NULL THEN \n          ROUND(v_current_weight * (1 + v_base_increment/2), 1)\n        ELSE NULL\n      END;\n      v_suggested_reps := v_current_reps;\n    ELSE\n      v_recommendation := 'maintain';\n      v_suggested_weight := v_current_weight;\n      v_suggested_reps := v_current_reps;\n    END IF;\n  ELSE\n    v_recommendation := 'maintain';\n    v_suggested_weight := v_current_weight;\n    v_suggested_reps := v_current_reps;\n  END IF;\n  \n  RETURN jsonb_build_object(\n    'action', v_recommendation,\n    'exercise_type', v_exercise_type,\n    'current_weight', v_current_weight,\n    'suggested_weight', v_suggested_weight,\n    'current_reps', v_current_reps,\n    'suggested_reps', v_suggested_reps,\n    'avg_rpe', ROUND(v_avg_rpe, 1),\n    'avg_rir', ROUND(v_avg_rir, 1),\n    'rpe_trend', ROUND(v_rpe_trend, 2),\n    'volume_trend', ROUND(v_volume_trend, 2),\n    'session_count', v_session_count,\n    'confidence_score', ROUND(v_confidence_score, 2),\n    'consistency_score', ROUND(v_consistency_score, 2),\n    'deload_needed', v_deload_needed,\n    'weeks_analyzed', p_weeks_back,\n    'reasoning', CASE v_recommendation\n      WHEN 'maintain' THEN 'RPE and RIR in optimal range, maintain current load'\n      WHEN 'increase_weight' THEN 'RPE too low or RIR too high, increase intensity'\n      WHEN 'decrease_weight' THEN 'RPE too high or RIR too low, reduce intensity'\n      WHEN 'micro_increase' THEN 'Optimal zone with positive adaptations, small increase'\n      WHEN 'deload' THEN 'Program-wide high RPE detected, deload recommended'\n      ELSE 'Insufficient data or low confidence'\n    END\n  );\nEND;\n$function$;\n\n-- Update the auto progression function to use the optimized algorithm\nCREATE OR REPLACE FUNCTION public.auto_progress_program_optimized(p_program_id uuid)\nRETURNS jsonb\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path TO 'public'\nAS $function$\nDECLARE\n  v_program_record RECORD;\n  v_item_record RECORD;\n  v_progression JSONB;\n  v_updates_made INTEGER := 0;\n  v_results JSONB := '[]'::jsonb;\n  v_deload_count INTEGER := 0;\nBEGIN\n  -- Check if program exists and has auto-progression enabled\n  SELECT * INTO v_program_record\n  FROM client_programs \n  WHERE id = p_program_id \n    AND auto_progression_enabled = true \n    AND status = 'active';\n    \n  IF NOT FOUND THEN\n    RETURN jsonb_build_object(\n      'success', false,\n      'reason', 'program_not_found_or_disabled',\n      'updates_made', 0\n    );\n  END IF;\n\n  -- Loop through all exercises in the program\n  FOR v_item_record IN \n    SELECT ci.*, cd.client_program_id\n    FROM client_items ci\n    JOIN client_days cd ON cd.id = ci.client_day_id\n    WHERE cd.client_program_id = p_program_id\n    ORDER BY cd.day_order, ci.order_in_day\n  LOOP\n    -- Use optimized progression analysis\n    v_progression := analyze_exercise_progression_optimized(v_item_record.id, 3);\n    \n    -- Apply progression based on recommendation\n    IF (v_progression->>'confidence_score')::NUMERIC >= 0.6 THEN\n      CASE (v_progression->>'action')\n        WHEN 'increase_weight', 'micro_increase' THEN\n          IF (v_progression->>'suggested_weight') IS NOT NULL THEN\n            UPDATE client_items \n            SET weight_kg = (v_progression->>'suggested_weight')::NUMERIC\n            WHERE id = v_item_record.id;\n            v_updates_made := v_updates_made + 1;\n          END IF;\n        WHEN 'decrease_weight', 'deload' THEN\n          IF (v_progression->>'suggested_weight') IS NOT NULL THEN\n            UPDATE client_items \n            SET weight_kg = (v_progression->>'suggested_weight')::NUMERIC\n            WHERE id = v_item_record.id;\n            v_updates_made := v_updates_made + 1;\n            IF (v_progression->>'action') = 'deload' THEN\n              v_deload_count := v_deload_count + 1;\n            END IF;\n          END IF;\n        -- 'maintain' requires no action\n        ELSE NULL;\n      END CASE;\n    END IF;\n    \n    -- Add to results\n    v_results := v_results || jsonb_build_object(\n      'exercise_name', v_item_record.exercise_name,\n      'item_id', v_item_record.id,\n      'progression', v_progression\n    );\n  END LOOP;\n\n  RETURN jsonb_build_object(\n    'success', true,\n    'program_id', p_program_id,\n    'updates_made', v_updates_made,\n    'deload_exercises', v_deload_count,\n    'algorithm_version', 'optimized_v1',\n    'progressions', v_results\n  );\nEND;\n$function$;"}		treenitaastu@gmail.com	\N
