 'RPE too high or RIR too low, reduce intensity'\n      WHEN 'micro_increase' THEN 'Optimal zone with positive adaptations, small increase'\n      WHEN 'deload' THEN 'Program-wide high RPE detected, deload recommended'\n      ELSE 'Insufficient data or low confidence'\n    END\n  );\nEND;\n$function$;\n\n-- Update the auto progression function to use the optimized algorithm\nCREATE OR REPLACE FUNCTION public.auto_progress_program_optimized(p_program_id uuid)\nRETURNS jsonb\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path TO 'public'\nAS $function$\nDECLARE\n  v_program_record RECORD;\n  v_item_record RECORD;\n  v_progression JSONB;\n  v_updates_made INTEGER := 0;\n  v_results JSONB := '[]'::jsonb;\n  v_deload_count INTEGER := 0;\nBEGIN\n  -- Check if program exists and has auto-progression enabled\n  SELECT * INTO v_program_record\n  FROM client_programs \n  WHERE id = p_program_id \n    AND auto_progression_enabled = true \n    AND status = 'active';\n    \n  IF NOT FOUND THEN\n    RETURN jsonb_build_object(\n      'success', false,\n      'reason', 'program_not_found_or_disabled',\n      'updates_made', 0\n    );\n  END IF;\n\n  -- Loop through all exercises in the program\n  FOR v_item_record IN \n    SELECT ci.*, cd.client_program_id\n    FROM client_items ci\n    JOIN client_days cd ON cd.id = ci.client_day_id\n    WHERE cd.client_program_id = p_program_id\n    ORDER BY cd.day_order, ci.order_in_day\n  LOOP\n    -- Use optimized progression analysis\n    v_progression := analyze_exercise_progression_optimized(v_item_record.id, 3);\n    \n    -- Apply progression based on recommendation\n    IF (v_progression->>'confidence_score')::NUMERIC >= 0.6 THEN\n      CASE (v_progression->>'action')\n        WHEN 'increase_weight', 'micro_increase' THEN\n          IF (v_progression->>'suggested_weight') IS NOT NULL THEN\n            UPDATE client_items \n            SET weight_kg = (v_progression->>'suggested_weight')::NUMERIC\n            WHERE id = v_item_record.id;\n            v_updates_made := v_updates_made + 1;\n          END IF;\n        WHEN 'decrease_weight', 'deload' THEN\n          IF (v_progression->>'suggested_weight') IS NOT NULL THEN\n            UPDATE client_items \n            SET weight_kg = (v_progression->>'suggested_weight')::NUMERIC\n            WHERE id = v_item_record.id;\n            v_updates_made := v_updates_made + 1;\n            IF (v_progression->>'action') = 'deload' THEN\n              v_deload_count := v_deload_count + 1;\n            END IF;\n          END IF;\n        -- 'maintain' requires no action\n        ELSE NULL;\n      END CASE;\n    END IF;\n    \n    -- Add to results\n    v_results := v_results || jsonb_build_object(\n      'exercise_name', v_item_record.exercise_name,\n      'item_id', v_item_record.id,\n      'progression', v_progression\n    );\n  END LOOP;\n\n  RETURN jsonb_build_object(\n    'success', true,\n    'program_id', p_program_id,\n    'updates_made', v_updates_made,\n    'deload_exercises', v_deload_count,\n    'algorithm_version', 'optimized_v1',\n    'progressions', v_results\n  );\nEND;\n$function$;"}		treenitaastu@gmail.com	\N
20250929123244	{"-- Fix static training program system to be repeatable after 20 days\n-- Remove status column dependency and create proper cycling logic\n\n-- Drop existing view that has incorrect status logic  \nDROP VIEW IF EXISTS v_static_status;\n\n-- Create improved view with cycling logic for 20-day program\nCREATE OR REPLACE VIEW v_static_status AS\nSELECT \n  ss.user_id,\n  ss.start_monday,\n  CASE \n    WHEN ss.start_monday > CURRENT_DATE THEN 'pending'\n    ELSE 'active'\n  END AS status,\n  (CURRENT_DATE - ss.start_monday) AS days_since_start,\n  -- Calculate current cycle (0-based) and day within cycle (1-20)\n  FLOOR((CURRENT_DATE - ss.start_monday) / 20) AS current_cycle,\n  CASE \n    WHEN (CURRENT_DATE - ss.start_monday) % 20 = 0 AND (CURRENT_DATE - ss.start_monday) > 0 \n    THEN 20  -- Day 20 of cycle\n    ELSE GREATEST(1, ((CURRENT_DATE - ss.start_monday) % 20) + 1)  -- Days 1-19 of cycle\n  END AS current_day_in_cycle,\n  -- Calculate which week and day in the 4-week structure\n  CASE \n    WHEN (CURRENT_DATE - ss.start_monday) % 20 = 0 AND (CURRENT_DATE - ss.start_monday) > 0 \n    THEN 4  -- Week 4\n    ELSE GREATEST(1, CEIL(((CURRENT_DATE - ss.start_monday) % 20 + 1) / 5.0))\n  END AS current_week_in_cycle,\n  CASE \n    WHEN (CURRENT_DATE - ss.start_monday) % 20 = 0 AND (CURRENT_DATE - ss.start_monday) > 0 \n    THEN 5  -- Day 5 of week 4  \n    ELSE GREATEST(1, (((CURRENT_DATE - ss.start_monday) % 20) % 5) + 1)\n  END AS current_weekday_in_cycle\nFROM static_starts ss;\n\n-- Create function to get current program day for user (cycling through 20 days)\nCREATE OR REPLACE FUNCTION get_user_current_program_day(p_user_id uuid)\nRETURNS TABLE(\n  programday_id uuid,\n  week integer,\n  day integer,\n  cycle_number integer,\n  day_in_cycle integer,\n  can_complete boolean\n) \nLANGUAGE plpgsql\nSTABLE\nAS $$\nDECLARE\n  v_status RECORD;\n  v_program_day RECORD;\nBEGIN\n  -- Get user status from static_starts\n  SELECT * INTO v_status \n  FROM v_static_status \n  WHERE user_id = p_user_id;\n  \n  IF NOT FOUND THEN\n    -- No program started yet\n    RETURN;\n  END IF;\n  \n  -- Get the program day for current position in cycle\n  SELECT * INTO v_program_day\n  FROM programday \n  WHERE week = v_status.current_week_in_cycle \n    AND day = v_status.current_weekday_in_cycle\n  LIMIT 1;\n  \n  IF FOUND THEN\n    RETURN QUERY SELECT \n      v_program_day.id,\n      v_program_day.week,\n      v_program_day.day,\n      v_status.current_cycle::integer,\n      v_status.current_day_in_cycle::integer,\n      TRUE; -- Always can complete in static system\n  END IF;\nEND;\n$$;\n\n-- Create function to mark program day complete (allowing multiple completions)\nCREATE OR REPLACE FUNCTION complete_static_program_day(p_user_id uuid, p_programday_id uuid)\nRETURNS jsonb\nLANGUAGE plpgsql\nAS $$\nDECLARE\n  v_existing_today RECORD;\n  v_today date := CURRENT_DATE;\nBEGIN\n  -- Check if already completed today (prevent double completion same day)\n  SELECT * INTO v_existing_today\n  FROM userprogress \n  WHERE user_id = p_user_id \n    AND programday_id = p_programday_id \n    AND completed_at::date = v_today;\n    \n  IF FOUND THEN\n    RETURN jsonb_build_object(\n      'success', false,\n      'message', 'Already completed today',\n      'completed_at', v_existing_today.completed_at\n    );\n  END IF;\n  \n  -- Mark as complete\n  INSERT INTO userprogress (user_id, programday_id, completed_at, done)\n  VALUES (p_user_id, p_programday_id, NOW(), true);\n  \n  RETURN jsonb_build_object(\n    'success', true,\n    'message', 'Program day completed',\n    'completed_at', NOW()\n  );\nEND;\n$$;"}		treenitaastu@gmail.com	\N
20250929123312	{"-- Fix static training program system to be repeatable after 20 days\n-- Remove status column dependency and create proper cycling logic\n\n-- Drop existing view that has incorrect status logic  \nDROP VIEW IF EXISTS v_static_status;\n\n-- Create improved view with cycling logic for 20-day program\nCREATE OR REPLACE VIEW v_static_status AS\nSELECT \n  ss.user_id,\n  ss.start_monday,\n  CASE \n    WHEN ss.start_monday > CURRENT_DATE THEN 'pending'\n    ELSE 'active'\n  END AS status,\n  (CURRENT_DATE - ss.start_monday) AS days_since_start,\n  -- Calculate current cycle (0-based) and day within cycle (1-20)\n  FLOOR((CURRENT_DATE - ss.start_monday) / 20) AS current_cycle,\n  CASE \n    WHEN (CURRENT_DATE - ss.start_monday) % 20 = 0 AND (CURRENT_DATE - ss.start_monday) > 0 \n    THEN 20  -- Day 20 of cycle\n    ELSE GREATEST(1, ((CURRENT_DATE - ss.start_monday) % 20) + 1)  -- Days 1-19 of cycle\n  END AS current_day_in_cycle,\n  -- Calculate which week and day in the 4-week structure\n  CASE \n    WHEN (CURRENT_DATE - ss.start_monday) % 20 = 0 AND (CURRENT_DATE - ss.start_monday) > 0 \n    THEN 4  -- Week 4\n    ELSE GREATEST(1, CEIL(((CURRENT_DATE - ss.start_monday) % 20 + 1) / 5.0))\n  END AS current_week_in_cycle,\n  CASE \n    WHEN (CURRENT_DATE - ss.start_monday) % 20 = 0 AND (CURRENT_DATE - ss.start_monday) > 0 \n    THEN 5  -- Day 5 of week 4  \n    ELSE GREATEST(1, (((CURRENT_DATE - ss.start_monday) % 20) % 5) + 1)\n  END AS current_weekday_in_cycle\nFROM static_starts ss;\n\n-- Create function to get current program day for user (cycling through 20 days)\nCREATE OR REPLACE FUNCTION get_user_current_program_day(p_user_id uuid)\nRETURNS TABLE(\n  programday_id uuid,\n  week integer,\n  day integer,\n  cycle_number integer,\n  day_in_cycle integer,\n  can_complete boolean\n) \nLANGUAGE plpgsql\nSTABLE\nAS $$\nDECLARE\n  v_status RECORD;\n  v_program_day RECORD;\nBEGIN\n  -- Get user status from static_starts\n  SELECT * INTO v_status \n  FROM v_static_status \n  WHERE user_id = p_user_id;\n  \n  IF NOT FOUND THEN\n    -- No program started yet\n    RETURN;\n  END IF;\n  \n  -- Get the program day for current position in cycle\n  SELECT * INTO v_program_day\n  FROM programday \n  WHERE week = v_status.current_week_in_cycle \n    AND day = v_status.current_weekday_in_cycle\n  LIMIT 1;\n  \n  IF FOUND THEN\n    RETURN QUERY SELECT \n      v_program_day.id,\n      v_program_day.week,\n      v_program_day.day,\n      v_status.current_cycle::integer,\n      v_status.current_day_in_cycle::integer,\n      TRUE; -- Always can complete in static system\n  END IF;\nEND;\n$$;\n\n-- Create function to mark program day complete (allowing multiple completions)\nCREATE OR REPLACE FUNCTION complete_static_program_day(p_user_id uuid, p_programday_id uuid)\nRETURNS jsonb\nLANGUAGE plpgsql\nAS $$\nDECLARE\n  v_existing_today RECORD;\n  v_today date := CURRENT_DATE;\nBEGIN\n  -- Check if already completed today (prevent double completion same day)\n  SELECT * INTO v_existing_today\n  FROM userprogress \n  WHERE user_id = p_user_id \n    AND programday_id = p_programday_id \n    AND completed_at::date = v_today;\n    \n  IF FOUND THEN\n    RETURN jsonb_build_object(\n      'success', false,\n      'message', 'Already completed today',\n      'completed_at', v_existing_today.completed_at\n    );\n  END IF;\n  \n  -- Mark as complete\n  INSERT INTO userprogress (user_id, programday_id, completed_at, done)\n  VALUES (p_user_id, p_programday_id, NOW(), true);\n  \n  RETURN jsonb_build_object(\n    'success', true,\n    'message', 'Program day completed',\n    'completed_at', NOW()\n  );\nEND;\n$$;"}		treenitaastu@gmail.com	\N
20250929123341	{"-- Fix security issues from previous migration by adding proper search_path settings\n\n-- Update functions with proper search_path for security\nCREATE OR REPLACE FUNCTION get_user_current_program_day(p_user_id uuid)\nRETURNS TABLE(\n  programday_id uuid,\n  week integer,\n  day integer,\n  cycle_number integer,\n  day_in_cycle integer,\n  can_complete boolean\n) \nLANGUAGE plpgsql\nSTABLE\nSECURITY DEFINER SET search_path = public\nAS $$\nDECLARE\n  v_status RECORD;\n  v_program_day RECORD;\nBEGIN\n  -- Get user status from static_starts\n  SELECT * INTO v_status \n  FROM v_static_status \n  WHERE user_id = p_user_id;\n  \n  IF NOT FOUND THEN\n    -- No program started yet\n    RETURN;\n  END IF;\n  \n  -- Get the program day for current position in cycle\n  SELECT * INTO v_program_day\n  FROM programday \n  WHERE week = v_status.current_week_in_cycle \n    AND day = v_status.current_weekday_in_cycle\n  LIMIT 1;\n  \n  IF FOUND THEN\n    RETURN QUERY SELECT \n      v_program_day.id,\n      v_program_day.week,\n      v_program_day.day,\n      v_status.current_cycle::integer,\n      v_status.current_day_in_cycle::integer,\n      TRUE; -- Always can complete in static system\n  END IF;\nEND;\n$$;\n\n-- Update complete function with proper security\nCREATE OR REPLACE FUNCTION complete_static_program_day(p_user_id uuid, p_programday_id uuid)\nRETURNS jsonb\nLANGUAGE plpgsql\nSECURITY DEFINER SET search_path = public\nAS $$\nDECLARE\n  v_existing_today RECORD;\n  v_today date := CURRENT_DATE;\nBEGIN\n  -- Security check - users can only complete their own program days\n  IF p_user_id != auth.uid() AND NOT is_admin() THEN\n    RAISE EXCEPTION 'Access denied: can only complete own program days';\n  END IF;\n  \n  -- Check if already completed today (prevent double completion same day)\n  SELECT * INTO v_existing_today\n  FROM userprogress \n  WHERE user_id = p_user_id \n    AND programday_id = p_programday_id \n    AND completed_at::date = v_today;\n    \n  IF FOUND THEN\n    RETURN jsonb_build_object(\n      'success', false,\n      'message', 'Already completed today',\n      'completed_at', v_existing_today.completed_at\n    );\n  END IF;\n  \n  -- Mark as complete\n  INSERT INTO userprogress (user_id, programday_id, completed_at, done)\n  VALUES (p_user_id, p_programday_id, NOW(), true);\n  \n  RETURN jsonb_build_object(\n    'success', true,\n    'message', 'Program day completed',\n    'completed_at', NOW()\n  );\nEND;\n$$;"}		treenitaastu@gmail.com	\N
20250929125513	{"-- Fix ambiguous column reference in get_user_current_program_day function\n\nDROP FUNCTION IF EXISTS get_user_current_program_day(uuid);\n\nCREATE OR REPLACE FUNCTION get_user_current_program_day(p_user_id uuid)\nRETURNS TABLE(\n  programday_id uuid,\n  week integer,\n  day integer,\n  cycle_number integer,\n  day_in_cycle integer,\n  can_complete boolean\n) \nLANGUAGE plpgsql\nSTABLE\nSECURITY DEFINER\nSET search_path = public\nAS $$\nDECLARE\n  v_status RECORD;\n  v_program_day RECORD;\nBEGIN\n  -- Get user status from static_starts\n  SELECT * INTO v_status \n  FROM v_static_status \n  WHERE user_id = p_user_id;\n  \n  IF NOT FOUND THEN\n    -- No program started yet\n    RETURN;\n  END IF;\n  \n  -- Get the program day for current position in cycle\n  -- Use qualified column names to avoid ambiguity\n  SELECT * INTO v_program_day\n  FROM programday \n  WHERE programday.week = v_status.current_week_in_cycle \n    AND programday.day = v_status.current_weekday_in_cycle\n  LIMIT 1;\n  \n  IF FOUND THEN\n    RETURN QUERY SELECT \n      v_program_day.id,\n      v_program_day.week,\n      v_program_day.day,\n      v_status.current_cycle::integer,\n      v_status.current_day_in_cycle::integer,\n      TRUE; -- Always can complete in static system\n  END IF;\nEND;\n$$;"}		treenitaastu@gmail.com	\N
20250929035014	{"-- Drop the outdated RLS policy on programday table\nDROP POLICY IF EXISTS \\"select_program_if_subscribed\\" ON public.programday;\n\n-- Create new RLS policy using the modern access control function\nCREATE POLICY \\"programday_select_static_access\\" \nON public.programday \nFOR SELECT \nUSING (can_access_static(auth.uid()));"}		treenitaastu@gmail.com	\N
20250929035717	{"-- Update the complete_static_program_day function to properly track sets\nCREATE OR REPLACE FUNCTION public.complete_static_program_day(p_user_id uuid, p_programday_id uuid)\n RETURNS jsonb\n LANGUAGE plpgsql\n SECURITY DEFINER\n SET search_path TO 'public'\nAS $function$\nDECLARE\n  v_existing_today RECORD;\n  v_today date := CURRENT_DATE;\n  v_programday_data RECORD;\n  v_total_sets INTEGER := 0;\n  v_total_reps INTEGER := 0;\nBEGIN\n  -- Security check - users can only complete their own program days\n  IF p_user_id != auth.uid() AND NOT is_admin() THEN\n    RAISE EXCEPTION 'Access denied: can only complete own program days';\n  END IF;\n  \n  -- Get program day data to calculate sets and reps\n  SELECT * INTO v_programday_data\n  FROM programday \n  WHERE id = p_programday_id;\n  \n  IF NOT FOUND THEN\n    RAISE EXCEPTION 'Program day not found';\n  END IF;\n  \n  -- Calculate total sets and reps from program day\n  v_total_sets := COALESCE(v_programday_data.sets1, 0) + \n                  COALESCE(v_programday_data.sets2, 0) + \n                  COALESCE(v_programday_data.sets3, 0) + \n                  COALESCE(v_programday_data.sets4, 0) + \n                  COALESCE(v_programday_data.sets5, 0);\n  \n  v_total_reps := COALESCE(v_programday_data.reps1, 0) + \n                  COALESCE(v_programday_data.reps2, 0) + \n                  COALESCE(v_programday_data.reps3, 0) + \n                  COALESCE(v_programday_data.reps4, 0) + \n                  COALESCE(v_programday_data.reps5, 0);\n  \n  -- Check if already completed today (prevent double completion same day)\n  SELECT * INTO v_existing_today\n  FROM userprogress \n  WHERE user_id = p_user_id \n    AND programday_id = p_programday_id \n    AND completed_at::date = v_today;\n    \n  IF FOUND THEN\n    RETURN jsonb_build_object(\n      'success', false,\n      'message', 'Already completed today',\n      'completed_at', v_existing_today.completed_at\n    );\n  END IF;\n  \n  -- Mark as complete with proper sets and reps tracking\n  INSERT INTO userprogress (user_id, programday_id, completed_at, done, sets, total_sets, reps, total_reps)\n  VALUES (p_user_id, p_programday_id, NOW(), true, v_total_sets, v_total_sets, v_total_reps, v_total_reps);\n  \n  RETURN jsonb_build_object(\n    'success', true,\n    'message', 'Program day completed',\n    'completed_at', NOW(),\n    'sets_completed', v_total_sets,\n    'reps_completed', v_total_reps\n  );\nEND;\n$function$"}		treenitaastu@gmail.com	\N
20250929035733	{"-- Update the complete_static_program_day function to properly track sets\nCREATE OR REPLACE FUNCTION public.complete_static_program_day(p_user_id uuid, p_programday_id uuid)\n RETURNS jsonb\n LANGUAGE plpgsql\n SECURITY DEFINER\n SET search_path TO 'public'\nAS $function$\nDECLARE\n  v_existing_today RECORD;\n  v_today date := CURRENT_DATE;\n  v_programday_data RECORD;\n  v_total_sets INTEGER := 0;\n  v_total_reps INTEGER := 0;\nBEGIN\n  -- Security check - users can only complete their own program days\n  IF p_user_id != auth.uid() AND NOT is_admin() THEN\n    RAISE EXCEPTION 'Access denied: can only complete own program days';\n  END IF;\n  \n  -- Get program day data to calculate sets and reps\n  SELECT * INTO v_programday_data\n  FROM programday \n  WHERE id = p_programday_id;\n  \n  IF NOT FOUND THEN\n    RAISE EXCEPTION 'Program day not found';\n  END IF;\n  \n  -- Calculate total sets and reps from program day\n  v_total_sets := COALESCE(v_programday_data.sets1, 0) + \n                  COALESCE(v_programday_data.sets2, 0) + \n                  COALESCE(v_programday_data.sets3, 0) + \n                  COALESCE(v_programday_data.sets4, 0) + \n                  COALESCE(v_programday_data.sets5, 0);\n  \n  v_total_reps := COALESCE(v_programday_data.reps1, 0) + \n                  COALESCE(v_programday_data.reps2, 0) + \n                  COALESCE(v_programday_data.reps3, 0) + \n                  COALESCE(v_programday_data.reps4, 0) + \n                  COALESCE(v_programday_data.reps5, 0);\n  \n  -- Check if already completed today (prevent double completion same day)\n  SELECT * INTO v_existing_today\n  FROM userprogress \n  WHERE user_id = p_user_id \n    AND programday_id = p_programday_id \n    AND completed_at::date = v_today;\n    \n  IF FOUND THEN\n    RETURN jsonb_build_object(\n      'success', false,\n      'message', 'Already completed today',\n      'completed_at', v_existing_today.completed_at\n    );\n  END IF;\n  \n  -- Mark as complete with proper sets and reps tracking\n  INSERT INTO userprogress (user_id, programday_id, completed_at, done, sets, total_sets, reps, total_reps)\n  VALUES (p_user_id, p_programday_id, NOW(), true, v_total_sets, v_total_sets, v_total_reps, v_total_reps);\n  \n  RETURN jsonb_build_object(\n    'success', true,\n    'message', 'Program day completed',\n    'completed_at', NOW(),\n    'sets_completed', v_total_sets,\n    'reps_completed', v_total_reps\n  );\nEND;\n$function$"}		treenitaastu@gmail.com	\N
20250929040135	{"-- Backfill missing total_sets and total_reps data in userprogress\n-- Update total_sets and total_reps from sets and reps columns where they are 0\nUPDATE userprogress \nSET \n  total_sets = COALESCE(sets, 0),\n  total_reps = COALESCE(reps, 0)\nWHERE \n  done = true \n  AND (total_sets = 0 OR total_reps = 0)\n  AND (sets > 0 OR reps > 0);"}		treenitaastu@gmail.com	\N
20250929044309	{"-- Create function to start 3-day PT trial for new users\nCREATE OR REPLACE FUNCTION public.start_pt_trial_3d(u uuid)\nRETURNS jsonb\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = 'public'\nAS $$\nDECLARE \n  now_ts timestamptz := now();\n  v_uid  uuid := COALESCE(u, auth.uid());\nBEGIN\n  IF v_uid IS NULL THEN\n    RAISE EXCEPTION 'forbidden: missing user id (pass u or call with a valid auth.uid())';\n  END IF;\n\n  -- create row or extend only if no active PT entitlement/trial\n  IF NOT EXISTS (\n    SELECT 1 FROM user_entitlements\n    WHERE user_id = v_uid AND product = 'pt'\n      AND (\n        (status = 'trialing' AND COALESCE(trial_ends_at, '-infinity') > now_ts) OR\n        (status = 'active'   AND (expires_at IS NULL OR expires_at > now_ts))\n      )\n  ) THEN\n    INSERT INTO user_entitlements (user_id, product, status, started_at, trial_ends_at, paused, source, note)\n    VALUES (v_uid, 'pt', 'trialing', now_ts, now_ts + interval '3 days', false, 'manual', '3d PT trial')\n    ON CONFLICT (user_id, product) DO UPDATE\n      SET status='trialing', trial_ends_at=EXCLUDED.trial_ends_at, started_at=now_ts, paused=false, updated_at=now_ts;\n  END IF;\n\n  RETURN jsonb_build_object(\n    'status','ok',\n    'row', (SELECT to_jsonb(ue) FROM user_entitlements ue WHERE ue.user_id=v_uid AND ue.product='pt')\n  );\nEND $$;"}		treenitaastu@gmail.com	\N
20250929085506	{"-- Update complete_static_program_day to also track total seconds\nCREATE OR REPLACE FUNCTION public.complete_static_program_day(p_user_id uuid, p_programday_id uuid)\n RETURNS jsonb\n LANGUAGE plpgsql\n SECURITY DEFINER\n SET search_path TO 'public'\nAS $function$\nDECLARE\n  v_existing_today RECORD;\n  v_today date := CURRENT_DATE;\n  v_programday_data RECORD;\n  v_total_sets INTEGER := 0;\n  v_total_reps INTEGER := 0;\n  v_total_seconds INTEGER := 0;\nBEGIN\n  -- Security check - users can only complete their own program days\n  IF p_user_id != auth.uid() AND NOT is_admin() THEN\n    RAISE EXCEPTION 'Access denied: can only complete own program days';\n  END IF;\n  \n  -- Get program day data to calculate sets, reps AND seconds\n  SELECT * INTO v_programday_data\n  FROM programday \n  WHERE id = p_programday_id;\n  \n  IF NOT FOUND THEN\n    RAISE EXCEPTION 'Program day not found';\n  END IF;\n  \n  -- Calculate total sets from program day\n  v_total_sets := COALESCE(v_programday_data.sets1, 0) + \n                  COALESCE(v_programday_data.sets2, 0) + \n                  COALESCE(v_programday_data.sets3, 0) + \n                  COALESCE(v_programday_data.sets4, 0) + \n                  COALESCE(v_programday_data.sets5, 0);\n  \n  -- Calculate total reps from program day\n  v_total_reps := COALESCE(v_programday_data.reps1, 0) + \n                  COALESCE(v_programday_data.reps2, 0) + \n                  COALESCE(v_programday_data.reps3, 0) + \n                  COALESCE(v_programday_data.reps4, 0) + \n                  COALESCE(v_programday_data.reps5, 0);\n  \n  -- Calculate total seconds from program day (NEW!)\n  v_total_seconds := COALESCE(v_programday_data.seconds1, 0) + \n                     COALESCE(v_programday_data.seconds2, 0) + \n                     COALESCE(v_programday_data.seconds3, 0) + \n                     COALESCE(v_programday_data.seconds4, 0) + \n                     COALESCE(v_programday_data.seconds5, 0);\n  \n  -- Check if already completed today (prevent double completion same day)\n  SELECT * INTO v_existing_today\n  FROM userprogress \n  WHERE user_id = p_user_id \n    AND programday_id = p_programday_id \n    AND completed_at::date = v_today;\n    \n  IF FOUND THEN\n    RETURN jsonb_build_object(\n      'success', false,\n      'message', 'Already completed today',\n      'completed_at', v_existing_today.completed_at\n    );\n  END IF;\n  \n  -- Mark as complete with proper sets, reps AND seconds tracking\n  INSERT INTO userprogress (user_id, programday_id, completed_at, done, sets, total_sets, reps, total_reps, total_seconds)\n  VALUES (p_user_id, p_programday_id, NOW(), true, v_total_sets, v_total_sets, v_total_reps, v_total_reps, v_total_seconds);\n  \n  RETURN jsonb_build_object(\n    'success', true,\n    'message', 'Program day completed',\n    'completed_at', NOW(),\n    'sets_completed', v_total_sets,\n    'reps_completed', v_total_reps,\n    'seconds_completed', v_total_seconds\n  );\nEND;\n$function$;"}		treenitaastu@gmail.com	\N
